(1848, 5, '黄浦江源第一漂，灵峰胜境大竹海', '<p><img src="http://local.com/00demo/plugins/ueditor/php/upload1/20170628/1498636073802456.jpg" title="641.jpg"/></p>', '2014年5月10日，又到了“每月活动”时间，我们壹银添丰大家庭集体出动，将开始为期两天的活动，本次目的地是被冠以气净、水净、土净的“三净之地”美誉的安吉。', '黄浦江源第一漂，灵峰胜境大竹海', '壹银添丰员工漂流,每月活动,灵峰竹海', '2014年5月10日，又到了“每月活动”时间，我们壹银添丰大家庭集体出动，将开始为期两天的活动，本次目的地是被冠以气净、水净、土净的“三净之地”美誉的安吉。', '', '', '2015-01-15', '2017-06-28', 'upload/img/2017-06-28/1498636052713.jpg', 'upload/soft/2017-06-28/1498636085129.txt', 1574),
(2909, 1, '法兴称2016需警惕商品市场二轮风暴', '<p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;"><strong>法国兴业银行(Societe Generale)在最新的市场研报中指出，隔夜穆迪评级(Moody&#39;s)将商品交易公司Noble \r\nGroup调降为非投资级别的消息引人关注，同时伴随着油价新一轮跌势及卢布汇率的滑落。</strong></span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">法国兴业银行写道：</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">围绕Noble Group的消息对于股票和信评分析师来说值得思考，但更为普遍的环境是商品价格的总体跌势。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">宏观经济指标迎来的第一轮感知，资本投资降低，生产类经济部门增速放缓，CPI数据疲软，而进口商的实际收入减少，随后汇率和利率调整将紧随而至。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">第二轮影响是企业部门将如何应对长期收入疲软(各部门间的倒退程度不一)，而依赖商品出口的经济体政府也将会做出反应。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;"><strong>上面第二个过程将在2016年对商品市场起到决定性作用。</strong></span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;"><strong>布伦特原油跌近2004年低位</strong></span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">隔夜油价再遇大跌，欧美两大原油合约下跌逾3%，布伦特原油滑向11年低位，此前美国公布上周原油库存意外增加，且有迹象显示，沙特将继续令全球供应过剩的情况愈发严重。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">美国能源资料协会(EIA)称，美国的原油库存上周增加260万桶，接受媒体调查的分析师预计减少250万桶。美国原油交付地库欣的原油库存达到纪录高位。汽油和取暖油库存增幅也超过预期。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">EIA数据刚刚发布后，油价走低，但随后没有再进一步大跌，部分市场人士认为是因为假日交投清淡。有数据显示，美国原油近月合约周三成交仅有略多于2.4亿桶，为两周前交易量的约一半。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">布伦特原油收跌3.5%，报每桶36.46美元，盘中低见36.35美元，距离上周触及的11年低位仅差不到0.4美元。美国原油收跌3.4%，报每桶36.60美元。</span></p>', '法国兴业银行(Societe Generale)在最新的市场研报中指出，隔夜穆迪评级(Moody''s)将商品交易公司Noble Group调降为非投资级别的消息引人关注，同时伴随着油价新一轮跌势及卢布汇率的滑落。', '法兴称2016需警惕商品市场二轮风暴', '原油 油价 市场 布伦特 美国能源资料协会 EIA', '法国兴业银行(Societe Generale)在最新的市场研报中指出，隔夜穆迪评级(Moody''s)将商品交易公司Noble Group调降为非投资级别的消息引人关注，同时伴随着油价新一轮跌势及卢布', '', '', '2016-01-08', '2016-01-08', '', '', 43),
(104, 9, '第431期', '<h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 20px;">【今日多空论道】:</span></h1><p style="line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;">利多因素：</span></p><p style="background: rgb(255, 204, 204); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">1、</span><span style="font-family:;">美国商务部4月16日公布的数据显示，美国3月新屋开工总数年化增至94.6万户（预期为97.3万户），年化月率上升2.8%，为连续第二个月增加，但增幅不及预期；营建许可总数下降至99万户，月率下降2.4%。最新数据表明房市依然低迷。</span></p><p style="line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 128, 0); font-family:;">利空因素：</span></p><p style="background: rgb(153, 255, 153); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">1、</span><span style="font-family:;">&nbsp;&nbsp;美联储4月16日公布的数据显示，美国3月包括制造业、矿业、电力和天然气公共事业在内的整体工业产出较上月增加0.7%，好于预期，表明该国经济正在走出冬季时期的低迷状态。具体数据显示，美国3月工业产出月率上升0.7%，好于预期的上升0.5%，前值上修为上升1.2%，初值为上升0.6%。</span></p><p style="background: rgb(153, 255, 153); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">2、</span><span style="font-family:;">美联储4月16日发布的褐皮书指出，随着天气相关因素对经济的拖累消退，最近几周美国经济活动反弹；12个月联储地区中，有八个地区称经济“温和至适度”成长。</span></p><p style="background: rgb(153, 255, 153); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">3、</span><span style="font-family:;">全球最大的黄金ETF--SPDR&nbsp;Gold&nbsp;Trust截至4月17日黄金持仓量报798.43吨，较前一日减仓8.39吨，黄金ETF--</span></p><p style="margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;" times="" new=""><br/></span></p><p class="p0" style="margin-top: 0pt; margin-bottom: 0pt;">&nbsp;<span style="color: rgb(255, 0, 0);">4月16日客户盈利抽样</span></p><p><img width="700" height="86" title="图片1.png" style="width: 700px; height: 86px;" src="/plugins/ueditor/php/upload1/20140417/1397716614616643.png" border="0" vspace="0" hspace="0"/></p><p><br/></p><p>详情请关注：<a href="http://www.gdyy99.com/tactics">http://www.gdyy99.com/tactics</a></p>', '', '', '', '', '', 'd', '2014-04-17', '2014-04-18', '1397716184979.jpg', '1397722730130.pdf', 901),
(2902, 21, '金秋惊喜 砸金蛋送豪礼', '<p><img src="/plugins/ueditor/php/upload1/20160106/1452074276115548.jpg" title="砸金蛋_壹银财富 - 2.jpg" style="width: 811px; height: 1864px;"/></p>', '', '', '', '', '', '', '2016-01-06', '2016-01-06', '1452074263693.jpg', '', 31),
(79, 9, '银策略20140410', '<p>【今日多空论道】<br/>利多因素：<br/>　　1、周三(4月9日)在季度报告中称，2014年一季度大宗商品ETP录得一年来首次季度净流入，其中白银ETP的流入量远高于其他商品ETP。此外，一季度黄金ETP最终录得微幅流出，但2月和3月均有不错的流入，暗示投资情绪有所转变。<br/>　　2、因日内美联储3月FOMC会议纪要整体偏向鸽派，同时其中并未提供升息前提条件的任何新信息，令市场对此前耶伦明年春季升息的言论产生质疑。。<br/>　　3、前美国钱币协会(ANA)、现美国联邦与加州州政府金银政治行动委员会(Gold &amp; Silver Political Action Committee)主席Barry Stuppler周三(4月9日)在最新发布的预测文章中称，预计到2015或2016年黄金价格将上涨至5000美元/盎司。<br/>利空因素：<br/>&nbsp;&nbsp;&nbsp; 1、周三(4月9日)公布的最新调查显示，多数固定收益投资经理并不对现在的通胀水平感到担忧，并希望美联储继续维持宽松政策。商品分析师指出，作为传统的抗通胀商品，眼下低通胀风险仍是白银市场的一大阻碍。</p>', '', '', '', '', '', '', '2014-04-15', '2014-04-16', '1397617226726.jpg', '1397552558943.pdf', 176),
(80, 9, '第427期', '<h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">【核心策略】：</span></h1><table width="568"><tbody><tr class="firstRow"><td width="126" valign="center" style="background: rgb(255, 204, 0); padding: 0px 7px; border: 1px solid rgb(0, 0, 0); border-image: none;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">市场点评</span></p></td><td width="442" valign="center" style="background: rgb(255, 204, 0); border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="line-height: 27px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</span><span style="font-family:;">周四的行情再次验证了睿森给出的策略，昨日白银强势走高，一路突破<span style="font-family: Times New Roman;">20</span><span style="font-family: 宋体;">日均线、</span><span style="font-family: Times New Roman;">4000</span><span style="font-family: 宋体;">关口并摸高至</span><span style="font-family: Times New Roman;">60</span><span style="font-family: 宋体;">日均线附近，不过随着美国经济数据的公布，白银高位回落。从近期白银走势来看，大幅下挫后回抽，大幅上扬后回落，整体运行在</span><span style="font-family: Times New Roman;">3880-4000</span><span style="font-family: 宋体;">的震荡区间内，在没有强力刺激因素推动下白银突破当前震荡区间的可能性不大。睿森认为即日起，美国公布的经济数据将明显增多，或对白银形成一定压制。预期白银今日区间震荡，震荡区间【</span><span style="font-family: Times New Roman;">3930-4030</span><span style="font-family: 宋体;">】。</span></span></p></td></tr><tr style="height: 37px;"><td width="126" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">短线策略</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;关注分析师即时喊单策略</span></p></td></tr><tr style="height: 30px;"><td width="126" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">银策略</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">【3930-4030】尽情把握市场的区间震荡机会</span></p></td></tr><tr style="height: 42px;"><td width="53" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" rowspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">关注</span></p><p style="margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp; 点位</span></p></td><td width="73" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">支撑位</span></p></td><td width="442" valign="center" style="border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">1、3930&nbsp;2、3880&nbsp;&nbsp;3、3850</span></p></td></tr><tr><td width="73" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">压力位</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">1、4030&nbsp;2、4</span><span style="color: rgb(0, 0, 0); font-family:;">100</span><span style="color: rgb(0, 0, 0); font-family:;">&nbsp;&nbsp;3、4150</span></p></td></tr></tbody></table><p style="margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;</span></p><h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">【今日多空论道】：</span></h1><p style="line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;">利多因素：</span></p><p style="background: rgb(255, 204, 204); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">1、乌克兰东部示威者仍在抗议，政府要求示威者和当局谈判，否则将会采取武力镇压。俄罗斯军队在4月8日在乌克兰和俄罗斯边境组织了庞大的军事力量，</span><span style="font-family:;">乌克兰局势又再次恶化，引发黄金避险情绪升温。</span></p><p style="background: rgb(255, 204, 204); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">2、南非统计局4月10日公布数据显示，南非2月黄金产出年率下降3.6%，1月黄金产出年率修正为下降6.2%，初值为下降6.3%。</span></p><p style="background: rgb(255, 204, 204); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;</span></p><p style="line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 128, 0); font-family:;">利空因素：</span></p><p style="background: rgb(153, 255, 153); line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1、</span><span style="font-family:;">周四欧市盘中，美国公布4月5日当周初请失业金人数为30.0万，预期32万，前值33.2万，好于预期和前值的表现帮助美元指数短线反弹到79.50上方。此外，美国3月进口物价指数月率增长0.6%，预期增长0.2%。</span></p><p><span style="color: rgb(255, 0, 0);">客户盈利抽样统计：</span></p><p><span style="color: rgb(255, 0, 0);"><img width="740" height="201" title="图片11.jpg" style="width: 740px; height: 201px;" src="/plugins/ueditor/php/upload1/20140417/1397724255870580.jpg" border="0" vspace="0" hspace="0"/></span></p><p><span style="color: rgb(255, 0, 0);"><a href="http://www.gdyy99.com/tactics/flag/d">http://www.gdyy99.com/tactics/flag/d</a></span></p><p><br/></p>', '', '', '', '', '', 'd', '2014-04-15', '2014-04-22', '1397617244777.jpg', '', 332),
(81, 9, '第100期', '<p style="line-height: 29px; text-indent: 16px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;</span></p><h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">【上周指导客户抽样盈利】：</span></h1><p><img width="740" height="85" title="图片7.png" style="width: 740px; height: 85px;" src="/plugins/ueditor/php/upload1/20140417/1397723832375935.png" border="0" vspace="0" hspace="0"/></p><p><img width="740" height="113" title="图片8.png" style="width: 740px; height: 113px;" src="/plugins/ueditor/php/upload1/20140417/1397723832532441.png" border="0" vspace="0" hspace="0"/></p><p><img width="740" height="97" title="图片9.png" style="width: 740px; height: 97px;" src="/plugins/ueditor/php/upload1/20140417/1397723832468789.png" border="0" vspace="0" hspace="0"/></p><p><img width="740" height="148" title="图片10.png" style="width: 740px; height: 148px;" src="/plugins/ueditor/php/upload1/20140417/1397723832735853.png" border="0" vspace="0" hspace="0"/></p><h1 style="margin-top: 0px; margin-bottom: 0px;">&nbsp;&nbsp;&nbsp;<span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">上周客户平均累计盈利达49%。本周迎来美联储会议纪要，可能再次呈现翻倍行情，投资者可重点把握。</span></h1><h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">详情请点击：<a href="http://www.gdyy99.com/tactics/flag/w">http://www.gdyy99.com/tactics/flag/w</a></span></h1><h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;"><br/></span></h1><p>&nbsp;</p>', '', '', '', '', '', 'w', '2014-04-15', '2014-04-18', '1397718164314.jpg', '', 469),
(82, 9, '第428期', '<h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">【核心策略】：</span></h1><table width="568"><tbody><tr class="firstRow"><td width="126" valign="center" style="background: rgb(255, 204, 0); padding: 0px 7px; border: 1px solid rgb(0, 0, 0); border-image: none;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">市场点评</span></p></td><td width="442" valign="center" style="background: rgb(255, 204, 0); border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="line-height: 27px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">&nbsp;&nbsp;&nbsp;</span><span style="font-family:;">周五美国公布的经济数据靓丽，在美国强劲数据打压下白银震荡小幅下挫。近期白银走势不断验证我们给出的<span style="font-family: Times New Roman;">3880-4030</span><span style="font-family: 宋体;">的震荡区间。而周末乌克兰局势再度发酵，受此影响白银周一高开，不过我们认为乌局势是否升级，需待消息进一步明确，但市场的无疑会再度聚焦地缘政治。睿森认为市场近期将在强劲的美国数据和不断摩擦的地缘政治危机的反复作用下震荡运行，若没有给力消息刺激，突破我们的轨道线，就维持我们的震荡判断，依旧在【</span><span style="font-family: Times New Roman;">3940-4030</span><span style="font-family: 宋体;">】震荡运行。</span></span></p></td></tr><tr style="height: 47px;"><td width="126" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">短线策略</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;关注分析师即时喊单策略</span></p></td></tr><tr><td width="126" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">银策略</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">【3940-4030】把握区间机会，让利润奔跑起来</span></p></td></tr><tr style="height: 42px;"><td width="53" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" rowspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">关注点位</span></p></td><td width="73" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">支撑位</span></p></td><td width="442" valign="center" style="border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">1、3940&nbsp;2、3880&nbsp;&nbsp;3、3850</span></p></td></tr><tr><td width="73" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">压力位</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">1、4030&nbsp;2、4050&nbsp;&nbsp;3、4150</span></p></td></tr></tbody></table><p style="margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;" new="" times="">&nbsp;</span></p><h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">【今日多空论道】</span></h1><p style="line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;">利多因素：</span></p><p style="background: rgb(255, 204, 204); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">1、在乌克兰政府4月13日发起的反恐活动中，至少造成两人丧生。有媒体消息称，在召开的国家安全与防务委员会会议上，与会者们讨论了在乌克兰东部地区实施国家紧急状态的可能性。</span></p><p style="background: rgb(255, 204, 204); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">2、据机构上周五(4月11日)公布的调查显示，本周看多的市场人士超过60%，仅少数仍看跌或看平。看涨人士称，鉴于上周美元持续走软以及乌克兰局势不断发酵，料金价能从中寻找到支撑并继续上涨。</span></p><p style="line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 128, 0); font-family:;">利空因素：</span></p><p style="background: rgb(153, 255, 153); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">1、周一(4月14日)监测的黄金ETFs数据显示，截止上周五(4月11日)黄金主要ETF持仓的黄金持仓量约为1311.16吨，较上一交易日减少1.80吨。</span></p><p style="background: rgb(153, 255, 153); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">2、美国劳工局4月11日公布的数据显示，美国3月PPI月率上升0.5%，创2013年6月以来最大升幅；年率上升1.4%，创2013年8月以来最大升幅；3月核心PPI月率上升0.6%，创下2011年3月以来最大增幅；年率上升1.4%。美国3月PPI月率录得九个月来最大升幅，食品和服务成本均出现上升。PPI的走高与美国整体通胀率低迷的趋势相反。</span></p><p><span style="color: rgb(255, 0, 0);">客户获利抽样统计：</span></p><p><span style="color: rgb(255, 0, 0);"><img width="740" height="116" title="图片6.png" style="width: 740px; height: 116px;" src="/plugins/ueditor/php/upload1/20140417/1397723607831232.png" border="0" vspace="0" hspace="0"/></span></p><p><span style="color: rgb(255, 0, 0);"><a href="http://www.gdyy99.com/tactics/flag/d">http://www.gdyy99.com/tactics/flag/d</a></span></p><p><br/></p>', '', '', '', '', '', 'd', '2014-04-15', '2014-04-22', '1397617270609.jpg', '', 243),
(83, 9, '第429期', '<h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">【核心策略】：</span></h1><table width="568"><tbody><tr class="firstRow"><td width="126" valign="center" style="background: rgb(255, 204, 0); padding: 0px 7px; border: 1px solid rgb(0, 0, 0); border-image: none;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">市场点评</span></p></td><td width="442" valign="center" style="background: rgb(255, 204, 0); border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="line-height: 27px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">&nbsp;&nbsp;&nbsp;</span><span style="font-family:;">周五美国公布的零售数据非常靓丽对白银形成压力，而乌克兰局势的升级对白银提供一定支撑，白银全天高开下挫后回抽。今日耶伦将开启演讲模式第一天，而乌克兰局势短期内或继续扰动市场。预期白银在这几个因素影响下还将继续拉锯震荡，随着上述重量级角色入场，预期白银今日可能再次大幅波动，震荡区间【<span style="font-family: Times New Roman;">3880-4030</span><span style="font-family: 宋体;">】。</span></span></p></td></tr><tr style="height: 47px;"><td width="126" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">短线策略</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;关注分析师即时喊单策略</span></p></td></tr><tr><td width="126" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">银策略</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">【3880-4030】把握区间机会，让利润奔跑起来</span></p></td></tr><tr style="height: 42px;"><td width="53" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" rowspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">关注</span></p><p style="margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp; 点位</span></p></td><td width="73" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">支撑位</span></p></td><td width="442" valign="center" style="border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">1、3920&nbsp;2、3880&nbsp;&nbsp;3、3850</span></p></td></tr><tr><td width="73" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">压力位</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">1、3990&nbsp;2、4030&nbsp;&nbsp;3、4100</span></p></td></tr></tbody></table><p style="margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;" new="" times=""><br/></span></p><p style="margin-top: 0px; margin-bottom: 0px;"><span style="left: 0px; width: 703px; height: 68px; position: absolute; z-index: -1;"></span><span style="font-family:; font-size: 24px;">&nbsp;</span></p><h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">【今日多空论道】</span></h1><p style="line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;">利多因素：</span></p><p style="background: rgb(255, 204, 204); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">1、在乌克兰周一给亲俄分裂主义武装力量下达最后通牒，要么面对“大规模反恐行动”，要么解除武装。同时联合国安理会周日晚间召开紧急会议，讨论如何解决这次危机。乌克兰局势升温再次引发市场关注。</span></p><p style="background: rgb(255, 204, 204); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">2、美国商务部周一公布的数据显示，美国2月商业库存增幅略低于预期，商业销售则出现反弹，这暗示补充存货速度缓慢可能对第一季度经济增长构成压力。具体数据显示，美国2月商业库存月率增长0.4%，预期为增长0.5%，前值为增长0.4%。</span></p><p style="line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 128, 0); font-family:;">利空因素：</span></p><p style="background: rgb(153, 255, 153); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">1、周一数据显示，美国&nbsp;3月&nbsp;零售销售月率上升1.1%，创2012年9月以来最大升幅，预期上升0.8%，前值由上升0.3%修正为上升0.7%；美国3月零售销售4339.1亿美元，前值由4271.9亿美元修正为4290.2亿美元。现货白银价格小幅走低后回升。</span></p><p style="background: rgb(153, 255, 153); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">2、高盛集团唱空黄金。高盛重申黄金今年以每盎司1050美元收官的预测；高盛分析师称，黄金最近的涨势主要受和天气有关的糟糕美国经济数据，以及乌克兰紧张局势的推动；考虑到美联储债券购买规模不断缩减，美国经济数据将再次成为金价下挫的推动因素；预计美国和中国经济活动将相继提速，因此将推动金价走低。</span></p><p><span style="color: rgb(255, 0, 0);">4月14日客户盈利统计：</span></p><p><span style="color: rgb(255, 0, 0);"><img width="740" height="92" title="图片5.png" style="width: 740px; height: 92px;" src="/plugins/ueditor/php/upload1/20140417/1397723423947252.png" border="0" vspace="0" hspace="0"/></span></p><p><span style="color: rgb(255, 0, 0);"><a href="http://www.gdyy99.com/tactics/flag/d">http://www.gdyy99.com/tactics/flag/d</a></span></p>', '', '', '', '', '', 'd', '2014-04-15', '2014-04-22', '1397617298509.jpg', '1397552838445.pdf', 264),
(84, 9, '第101期', '<p style="line-height: 29px; text-indent: 16px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 20px;">【上周指导客户抽样盈利】：</span><span style="color: rgb(0, 0, 0); font-family:;"><br/></span></p><p><img width="740" height="201" title="图片4.jpg" style="width: 740px; height: 201px;" src="/plugins/ueditor/php/upload1/20140417/1397723150278156.jpg" border="0" vspace="0" hspace="0"/></p><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;上周客户平均累计盈利达</span><span style="color: rgb(192, 0, 0); font-family:;">53</span><span style="color: rgb(192, 0, 0); font-family:;">%</span><span style="color: rgb(192, 0, 0); font-family:;">，银策略正确率达到</span><span style="color: rgb(192, 0, 0); font-family:;">90%以上。</span><span style="color: rgb(192, 0, 0); font-family:;">本周迎来</span><span style="color: rgb(192, 0, 0); font-family:;">两次美联储主席讲话及美国褐皮书</span><span style="color: rgb(192, 0, 0); font-family:;">，可能再次呈现翻倍行情，</span><span style="color: rgb(192, 0, 0); font-family:;">睿森金融研究所建议</span><span style="color: rgb(192, 0, 0); font-family:;">投资者可重点把握。</span></p><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:;">详情请关注：<a href="http://www.gdyy99.com/tactics">http://www.gdyy99.com/tactics</a></span></p><p style="line-height: 29px; text-indent: 16px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;"><br/></span></p><p>&nbsp;</p>', '', '', '', '', '', 'w', '2014-04-15', '2014-04-18', '1397723035175.jpg', '', 1337),
(94, 9, '第430期', '<h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">【核心策略】：</span></h1><table width="568"><tbody><tr class="firstRow"><td width="126" valign="center" style="background: rgb(255, 204, 0); padding: 0px 7px; border: 1px solid rgb(0, 0, 0); border-image: none;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">市场点评</span></p></td><td width="442" valign="center" style="background: rgb(255, 204, 0); border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="line-height: 27px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">&nbsp;&nbsp;&nbsp;</span><span style="font-family:;">周二美国方面公布了<span style="font-family: Times New Roman;">3</span><span style="font-family: 宋体;">月份的</span><span style="font-family: Times New Roman;">CPI</span><span style="font-family: 宋体;">数据，结果显示美国的通胀水平上升至</span><span style="font-family: Times New Roman;">1.5%</span><span style="font-family: 宋体;">。该结果与美联储设定的</span><span style="font-family: Times New Roman;">2%</span><span style="font-family: 宋体;">目标进一步接近，加之失业率也与设定目标相去不远，市场受到了前所未有的鼓舞。从近几日多方博弈情况来看，美国数据对白银市场的影响起到了更重要的作用，今日美国方面仍将公布新屋开工、工业产出等重要数据，预期数据向好，白银继续承压。预期白银今日震荡下行，震荡区间【</span><span style="font-family: Times New Roman;">3800-3880</span><span style="font-family: 宋体;">】。</span></span></p></td></tr><tr style="height: 47px;"><td width="126" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">短线策略</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;关注分析师即时喊单策略</span></p></td></tr><tr><td width="126" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">银策略</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">【3800-3880】逢高做空</span></p></td></tr><tr style="height: 42px;"><td width="53" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" rowspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">关注</span></p><p style="margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp; 点位</span></p></td><td width="73" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">支撑位</span></p></td><td width="442" valign="center" style="border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">1、3800&nbsp;2、3760&nbsp;3、3690</span></p></td></tr><tr><td width="73" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">压力位</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">1、3900&nbsp;2、3940&nbsp;&nbsp;3、3980</span></p></td></tr></tbody></table><p style="margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;" new="" times="">&nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px;"><span style="left: 0px; width: 703px; height: 68px; position: absolute; z-index: -1;"></span><span style="font-family:;">&nbsp;</span></p><h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">【今日多空论道】：</span></h1><p style="line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;">利多因素：</span></p><p style="background: rgb(255, 204, 204); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">1、</span><span style="font-family:;">美国波士顿联储主席罗森格伦4月15日表示，利率应该取决于双重任务的进展情况，美国经济依然需要异常宽松的货币政策；失业率掩盖了美国劳动力市场问题的严重性，且几乎没有证据表明通胀正朝美联储设定的2%目标逼近；美联储应维持利率接近零的状态，直到达到充分就业和2％的通胀目标。</span></p><p style="background: rgb(255, 204, 204); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">2、</span><span style="font-family:;">欧洲股市在4月15日再度全线下跌，因市场情绪再度遭到利空消息主导。自4月12-13日以来，乌克兰东部局势再度显著恶化，令各界担心该国可能会近一步迫近内战深渊，这一前景使得投资者被迫出脱股市多头仓位并寻求避险。</span></p><p style="line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 128, 0); font-family:;">利空因素：</span></p><p style="background: rgb(153, 255, 153); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">1、</span><span style="font-family:;">美国明尼亚波利斯联储主席柯薛拉柯塔当地时间周二(4月15日)表示，将“竭尽全力”保持通胀率在接近2%的水平，例如若物价螺旋形上升的速度开始出人意料地过快，则将大幅加息。</span></p><p style="background: rgb(153, 255, 153); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">2、</span><span style="font-family:;">国际现货金价昨天急跌约2%。此前，金价在跌穿关键的200日移动均线后，动能交易商设定的大量止损单被触动，导致金价进一步承压下跌。而在周一(4月14日)贵金属市场全面攀升至本月新高之后，白银和铂系金属在周二也被抛售。</span></p><p style="background: rgb(153, 255, 153); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">3、</span><span style="font-family:;">周二(4月15日)欧市盘中，美国公布月季调后CPI月率，数据显示增长0.2%，预期值增长0.1%。通胀温和，利好美元打压白银。</span></p><p><span style="color: rgb(255, 0, 0);">4月15日客户盈利抽样：</span></p><p><span style="color: rgb(255, 0, 0);"><img width="750" height="90" title="图片2.png" style="width: 750px; height: 90px;" src="/plugins/ueditor/php/upload1/20140417/1397722998472075.png" border="0" vspace="0" hspace="0"/></span></p><p><span style="color: rgb(255, 0, 0);"><a href="http://www.gdyy99.com/tactics/flag/d">http://www.gdyy99.com/tactics/flag/d</a></span></p>', '', '', '', '', '', 'd', '2014-04-16', '2014-04-22', '1397617535698.jpg', '1397617472633.pdf', 287),
(123, 9, '第432期', '<p>【今日多空论道】<br/>利多因素：<br/>　&nbsp; 耶伦在纽约经济俱乐部的第二场讲话并未给行情带来明确指引，耶伦一方面谨慎地表述了对经济的乐观看法，另一方面又吸取了此前在3月份政策新闻发布会上“失言”的教训，在具体的政策时间表问题上避而不语。整体来看，耶伦的言论和最近美联储的鸽派基调基本一致，使得白银价格暂时获得的喘息契机。<br/>利空因素：<br/>　&nbsp; 1、美国劳工部4月17日公布的数据显示，美国4月12日当周初请失业金人数增加0.2万，至30.4万，仍低于市场预期，且仍处在近七年低位，表明就业市场正在改善。4月12日当周初请失业金人数四周均值降至31.2万，为2007年10月以来最低。<br/>　　2、4月17日公布的一份调查显示，美国4月费城联储制造业指数升至16.6，预期为10.0，前值为9.0，为2013年9月以来最高，高于预期。<br/>　　3、美国、俄罗斯、乌克兰和欧盟周四在日内瓦启动乌克兰问题四方会谈，寻求通过政治对话解决乌克兰危机。美国国务卿克里、欧盟外交和安全政策高级代表阿什顿、俄罗斯外长拉夫罗夫和乌克兰代理外长杰希察参加会谈。会后俄罗斯外交部长拉夫罗夫(Sergei Lavrov)发表讲话称，日内瓦四方会谈同意发布实施初步措施的联合声明以缓和乌克兰局势。</p><p class="p0" style="margin-top: 0pt; margin-bottom: 0pt;">&nbsp;<img width="740" height="91" title="图片1.png" style="width: 740px; height: 91px;" src="/plugins/ueditor/php/upload1/20140421/1398063449228732.png" border="0" vspace="0" hspace="0"/></p><p><!--EndFragment--></p><p><a href="http://www.gdyy99.com/tactics">http://www.gdyy99.com/tactics</a></p><p class="p0" style="margin-top: 0pt; margin-bottom: 0pt;"></p>', '', '', '', '', '', 'd', '2014-04-21', '2014-04-21', '', '1398067181430.pdf', 260),
(124, 9, '第102期', '<p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:;"></span>【上周战绩】<br/>&nbsp;&nbsp;&nbsp; 上周超级周行情壹银添丰集团会员均赚得盆满钵满，现货白银累计波动点数达393点，波幅达10%以上。客户获利空间达35万以上。特别是上周二，创下单周最大波幅，也是壹银添丰会员获利颇丰的一天，高盛唱空黄金，黄金触发大量的多头止损盘现巨量的抛售急跌月2%，白银和铂系金属在周二也被抛售，睿森研究所果断带领客户做空白银，斩获138点，20以上客户获利在10万元以上，平均获利30%以上。<br/><span style="color: rgb(255, 0, 0); font-family:;"></span></p><p><img width="740" height="90" title="图片1.png" style="width: 740px; height: 90px;" src="/plugins/ueditor/php/upload1/20140421/1398072046351233.png" border="0" vspace="0" hspace="0"/></p><p><a href="http://www.gdyy99.com/tactics/flag/w">http://www.gdyy99.com/tactics/flag/w</a></p>', '', '', '', '', '', 'w', '2014-04-21', '2014-04-22', '', '1398071916940.pdf', 1389),
(134, 9, '第433期', '<p>【今日多空论道】<br/>利多因素：<br/>　&nbsp; Silver Trust周二(4月22日)公布的数据显示，Silver Trust周一(4月21日)白银持有量10282.78吨，较上一交易日增加53.81吨；当日白银持有总价值升至约64.84亿美元。<br/>　　1、美国国务院女发言人帕莎其4月21日表示，美国或将考虑对俄罗斯总统普京实施制裁，亦在考虑对俄罗斯的一系列官员实行制裁，在讨论对普京实施制裁前还有很多要制裁的对象。当日稍早，美国国务卿克里敦促俄罗斯采取具体措施以践行之前达成的乌克兰协议。<br/>　　2、高盛4月21日预计，美联储此后真正上调政策利率的时间很可能晚于此前各界预期中的2015年中期，一方面，当天美国整体通胀率水平低企的状况确实会令美联储推迟行动步伐，而另一方面，基于以往的政策记录，美联储历次进而加息周期的时间点相比实际的经济周期都会有所延迟。<br/>利空因素：<br/>　　3、隔夜纽约时段前公布的美国3月谘商会领先指标高于预期，可能在一定程度上推动了美元的强势。数据显示，美国3月谘商会领先指标月率上升0.8%，好于预期的上升0.7%，前值为上升0.5%。3月谘商会领先指标升至100.9，前值修正为100.1，初值为99.8。</p><p><a style="color: rgb(255, 0, 0); text-decoration: underline;" href="http://www.gdyy99.com/tactics/flag/d"><span style="color: rgb(255, 0, 0);">http://www.gdyy99.com/tactics/flag/d</span></a></p>', '', '', '', '', '', 'd', '2014-04-22', '2014-04-22', '', '1398135022347.pdf', 273);
