(153, 9, '第435期', '<p>【今日多空论道】<br/>利多因素：<br/>　&nbsp; 美国商务部4月23日公布的数据显示，美国3月新屋销售总数年化回落至38.4万户，创2013年7月份以来新低，预期会略微回升至45.0万户，2月由44.0万户修正为44.9万户。美国3月新屋销售量大幅下滑，进一步表明美国住房市场举步维艰，仍然难以延续2013年的动能。<br/>　　数据编撰机构Markit于4月23日发布的数据显示，欧元区4月制造业采购经理人指数(PMI)初值超预期上升至53.3，表明欧元区民间部门已经在2014年第二季度录得将近三年来最强的根基。<br/>　　据海外多家媒体23日报道，叙利亚爆发新一轮的武装冲突，据消息称叙利亚军队在大马士革乡村东古塔地区开始镇压活动。在短短的3日以内，已有超过1000名恐怖分子被打死。消息还称叙利亚军队有非法使用化学武器的迹象，美国将进一步介入调查。<br/>利空因素：<br/>　　法国公布4月制造业PMI初值50.9，预期51.9；服务业PMI初值50.3，预期51.5；数据均弱于预期导致欧元兑美元短线自1.3822附近跌落至1.3807。稍晚还将公布德国和欧元区PMI数据。法国PMI数据不如预期暗示欧元区核心经济体经济状况依然不如人意，导致欧元短线回落。</p><p class="p0" style="margin-top: 0pt; margin-bottom: 0pt;"></p><p><!--EndFragment--></p><p><img width="740" height="90" title="图片1.png" style="width: 740px; height: 90px;" src="/plugins/ueditor/php/upload1/20140424/1398311703802399.png" border="0" vspace="0" hspace="0"/></p><p>详情请关注：<a href="http://www.gdyy99.com/tactics">http://www.gdyy99.com/tactics</a></p><p><br/></p>', '', '', '', '', '', 'd', '2014-04-24', '2014-04-24', '', '1398311588850.pdf', 246),
(154, 9, '千点行情即将来临', '<h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">一、现货白银历史性的时刻</span></h1><p style="line-height: 31px; margin-top: 0px; margin-bottom: 0px;"><span style="background: rgb(255, 255, 255); font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="background: rgb(255, 255, 255); color: rgb(255, 0, 0); font-family:;">4月30日--5月2日，现货白银即将迎来历史上纪念性的时刻：连续3日大事件，千点行情一触即发！</span><span style="background: rgb(255, 255, 255); font-family:;">睿森金融研究所三大分析团队已集结完毕，且行且珍惜，小伙伴，你们准备好了吗？</span></p><p style="text-align: center; line-height: 31px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;</span></p><p style="text-align: left; line-height: 31px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style="color: rgb(255, 0, 0); font-family:;">现货白银连续3天大事件，引爆2014大行情，3天资产翻倍。</span>&nbsp;</p><table width="568"><tbody><tr class="firstRow" style="height: 35px;"><td width="75" valign="top" style="background: rgb(255, 204, 255); padding: 0px 7px; border: 1px solid rgb(0, 0, 0); border-image: none;"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">日期</span></p></td><td width="60" valign="top" style="background: rgb(255, 204, 255); border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">时间</span></p></td><td width="57" valign="top" style="background: rgb(255, 204, 255); border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">