(183, 9, '第436期', '<p>【今日多空论道】<br/>利多因素：<br/>　&nbsp; 1、美国劳工部(Department of Labor)周四(4月24日)公布的数据显示，美国4月19日当周初请失业金人数跳升，表明裁员人数有所增加。数据显示，美国4月19日当周初请失业金人数增加2.4万，至32.9万，高于预期的31万，前值修正为30.5万，初值为30.4万。这是去年12月以来出现的最大单周增幅。 <br/>&nbsp;&nbsp;&nbsp; 2、受俄罗斯军演消息刺激，全球金银大涨，国内金银录得近两个月最大波幅。乌克兰军队当地时间24日对该国东部城镇发动攻势，打死五人，并从“分离主义分子”手中夺回部分地区控制权。俄总统普京随即警告基辅得为此付出代价，而俄防长绍伊古则下令俄军举行新一轮的军事演习，地区紧张局势急速升温。<br/>利空因素：<br/>　　1、美国商务部(Department of Commerce)周四(4月24日)公布的数据显示，美国3月耐用品订单稳步上升，表明经济正从寒冬的萧条中复苏过来。具体数据显示，美国3月耐用品订单月率上升2.6%，创2013年11月份以来最大升幅，预期上升2.0%，前值下修为上升2.1%，初值为上升2.2%。对民用和防务飞机及零部件的需求推升整体耐用品订单的增加。</p><p><a href="http://www.gdyy99.com/tactics/flag/d">http://www.gdyy99.com/tactics/flag/d</a></p>', '', '', '', '', '', 'd', '2014-04-28', '2014-04-28', '', '1398662818605.pdf', 208),
(184, 9, '第437期', '<p>【今日多空论道】<br/>利多因素：<br/>　　1、乌克兰亲俄武装分子展示其在乌东部扣押的欧洲观察人员，释放了其中一人，但表示尚无计划释放其他七人，而美国和欧盟(EU)准备对俄罗斯实施新的制裁。美国总统奥巴马呼吁美国和欧洲通力合作，采取更强有力的措施来制约俄罗斯。白宫表示，当地时间周一(4月28日)将把更多与俄罗斯总统普京关系密切的人士及其控制的企业列入制裁名单，并对高科技出口施加新的限制。<br/>　　2、美国商品期货交易委员会4月25日发布的数据显示，投资者所持有的黄金投机性净多头仓位在截止至4月22日的一周中小幅增加了不到1%，这也是最近四周以来，黄金持仓规模首度出现增加。<br/>利空因素：<br/>　　1、美联储本周将举行新一度的联邦公开市场委员会会议，不过受到国会表决议程的限制，副主席职务在本月的会议上仍将空缺，但如果此后一切状况进展顺利，那么候任副主席费希尔将能够在6月份的下一次会议开始之前正式履新。费希尔此后所预期的美联储加息政策前景，可能会比各界此前预料者更为激进，在时间框架推至2016年后，情况就更会如此，一旦如此，美联储加息进程就会快于预期，这对于美元指数后市走势将是利好，是贵金属的一大利空。</p><p><a href="http://www.gdyy99.com/tactics/flag/d">http://www.gdyy99.com/tactics/flag/d</a></p>', '', '', '', '', '', 'd', '2014-04-28', '2014-04-28', '', '1398662951969.pdf', 189),
(185, 9, '战争特刊', '<p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;">乌克兰战争爆发以来，现货白银获利情况表</span></p><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;"><br/></span></p><p><img width="745" height="454" title="图片1.png" style="width: 745px; height: 454px;" src="/plugins/ueditor/php/upload1/20140428/1398674401640915.png" border="0" vspace="0" hspace="0"/></p><p><img width="745" height="98" title="图片2.jpg" style="width: 745px; height: 98px;" src="/plugins/ueditor/php/upload1/20140428/1398674401293388.jpg" border="0" vspace="0" hspace="0"/></p><p style="margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;"><br/></span><span style="color: rgb(255, 0, 0); font-family:;">受乌克兰局势影响，现货白银累计获利</span><span style="color: rgb(0, 0, 255); font-family:;">1161点</span><span style="color: rgb(255, 0, 0); font-family:;">，20万客户累计获利空间达到</span><span style="color: rgb(0, 0, 255); font-family:;">104万</span><span style="color: rgb(255, 0, 0); font-family:;">。</span></p><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;">详细内容请点击</span></p><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;"><a href="http://www.gdyy99.com/tactics/flag/s">http://www.gdyy99.com/tactics/flag/s</a></span></p><p style="margin-top: 0px; margin-bottom: 0px;">&nbsp;</p><p>&nbsp;</p>', '', '', '', '', '', 's', '2014-04-28', '2014-05-05', '1398739976873.jpg', '1399275154711.pdf', 1498),
(215, 9, '第440期', '<p>【今日多空论道】<br/>利多因素：<br/>　　1、乌克兰临时总理亚采纽克5月1日在接受采访时表示，他的国家正进入1991年独立以来最危险的10天，亲俄分裂势力接近于控制工业化的东乌克兰核心地带，但政府将会奋力与之抗争。基辅当局担忧分裂势力在5月9日会发动更大势力的袭击，同时分裂势力还计划在5月11日举行独立公投。<br/>　　2、联合国安理会5月2日召开紧急会议，就乌克兰局势进行进一步商讨。此前，乌克兰政府再度在该国东部地区以“反恐”为名发动军事行动，并动用直升飞机射杀了至少一名亲俄反政府人士，这令该国的局势进一步猝然趋紧。<br/>利空因素：<br/>　　1、美国劳工部5月2日公布的数据显示，美国4月季调后非农就业人口增加28.8万，创2012年1月以来最大增幅，失业率降至6.3%，创2008年9月以来新低。此前两个月的非农就业人口增幅共计上修3.6万人。<br/>　　2、美国商务部5月2月公布，美国3月工厂订单月率增长1.1%，为连续第二个月增加，表明一季度末制造业以及更广泛的经济走强。3月耐用品订单月率上修为增长2.9%；扣除飞机非国防资本耐用品订单月率上修为增长3.5%，创2013年1月以来最大增幅。</p><p><!--StartFragment --><br/></p><div></div><p><!--StartFragment --><span id="_baidu_bookmark_start_15" style="line-height: 0px; display: none;">‍</span><img width="740" height="115" title="QQ图片20140505113259.jpg" style="width: 740px; height: 115px;" src="/plugins/ueditor/php/upload1/20140505/1399260798565611.jpg" border="0" vspace="0" hspace="0"/></p><div></div><p><a href="http://www.gdyy99.com/tactics">http://www.gdyy99.com/tactics</a></p>', '', '', '', '', '', 'd', '2014-05-05', '2014-05-05', '', '1399260717509.pdf', 224),
(214, 9, '第439期', '<p>【今日多空论道】<br/>利多因素：<br/>　　1、美国经济谘商会周二(4月29日)公布的数据显示，4月美国消费者信心下降，因企业和劳工市场状况打击消费者的信心。具体数据显示，美国4月谘商会消费者信心指数降至82.3，不及预期的83.0，前值上修为83.9，初值为82.3。<br/>　　2、乌克兰亲俄抗议者29日下午冲击并占领了乌东部卢甘斯克州政府大楼，并在楼顶升起俄罗斯国旗。据当地媒体报道，当天下午2时是亲俄抗议者向乌克兰当局发出的最后通牒截止时间。他们要求当局就大赦全部政治犯、就联邦制问题举行全民公决、给俄语官方语言地位等问题作出答复。<br/>　　3、美国商务部周二(4月29日)发布的数据显示，美国民间住房自有率在今年一季度继续下降，触及自1995三季度以来的十八年多新低，这显示，尽其近来美国住房市场已经显著趋向复数，但是要让住房业完全弥合此前次贷危机所留下的巨头伤痕则仍需一些时日。<br/>利空因素：<br/>　　1、欧盟委员会4月29日公布，欧元区4月经济景气指数降至102.0，这是自2013年4月以来首次下降。可能是受到欧盟同俄罗斯就乌克兰危机所产生的紧张关系影响，同时欧元升值也加重了制造业负担。<br/>　　2、欧洲央行4月29日公布的数据显示，尽管欧洲央行采取超级宽松的货币政策立场，但欧元区3月面向家庭和企业的贷款进一步下滑，且货供额增幅放缓。欧元区3月货币供应M3年率增长1.1%；私营企业贷款年率下降2.2%。</p><p><img width="740" height="149" title="图片1.png" style="width: 740px; height: 149px;" src="/plugins/ueditor/php/upload1/20140505/1399261030489345.png" border="0" vspace="0" hspace="0"/></p><p><a href="http://www.gdyy99.com/tactics">http://www.gdyy99.com/tactics</a></p>', '', '', '', '', '', 'd', '2014-05-05', '2014-05-05', '', '1399261096874.pdf', 236),
(226, 9, '第441期', '<p>【今日多空论道】<br/>利多因素：<br/>　　1、乌克兰国防部称，该国一架军用直升机当地时间周一(5月5日)在亲俄反叛分子控制的东部城镇斯拉维扬斯克附近被击落，但飞行员幸存。这架米-24直升机遭到重机枪射击，坠入河中。国防部在一份声明中称，机组人员撤退到附近营地，但未具体说明其状况如何。自今年年初乌克兰东部爆发冲突以来，亲俄的反政府一方还另外击落了至少三架直升机。<br/>　　2、美国达拉斯联储主席费舍尔表示，尽管美国经济正在走强，但对美联储(Fed)来说开始考虑升息为时尚早。费舍尔自称是一位鹰派人士，他反对美联储的最新一轮的购债行动。他称，受天气这一暂时性事件的影响，美国第一季度经济增长几乎停滞。<br/>利空因素：<br/>　　1、美国供应管理协会(ISM)周一(5月5日)公布的报告显示，4月美国服务业增速创八个月来最快，因新订单跳升，且整体活动创2008年初以来最大增幅。数据显示，美国4月ISM非制造业采购经理人指数(PMI)升至55.2，创2013年8月以来最高，高于预期的54.1，前值为53.1。这是该指数连续第52个月处在荣枯分水岭50上方，表明寒冬影响逐渐消退。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2、咨商会周一(5月5日)公布的一份报告显示，美国就业市场在4月份继续改善。具体数据显示，美国4月咨商会就业趋势指数为118.00，前值上修为117.77，初值为117.52。同时，较一年前上升了5.5%。4月就业趋势指数得到上升，以及近几个月的持续改善，表明到夏季就业会出现稳定增长。</p><p>详情请点击：<a href="http://www.gdyy99.com/tactics">http://www.gdyy99.com/tactics</a></p>', '', '', '', '', '', 'd', '2014-05-06', '2014-05-06', '', '', 239),
(227, 9, '第103期', '<h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:;">【</span><span style="color: rgb(192, 0, 0); font-family:;">上周战绩</span><span style="color: rgb(192, 0, 0); font-family:;">】：</span></h1><p style="text-align: justify; line-height: 31px; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">枪炮一响，黄金万两！</span><span style="font-family:;">上周</span><span style="font-family:;">市场又迎来了一轮超级周的洗礼，而</span><span style="font-family:;">现货白银</span><span style="font-family:;">走势则在最后关口迎来了峰回路转。由于乌克兰紧张局势在周五全面升级，令市场避险情绪大幅升温，彻底掩盖了强劲非农对</span><span style="font-family:;">银</span><span style="font-family:;">价的利空，美国非农井喷式增长，可怜</span><span style="font-family:;">白银</span><span style="font-family:;">空头晚节不保</span><span style="font-family:;">，</span><span style="font-family:;">价格强势反弹。</span></p><p style="text-align: justify; line-height: 31px; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">此前，乌俄局势在周一曾一度有所缓和。美国周一宣布对七名俄罗斯政府官员和17家与总统普京有联系的公司实施制裁，这是美国针对莫斯科干预乌克兰局势的最新惩罚举措。由于制裁力度明显弱于市场此前预期，市场避险情绪在当时快速降温。</span></p><p style="text-align: justify; line-height: 31px; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;">上周部分客户交割单：</span></p><p style="text-align: justify; line-height: 31px; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;"><img width="745" height="114" title="图片1.png" style="width: 745px; height: 114px;" src="/plugins/ueditor/php/upload1/20140506/1399349746469790.png" border="0" vspace="0" hspace="0"/></span></p><p style="margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;" new="" times="">&nbsp;</span></p><p style="text-align: justify; line-height: 31px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;">千点行情客户收益达到15万之多</span><span style="color: rgb(255, 0, 0); font-family:;">。</span></p><p style="text-align: justify; line-height: 31px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;">详情请点击：<a href="http://www.gdyy99.com/tactics/flag/w">http://www.gdyy99.com/tactics/flag/w</a></span></p><p></p>', '', '', '', '', '', 'w', '2014-05-06', '2014-05-06', '', '', 1423),
(246, 9, '第442期', '<h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">【今日多空论道】</span></h1><p style="line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;">利多因素：</span></p><p style="background: rgb(255, 204, 204); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">1、</span><span style="font-family:;">最近数日，乌克兰强力部门在乌克兰东南部采取大规模行动，镇压亲俄分子，同时再度进行战争动员。乌克兰议会6日批准了代行总统职务的议长图尔奇诺夫再次签署的部分动员令，命令自批准之日起生效。部分动员是乌克兰的一种临时征兵方式，通常是在国家遇到危急情况需要加强军事力量时进行。</span></p><p style="background: rgb(255, 204, 204); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">2、</span><span style="font-family:;">欧盟统计局周二(5月6日)公布的数据显示，欧元区3月零售销售月率意外上升，年率升幅则略微不及预期。具体数据显示，欧元区3月零售销售月率上升0.3%，预期下降0.2%，前值修正为上升0.1%，初值上升0.4%。</span></p><p style="line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 128, 0); font-family:;">利空因素：</span></p><p style="background: rgb(153, 255, 153); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">1、</span><span style="font-family:;">美国商务部(Department&nbsp;of&nbsp;Commerce)周二(5月6日)公布的数据显示，美国3月贸易逆差收窄，进出口双双录得增长，表明海内外需求均增强，这应当会支持美国的经济增长。数据显示，美国3月贸易逆差收窄至403.8亿美元，预期为403.0亿美元，前值修正为418.7亿美元，初值为423.0亿美元。</span></p><p style="background: rgb(153, 255, 153); line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;2、</span><span style="font-family:;">经济合作与发展组织5月6日表示，美国第二季度经济将强劲反弹，因严冬所造成的伤害逐渐淡去，不过通胀压力平缓情况将持续至2015年。OECD预估，美国本季国内生产总值年化季率为成长3.9%，并预期年底前将维持稳健成长步伐。</span></p><p><a href="http://www.gdyy99.com/tactics">http://www.gdyy99.com/tactics</a></p>', '', '', '', '', '', 'd', '2014-05-08', '2014-05-08', '', '', 194),
(256, 9, '第443期', '<h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">【今日多空论道】</span></h1><p style="line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(255, 0, 0); font-family:;">利多因素：</span></p><p style="background: rgb(255, 204, 204); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">1、</span><span style="font-family:;">乌克兰东部地区亲俄分离分子已忽视了俄罗斯总统普京有关延迟全民公投的呼吁，声称他们仍将于周日举行公投，加之今日恰逢前苏联战胜纳粹德国的纪念日，亲俄分子很可能发起大规模袭击。</span></p><p style="background: rgb(255, 204, 204); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">2、</span><span style="font-family:;">俄罗斯国防部副部长安东诺夫周四(5月8日)对国际文传电讯社表示，在乌克兰东部地区举行脱离乌克兰公投之前，乌克兰已经派遣15000人的军队前往俄乌边境。乌克兰东部的分离势力证实，公投将按计划于周日(5月11日)举行。</span></p><p style="line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 128, 0); font-family:;">利空因素：</span></p><p style="background: rgb(153, 255, 153); line-height: 150%; text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">1、</span><span style="font-family:;">欧洲央行在周四(5月8日)结束的政策会议上一如各界预期地宣布在货币政策措施上继续&nbsp;按兵不动，但是行长德拉基(Mario&nbsp;Draghi)在此后的新闻发布会讲话中却进一步强调了在未来采取进一步宽松措施的可能性，这使得欧元兑美元汇价应声自高位回落。</span></p><p style="background: rgb(153, 255, 153); line-height: 150%; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;2、</span><span style="font-family:;">美国劳工部(Department&nbsp;of&nbsp;Labor)周四(5月8日)公布的数据显示，5月3日当周美国初请失业金人数下降，表明企业裁员在经历复活节假日前后数周的波动之后开始企稳。数据显示，美国5月3日当周初请失业金人数减少2.6万，至31.9万，创3月初以来最低水平，低于预期的32.5万，前值修正为34.5万，初值为34.4万。</span></p><p>详细内容请点击：<a href="http://www.gdyy99.com/tactics">http://www.gdyy99.com/tactics</a></p>', '', '', '', '', '', 'd', '2014-05-09', '2014-05-09', '', '1399606060391.pdf', 208),
(266, 9, '第444期', '<h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;"><br/></span></h1><h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">【核心策略】：</span></h1><table width="568"><tbody><tr class="firstRow"><td width="126" valign="center" style="background: rgb(255, 204, 0); padding: 0px 7px; border: 1px solid rgb(0, 0, 0); border-image: none;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">市场点评</span></p></td><td width="442" valign="center" style="background: rgb(255, 204, 0); border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="line-height: 27px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">&nbsp;&nbsp;</span><span style="font-family:;">&nbsp;&nbsp;日内开盘各货币对波动较为平淡，乌克兰东部两州公投的进程并未能对行情产生太大的波动。而目前据外媒最新报道显示，乌克兰东部亲俄民间武装力量已在周日的公投中赢得压倒性胜利，主要地区的组织者称，接近90%的投票者支持自治。目前乌克兰内战风险如剑悬顶，欧美加大制裁或新增恐慌，且地缘危机或冲击欧美经济，欧美政策预期分化，耶伦讲话凸显央行退出宽松不容易,对白银而言无疑都是潜在的利多因素，日内建投资者可在3780附近逢低做多。</span></p></td></tr><tr style="height: 47px;"><td width="126" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">短线策略</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;关注分析师即时喊单策略</span></p></td></tr><tr style="height: 47px;"><td width="126" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">银策略</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">【<span style="font-family: Times New Roman;">3</span>780-3800】逢低做多</span></p></td></tr><tr style="height: 42px;"><td width="53" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" rowspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">关注</span></p><p style="margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp; 点位</span></p></td><td width="73" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">支撑位</span></p></td><td width="442" valign="center" style="border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">1、3770&nbsp;&nbsp;2、3730&nbsp;&nbsp;3、3700</span></p></td></tr><tr style="height: 42px;"><td width="73" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;"><p style="text-align: center; margin-top: 0px; 