(338, 9, '第450期', '<h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">【核心策略】：</span></h1><table width="568"><tbody><tr class="firstRow"><td width="126" valign="center" style="background: rgb(255, 204, 0); padding: 0px 7px; border: 1px solid rgb(0, 0, 0); border-image: none;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">市场点评</span></p></td><td width="442" valign="center" style="background: rgb(255, 204, 0); border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;" colspan="3"><p style="line-height: 27px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">&nbsp;</span><span style="color: rgb(0, 0, 0); font-family:;">&nbsp;&nbsp;</span><span style="font-family:;">今天可以说是本周最为关键的一个交易日。欧洲议会选举、美联储副主席费希尔最终提名确认，当然，这其中自然少不了最受市场关注的美联储4月货币政策会议纪要。目前，距离耶伦出任美联储主席已过去了100多天。而在这100多天中，虽然耶伦仍大体按步照班了伯南克时代的退出步伐，但从一些细微的变化中，投资者仍不难发现其中诸多的耶伦烙印。耶伦在上任后，循序渐进推进缩减购债计划，坚持长期维持低利率环境，不过，她同时也修改了伯南克时代定下的前瞻性指引，放弃了以6.5%失业率作为加息门槛，</span><span style="font-family:;">也</span><span style="font-family:;">偶然一次发出“六个月加息”的“鹰派”言论引起市场轩然大波</span><span style="font-family:;">，预计今晚会议纪要再次引爆行情，白银近期的震荡区间有望突破。</span></p></td></tr><tr style="height: 40px;"><td width="126" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">短线策略</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;" colspan="3"><p style="text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;&nbsp;&