(404, 9, '第104期', '<h1 style="margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(192, 0, 0); font-family:; font-size: 24px;">【市场点评】：</span></h1><p style="text-align: justify; line-height: 31px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style="font-family:;">上周现货白银价格限于窄幅区间内运行，周三备受关注的美联储会议纪要</span><span style="font-family:;">整体偏鸽派，认为美国就业复苏依然不足，并提及了对房地产市场疲软的担忧，同时暗示美联储暂不升息，这给市场之前对美元的乐观的情绪浇了一盆冷水，也让黄金白银暂时回升。周四，地缘冲突再次升温，除乌克兰外，泰国、朝鲜均不断传来冲突消息，持续推动银价走高。然而周末的乌克兰大选牵动着很多人的神经，而最终乌克兰局势似乎有平稳过渡的态势。</span></p><p>盈利交割单：</p><p><img width="740" height="93" title="图片1.jpg" style="width: 740px; height: 93px;" src="/plugins/ueditor/php/upload1/20140528/1401266323841784.jpg" border="0" vspace="0" hspace="0"/></p><p><img width="740" height="101" title="图片2.jpg" style="width: 740px; height: 101px;" src="/plugins/ueditor/php/upload1/20140528/1401266323229813.jpg" border="0" vspace="0" hspace="0"/></p><p><span style="color: rgb(255, 0, 0); font-size: 20px;">详细内容请关注：</span><a style="color: rgb(255, 0, 0); font-size: 20px; text-decoration: underline;" href="http://www.gdyy99.com/tactics/flag/w"><span style="color: rgb(255, 0, 0); font-size: 20px;">http://www.gdyy99.com/tactics/flag/w</span></a></p>', '', '', '', '', '', 'w', '2014-05-28', '2014-05-28', '', '1401266572512.pdf', 1482),
(476, 9, '第457期', '<p style="line-height: 31px; margin-top: 0px; margin-bottom: 0px;"><span style="font-size: 24px;"><strong><span style="color: rgb(204, 0, 0); font-family:;">【核心策略】：</span></strong></span></p><table width="568"><tbody><tr class="firstRow"><td width="126" valign="center" style="background: rgb(255, 204, 0); padding: 0px 7px; border: 1px solid rgb(0, 0, 0); border-image: none;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">市场点评</span></p></td><td width="442" valign="center" style="background: rgb(255, 204, 0); border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;" colspan="3"><p style="line-height: 27px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">&nbsp;</span><span style="color: rgb(0, 0, 0); font-family:;">&nbsp;&nbsp;</span><span style="font-family:;">本周黄金破位下行市场一片哗然，大批市场声音已加入空军行列，由于美国经济数据持续向好，美国股市连创佳绩，黄金</span><span style="font-family:;">白银</span><span style="font-family:;">连续承压，美元指数近日的优异表现也使得黄金失去其耀眼的光芒，5月份是美元指数传统强势月，6月份可能还有惯性冲高，今日无疑是本周最为关键的一个交易日。而重头戏将是美国一季度GDP修正值及初请失业金的表现。此前GDP初值低于市场较弱的预期，已令不少投资者大跌眼镜。而此次年化季率的修正值市场更是预期可能陷入负值，若表现不佳可能对美元构成打压，利好白银。是让黄金起死回生还是落井下石？结果晚上就将揭晓。</span></p></td></tr><tr style="height: 40px;"><td width="126" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">短线策略</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;" colspan="3"><p style="text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nb