(477, 9, '第458期', '<p style="line-height: 31px; margin-top: 0px; margin-bottom: 0px;"><span style="font-size: 24px;"><strong><span style="color: rgb(204, 0, 0); font-family:;">【核心策略】：</span></strong></span></p><table width="568"><tbody><tr class="firstRow"><td width="126" valign="center" style="background: rgb(255, 204, 0); padding: 0px 7px; border: 1px solid rgb(0, 0, 0); border-image: none;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">市场点评</span></p></td><td width="442" valign="center" style="background: rgb(255, 204, 0); border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;" colspan="3"><p style="line-height: 27px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">&nbsp;</span><span style="color: rgb(0, 0, 0); font-family:;">&nbsp;&nbsp;</span><span style="font-family:;">日内依然将有多项美国重要经济数据发布。其中美国4月核心PCE物价指数年率无疑值得投资者重点关注。在2012年1月，美联储将核心PCE年率涨幅2%定为长期通胀目标。而目前，已有越来越多迹象显示，美国未来几年通胀将回升至2%，近期美国CPI等其他通胀数据也呈现出明显回升。可以预见，一旦日内PCE物价指数继续呈现良好复苏态势，极有可能令美联储在6月的“大决议”中上调通胀目标，而美国在未来一段时间年内，也有望逐步摆脱低通胀的“帽子”，若PEC物价指数公布好于预期值将利好美元，打压银价。</span></p></td></tr><tr style="height: 40px;"><td width="126" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">短线策略</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;" colspan="3"><p style="text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;关注分析师即时喊单策略</span></p></td></tr><tr style="height: 36px;"><td width="126"