(514, 9, '第461期', '<p style="line-height: 31px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(204, 0, 0); font-family:; font-size: 24px;">【核心策略】：</span></p><table width="568"><tbody><tr class="firstRow"><td width="126" valign="center" style="background: rgb(255, 204, 0); padding: 0px 7px; border: 1px solid rgb(0, 0, 0); border-image: none;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">市场点评</span></p></td><td width="442" valign="center" style="background: rgb(255, 204, 0); border-width: 1px 1px 1px medium; border-style: solid solid solid none; border-color: rgb(0, 0, 0) rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;" colspan="3"><p style="line-height: 27px; margin-top: 0px; margin-bottom: 0px;"><span style="color: rgb(0, 0, 0); font-family:;">&nbsp;</span><span style="color: rgb(0, 0, 0); font-family:;">&nbsp;&nbsp;今晚的货币政策会议可能将成为欧洲央行的又一个里程碑。华尔街投行几乎一致预期该央行本周将采取“行动”，对于欧洲央行而言，有两种选项目前看来具有历史性意义，一是该行可能首度将存款利率降至负值区域，过去五年间仅有两家全球主要央行敢于采取如此行动；二是欧洲央行存在推出欧版量化宽松(QE)的可能性。虽然就目前投行预期来看，本次欧洲央行推出QE的可能要远小于其他宽松措施。作为超级周的传统大戏，欧洲央行决议时常会与非农在同一周登场。以往，投资者也许更为关注于后者，但本周可能将有所改变，至少就华尔街投行事先的评述而言，有关欧银决议的数量已远超非农</span><span style="font-family:;">。</span></p></td></tr><tr style="height: 40px;"><td width="126" valign="center" style="border-width: medium 1px 1px; border-style: none solid solid; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0); padding: 0px 7px;" colspan="2"><p style="text-align: center; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">短线策略</span></p></td><td width="442" valign="center" style="border-width: medium 1px 1px medium; border-style: none solid solid none; border-color: currentColor rgb(0, 0, 0) rgb(0, 0, 0) currentColor; padding: 0px 7px;" colspan="3"><p style="text-indent: 32px; margin-top: 0px; margin-bottom: 0px;"><span style="font-family:;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;关注分析师即时喊单策略</span></p></td></tr><tr style="height: 36px;"><td width="126" valign="c