ft-style: none; border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style=";text-align:center"><span style="font-size: 16px;font-family: 宋体">38</span><span style="font-size: 16px;font-family: 宋体">50</span></p></td><td width="147" valign="center" style="padding: 0px 7px; border-left-style: none; border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style=";text-align:center"><span style="font-size: 16px;font-family: 宋体">38</span><span style="font-size: 16px;font-family: 宋体">80</span></p></td></tr></tbody></table><p>详细内容请关注：http://www.gdyy99.com/tactics</p>', '', '', '', '', '', 'd', '2014-06-11', '2014-06-11', '', '1402455762308.pdf', 206),
(580, 9, '第466期', '<p style=";line-height:31px"><span style=";color:rgb(204,0,0);font-weight:bold;font-size:21px;font-family:&#39;微软雅黑&#39;">【核心策略】</span></p><table width="568"><tbody><tr class="firstRow"><td width="126" valign="center" colspan="2" style="padding: 0px 7px; border-width: 1px; border-color: rgb(0, 0, 0); background-color: rgb(255, 204, 0); "><p style=";text-align:center"><span style=";font-weight:bold;font-size:19px;font-family:&#39;微软雅黑&#39;">市场点评</span></p></td><td width="442" valign="center" colspan="3" style="padding: 0px 7px; border-left-style: none; border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-width: 1px; border-top-color: rgb(0, 0, 0); border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); background-color: rgb(255, 204, 0); "><p style=";line-height:27px"><span style="font-size: 19px;font-family: 微软雅黑">&nbsp;&nbsp;&nbsp;</span><span style="font-size: 16px;font-family: 宋体">在充分消化上周一系列的风险事件后，白银市场目前更像是来到了一个十字路口。而未来走势究竟何去何从，已有不少业内人士将目光瞄准了下周将召开的美联储6月货币政策会议。目前，美联储官方已经进入了决议前一周的沟通中断期。但市场围绕美联储政策的猜测却并没有因此消散。美联储新一轮的鹰鸽大战或将达成妥协，并导致美联储加息提前。双方的拉锯很可能在6月17-18日的美联储会议上展开。</span><span style="font-size: 16px;font-family: 宋体">今日重点关注初请失业金人数，昨日银价冲高遇阻回落，亚洲盘注意</span><span style="font-size: 16px;font-family: 宋体">3800一线的得失，盘面以低多为主。</span></p></td></tr><tr style="height:40px"><td width="126" valign="center" colspan="2" style="padding: 0px 7px; border-left-width: 1px; border-left-color: rgb(0, 0, 0); border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style=";text-align:center"><span style=";font-weight:bold;font-size:19px;font-family:&#39;微软雅黑&#39;">短线策略</span></p></td><td width="442" valign="center" colspan="3" style="padding: 0px 7px; border-left-style: none; border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style="text-indent:32px"><span style=";font-size:16px;font-family:&#39;宋体&#39;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;关注分析师即时喊单策略</span></p></td></tr><tr style="height:36px"><td width="126" valign="center" colspan="2" style="padding: 0px 7px; border-left-width: 1px; border-left-color: rgb(0, 0, 0); border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style=";text-align:center"><span style=";font-weight:bold;font-size:19px;font-family:&#39;微软雅黑&#39;">银策略</span></p></td><td width="442" valign="center" colspan="3" style="padding: 0px 7px; border-left-style: none; border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style="text-indent:32px"><span style=";font-size:16px;font-family:&#39;宋体&#39;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;【<span style="font-family:Times New Roman">37</span></span><span style=";font-size:16px;font-family:&#39;宋体&#39;">80</span><span style=";font-size:16px;font-family:&#39;宋体&#39;">-3</span><span style=";font-size:16px;font-family:&#39;宋体&#39;">800</span><span style=";font-size:16px;font-family:&#39;宋体&#39;">】逢低做多</span></p></td></tr><tr style="height:43px"><td width="53" valign="center" rowspan="2" style="padding: 0px 7px; border-left-width: 1px; border-left-color: rgb(0, 0, 0); border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style=";text-align:center"><span style=";font-weight:bold;font-size:19px;font-family:&#39;微软雅黑&#39;">关注点位</span></p></td><td width="73" valign="center" style="padding: 0px 7px; border-left-style: none; border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style=";text-align:center"><span style=";font-weight:bold;font-size:16px;font-family:&#39;宋体&#39;">支撑位</span></p></td><td