style=";text-align:center"><span style="font-size: 16px;font-family: 宋体">3850</span></p></td><td width="147" valign="center" style="padding: 0px 7px; border-left-style: none; border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style=";text-align:center"><span style="font-size: 16px;font-family: 宋体">3880</span></p></td></tr></tbody></table><p>详细内容请关注：<a href="http://www.gdyy99.com/tactics" target="_blank">http://www.gdyy99.com/tactics</a></p>', '', '', '', '', '', 'd', '2014-06-12', '2014-06-17', '', '1402561990170.pdf', 352),
(581, 9, '决战议息会议', '<h1><span style="color: rgb(255, 0, 0);font-size: 19px;font-family: 宋体">美联储议息会议</span><span style="color: rgb(255, 0, 0);font-size: 19px;font-family: 宋体">召开时间</span></h1><p style=";text-autospace:ideograph-numeric;text-autospace:ideograph-other;text-align:justify;line-height:31px;vertical-align:"><span style=";font-size:16px;font-family:&#39;宋体&#39;">&nbsp;&nbsp;&nbsp;&nbsp;FOMC委员会的重要决定一般都需要通过举办议息会议进行投票决定,&nbsp;一般每一年都会在华盛顿特区举办八次,&nbsp;具体的日程安排都会对外向普通民众们公布。</span></p><h2><span style="color: rgb(255, 0, 0);font-size: 16px;font-family: 宋体">2014年利率决议</span><span style="color: rgb(255, 0, 0);font-size: 16px;font-family: 宋体">召开时间</span></h2><p><img src="/plugins/ueditor/php/upload1/20140612/1402562187588379.jpg" title="图片1.jpg" width="684" height="165" border="0" hspace="0" vspace="0" style="width: 684px; height: 165px; "/></p><p>详细内容请关注：<a href="http://www.gdyy99.com/tactics/flag/s" target="_blank"><span style="color: rgb(255, 0, 0); ">http://www.gdyy99.com/tactics/flag/s</span></a></p>', '', '', '', '', '', 's', '2014-06-12', '2014-06-12', '1402562445889.png', '1402563222842.pdf', 1616),
(615, 9, '第468期', '<p style=";line-height:31px"><span style=";color:rgb(204,0,0);font-weight:bold;font-size:21px;font-family:&#39;微软雅黑&#39;">【核心策略】</span><span style=";color:rgb(204,0,0);font-weight:bold;font-size:21px;font-family:&#39;微软雅黑&#39;">：</span></p><table width="568"><tbody><tr class="firstRow"><td width="126" valign="center" colspan="2" style="padding: 0px 7px; border-width: 1px; border-color: rgb(0, 0, 0); background-color: rgb(255, 204, 0); "><p style=";text-align:center"><span style=";font-weight:bold;font-size:19px;font-family:&#39;微软雅黑&#39;">市场点评</span></p></td><td width="442" valign="center" colspan="3" style="padding: 0px 7px; border-left-style: none; border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-width: 1px; border-top-color: rgb(0, 0, 0); border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); background-color: rgb(255, 204, 0); "><p style=";line-height:27px"><span style="font-size: 19px;font-family: 微软雅黑">&nbsp;&nbsp;</span><span style="font-size: 16px;font-family: 微软雅黑">&nbsp;</span><span style="font-size: 16px;font-family: 宋体">伴随着伊拉克的隆隆战火，投资者又将在似曾相似的地缘紧张局势笼罩下，开始新一周的交易。伊拉克安全部队与反政府武装15日继续发生激烈交火。</span><span style="font-size: 16px;font-family: 宋体">周一白银市场开盘即冲高，</span><span style="font-size: 16px;font-family: 宋体">油价价格依然升势不歇，显示这一突发的地缘局势，仍是市场目前最为关心的热点。而在伊拉克紧张局势持续升级，乌克兰方面近期显然也并不消停。俄罗斯、乌克兰和欧盟三方上周末再次就天然气问题举行谈判，俄罗斯天然气工业公司总裁米勒表示，俄方不会再度推迟6月16日的天然气欠款最终支付期限，如果乌方不足额支付欠款，就可能被断气。在脱离市场视线多日后，乌克兰危机也很可能再度死灰复燃。</span></p></td></tr><tr style="height:40px"><td width="126" valign="center" colspan="2" style="padding: 0px 7px; border-left-width: 1px; border-left-color: rgb(0, 0, 0); border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style=";text-align:center"><span style=";font-weight:bold;font-size:19px;font-family:&#39;微软雅黑&#39;">短线策略</span></p></td><td width="442" valign="center" colspan="3" style="padding: 0px 7px; border-left-style: none; border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style="text-indent:32px"><span style=";font-size:16px;font-family:&#39;宋体&#39;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;关注分析师即时喊单策略</span></p></td></tr><tr style="height:36px"><td width="126" valign="center" colspan="2" style="padding: 0px 7px; border-left-width: 1px; border-left-color: rgb(0, 0, 0); border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style=";text-align:center"><span style=";font-weight:bold;font-size:19px;font-family:&#39;微软雅黑&#39;">银策略</span></p></td><td width="442" valign="center" colspan="3" style="padding: 0px 7px; border-left-style: none; border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style="text-indent:32px"><span style=";font-size:16px;font-family:&#39;宋体&#39;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;【<span style="font-family:Times New Roman">3</span></span><span style=";font-size:16px;font-family:&#39;宋体&#39;">880</span><span style=";font-size:16px;font-family:&#39;宋体&#39;">-3</span><span style=";font-size:16px;font-family:&#39;宋体&#39;">900</span><span style="font-size:16px;font-family:&#39;宋体&#39;">】</span><span style=";font-size:16px;font-family:&#39;宋体&#39;">逢低做多</span></p></td></tr><tr style="height:43px"><td width="53" valign="center" rowspan="2" style="padding: 0px 7px; border-left-width: 1px; border-left-color: rgb(0, 0, 0); border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style=";text-align:center"><span style=";font-weight:bold;font-size:19px;font-family:&#39;微软雅黑&#39;">关注点位</span></p></td><td width="73" valign="center" style="padding: 0px 7px; border-left-style: none; border-right-width: 1p