(616, 9, '第467期', '<p style=";line-height:31px"><span style=";color:rgb(204,0,0);font-weight:bold;font-size:21px;font-family:&#39;微软雅黑&#39;">【核心策略】</span><span style=";color:rgb(204,0,0);font-weight:bold;font-size:21px;font-family:&#39;微软雅黑&#39;">：</span></p><table width="568"><tbody><tr class="firstRow"><td width="126" valign="center" colspan="2" style="padding: 0px 7px; border-width: 1px; border-color: rgb(0, 0, 0); background-color: rgb(255, 204, 0); "><p style=";text-align:center"><span style=";font-weight:bold;font-size:19px;font-family:&#39;微软雅黑&#39;">市场点评</span></p></td><td width="442" valign="center" colspan="3" style="padding: 0px 7px; border-left-style: none; border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-width: 1px; border-top-color: rgb(0, 0, 0); border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); background-color: rgb(255, 204, 0); "><p style=";line-height:27px"><span style="font-size: 19px;font-family: 微软雅黑">&nbsp;&nbsp;</span><span style="font-size: 16px;font-family: 微软雅黑">&nbsp;</span><span style="font-size: 16px;font-family: 宋体">全球瞩目的2014年巴西世界杯已于北京时间6月13日今日凌晨开始，在首场揭幕战中，五届世界杯冠军得主巴西以3比1力克东欧劲旅克罗地亚。美国队作为世界第一体育大国，在体育方面取得的成就也许足以与美元在全球汇市的霸主地位相媲美。然而，就足球而言，美国队的实力显然尚还不具有问鼎的能力。作为中北美的传统劲旅，美国队在此届巴西世界杯也许具有小组出线的能力，但想要走的更远，或许还要更多努力。而与其一样，美元目前似乎也有着这方面的保障。在世界杯期间，美元所面临的最大挑战无疑是6月中旬的美联储利率决议。这次决议的重要性不言而喻，在不少投行的眼中，已将其视为美联储可能释放提前加息信号的关键节点。而值得一提的是，美联储在此次决议中，也将首度阵容齐整地登场亮相。昨天批准了费希尔美联储(Fed)副主席的提名。</span></p></td></tr><tr style="height:40px"><td width="126" valign="center" colspan="2" style="padding: 0px 7px; border-left-width: 1px; border-left-color: rgb(0, 0, 0); border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style=";text-align:center"><span style=";font-weight:bold;font-size:19px;font-family:&#39;微软雅黑&#39;">短线策略</span></p></td><td width="442" valign="center" colspan="3" style="padding: 0px 7px; border-left-style: none; border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style="text-indent:32px"><span style=";font-size:16px;font-family:&#39;宋体&#39;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;关注分析师即时喊单策略</span></p></td></tr><tr style="height:36px"><td width="126" valign="center" colspan="2" style="padding: 0px 7px; border-left-width: 1px; border-left-color: rgb(0, 0, 0); border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style=";text-align:center"><span style=";font-weight:bold;font-size:19px;font-family:&#39;微软雅黑&#39;">银策略</span></p></td><td width="442" valign="center" colspan="3" style="padding: 0px 7px; border-left-style: none; border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style="text-indent:32px"><span style=";font-size:16px;font-family:&#39;宋体&#39;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;【<span style="font-family:Times New Roman">3</span></span><span style=";font-size:16px;font-family:&#39;宋体&#39;">860</span><span style=";font-size:16px;font-family:&#39;宋体&#39;">-3</span><span style=";font-size:16px;font-family:&#39;宋体&#39;">880</span><span style="font-size:16px;font-family:&#39;宋体&#39;">】</span><span style=";font-size:16px;font-family:&#39;宋体&#39;">逢高做空</span></p></td></tr><tr style="height:43px"><td width="53" valign="center" rowspan="2" style="padding: 0px 7px; border-left-width: 1px; border-left-color: rgb(0, 0, 0); border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style=";text-align:center"><span style=";font-weight:bold;font-size:19px;font-family:&#39;微软雅黑&#39;">关注点位</span></p></td><td width="73" valign="center" style="padding: 0px 7px; border-left-style: none; border-right-width: 1px; border-right-color