(617, 9, '第469期', '<p style=";line-height:31px"><span style=";color:rgb(204,0,0);font-weight:bold;font-size:21px;font-family:&#39;微软雅黑&#39;">【核心策略】</span><span style=";color:rgb(204,0,0);font-weight:bold;font-size:21px;font-family:&#39;微软雅黑&#39;">：</span></p><table width="568"><tbody><tr class="firstRow"><td width="126" valign="center" colspan="2" style="padding: 0px 7px; border-width: 1px; border-color: rgb(0, 0, 0); background-color: rgb(255, 204, 0); "><p style=";text-align:center"><span style=";font-weight:bold;font-size:19px;font-family:&#39;微软雅黑&#39;">市场点评</span></p></td><td width="442" valign="center" colspan="3" style="padding: 0px 7px; border-left-style: none; border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-width: 1px; border-top-color: rgb(0, 0, 0); border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); background-color: rgb(255, 204, 0); "><p style=";line-height:27px"><span style="font-size: 19px;font-family: 微软雅黑">&nbsp;&nbsp;</span><span style="font-size: 19px;font-family: 微软雅黑">&nbsp; &nbsp;</span><span style="font-size: 16px;font-family: 宋体">万众瞩目的美联储6月利率决议即将于周四凌晨(6月19日)2点公布。美联储周一(6月16日)宣布，斯坦利·费希尔已经宣誓就任联储副主席。在新人各就各位的情况下，美联储此次年中大戏阵容终于可谓兵强马壮。而有关中期货币政策问题的讨论，也已被美联储事先划为了闭门会议的重点。对于市场而言，此次美联储决议的重要性显然不言而喻。美联储届时释放的消息，很可能为下半年乃至明年的货币政策走向指明方向。</span></p></td></tr><tr style="height:40px"><td width="126" valign="center" colspan="2" style="padding: 0px 7px; border-left-width: 1px; border-left-color: rgb(0, 0, 0); border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style=";text-align:center"><span style=";font-weight:bold;font-size:19px;font-family:&#39;微软雅黑&#39;">短线策略</span></p></td><td width="442" valign="center" colspan="3" style="padding: 0px 7px; border-left-style: none; border-right-width: 1px; border-right-color: rgb(0, 0, 0); border-top-style: none; border-bottom-width: 1px; border-bottom-color: rgb(0, 0, 0); "><p style="text-indent:32px