(2899, 17, '川商所运营首日舆论关注度高', '<p style="white-space: normal;">2014年6月18日，四川川商商品交易中心(简称“川商所”)运营启动仪式取得圆满成功。仪式当天实现金属钒的现货交割过亿开门红，同时与10家银行现场签约，成功建立银行保障体系托管服务。这将成为陕西从有色金属资源大省到资源强省提升转变、获取有色金属国际定价权的有效抓手。　</p><p style="white-space: normal;">本次运营启动仪式邀请到省金融办、省银监局、省工商局等省政府职能部门、10家银行、20余家中省媒体及相关服务机构参与，引起广泛关注，逾百家媒体对本次活动进行了相关报道和转载。</p><p style="white-space: normal; text-align: center;"><img src="/plugins/ueditor/php/upload/72401452073938.png" title="6.1.png"/></p><p style="white-space: normal;">四川川商商品交易中心运营首日各大媒体相关报道链接：</p><p style="white-space: normal;">1、陕西网络广播电视台：四川川商商品交易中心挂牌成立 (视频)</p><p style="white-space: normal;">http://www.snrtv.com/content/2014-06/19/content_11273039.htm</p><p style="white-space: normal;">2、中新闻陕西新闻时政要闻、记者一线：四川川商商品交易中心挂牌成立(视频)</p><p style="white-space: normal;">http://www.shx.chinanews.com/news/2014/0618/1463.html</p><p style="white-space: normal;">3、西安网络电视台：陕西省有色金属交易中心挂牌(视频)</p><p style="white-space: normal;">http://v.xiancity.cn/newschannel/xianxinwen/detail_2014_06/19/125968_0.shtml</p><p style="white-space: normal;">4、央视网：四川川商商品交易中心挂牌成立(视频)</p><p style="white-space: normal;">http://news.cntv.cn/2014/06/18/VIDE1403097844777970.shtml</p><p style="white-space: normal;">5、中国新闻网财经中心财经频道：陕西“瞄准”有色金属国际定价权 互联网金融引关注</p><p style="white-space: normal;">http://finance.chinanews.com/cj/2014/06-18/6295104.shtml</p><p style="white-space: normal;">6、华数广电宽频：陕西新闻联播(12分30秒开始)</p><p style="white-space: normal;">http://v.baidu.com/kan/tvshow/?id=7494&amp;vfm=bdvtx&amp;site=wasu.cn&amp;n=20140618&amp;url=http://www.wasu.cn/Play/show/id/3526832?refer=video.baidu.com#frp=v.baidu.com/show_intro/&amp;qq-pf-to=pcqq.group</p><p style="white-space: normal;">7、陕西人民政府网：我省唯一省级有色金属交易中心挂牌运营</p><p style="white-space: normal;">http://www.shaanxi.gov.cn/0/1/9/39/175694.htm</p><p style="white-space: normal;">8、网易新闻: 陕西“瞄准”有色金属国际定价权 互联网金融引关注</p><p style="white-space: normal;">http://news.163.com/14/0618/16/9V1KPMGJ00014JB6.html?ADUIN=380214316&amp;ADSESSION=1403079120&amp;ADTAG=CLIENT.QQ.5329_.0&amp;ADPUBNO=26349</p><p style="white-space: normal;">9、新华网陕西频道：四川川商商品交易中心挂牌成立 当天交易额超一亿元</p><p style="white-space: normal;">http://www.sn.xinhuanet.com/2014-06/18/c_1111201417_2.htm</p><p style="white-space: normal;">10、凤凰财经网：打造全球最大有色金属钒交易中心</p><p style="white-space: normal;">http://finance.ifeng.com/a/20140619/12569588_0.shtml</p><p style="white-space: normal;">11、陕西“瞄准”有色金属国际定价权 互联网金融引关注</p><p style="white-space: normal;">http://finance.ifeng.com/a/20140618/12566805_0.shtml</p><p style="white-space: normal;">12、中国科技网 地方科技动态陕西：“川商所”挂牌运营当日交易额过亿元</p><p style="white-space: normal;">http://www.wokeji.com/shouye/jzz/sx/201406/t20140619_752443.shtml</p><p style="white-space: normal;">13、人民网：四川川商商品交易中心挂牌运营</p><p style="white-space: normal;">http://sn.people.com.cn/BIG5/n/2014/0618/c226647-21455987.html</p><p style="white-space: normal;">14、新浪财经网：陕西“瞄准”有色金属国际定价权 互联网金融引关注</p><p style="white-space: normal;">http://finance.sina.com.cn/roll/20140618/154619450816.shtml?bsh_bid=432816225</p><p style="white-space: normal;">15、中国经济网：陕西唯一省级有色金属交易中心挂牌运营</p><p style="white-space: normal;">http://sn.ce.cn/gd/201406/19/t20140619_1589053.shtml</p><p style="white-space: normal;">16、新华网新华重庆: 四川川商商品交易中心挂牌成立 当天交易额超一亿元</p><p style="white-space: normal;">http://www.cq.xinhuanet.com/2014-06/18/c_1111203976.htm</p><p style="white-space: normal;">17、华夏经纬网：四川川商商品交易中心挂牌成立 当天交易额超一亿元</p><p style="white-space: normal;">http://www.huaxia.com/zjsx/xwsc/2014/06/3937590.html</p><p style="white-space: normal;">18、陕西传媒网：陕西省唯一省级有色金属交易中心挂牌运营</p><p style="white-space: normal;">http://www.sxdaily.com.cn/n/2014/0619/c266-5454412.html</p><p style="white-space: normal;">19、中共西安市委机关报: 四川川商商品交易中心昨挂牌</p><p style="white-space: normal;">http://epaper.xiancn.com/xarb/html/2014-06/19/content_305120.htm</p><p style="white-space: normal;">20、瑞道金属网：四川川商商品交易中心挂牌成立</p><p style="white-space: normal;">http://www.ruidow.com/AA/AA16/2014/157992.asp</p><p style="white-space: normal;">21、亚洲金属网：打造最大钒有色金属交易中心</p><p style="white-s