(1849, 5, '清凉一夏：热带风暴，我们来啦！', '<p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">想要拥有高空滑翔的体验吗？想要感受海滨风情的浪漫吗？上海水上乐园——热带风暴，赶紧拿出你阳光一样火辣的热情欢迎我们吧！2014年8月30日，壹银添丰大家庭再次集结，本次我们的终点站，就是位于上海闵行区新镇路顾戴路口，号称亚洲最大的露天水上乐园之一的热带风暴！</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20160225/1456369784976087.jpg" title="1421911118190669.jpg"/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">照片上的大家不够投入哦！还没来得及喊“茄子”，就被摄影师给“咔嚓”啦！</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">来，换个场景再来张合影，彰显我们笑容的魅力！</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20160225/1456369798151067.jpg" title="1421911129817162.jpg"/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">看我们的“葵花点穴手”，看我们的一排小白牙……看我们笑得多么灿烂！</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="color: rgb(255, 0, 0); font-size: 14px; font-family: 宋体, SimSun;">PS：你对那水做了什么？我邪恶了……</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20160225/1456369812100733.jpg" title="1421911144150191.jpg"/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">美女如云？没办法，金融公司就是这么霸气侧漏！</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">我们换个装，你且再看……</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20150122/1421911233607195.jpg" title="04.jpg"/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun;"><span style="font-size: 16px; font-family: 宋体;"></span>肿么样？要模样有模样，要身材有身材吧？！</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun; color: rgb(255, 0, 0);">PS：姑凉们，你们穿的如此清凉，看的我这小心脏扑通扑通地火烫……</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><img src="/plugins/ueditor/php/upload1/20150122/1421911246236294.jpg" title="05.jpg"/></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun;">“不明生物”入镜……</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><img src="/plugins/ueditor/php/upload1/20150122/1421911257542614.jpg" title="06.jpg"/></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun;">你这么调皮，你家里人知道吗？</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><img src="/plugins/ueditor/php/upload1/20150122/1421911272148508.jpg" title="07.jpg"/></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun;">扑通，有人落水……</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun; color: rgb(255, 0, 0);">PS：呼叫柯南，谁是“凶手”？！</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><img src="/plugins/ueditor/php/upload1/20150122/1421911285985859.jpg" title="08.jpg"/></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun;">接下来，请大家欣赏“水上芭蕾”！</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><img src="/plugins/ueditor/php/upload1/20150122/1421911299948967.jpg" title="09.jpg"/></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun;">各位“大佬”就位……</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun; color: rgb(255, 0, 0);">PS：赶紧表演，信不信我分分钟切腹给你看！？</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><img src="/plugins/ueditor/php/upload1/20150122/1421911314319277.jpg" title="10.jpg"/></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun;">如果感到快乐你就拍拍手……</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><img src="/plugins/ueditor/php/upload1/20150122/1421911329794350.jpg" title="11.jpg"/></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">如果感到幸福你就跺跺脚……<br/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun; color: rgb(255, 0, 0);">PS：这画面太美，我不忍直视……</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20150122/1421911345210147.jpg" title="12.jpg"/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">我爱洗澡，皮肤好好……</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20150122/1421911359619192.jpg" title="13.jpg"/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun;"><span style="font-size: 16px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; color: rgb(255, 0, 0);">“老少年派”</span><span style="font-size: 16px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;">的奇幻漂流……</span></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20150122/1421911399653168.jpg" title="14.jpg"/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">再把视线转回沙滩，正在上演着“残忍”的一幕……<br/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20150122/1421911414329204.jpg" title="15.jpg"/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">这位“怪蜀黍”，你在对伦家做什么？</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun;"><strong><span style="font-size: 16px; font-family: 宋体; color: rgb(255, 0, 0);">PS：我要找麻麻……</span></strong></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20150122/1421911459137747.jpg" title="16.jpg"/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">沙“埋”活人……</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20150122/1421911485287408.jpg" title="19.jpg"/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">我不是“妹纸”……</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20150122/1421911510224255.jpg" title="20.jpg"/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">天啊，这“货”不是我！？</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20150122/1421911524734177.jpg" title="21.jpg"/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">赶紧过来清凉一夏吧！<br/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20160225/1456369870499048.jpg" title="1422005122903786.jpg"/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">你确定，你不是再给雪碧做广告吗？</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20150122/1421911554378985.jpg" title="18.jpg"/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-size: 14px; color: rgb(255, 0, 0); font-family: 宋体, SimSun;">每当夜幕降临</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun; color: rgb(255, 0, 0);">我总想起</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun; color: rgb(255, 0, 0);">那日在烈日下的奔跑</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun; color: rgb(255, 0, 0);">那是我逝去的青春<br/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-size: 14px; font-family: 宋体, SimSun; color: rgb(255, 0, 0);">……</span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: center; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><br/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><br/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体, SimSun; font-size: 14px;"><br/></span></p><p style="margin: 15px 0px; text-indent: 28px; text-align: justify; line-height: 2em;"><span style="font-family: 宋体; font-size: 16px;"><br/></span></p>', '想要拥有高空滑翔的体验吗？想要感受海滨风情的浪漫吗？2014年8月30日，壹银添丰大家庭再次集结，本次前往号称亚洲最大的露天水上乐园之一的热带风暴！', '清凉一夏：热带风暴，我们来啦！', '壹银添丰集团清凉一夏,水上乐园,热带风暴', '想要拥有高空滑翔的体验吗？想要感受海滨风情的浪漫吗？2014年8月30日，壹银添丰大家庭再次集结，本次前往号称亚洲最大的露天水上乐园之一的热带风暴！', '', '', '2015-01-15', '2016-02-25', '1452570268949.png', '', 3551);
INSERT INTO `by_article` (`id`, `cate_id`, `title`, `content`, `intro`, `site_title`, `site_keywords`, `site_description`, `tags`, `flag`, `create_date`, `update_date`, `img`, `attach`, `click`) VALUES
(1890, 5, '壹银添丰：周末好去处——桌球竞技场', '<p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">足球、篮球、排球、网球、棒球、乒乓球还有羽毛球等，似乎都比较“动”，而桌球，在国内也被称为“台球”，相对而言比较“静”，可谓老少皆宜。</span></p><p style="text-align: center; margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px"><img src="/plugins/ueditor/php/upload1/20150122/1421912919322262.jpg" title="05.jpg"/>&nbsp;</span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">架杆、瞄准、摆动、出杆、延伸等，需要的可不仅是力气，而是技巧，对握杆姿势、杆架手势、身体姿势等都有要求。</span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em; text-align: center;"><span style=";font-family:宋体;font-size:14px">&nbsp;<img src="/plugins/ueditor/php/upload1/20150122/1421912943856254.jpg" title="03.jpg"/></span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">又是周末，壹银添丰家族，三五结伴，一起来玩桌球。</span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em; text-align: center;"><span style=";font-family:宋体;font-size:14px"><img src="/plugins/ueditor/php/upload1/20150122/1421913027720136.jpg" title="01.jpg"/></span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px"><span style="font-family:宋体">桌球也是身体协调能力、反应速度和判断能力的</span><span style="font-family:Times New Roman">PK</span><span style="font-family:宋体">，听说心态也能更加沉着冷静呢！</span></span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em; text-align: center;"><span style=";font-family:宋体;font-size:14px">&nbsp;<img src="/plugins/ueditor/php/upload1/20150122/1421912959124356.jpg" title="06.jpg"/></span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">怎么样？这架势、这眼神、这姿态……啧啧，有木有点儿桌球明星们的神采？！我们可是专业的哦！</span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em; text-align: center;"><span style=";font-family:宋体;font-size:14px">&nbsp;<img src="/plugins/ueditor/php/upload1/20150122/1421912977711295.jpg" title="08.jpg"/></span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">壹银添丰家族在员工户外拓展方面，讲求的是多样性，因人体质和性情而异的，所以在锻炼成果上也是收获颇丰的！</span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em; text-align: center;"><span style=";font-family:宋体;font-size:14px"><img src="/plugins/ueditor/php/upload1/20150122/1421913047612465.jpg" title="04.jpg"/></span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">尤其是在团队协作和配合上，大家越来越默契啦！</span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em; text-align: center;"><span style=";font-family:宋体;font-size:14px"><img src="/plugins/ueditor/php/upload1/20150122/1421913102201611.jpg" title="02.jpg"/></span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style="font-family:宋体"><span style="font-size: 14px;">小伙伴们，又要到周末啦！约不？一起“球”去吧！</span></span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em; text-align: center;"><span style=";font-family:宋体;font-size:14px"><img src="/plugins/ueditor/php/upload1/20150122/1421912995608238.jpg" title="07.jpg"/></span></p><p><br/></p>', '小伙伴们，又要到周末啦！想要“动”的，过去打篮球吧！想要“静”的，过来打桌球吧！你要约不？', '壹银添丰：周末好去处——桌球竞技场', '壹银添丰周末活动,桌球竞技', '小伙伴们，又要到周末啦！想要“动”的，过去打篮球吧！想要“静”的，过来打桌球吧！你要约不？', '', '', '2015-01-22', '2017-06-20', '1452570377642.png', '', 1625),
(1874, 5, '两天一夜：南山竹海、御水温泉、砂锅鱼头……', '<p style="margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">有个地方你可能没去过，但你肯定听过——就是位于江苏、浙江、安徽三省交界地带的天目湖，素有“江南明珠”之称。<span style="font-family:Times New Roman">2015</span><span style="font-family:宋体">年</span><span style="font-family:Times New Roman">1</span><span style="font-family:宋体">月</span><span style="font-family:Times New Roman">10</span><span style="font-family:宋体">日早晨八点，壹银添丰大家庭成员准时出动，我们要去体验天目湖旅游区秀美、野趣、三绝的三大特色。</span></span></p><p style="text-align: center; margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px"><img src="/plugins/ueditor/php/upload1/20150120/1421739890153709.jpg" title="01.jpg"/>&nbsp;</span></p><p style="margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">经过四个小时的颠簸，我们早已是饥肠辘辘，汽车首先停靠在溧阳乡土菜馆，我们要开荤啦！或腌、或风、或凉、或渍、或酱、或醉，各种野味，各种吃法，当地特色菜，满足吃货的小肚子！赞！</span></p><p style="text-align: center; margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><img src="/plugins/ueditor/php/upload1/20160225/1456369931891989.jpg" title="1421739009613021.jpg"/></p><p style="margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">饭后，我们马不停蹄地立即赶往南山竹海，阳光无比绚烂，每个人带上一瓶矿泉水，集合在景区门口，等待缆车，另一部分成员选择步行，一场时间和体力的竞赛开始啦！长久坐办公室缺乏运动量的小伙伴们，爬到半山腰时候已是气喘吁吁。再看坐缆车的小伙伴们，尤其是女孩子，尖叫和笑声杂糅，在山谷中回响。</span></p><p style="text-align: center; margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">&nbsp;<img src="/plugins/ueditor/php/upload1/20160225/1456370043891605.jpg" title="1421739064693585.jpg"/></span></p><p style="margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">下午的时光几乎都在上山和下山中流淌着，但一路上的风景也着实让人醉心。山清水秀，大口呼吸，感觉给自己的五脏六腑都洗了个澡！流水潺潺，鸟鸣阵阵，大家一路上，嬉笑打闹，完全没有了昔日工作里的严肃和谨慎，一片热闹，大竹海里，还有人好奇地寻找着竹笋。</span></p><p style="text-align: center; margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">&nbsp;<img src="/plugins/ueditor/php/upload1/20160225/1456370055269395.jpg" title="1421739331376848.jpg"/></span></p><p style="margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">转眼来到晚上五点，我们来到就餐地点，砂锅鱼头、乌米饭、农家乡土菜，一道一道上来，盘子在桌上转动，美味翻滚在舌尖上。</span></p><p style="text-align: center; margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">&nbsp;<img src="/plugins/ueditor/php/upload1/20150120/1421739951944187.jpg" title="05.jpg"/></span></p><p style="margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">夜幕降临，正式开始此行的重头戏——御水温泉。我们要开始泡温泉咯！披着浴巾的，穿着浴袍的，大家三五一群，在各个水池之间流转，有被温泉烫得龇牙咧嘴的，也有被露天冻得瑟瑟发抖的，更有蒸桑拿面色红润的，一天的舟车劳顿，刹时都在各种放松中消失殆尽。</span></p><p style="text-align: center; margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px"><img src="/plugins/ueditor/php/upload1/20150120/1421740165596354.jpg" title="06.jpg"/>&nbsp;</span></p><p style="margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">结束温泉之行，我们驱车前往酒店，两人一组，看电视的，玩扑克的，玩到半夜，次日睡到自然醒，再带着大包小袋的当地特产，一顿饱餐过后，我们便驱车返回上海。</span></p><p style="text-align: center; margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><img src="/plugins/ueditor/php/upload1/20150120/1421740251994406.jpg" title="07.jpg"/></p><p style="margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">两天一夜，如果你问我，天目湖给你最大的印象是什么？</span></p><p style="margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">那么我会毫不犹豫地回答：是小伙伴们攀登时候互相搀扶的肩膀，更是小伙伴们缆车时候彼此紧握的手。</span></p><p style="text-align: center; margin-top: 10px; margin-bottom: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px"><img src="/plugins/ueditor/php/upload1/20150120/1421740534870605.jpg" title="08.jpg"/></span></p><p><br/></p>', '有个地方你可能没去过，但你肯定听过——就是位于江苏、浙江、安徽三省交界地带的天目湖，素有“江南明珠”之称。2015年1月10日早晨八点，壹银添丰大家庭成员准时出动。', '两天一夜：南山竹海、御水温泉、砂锅鱼头……', '四川川商商品交易中心员工旅游,御水温泉,南山竹海', '有个地方你可能没去过，但你肯定听过——就是位于江苏、浙江、安徽三省交界地带的天目湖，素有“江南明珠”之称。2015年1月10日早晨八点，壹银添丰大家庭成员准时出动。', '', '', '2015-01-20', '2016-02-25', '1452570249811.png', '', 1744),
(1875, 5, '壹银添丰：奔跑吧！兄弟姐妹！', '<p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">无规矩不成方圆。</span><span style=";font-family:宋体;font-size:14px">现今，许多</span><span style=";font-family:宋体;font-size:14px">企业都订立了严格的规章制度，奖惩分明，以为“制度管人”就是万能公式，可以一劳永逸。殊不知，我们早已走出了“理性经济人”的时代，现代管理开始以“社会人”和“复杂人”作为人性假设。</span><span style=";font-family:宋体;font-size:14px">壹银添丰更通过实践证明，人性化管理更加温情和有效，定期室外拓展训练，更是壹银添丰人性化管理模式的一种成功尝试！</span></p><p style="text-align: center; margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><img src="/plugins/ueditor/php/upload1/20150120/1421742728759549.jpg" title="01.jpg"/></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">壹银添丰由始至终就知道，一个</span><span style=";font-family:宋体;font-size:14px">企业</span><span style=";font-family:宋体;font-size:14px">要想做大做强，必须</span><span style=";font-family:宋体;font-size:14px">上下同心，形成高度凝聚力，</span><span style=";font-family:宋体;font-size:14px">才</span><span style=";font-family:宋体;font-size:14px">是</span><span style=";font-family:宋体;font-size:14px">快速</span><span style=";font-family:宋体;font-size:14px">发展的强大精神武器</span><span style=";font-family:宋体;font-size:14px">。壹银添丰敢于</span><span style=";font-family:宋体;font-size:14px">打破僵硬的管理手段，培育健康的人际关系，既有严明的制度，又有温情的管理，二者相辅相成，相得益彰。</span></p><p style="text-align: center; margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px"><img src="/plugins/ueditor/php/upload1/20150120/1421742743558226.jpg" title="02.jpg"/></span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style="font-family: 宋体; font-size: 14px;">壹银添丰定期就会举行员工拓展训练，在活动中，大家职位、身份</span><span style="font-family: 宋体; font-size: 14px;">不分高低，只有一个互相信任、协调默契的团队。</span></p><p style="text-align: center; margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style="font-family: 宋体; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20150120/1421742764221764.jpg" title="03.jpg"/></span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">拓展训练通过精心的设计和实施，用快乐体验式的培训，为企业带来的思维冲击还有可能激发组织的变革和管理理念的更新，使企业有一个质的飞跃，最终突破制约其发</span><span style=";font-family:宋体;font-size:14px">展的瓶颈。</span></p><p style="text-align: center; margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px"><img src="/plugins/ueditor/php/upload1/20150120/1421742785722018.jpg" title="04.jpg"/></span></p><p style="margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px">事实证明，定期员工拓展训练，不仅</span><span style=";font-family:宋体;font-size:14px">有利于凝聚员工的企业精神，减少员工的可能性流动，</span><span style=";font-family:宋体;font-size:14px">更有助于</span><span style=";font-family:宋体;font-size:14px">增强团队的稳定性和员工的归属感、事业心、向心力，从而赢得</span><span style=";font-family:宋体;font-size:14px">壹银添丰更加</span><span style=";font-family:宋体;font-size:14px">持续的竞争优势。</span></p><p style="text-align: center; margin-bottom: 10px; margin-top: 10px; line-height: 2em;"><span style=";font-family:宋体;font-size:14px"><img src="/plugins/ueditor/php/upload1/20150120/1421742802293644.jpg" title="05.jpg"/></span></p><p><br/></p>', '壹银添丰由始至终就知道，一个企业要想做大做强，必须上下同心，形成高度凝聚力。定期室外拓展训练，更是壹银添丰人性化管理模式的一种成功尝试！', '壹银添丰：奔跑吧！兄弟姐妹！', '壹银添丰集团户外拓展,拓展训练', '壹银添丰由始至终就知道，一个企业要想做大做强，必须上下同心，形成高度凝聚力。定期室外拓展训练，更是壹银添丰人性化管理模式的一种成功尝试！', '', '', '2015-01-20', '2016-02-25', '1421743029751.jpg', '', 1584),
(1876, 9, '第582期', '<p><img src="/plugins/ueditor/php/upload1/20150121/14218099505969.png"/></p><p>详细内容请关注：<a href="http://www.gdyy99.com/tactics" target="_blank">http://www.gdyy99.com/tactics</a></p>', '', '', '', '', '', 'd', '2015-01-21', '2015-01-21', '', '1421810012282.pdf', 210),
(1889, 5, '壹银添丰：看“球”颜值哪家强？壹银添丰家族最在行！', '<p style="line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><span style="font-family: 宋体; font-size: 14px;">俗话说，身体是革命的本钱。我们壹银添丰家族的口号就是：“要业绩，更要体力！”你还在为《武媚娘传奇》中的“大头贴”而耿耿于怀吗？为了老、中、青少年和儿童的身心都健康，不如来我们赛场上，心安理得地看“球”吧！</span></p><p style="text-align: center; line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><span style="font-family: 宋体; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20150122/1421908819498289.jpg" title="05.jpg"/>&nbsp;</span><br/></p><p style="line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><span style=";font-family:宋体;font-size:14px">每到周五，一下班，小伙伴们就开始欢腾起来啦！球鞋、球衣、球帽，一身休闲，队伍整齐地前往运动场，别看我们平日工作中礼让谦和，一到了球场，立即显出生龙活虎的英雄本色！</span></p><p style="text-align: center; line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><img src="/plugins/ueditor/php/upload1/20150122/1421908847549519.jpg" title="06.jpg"/></p><p style="line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><span style=";font-family:宋体;font-size:14px">2014<span style="font-family:宋体">年6月4日，我们壹银添丰家族还成立了壹银添丰篮球社，看我们一溜水儿的红色队服，各个精神抖擞、斗志昂扬，颜值爆表！呆萌小鲜肉、性感怪蜀黍和长腿欧巴，可谓应有尽有！对面的女孩看过来！</span></span></p><p style="text-align: center; line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><img src="/plugins/ueditor/php/upload1/20150122/1421909069888065.jpg" title="08.jpg"/></p><p style="line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><span style=";font-family:宋体;font-size:14px">赛场上，两组选手积极主动、团结协作，比赛在奋勇争先，热烈的氛围中有序进行。</span></p><p style="text-align: center; line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><span style=";font-family:宋体;font-size:14px">&nbsp;<img src="/plugins/ueditor/php/upload1/20150122/1421909104504376.jpg" title="04.jpg"/></span></p><p style="line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><span style=";font-family:宋体;font-size:14px"><span style="font-family: 宋体; font-size: 14px;">大家组织有序、攻防得当，精湛的球技和激烈的争夺，不断迎来阵阵喝彩。</span></span></p><p style="text-align: center; line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><span style=";font-family:宋体;font-size:14px"><span style="font-family: 宋体; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20150122/1421909434734511.jpg" title="03.jpg"/></span></span></p><p style="line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><span style=";font-family:宋体;font-size:14px">比赛如火如荼地进行，小伙伴们挥汗如雨，但面色红润，越发勇猛！</span></p><p style="text-align: center; line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><span style=";font-family:宋体;font-size:14px">&nbsp;<img src="/plugins/ueditor/php/upload1/20150122/1421909123231623.jpg" title="07.jpg"/></span></p><p style="line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><span style=";font-family:宋体;font-size:14px"><span style="font-family: 宋体; font-size: 14px;">友谊第一，比赛第二，不管是哪一组获胜，大家都无比愉快！</span></span></p><p style="text-align: center; line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><span style=";font-family:宋体;font-size:14px"><span style="font-family: 宋体; font-size: 14px;"><img src="/plugins/ueditor/php/upload1/20150122/1421909395432869.jpg" title="02.jpg"/></span></span></p><p style="line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><span style=";font-family:宋体;font-size:14px">紧张的工作之余，公司组织的球赛，旨在磨练员工意志，培养积极向上、合作互助的团队精神，增进了壹银添丰大家庭成员之间的默契，丰富了公司的业余文化生活。</span></p><p style="text-align: center; line-height: 2em; margin-bottom: 10px; margin-top: 10px;"><span style=";font-family:宋体;font-size:14px">&nbsp;<img src="/plugins/ueditor/php/upload1/20150122/1421909141325864.jpg" title="01.jpg"/></span></p><p><br/></p>', '你还在为《武媚娘传奇》中的“大头贴”而耿耿于怀吗？为了老、中、青少年和儿童的身心都健康，不如来我们赛场上，心安理得地看“球”吧！壹银添丰篮球社“开张”啦！', '壹银添丰：看“球”颜值哪家强？壹银添丰家族最在行！', '四川川商商品交易中心活动,篮球竞技', '为了老、中、青少年和儿童的身心都健康，不如来我们赛场上，心安理得地看“球”吧！壹银添丰篮球社“开张”啦！', '', '', '2015-01-22', '2016-02-25', '1452570221542.png', '', 1543),
