(2910, 1, '沙特与伊朗断绝外交关系 双方矛盾升级', '<p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;"><strong>据新华社周日(1月3日)消息称，沙特阿拉伯外交大臣朱拜尔当天宣布，沙特与伊朗断绝外交关系，并责令伊朗外交人员48小时内离境。</strong></span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">朱拜尔在当晚的记者会上表示，伊朗政府不仅不为沙特驻伊朗使领馆安全采取保护措施，反而为冲击、打砸和焚烧沙特使领馆的伊朗示威者提供方便。为此，沙特宣布与伊朗断绝外交关系。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">由于沙特内政部周六(1月2日)宣布处决47名犯有恐怖主义罪行的囚犯中包括知名什叶派教士尼姆尔，引发伊朗民众不满，并于周六晚间在沙特驻伊朗大使馆前举行示威活动，并冲击大使馆。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">据伊朗塔斯尼姆通讯社报道，示威民众在沙特驻伊朗使馆前高喊抗议口号，有人向使馆内投掷燃烧弹。几名抗议者闯入使馆内，打砸门窗，并在楼内放火，现场浓烟滚滚。伊朗警察和安全人员随后驱散示威人群，控制住现场局势，逮捕数名抗议者。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">伊朗总统鲁哈尼周日谴责伊朗抗议者焚烧沙特大使馆的行为，表示伊朗当局将保障外国使领馆安全。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">但朱拜尔强调，伊朗长期以来在沙特等阿拉伯国家支持和培训恐怖分子，以达到破坏这些国家安全的目的。他表示，沙特将采取一切手段回击伊朗的威胁。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">朱拜尔还指出，伊拉克政府已保证将采取措施保护沙特驻伊拉克使领馆的安全。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">据沙特的阿拉伯卫视报道，在沙特宣布与伊朗断交之前，沙特驻伊朗的外交人员已在沙特驻伊朗大使馆遭冲击后撤离到阿联酋迪拜，并将从迪拜回国。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;"><strong>伊朗政府呼吁克制</strong></span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;"><strong>就周六沙特使领馆遭冲击事件，伊朗外交部发言人安萨里周日呼吁示威者保持克制、尊重沙特的外交设施。</strong></span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">伊朗警方高官萨吉迪尼称，警方已把示威者驱离大使馆并逮捕其中一些人。按照他的说法，使馆外的情况“已经缓和”。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">沙特处决那名宗教人士后，伊朗表达强烈谴责。安萨里表示，“这只表明沙特是多么轻率和不负责任”。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">伊朗议长指出，这一处决将让沙特陷入“大漩涡”，沙特将无法通过这一“大漩涡”。伊朗外交部周六还召见沙特使节，抗议这一处决。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">作为回应，沙特也召见伊朗大使，抗议伊朗当局的批评性言论。沙特通讯社援引沙特外交部的声明报道，伊朗对沙特司法系统的批评是“公然干涉”沙特内政。沙特还要求伊朗政府按照相关国际公约，保护沙特驻伊朗使领馆和工作人员的安全，使其免遭可能的敌意行为的伤害。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;"><strong>伊朗表态继续研发导弹再引美伊争执</strong></span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;"><strong>伊朗近日因其导弹研发计划与美国争执不休。伊朗议长拉里贾尼周六强硬表示，将继续推进本国的导弹研发。</strong></span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">美国军方日前声称，伊朗去年12月26日在霍尔木兹海峡附近试射数枚火箭弹，其中一枚落在距美国“哈里·杜鲁门”号航空母舰仅1400米处，因此具有“高度挑衅性”。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">对此，伊朗方面予以坚决否认。在多次指控伊朗违反联合国禁令试射弹道导弹后，奥巴马政府去年12月30日向国会提交了一份名单，准备对伊朗、阿联酋等国家与伊导弹计划相关的近12家公司和个人实施新的经济制裁。但此后，白宫推迟了这项制裁措施。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">一些美国国会议员对白宫在这个问题上犹豫不决的态度展开激烈抨击，认为这将导致伊朗更大胆地采取破坏中东地区稳定的行动。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">面对指责和威胁，伊朗不但没有停止弹道导弹的研制脚步，反而在重压下反弹。伊朗总统鲁哈尼日前给伊朗国防部下令，指示加快导弹制造，以应对美国可能实施的新制裁。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">分析人士认为，伊核协议的达成被一些人看成是美伊两国展开谨慎合作或至少是停止敌对关系的开端，但美伊目前的争执与交锋清楚地表明两国若要达到这一目标仍有相当长的路要走。</span></p>', '据新华社周日(1月3日)消息称，沙特阿拉伯外交大臣朱拜尔当天宣布，沙特与伊朗断绝外交关系，并责令伊朗外交人员48小时内离境。', '沙特与伊朗断绝外交关系 双方矛盾升级', '沙特阿拉伯 伊朗 断绝外交关系 美国 紧张局势 中东 地缘政治因素 ', '据新华社周日(1月3日)消息称，沙特阿拉伯外交大臣朱拜尔当天宣布，沙特与伊朗断绝外交关系，并责令伊朗外交人员48小时内离境。', '', '', '2016-01-08', '2016-01-08', '', '', 59),
(2911, 1, 'API原油库存锐减560万桶 库欣库存大幅增加', '<p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">美国石油学会(API)周二(1月5日)最新数据显示，上周美国原油库存意外锐减，而汽油和精炼油库存均录得大幅增加。北京时间周三23:30，美国能源信息署(EIA)将公布美国上周官方原油库存数据。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">API此次公布的具体数据显示，截至1月1日当周，美国原油库存锐减560万桶，至4.84亿桶，预期为增加43.9万桶，前值为增加294万桶。同时库欣原油库存增加140万桶。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">API数据还显示，美国上周汽油库存增加710万桶，预期为增加230万桶，前值为增加53万桶。精炼油库存增加560万桶，预期为增加200万桶，前值为增加208万桶。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">在API原油库存数据公布后，美国WTI原油和布伦特原油跌幅缩减，并重归平盘上方。</span></p><p><br/></p><p style="line-height: 1.5em; margin-bottom: 15px;"><img alt="\\" src="/plugins/ueditor/php/upload/43751452247827.jpg" width="600" height="296"/></p><p><br/></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">(美国API原油库存变化图)</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">北京时间06:04，美国WTI原油期货价格报36.15美元/桶，布伦特原油期货价格报36.58美元/桶。</span></p>', '美国石油学会(API)周二(1月5日)最新数据显示，上周美国原油库存意外锐减，而汽油和精炼油库存均录得大幅增加。北京时间周三23:30，美国能源信息署(EIA)将公布美国上周官方原油库存数据。', 'API原油库存锐减560万桶 库欣库存大幅增加', '美国石油学会 原油 库存 油价 美国能源信息署 EIA 产量 供应过剩 ', '美国石油学会(API)周二(1月5日)最新数据显示，上周美国原油库存意外锐减，而汽油和精炼油库存均录得大幅增加。北京时间周三23:30，美国能源信息署(EIA)将公布美国上周官方原油库存数据。', '', '', '2016-01-08', '2016-01-08', '', '', 61),
