(2900, 17, '川商所助力新常态下的“五力破阵”', '<p style="white-space: normal; text-align: center;"><img src="/plugins/ueditor/php/upload/13311452074005.png" title="7.1.png"/></p><p style="white-space: normal;">导语：“金融、物流、旅游等服务业也加大了提速增效的步伐。陕西股权交易中心和有色金属交易中心正式成立，京东、苏宁、阿里巴巴等大型电子商务企业和申通、圆通等仓储物流企业落户陕西”，引自新闻评论。</p><p style="white-space: normal;"><strong>川商所助力新常态下的“五力破阵”</strong></p><p style="white-space: normal;">2015年1月5日，陕西日报和陕西传媒网同时发布了题为“2015：陕西经济 雁行破阵”的新闻评论，阐述了包括四川川商商品交易中心在内的多家大型企业对促进陕西经济转型升级发展的重大意义。</p><p style="white-space: normal;">陕西日报结合陕西省省委十二届六次全会第二次会议“主动作为引领经济发展新常态，积极推进法治陕西建设开新局”的主题，详细论述了陕西经济在新常态下的五个重要突破口。2015年的经济形势，“新常态”成为关键词，新一代决策层以“新常态”定义当下的中国经济发展阶段，其中，加快陕西经济转型升级、创新发展成为关键性阶段。</p><p style="white-space: normal;">近年来，金融、物流等行业尤为火热。作为陕西金融控股集团的代表企业之一，四川川商商品交易中心于2014年成立，有效地将互联网思维模式与有色金属的交易模式相结合，为有色金属国际定价中心的形成起到先决条件，对加快经济发展方式转变、提升产业层次、推动传统产业升级具有重要作用。</p><p style="white-space: normal;">川商所自成立以来受到政府的高度支持及舆论的广泛关注，在陕西金融控股集团的带领下取得了显著地发展成效，其独特的发展模式及运营思路在陕西经济新常态下的发展中越来越凸显优势和作用。</p><p style="white-space: normal;">省委书记赵正永在省委十二届六次全会第二次会议上强调，“现在各省都处于结构调整的阵痛过程，面对经济下行的共同遭遇，谁先破阵谁领先。”四川川商商品交易中心将凭借其产业链金融的不断优化和完善推进丝绸之路经济带的建设，助力陕西经济新常态下的“五力破阵”。</p>', '导语：“金融、物流、旅游等服务业也加大了提速增效的步伐。陕西股权交易中心和有色金属交易中心正式成立，京东、苏宁、阿里巴巴等大型电子商务企业和申通、圆通等仓储物流企业落户陕西”，引自新闻评论。', '川商所助力新常态下的“五力破阵”', '川商所 新常态 经济 金融 有色金属 交易中心', '导语：“金融、物流、旅游等服务业也加大了提速增效的步伐。陕西股权交易中心和有色金属交易中心正式成立，京东、苏宁、阿里巴巴等大型电子商务企业和申通、圆通等仓储物流企业落户陕西”，引自新闻评论。', '', '', '2016-01-06', '2016-01-08', '1452246354552.jpg', '', 43),
