(2897, 17, '川商所运营启动仪式系列报道（三）', '<p style="margin-bottom: 10px; white-space: normal; text-align: center; line-height: 1.5em;"><img src="/plugins/ueditor/php/upload1/20160225/1456370409233127.png" title="1.png"/></p><p style="text-align: center"><img src="/plugins/ueditor/php/upload1/20160225/1456370441437710.png" style="" title="2.png"/></p><p style="text-align: center"><img src="/plugins/ueditor/php/upload1/20160225/1456370441964356.png" style="" title="3.png"/></p><p style="text-align: center"><img src="/plugins/ueditor/php/upload1/20160225/1456370441340300.png" style="" title="4.png"/></p><p style="text-align: center"><img src="/plugins/ueditor/php/upload1/20160225/1456370441745747.png" style="" title="5.png"/></p><p style="text-align: center"><img src="/plugins/ueditor/php/upload1/20160225/1456370441306885.png" style="" title="6.png"/></p><p style="text-align: center"><img src="/plugins/ueditor/php/upload1/20160225/1456370441430330.png" style="" title="7.png"/></p><p style="text-align: center"><img src="/plugins/ueditor/php/upload1/20160225/1456370441246473.png" style="" title="8.png"/></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><br/></p><p style="white-space: normal;"><br/></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;">2014年6月18日，四川川商商品交易中心(简称“川商所”)在西安正式挂牌成立。当日与10家银行现场签约，成功建立银行保障体系托管服务。</p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;">金融服务行业的第三方银行保障体系托管服务最为重要，决定着整个交易链的风险控制和安全操作性。四川川商商品交易中心与中国建设银行、兴业银行、中国农业银行、中国工商银行、招商银行、平安银行、民生银行达成战略合作协议，实现资金托管方便快捷，服务交易者随时随地开户交易，同时推动相关仓储质押、供应链金融等一系列有助于解决实体经济融资难题的金融配套服务。</p><p><br/></p>', '2014年6月18日，四川川商商品交易中心(简称“川商所”)在西安正式挂牌成立。当日与10家银行现场签约，成功建立银行保障体系托管服务。', '川商所运营启动仪式系列报道（三）', '川商所 启动仪式 有色金属', '2014年6月18日，四川川商商品交易中心(简称“川商所”)在西安正式挂牌成立。当日与10家银行现场签约，成功建立银行保障体系托管服务。', '', '', '2016-01-06', '2016-02-25', '1452246366815.jpg', '', 45),
(2512, 9, '第634期', '<p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20150701/1435716914162715.jpg" style="float:none;" title="QQ图片20150701101410.jpg"/></p><p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20150701/1435716914761421.jpg" style="float:none;" title="QQ图片20150701101430.jpg"/></p><p style="text-align: center;"><br/></p>', '', '', '', '', '', 'd', '2015-07-01', '2015-07-01', '', '1435716936948.pdf', 73),
(2895, 21, '私人订制 悦享投资', '<p><img src="/plugins/ueditor/php/upload1/20160106/1452073862638505.jpg" title="私人订制-2.jpg"/></p>', '', '', '', '', '', '', '2016-01-06', '2016-01-06', '1452073787593.png', '', 27),
(2896, 17, '川商所运营启动仪式系列报道（二）', '<p style="white-space: normal; text-align: center;"><img src="/plugins/ueditor/php/upload/3751452073849.png" title="4.1.png" style="float: none;"/></p><p style="white-space: normal; text-align: center;"><img src="/plugins/ueditor/php/upload/77411452073850.png" title="4.2.png" style="float: none;"/></p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">2014年6月18日，四川川商商品交易中心(简称“川商所”)在西安正式挂牌成立。当日实现1400吨有色金属钒现货交割，交易额逾亿元。</p><p style="white-space: normal;">陕西是有色资源大省，其中钒、钛、钼、镁、镍等金属的储量和年生产量均位世界前列，全球最大的钒氮合金生产企业正是位于陕西。川商所总经理周军虎介绍说，钒氮合金的原材料五氧化二钒全球年产量为12.5万吨，而仅陕西丰源钒业一家企业的需求量就超过了1.2万吨。随着川商所的建立，未来丰源钒业等五氧化二钒需求企业的原料交易将从线下向线上转移，并将带动更多的相关企业来陕交易。由此，全球最大的有色金属钒交易中心有望在陕成型。</p>', '2014年6月18日，四川川商商品交易中心(简称“川商所”)在西安正式挂牌成立。当日实现1400吨有色金属钒现货交割，交易额逾亿元。', '川商所运营启动仪式系列报道（二）', '川商所 有色金属 挂牌成立', '2014年6月18日，四川川商商品交易中心(简称“川商所”)在西安正式挂牌成立。当日实现1400吨有色金属钒现货交割，交易额逾亿元。', '', '', '2016-01-06', '2016-01-08', '1452246329924.jpg', '', 34),
