(2894, 17, '川商所运营启动仪式系列报道（一）', '<p style="margin-bottom: 10px; white-space: normal; text-align: center; line-height: 1.5em;"><img src="/plugins/ueditor/php/upload/14621452073790.png" title="3.1.png" style="float: none;"/></p><p style="margin-bottom: 10px; white-space: normal; text-align: center; line-height: 1.5em;"><img src="/plugins/ueditor/php/upload/21661452073791.png" title="3.2.png" style="float: none;"/></p><p style="margin-bottom: 10px; white-space: normal; text-align: center; line-height: 1.5em;">陕西省人大常委会副主任李晓东在仪式上讲话</p><p style="margin-bottom: 10px; white-space: normal; text-align: center; line-height: 1.5em;"><img src="/plugins/ueditor/php/upload/49331452073792.png" title="3.3.png" style="float: none;"/></p><p style="margin-bottom: 10px; white-space: normal; text-align: center; line-height: 1.5em;">陕西省金融工作办公室副主任滕西鹏在仪式上讲话</p><p style="margin-bottom: 10px; white-space: normal; text-align: center; line-height: 1.5em;"><img src="/plugins/ueditor/php/upload/8251452073792.png" title="3.4.png" style="float: none;"/></p><p style="margin-bottom: 10px; white-space: normal; text-align: center; line-height: 1.5em;">陕西金融控股集团董事长权永生在仪式上讲话</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;"><br/></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;">2014年6月18日，四川川商商品交易中心(简称“川商所”)在西安正式挂牌成立，这将成为陕西从有色金属资源大省到资源强省提升转变、获取有色金属国际定价权的有效抓手。</p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;">陕西省人大常委会副主任李晓东，陕西省金融工作办公室副主任滕西鹏，陕西金融控股集团董事长、川商所法人代表权永生出席了本次启动仪式并分别作了讲话，希望四川川商商品交易中心能够全力打造出一个全新的金融行业品牌形象，树立良好的公信度，助力陕西金融事业更上一层楼。</p>', '2014年6月18日，四川川商商品交易中心(简称“川商所”)在西安正式挂牌成立，这将成为陕西从有色金属资源大省到资源强省提升转变、获取有色金属国际定价权的有效抓手。', '川商所运营启动仪式系列报道（一）', '四川川商商品交易中心 川商所 成立', '2014年6月18日，四川川商商品交易中心(简称“川商所”)在西安正式挂牌成立，这将成为陕西从有色金属资源大省到资源强省提升转变、获取有色金属国际定价权的有效抓手。', '', '', '2016-01-06', '2016-01-08', '1452246314834.jpg', '', 40),
