(2903, 1, '高盛表示油市供应过剩将缓和 看涨钯金', '<p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">国际顶级投行高盛集团(Goldman \r\nSachs)周一(12月21日)发布报告称，在油价接近每桶40美元水平时，高成本生产商将面临资金压力和融资市场关闭的风险，这可能令原油供应过剩的状况在2016年四季度缓和，如美国产量持续下降。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">高盛预计，未来3个月/6个月/12个月美国原油(WTI)预估价分别为每桶38美元、45美元及50美元。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">同时，高盛还预计未来3个月/6个月/12个月布伦特原油预估价分别为每桶43美元、50美元及54美元。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;"><strong>贵金属方面，高盛预计未来12个月钯金价格将升至每盎司750美元，因供应赤字持续。同时，该行还预计未来12个月铂金价格将在每盎司925美元。</strong></span></p>', '国际顶级投行高盛集团(Goldman Sachs)周一(12月21日)发布报告称，在油价接近每桶40美元水平时，高成本生产商将面临资金压力和融资市场关闭的风险，这可能令原油供应过剩的状况在2016年四季度缓和，如美国产量持续下降。', '高盛表示油市供应过剩将缓和 看涨钯金', '原油 钯金 贵金属 ', '国际顶级投行高盛集团(Goldman Sachs)周一(12月21日)发布报告称，在油价接近每桶40美元水平时，高成本生产商将面临资金压力和融资市场关闭的风险，这可能令原油供应过剩的状况在2016年四', '', '', '2016-01-08', '2016-01-08', '', '', 0),
(2893, 17, '热烈祝贺川商所运营启动仪式取得圆满成功', '<p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: center;"><span style="font-family: 宋体, SimSun;"><img src="/plugins/ueditor/php/upload/20561452073733.png" title="2.1.png"/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">四川川商商品交易中心18日上午在西安揭牌。挂牌当天实现1400吨有色金属钒现货交割，交易金额超过一亿元人民币。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">陕西省人大常委会副主任李晓东及陕西省金融办副主任滕西鹏、陕西金融控股集团、陕西省有色金属交易中心董事长权永生等领导出席揭牌仪式。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">陕西是有色金属大省，其中钒、钛、钼、镁、镍等储量和产量位居世界前列。此次，由陕西金融控股集团发起成立四川川商商品交易中心，将以互联网金融的商业模式与现有行业嫁接，推出以实现线上贸易、交收、物流配套等综合一体化电子交易结算系统;建设陕西有色金属商品大流通、大数据平台;推动陕西及中国有色金属产业的规模化经营及拥有市场定价权。 “川商所”的业务核心是支持有色金属产业健康高效发展，优化金融资源配置、完善产业发展所需的金融服务体系。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">揭牌后，四川川商商品交易中心分别与中国建设银行陕西省分行、中国工商银行陕西省分行、中国农业银行陕西省分行、招商银行、浦发银行、中信银行、西安银行、平安银行等签订战略合作协议。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">“川商所”总经理周军虎介绍，四川川商商品交易中心将通过最先进的创新金融模式，建立金融机关认可的仓储管理体系，以标准化电子仓单合约形式全面承载各个金融产品;建立国际领先的交易平台，提供安全稳定的交易环境;实现专业银行“第三方资金监管”，保障投资者资金安全。(来源 新华网陕西频道)</span></p>', '四川川商商品交易中心18日上午在西安揭牌。挂牌当天实现1400吨有色金属钒现货交割，交易金额超过一亿元人民币。', '热烈祝贺川商所运营启动仪式取得圆满成功', '川商所 有色金属 交易 中心', '四川川商商品交易中心18日上午在西安揭牌。挂牌当天实现1400吨有色金属钒现货交割，交易金额超过一亿元人民币。', '', '', '2016-01-06', '2016-01-08', '1452246301362.jpg', '', 22),
