(2905, 1, '丰业银行表示1089为金价阻力 金银比将走低', '<p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">丰业银行(Scotia Bank)在报告中指出，自11月中旬以来，黄金市场一直处在观望状态中，可能会尝试触底。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">丰业指出，近期黄金市场的双顶1089美元/盎司是阻力水平，下行支撑则在1047美元/盎司水平。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">该行指出，金价/银价略低于75.2的水平，长期的上行趋势依然在，下行支撑为70.96。过去一周金价/银价自78.18的高点回落至75.01，该比率可能会进一步走低。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">金价/银价走高通常是贵金属价格下跌时，而该比例上涨则通常在其价格上涨时。</span></p>', '丰业银行(Scotia Bank)在报告中指出，自11月中旬以来，黄金市场一直处在观望状态中，可能会尝试触底。', '丰业银行表示1089为金价阻力 金银比将走低', '黄金 市场 金价 触底', '丰业银行(Scotia Bank)在报告中指出，自11月中旬以来，黄金市场一直处在观望状态中，可能会尝试触底。', '', '', '2016-01-08', '2016-01-08', '', '', 12),
(2906, 1, '专家称供求面继续打压油价', '<p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">哥伦比亚大学全球能源政策中心的主管Jason Bordoff近日接受MSNBC采访，讨论了近期原油市场的表现。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">Bordoff指出，这个冬天由于天气比较热，加热油需求降低，影响整体原油需求</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">Bordoff称，在市场供需面，美国页岩油在低油价环境中比市场预期得更顽强，OPEC甚至还增加产量，供大于求打压油价。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">另外Bordoff认为，某种程度上，对于不削减产量沙特别无选择，沙特此前已经大举削减产量，但美国产量弥补了这些削减，而目前沙特不会单独削减，需要其它国家一同削减，但其它国家并不愿意削减。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">因此，Bordoff称，沙特产量一方面是打压美国原油产量，一方面更是打压那些高成本的其它国家产量。这最终带来了原油市场投资资本的大幅减少。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">对于伊朗伊朗原油回归市场，Bordoff认为，其影响已经很大程度上计入了金价中，但如果伊朗原油产量增加，将进一步打压油价。</span></p>', '哥伦比亚大学全球能源政策中心的主管Jason Bordoff近日接受MSNBC采访，讨论了近期原油市场的表现。', '专家称供求面继续打压油价', '全球能源政策 原油 市场 油价 供应过剩 沙特 美国 页岩油 ', '哥伦比亚大学全球能源政策中心的主管Jason Bordoff近日接受MSNBC采访，讨论了近期原油市场的表现。', '', '', '2016-01-08', '2016-01-08', '', '', 16),
(2892, 17, '川商所总经理周军虎向副省长李金柱汇报工作', '<p style="white-space: normal;"><br/></p><p style="white-space: normal; text-align: center;"><img src="/plugins/ueditor/php/upload/81821452073672.png" title="11.2.png" style="float: none;"/></p><p style="white-space: normal; text-align: center;">(图为李金柱副省长在生产车间调研现场)</p><p style="white-space: normal; text-align: center;"><img src="/plugins/ueditor/php/upload/67641452073672.png" title="11.1.png" style="float: none;"/></p><p style="white-space: normal; text-align: center;">(图为李金柱副省长与四川川商商品交易中心总经理周军虎留影)</p><p style="white-space: normal;"><br/></p><p style="white-space: normal;">近日，川商所总经理周军虎就交易所的筹备及运营情况向陕西省人民政府副省长李金柱进行工作汇报，并陪同考察全球最大的钒合金生产基地。</p>', '近日，川商所总经理周军虎就交易所的筹备及运营情况向陕西省人民政府副省长李金柱进行工作汇报，并陪同考察全球最大的钒合金生产基地。', '川商所总经理周军虎向副省长李金柱汇报工作', '川商所 壹银添丰', '近日，川商所总经理周军虎就交易所的筹备及运营情况向陕西省人民政府副省长李金柱进行工作汇报，并陪同考察全球最大的钒合金生产基地。', '', '', '2016-01-06', '2016-01-08', '1452246275366.jpg', '', 16),
(2904, 1, '空头回补和ETF买盘或推动金价回升', '<p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">在上周美联储做出了10年第一次升息的决定之后，周四金价一度大幅走低，接近此前12月低点，但上周五至本周一黄金市场却大幅上涨，周一一度突破1080美元/盎司水平。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">盛宝银行(Saxo Bank)商品研究主管Ole \r\nHansen指出，在升息决定之前，12月15日结束当周，期金市场的净空头头寸创下纪录，但在升息真正到来之后，空头头寸被逐渐减少。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">此外，Hansen还指出，黄金ETF也带来了一些支撑。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">SPDR黄金ETF的持有量在上周五增长近3%，当周总持有量增加近13吨，这是1月30日以来最大的单周流入量，而此前该ETF已经连续7周流出。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">Hansen称，在期货市场空头回补和ETF新买盘的双重推动下，金价出现了回升，技术面也有所改善，如果上行能突破1082美元/盎司的阻力水平，那么将上行至1100美元/盎司的关键水平。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><img alt="\\" src="/plugins/ueditor/php/upload/54761452247251.jpg" width="599" height="377"/></p>', '在上周美联储做出了10年第一次升息的决定之后，周四金价一度大幅走低，接近此前12月低点，但上周五至本周一黄金市场却大幅上涨，周一一度突破1080美元/盎司水平。', '空头回补和ETF买盘或推动金价回升', '美联储 空头回补 升息 黄金 市场 金价', '在上周美联储做出了10年第一次升息的决定之后，周四金价一度大幅走低，接近此前12月低点，但上周五至本周一黄金市场却大幅上涨，周一一度突破1080美元/盎司水平。', '', '', '2016-01-08', '2016-01-08', '', '', 12),
(2843, 9, '第678期', '<p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20150902/1441159836312353.jpg" style="float:none;" title="QQ图片20150902100836.jpg"/></p><p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20150902/1441159836370989.jpg" style="float:none;" title="QQ图片20150902100854.jpg"/></p><p><br/></p>', '', '', '', '', '', 'd', '2015-09-02', '2015-09-02', '', '1441159847253.pdf', 162),
(2890, 15, '关于交易系统升级的公告', '<p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; line-height: 1.5em;">各会员及投资者：<br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; 交易中心将在2015年11月07日04:00至2015年11月09日07:00对交易系统进行升级。现通知如下：</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; 1、下周一早上08:00前交易中心将会将系统升级后的交易客户端及相关签约教程发送至各会员单位;</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; 2、升级后所有已与银行签约的投资者，需在交易系统电脑客户端修改资金密码后才可以出入金;</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; 3、升级后所有未签约投资者，需在交易系统电脑客户端注册资金账号后。根据新注册的资金账号执行银行签约;</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; 4、系统升级后原电脑交易客户端支持自动升级，若有电脑客户端无法完成自动升级的投资者，请及时和相关会员单位联系，更换为升级后嗯对电脑交易客户端。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; 此次系统升级为交易系统电脑客户端升级，手机客户端(IOS、安卓)择期升级，手机客户端升级前无法进行出入金操作。升级期间交易软件会显示开市状态，请会员和投资者勿登录进行操作。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; &nbsp; 请各会员知晓并通知下属投资者。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;">壹银添丰商品经营有限公司</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;">2015年11月6日</span></p>', '​各会员及投资者：交易中心将在2015年11月07日04:00至2015年11月09日07:00对交易系统进行升级。现通知如下', '交易系统 升级 壹银添丰 ', '关于交易系统升级的公告', '​各会员及投资者：交易中心将在2015年11月07日04:00至2015年11月09日07:00对交易系统进行升级。现通知如下', '', '', '2016-01-06', '2016-01-06', '', '', 89),
(2907, 1, '有分析师认为黄金面临“完美风暴”', '<p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;"><strong>上周在美联储升息的影响下，金价一度跌破1050美元/盎司水平，非常接近12月初1046美元/盎司的低点。尽管此后金价有所回升，但有分析师认为，黄金市场依然面临着很大的困难。</strong></span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">今年一整年黄金市场都受到升息预期的影响，而在升息最终到来后，今年将是黄金市场连续第三年下跌。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">Evercore ISI的Rich Ross表示，美联储升息使得黄金市场基本面看空，而从技术面而言，黄金市场也不乐观。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">Ross认为：“美元走强、利率走高以及大宗商品市场的崩溃，外加原油低迷，信用曲线等，对黄金市场而言基本上就是一个完美风暴。”</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">Ross认为，金价走势是非常完整的下行趋势，表明了今年年底金价最终会跌破1000美元/盎司水平。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">从长期走势来看，Ross指出，金价形成了头肩形，因此表明了金价还会走低。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">上行而言，Ross认为，金价必须上行突破100周移动均线才行。“在此之前我是不会买入黄金的。”100周移动均线在1215美元/盎司左右。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">Ross认为，黄金市场切不可接飞刀，应当等待金价走高再入场。</span></p>', '上周在美联储升息的影响下，金价一度跌破1050美元/盎司水平，非常接近12月初1046美元/盎司的低点。尽管此后金价有所回升，但有分析师认为，黄金市场依然面临着很大的困难。', '有分析师认为黄金面临“完美风暴”', '美联储升息 金价 黄金 市场 ', '上周在美联储升息的影响下，金价一度跌破1050美元/盎司水平，非常接近12月初1046美元/盎司的低点。尽管此后金价有所回升，但有分析师认为，黄金市场依然面临着很大的困难。', '', '', '2016-01-08', '2016-01-08', '', '', 27),
(2908, 1, '嘉能可称中国依然是大宗商品的利好因素', '<p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;"><strong>全球大宗商品贸易巨头——嘉能可(Glencore)董事John \r\nMack周三(12月30日)在接受电视采访时称，从长期来看，中国经济增长引擎将带动原材料需求。</strong>他还表示，这家大宗商品公司依然把精力放在商品交易上。John \r\nMack曾担任摩根士丹利的首席执行官。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">Mack周三表示，煤炭价格将继续下跌，中国不大可能像美国那么大力度的弃用煤炭、改用天然气。他说，嘉能可已经降低铜产量，如果要让铜价反弹，其他公司也必须采取同样的行动。</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">Mack支出，“对于嘉能可而言，最重要的事情是保住投资级评级，发掘可以减产的领域。同时，我们不会缩减交易业务。在交易领域，我们一如既往地激进。”</span></p><p style="line-height: 1.5em; margin-bottom: 15px;"><span style="font-size: 14px;">随着中国的大宗商品需求减弱、从石油到铝等原材料价格下挫，嘉能可股价2015年重挫70%。但Mack表示，尽管中国增长减速今年拖累了大宗商品价格，但是长期来看，伴随着消费增加，大宗商品前景向好。</span></p>', '全球大宗商品贸易巨头——嘉能可(Glencore)董事John Mack周三(12月30日)在接受电视采访时称，从长期来看，中国经济增长引擎将带动原材料需求。他还表示，这家大宗商品公司依然把精力放在商品交易上。John Mack曾担任摩根士丹利的首席执行官。', '嘉能可称中国依然是大宗商品的利好因素', '大宗商品 中国经济 原材料需求 商品贸易 石油 原油 铝 ', '全球大宗商品贸易巨头——嘉能可(Glencore)董事John Mack周三(12月30日)在接受电视采访时称，从长期来看，中国经济增长引擎将带动原材料需求。他还表示，这家大宗商品公司依然把精力放在商', '', '', '2016-01-08', '2016-01-08', '', '', 34);
