(2884, 15, '通知', '<p><span style="font-size: 14px; line-height: 21px;"></span></p><p style="white-space: normal;"><span style="font-family: 宋体, SimSun;">各会员及投资者：</span></p><p style="white-space: normal;"><br/></p><p style="white-space: normal;"><span style="font-family: 宋体, SimSun;">&nbsp; &nbsp; 因系统发送清算文件失败，导致建设银行签约投资者今天(5月7日)只能入金不能出金。交易中心正在紧急处理，客户资金不会产生安全风险。给各会员单位及投资者带来不便，敬请谅解。</span></p><p style="white-space: normal;"><br/></p><p style="white-space: normal;"><span style="font-family: 宋体, SimSun;">&nbsp; &nbsp; 特此公告</span></p><p style="white-space: normal;"><span style="font-family: 宋体, SimSun;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></p><p style="white-space: normal;"><br/></p><p style="white-space: normal; text-align: right;"><br/></p><p style="white-space: normal; text-align: right;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="white-space: normal; text-align: right;"><span style="font-family: 宋体, SimSun;">壹银添丰商品经营有限公司</span></p><p style="white-space: normal; text-align: right;"><span style="font-family: 宋体, SimSun;">2015年5月7日</span></p>', '因系统发送清算文件失败，导致建设银行签约投资者今天(5月7日)只能入金不能出金。交易中心正在紧急处理，客户资金不会产生安全风险。', '通知', '出入金 建设银行', '因系统发送清算文件失败，导致建设银行签约投资者今天(5月7日)只能入金不能出金。交易中心正在紧急处理，客户资金不会产生安全风险。', '', '', '2016-01-06', '2016-01-06', '', '', 22),
(2885, 15, '关于模拟系统升级的通知', '<p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">各会员及投资者：</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; &nbsp; 壹银添丰商品经营有限公司将于2015年5月15日升级测试模拟交易系统，模拟交易系统5月15日22:00闭市。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp;&nbsp;</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; &nbsp; 特此通知!</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;">壹银添丰商品经营有限公司</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;">2015年5月15日</span></p>', '关于模拟系统升级的通知', '关于模拟系统升级的通知', '模拟系统 升级', '关于模拟系统升级的通知', '', '', '2016-01-06', '2016-01-06', '', '', 13),
(2886, 15, '关于调整交易时间的公告', '<p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">各会员及客户：</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; 2015年5月25日(星期一)为国际金融假日，相关国际金融市场休市，为了与国际市场更有效地保持价格联动，壹银添丰商品经营有限公司调整本市场的交易时间，具体规定如下：</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; 2015年5月25日(星期一)，白银15千克、白银50千克、白银100千克、三个产品提前至2015年5月26日(星期二)01:00停止交易。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; 2015年5月26日(星期二)早上8:00开市，所有产品恢复正常交易。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; &nbsp;&nbsp;</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; &nbsp; 请各会员知晓并通知下属客户。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;">壹银添丰商品经营有限公司</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;">2015年5月22日</span></p>', '关于调整交易时间的公告', '关于调整交易时间的公告', '交易时间 调整', '关于调整交易时间的公告', '', '', '2016-01-06', '2016-01-06', '', '', 61),
(2887, 15, '关于端午节假期开市的公告', '<p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">各会员及投资者：</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp;&nbsp;2015年6月22日(星期一)为端午节假期，壹银添丰商品经营有限公司根据发布的交易日历安排各产品交易时间，具体规定如下：</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; line-height: 1.5em;">&nbsp; 2015年6月22日(星期一)早8:00照常开市，所有产品正常交易， 2015年6月20日(星期六)至2015年6月21日(星期日)均为周末休市。</span><br/></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp;&nbsp;</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; 请各会员及客户做好资金安排，防范交易风险，并请会员向客户做好相应的告知工作。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;">壹银添丰商品经营有限公司</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;">二〇一五年六月十日</span></p>', '关于端午节假期开市的公告', '关于端午节假期开市的公告', '端午节 开市 ', '关于端午节假期开市的公告', '', '', '2016-01-06', '2016-01-06', '', '', 56),
(2888, 15, '关于调整白银100千克最大持仓限额的公告', '<p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; line-height: 24px;">各会员及投资者：</span></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; line-height: 1.5em;">&nbsp;</span><span style="font-family: 宋体, SimSun; line-height: 1.5em;">&nbsp;根据目前业务需要，壹银添丰商品经营有限公司将于2015年6月25日闭市后(6月26日04:00)，调整交易品种白银100千克最大持仓限额为300手。<br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; 请各会员及客户做好资金安排，防范交易风险，并请会员向客户做好相应的告知工作。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;">壹银添丰商品经营有限公司</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;">二〇一五年六月二十三日</span></p>', '关于调整白银100千克最大持仓限额的公告', '关于调整白银100千克最大持仓限额的公告', '白银 持仓 限额 ', '关于调整白银100千克最大持仓限额的公告', '', '', '2016-01-06', '2016-01-06', '', '', 64),
(2889, 15, '关于工商银行免除出入金手续费的公告', '<p><span style="font-family: 宋体, SimSun; line-height: 24px;">各会员及投资者：</span></p><p></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; 壹银添丰商品经营有限公司(以下简称“交易中心”)第三方存管银行——中国工商银行于2015年6月23日(星期二)起免除交易中心投资者出入金手续费。如有变动交易中心另行通知。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun;">&nbsp; 请投资者及会员做好风险防范，合理选择签约银行。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;"><br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun; line-height: 1.5em;">壹银添丰商品经营有限公司<br/></span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em; text-align: right;"><span style="font-family: 宋体, SimSun;">&nbsp;二〇一五年六月二十三日</span></p><p><span style="font-family: 宋体, SimSun;"><br/></span></p><p><span style="font-family: 宋体, SimSun; line-height: 24px;"><br/></span><br/></p>', '关于工商银行免除出入金手续费的公告', '关于工商银行免除出入金手续费的公告', '工商银行 出入金 手续费 壹银添丰', '关于工商银行免除出入金手续费的公告', '', '', '2016-01-06', '2016-01-06', '', '', 64),
(2912, 9, '第763期', '<p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160112/1452568748377173.png" style="float:none;" title="银1.png"/></p><p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160112/1452568748993603.png" style="float:none;" title="银2.png"/></p><p><br/></p>', '国际白银价格周一(1月12日)下跌0.57%，报收13.92美元/盎司。昨日美国公布的经济数据表现良好，这对美元构成支撑。具体数据显示，美国12月就业市场状况指数(LMCI) 2.9，预期0.0，前值由0.5修正为2.7。美国12月就业市场状况指数大幅反弹，大致弥补了11月的下滑幅度。', '第763期', '壹银财富 银精矿 聚丙烯 策略点评 白银 原油 银价 油价 基本面 美元 中国经济 全球金融市场', '国际白银价格周一(1月12日)下跌0.57%，报收13.92美元/盎司。昨日美国公布的经济数据表现良好，这对美元构成支撑。具体数据显示，美国12月就业市场状况指数(LMCI) 2.9，预期0.0，前值', '', 'd', '2016-01-12', '2016-01-12', '', '1452568757718.pdf', 8),
(2874, 21, '跨年狂欢夜  岁末享回馈', '<p><img src="/plugins/ueditor/php/upload1/20160106/1452070534128213.jpg" title="跨年.jpg"/><br/></p>', '跨年大狂欢', '跨年大狂欢', '跨年大狂欢', '跨年大狂欢', '跨年大狂欢', '', '2016-01-06', '2016-01-07', '1452073602732.png', '', 16),
(2891, 17, '证券日报：上期所利用有色指数期货拓展风险管理空间', '<p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">本周市场多空叠加，美国公布经济数据喜忧参半，耶伦在联储会议上论调谨慎，维持宽松预期，美元大幅回落，但对大宗商品提振有限;欧洲多国公布经济数据疲弱，乌克兰政局持续发酵，市场避险情绪升温，金属表现分化，伦镍劲涨12%以上，伦镍年内至今已暴涨53%，国内金川公司连续调价，周内SMMI.Ni领涨16.5%，除了镍保持连续反弹格局，铅锌因为冶炼厂继续检修状态，出货量有限，挺价意愿较浓，录得小涨，但涨幅有限，SMMI.Pb涨0.2%，SMMI.Zn微涨0.05%。铜因进口铜到货增加，缓解了前期的供应紧张，持货商换现积极，现货升水下降，“买近抛远”导致期铜压力重启，现货铜价受拖累跟跌，SMMI.Cu下跌0.64%，铝因前期涨势过猛，获利回吐增强导致期铝回调幅度加大，现货商畏跌主动抛货，下游欲等待价格企稳，观望居多，现货铝价加速滑坡，SMMI.Al较节前下跌2.47%。节后一周SMMI在涨跌互现下，维持小涨0.2%之态，市场对五月份的行情仍乐观偏多。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">铜：本周市场多空叠加，伦铜维持在6650-6720美元/吨区间运行，重心小幅下沉，回调1%，成交量与持仓量下降，空头力量重启，上方技术性压力增强，技术面主导周内走势。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">国内A股回落0.8%，2000点受到考验，远月合约抛压加重，多空分歧加大，成交亦放量，持仓量激增4万余手，主力合约完成后移。夜盘周初成交活跃度低迷，周后改善伴随增仓，但整体活跃度不及节前。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">现货市场，沪伦比值继续修复，进口铜大量涌入市场，加之保值盘流出，现铜供应充裕，换现意愿明显，现货升水一路收窄，投机商择机入市，下游按需接货，成交活跃度较节前下降，以中间商投机为主。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">铝：本周数据面与消息面逐步恢复平静，伦铝也在五连阴下挫之后得到短暂喘息，于60日均线上方盘整两日，但之后中国连续公布的经济数据不佳，耶伦国会证词讲话对美国经济前景措辞谨慎，伦铝终失守最后一条均线支撑，至一个多月来低点1756.3美元/吨。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">中国4月汇丰PMI终值下修，服务业PMI数据也令人失望，中国经济发展和中国需求成为投资者重要忧虑，A股下滑，国内沪期铝主力连续八日大幅下跌，直至底部遇13000元/吨整数关口支撑，出现止跌回升迹象，本周主力成交量增加94722手至23.6万手，持仓量增加2162手至11.7万手。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">“五一”假期前后沪期铝当月结束疯狂涨势转而下跌，先后跌破各条均线及下方13000元/吨整数关口的支撑，现货表现跟跌，加上节后现货库存由减转增，下游谨慎观望情绪再现，接货恢复按需采购的模式，持货商13000元/吨以下的低价位出货意愿虽有下降，但仍有保值货不断流出，市场流通货源较多，拖累现货成交价格不断大幅走低，贴水也由贴水30元/吨扩大至贴水70元/吨左右，直至周末，下游备货加上期铝反弹的支撑，市场信心回暖，成交市况才在清淡中大幅改善。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">铅：周内消息面较清淡，虽有美联储耶伦及欧央行德拉吉的宽松言论以及中国4月利好的贸易帐数据提振，但乌克兰危机升级、中国房地产放缓以及IPO名单扩容忧虑压制，伦铅无法走出单边趋势，运行于2080-2100美元/吨的震荡区间，持仓量及库存均变动较少。但伦铅的技术图形来看处于偏弱的震荡整理格局，上方压力较大，料下周仍将维持区间震荡走势2070-2120美元/吨。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">沪铅1406合约围绕14900元/吨一线，运行于13830-14000元/吨，下方支撑及上方压力都较强。随着交割日的临近，铅现货的强劲带动05合约持仓量的激增，再度超越06合约成为主力合约，近强远弱格局明显。下周随着交割日的临近，现货偏紧又受到部分套利盘买近抛远的制约，料下周运行主体为13850-13950元/吨。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">周内现铅市场缺乏明显方向，但较期货抗跌迹象凸显。上海市场货源仅驰宏、汉江、恒邦货源尚可，成交普遍集中于13900-13950元/吨;广东地区个旧及仓单货源价格接近，集中于13850-13880元/吨;河南13850-13900元/吨，江西、湖南现货货源依旧较少。同时，下游铅蓄电池企业受制于终端消费，成品库存等原因，买兴不佳。现铅市场下周供需拉锯延续，现货偏强13850-13950元/吨。铅锭供应偏紧格局较难改善，因5月仍处于冶炼厂集中检修期，且原料铅精矿紧缺限制出货;下游维持按需采购，但采购量料将出现下滑。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">锌：本周市场缺乏明确方向指引，伦锌企稳于各路常用均线之间。周一外盘因五月节休市，周内消息繁杂，市场交投谨慎，成交量达1.5万余手较上周缩减803手，持仓量变化不大基本于上周持平维持在30.3万余手。截止至周四，伦锌累计小跌4.3美元/吨，累计跌幅0.2%。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">周内沪期锌主力1407合约保持震荡盘整的走势，总体运行于区间15050-15180元/吨。周初，沪期锌在多头引导下依托20日均线顺势而上，上方触及15180元/吨高位后震荡回落，下方支撑于60日均线附近。截止至周四，周内沪期锌主力1407合约持仓量累计减少7242手至84310手。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">本周现锌价格持稳，现货供应压力缓解带动0#锌对沪期锌主力1407合约升水收窄，由上周升水40元/吨回落至平水至升水20元/吨。0#锌价格运行于15090-15110元/吨，与上周基本持平，前期检修炼厂陆续恢复正常生产，现货供应紧张持续缓解，现货对沪期锌主力升水有所收窄，打击贸易商采货积极性;下游畏跌情绪加重，采货积极性减弱，整体市场成交趋淡。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">周内广东市场锌价表现较为强势，部分进口锌流入市场补充市场货源，但现货流通资源偏紧，库存持续小幅下降，0#锌锭对上海市场0#锌锭由上周末贴水30元/吨转为升水20元/吨。天津市场锌价也表现较为坚挺，部分品牌货少，0#锌锭对上海市场0#锌锭由上周末的贴水50元/吨转为平水，不过下游企业反馈平平，多以按需采购为主，市场成交疲弱。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">锡：经历五一期间的重挫之后，本周伦锡整体走势震荡上扬，但涨幅有限仅沿着60日均线运行，上方30日均线处有压力。截至周四电子盘收盘23223美元/吨，较上周四上涨363美元/吨。基本面消息淡静，走势驱动依然主要来自于宏观和技术面。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">本周国内现货价格走势脱离外盘，明显弱于外盘，外盘走势显示小幅震荡上扬，而现货价格在周一至周四却持续大幅下跌，尤其是周二、周三，日跌1000元/吨，截至周四主流价格跌至137000-140000元/吨;不过随着二三线品牌逐渐被消耗，周五现货价格小幅反弹，低价资源减少，主流价格缩窄至139500-140500元/吨，高价货源依然上行乏力。周内整体成交偏淡，下游入市不多，多为贸易商之间转货、补货。冶炼厂报价大多跟随市场价格，云锡公司出厂报价相对坚挺。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">镍：伦镍历经4月底和劳动节的短暂盘整后，本周再度大幅走强。宏观上中国公布的4月进出口贸易帐有明显改善，体现了国际市场需求有所回暖，为基本金属提供数据利好支撑。另外周三下午淡水河谷公司因工厂泄漏暂时停运，市场不断推高镍价，致使无锡电子盘一度封于涨停，外盘先破前高19000美元后企稳20000美元大关，上方攻至20500美元的高位。技术指标上，镍价上方60月均线的阻力线已被攻破，目前直逼22000美元的前期平台;价量方面，在周一LME休市的情况下，单周录得8515手的新增成交和3710手的新增持仓，LME库存方面也再度下滑了1560吨，至周四的277968吨。</span></p><p style="margin-bottom: 10px; white-space: normal; line-height: 1.5em;"><span style="font-family: 宋体, SimSun; font-size: 14px;">本周现货均价为131340元/吨，环比上涨6206元。上海地区金川公司累计5次将大板镍价格上调至143000元，上调幅度11700元。终端有采购俄镍的意愿却难以从贸易商中获得稳定货源，因此集中向交易所订购交仓货，部分企业则通过进口商点价拿货。今日沪伦比值已回归7.2以上，逐步向正套行情发展。据SMM调研，保税库今日有平水成交的俄镍，但进口商并未大量放货，他们认为目前客户要价的升水依旧偏低。国内俄板价格和金川镍已基本价格趋于一致，贸易商囤俄镍已失去优势，因此本周市面上贸易商多出俄镍收交仓的金川货。此外国产镍在长期无人问津的情况下，本周成交有所改善，贸易商试图和新疆镍，江锂镍等品牌镍的供货商建立供货关系。</span></p>', '本周市场多空叠加，美国公布经济数据喜忧参半，耶伦在联储会议上论调谨慎，维持宽松预期，美元大幅回落，但对大宗商品提振有限;欧洲多国公布经济数据疲弱', '证券日报：上期所利用有色指数期货拓展风险管理空间', '美国 数据 美联储 宽松 美元 回落 大宗商品', '本周市场多空叠加，美国公布经济数据喜忧参半，耶伦在联储会议上论调谨慎，维持宽松预期，美元大幅回落，但对大宗商品提振有限;欧洲多国公布经济数据疲弱', '', '', '2016-01-06', '2016-01-08', '1452246261325.jpg', '', 23),
