(2913, 9, '第764期', '<p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160114/1452740354244535.png" style="float:none;" title="银1.png"/></p><p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160114/1452740354688595.png" style="float:none;" title="银2.png"/></p><p><br/></p>', '国际白银价格周二(1月12日)下跌0.56%，报收13.77美元/盎司。昨日美联储官员的讲话对市场的影响有限，投资者的焦点似乎并没有在政策差异之上。美联储副主席费希尔也发表了公开言论，他预计生产力增速将最终恢复，货币政策现在或更大程度受到零利率区间的制约，负利率在美国快速实施比较困难。', '第764期', '壹银添丰 壹银财富 银精矿 聚丙烯 白银 原油 油价 银价 黄金 货币政策 气温 股市 人民币汇率 策略点评 ', '国际白银价格周二(1月12日)下跌0.56%，报收13.77美元/盎司。昨日美联储官员的讲话对市场的影响有限，投资者的焦点似乎并没有在政策差异之上。美联储副主席费希尔也发表了公开言论，他预计生产力增速', '', 'd', '2016-01-14', '2016-01-14', '', '1452740367655.pdf', 7),
(2914, 9, '第765期', '<p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160114/1452740433692295.png" style="float:none;" title="银1.png"/></p><p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160114/1452740433737527.png" style="float:none;" title="银2.png"/></p><p><br/></p>', '国际白银价格周三(1月14日)上涨2.75%，报收14.14美元/盎司。昨日市场的避险情绪再度升温，虽然人民币汇率最近两日在中国央行的干预下暂时企稳，但包括中国股市在内的全球股市在周三的交投中表现低迷，增加了避险，打压了市场人气，银价受此提振走高。', '第765期', '壹银添丰 壹银财富 银精矿 聚丙烯 白银 银价 黄金 原油 中国经济 经济数据 避险情绪 策略 ', '国际白银价格周三(1月14日)上涨2.75%，报收14.14美元/盎司。昨日市场的避险情绪再度升温，虽然人民币汇率最近两日在中国央行的干预下暂时企稳，但包括中国股市在内的全球股市在周三的交投中表现低迷', '', 'd', '2016-01-14', '2016-01-14', '', '1452740441349.pdf', 2),
(2917, 9, '第766期', '<p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160115/1452825929122389.png" style="float:none;" title="银1.png"/></p><p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160115/1452825929385867.png" style="float:none;" title="银2.png"/></p><p><br/></p>', '国际白银价格周四(1月14日)下跌2.23%，报收13.83美元/盎司。昨日美国公布的当周初请失业金人数至28.4万。初请失业金人数的意外"飙升"创下了去年七月以来的此高水平。但是美国上周初请人数依然保持着连续第45周低于30万人关口的1970年代以来最长低位记录，这表明美国就业市场状况较为健康。美元小幅回落后再度上扬。', '第766期', '壹银添丰 白银 银价 油价 原油 初请失业金 美国 美元 就业市场 黄金 银精矿 聚丙烯 策略点评 ', '国际白银价格周四(1月14日)下跌2.23%，报收13.83美元/盎司。昨日美国公布的当周初请失业金人数至28.4万。初请失业金人数的意外"飙升"创下了去年七月以来的此高水平。但是美国上周初请人数依然', '', 'd', '2016-01-15', '2016-01-15', '', '1452825937435.pdf', 2),
