(2928, 9, '第768期', '<p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160119/1453171497159565.png" style="float:none;" title="银1.png"/></p><p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160119/1453171497502496.png" style="float:none;" title="银2.png"/></p><p><br/></p>', '国际白银价格周一(1月18日)上涨0.15%，报收13.93美元/盎司。周一美国股市因马丁路德金纪念日休市一日，这使得全球市场在周一行情中非常淡静。由于周一中国股市和汇市也暂时企稳，这使得市场风险情绪有所回升，美元因此小升。目前市场焦点都集中在今天北京时间10点中国公布的四季度GDP数据之上。', '第768期', '壹银财富 策略点评 技术解盘 白银 银价 黄金 原油 油价 银精矿 长安PP3 美国 中国股市 市场 GDP数据', '国际白银价格周一(1月18日)上涨0.15%，报收13.93美元/盎司。周一美国股市因马丁路德金纪念日休市一日，这使得全球市场在周一行情中非常淡静。由于周一中国股市和汇市也暂时企稳，这使得市场风险情绪', '', 'd', '2016-01-19', '2016-01-19', '', '1453171507702.pdf', 13),
(2929, 9, '第135期', '<p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160119/1453182752571786.png" title="银周1.png"/></p>', '上周市场继续震荡下行，尽管周四一度触及前期低点后有所反弹，但周五又明显下跌，最终上证指数收于2901点，周跌幅8.96%；创业板指数收于2113点，周跌幅6.05%；中小板指数收于6632点，周跌幅7.89%。回顾上周市场，造成开年首周急跌的熔断机制、人民币贬值、减持风波等事件逐渐趋于缓和，而无论政策层面、消息层面还是基本面层面均无明显利空，市场持续下跌的动因更多源于市场信心受挫，目前市场谨慎情绪占据上风。', '第135期', '壹银财富 市场  A股 股票 黄金 白银 银价 原油 熔断机制 行情 解盘 ', '上周市场继续震荡下行，尽管周四一度触及前期低点后有所反弹，但周五又明显下跌，最终上证指数收于2901点，周跌幅8.96%；创业板指数收于2113点，周跌幅6.05%；中小板指数收于6632点，周跌幅7', '', 'w', '2016-01-19', '2016-01-19', '', '1453182759644.pdf', 25),
