(2935, 9, '第774期', '<p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160127/1453863255237092.png" style="float:none;" title="银1.png"/></p><p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160127/1453863255346483.png" style="float:none;" title="银2.png"/></p><p><br/></p>', '国际现货白银周二收于14.47美元/盎司，上涨0.26美元，涨幅为1.82%。美周二(1月25日)美联储决议公布前一交易日。目前市场普遍预期本次决议美联储将会带来鸽派信息，投资者在美联储政策会议结果公布前变得谨慎。', '第774期', '壹银财富 壹银添丰 现货白银 美联储会议 银精矿 长安PP3 原油 油价 银价 策略', '国际现货白银周二收于14.47美元/盎司，上涨0.26美元，涨幅为1.82%。美周二(1月25日)美联储决议公布前一交易日。目前市场普遍预期本次决议美联储将会带来鸽派信息，投资者在美联储政策会议结果公', '', 'd', '2016-01-27', '2016-01-27', '', '1453863263374.pdf', 33),
(2936, 9, '第775期', '<p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160128/1453946450591362.png" style="float:none;" title="银1.png"/></p><p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160128/1453946450928110.png" style="float:none;" title="银2.png"/></p><p><br/></p>', '国际现货白银周二收于14.45美元/盎司，美联储发布鸽派决议声明，施压美指回落走低。美联储维持联邦基金基准利率0.25%-0.5%不变。美联储在决议中强调了当前通胀和全球经济状况，这打压美指小幅回落。', '第775期', '壹银财富 原油 白银 银价 油价 银精矿 长安PP3 美联储 鸽派决议 供应 产量 策略 OPEC 减产协议 ', '国际现货白银周二收于14.45美元/盎司，美联储发布鸽派决议声明，施压美指回落走低。美联储维持联邦基金基准利率0.25%-0.5%不变。美联储在决议中强调了当前通胀和全球经济状况，这打压美指小幅回落。', '', 'd', '2016-01-28', '2016-01-28', '', '1453946459193.pdf', 44),
(2937, 9, '第776期', '<p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160201/1454293958588308.png" style="float:none;" title="银1.png"/></p><p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160201/1454293958981408.png" style="float:none;" title="银2.png"/></p><p><br/></p>', '国际现货白银周二收于14.45美元/盎司，周四美联储决议之后，市场重新把焦点集中在美国一系列重要经济数据之上，结果美国公布的以耐用品订单为代表的数据整体疲弱，再一次显现了经济放缓的信号，美元因此遭市场抛售跌至两周低位。', '第776期', '壹银财富 原油 白银 美联储决议 美国 经济数据 疲弱 长安PP3 银精矿 策略 ', '国际现货白银周二收于14.45美元/盎司，周四美联储决议之后，市场重新把焦点集中在美国一系列重要经济数据之上，结果美国公布的以耐用品订单为代表的数据整体疲弱，再一次显现了经济放缓的信号，美元因此遭市场', '', 'd', '2016-02-01', '2016-02-01', '', '1454294000583.pdf', 23),
(2938, 9, '第777期', '<p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160201/1454294151306729.png" style="float:none;" title="银1.png"/></p><p style="text-align: center;"><img src="/plugins/ueditor/php/upload1/20160201/1454294151674688.png" style="float:none;" title="银2.png"/></p>', '国际白银价格上周五(1月29日)上涨0.06%，报收14.24美元/盎司。上周五美国经济数据表现好坏参半，并未限制美元升势。其中市场关注的四季度GDP数据略低预期，但个人消费支出PCE表现良好支撑美元。', '第777期', '壹银财富 国际白银 国际原油 美国经济数据 美元升势 市场 GDP 银精矿 长安PP3 策略点评 ', '国际白银价格上周五(1月29日)上涨0.06%，报收14.24美元/盎司。上周五美国经济数据表现好坏参半，并未限制美元升势。其中市场关注的四季度GDP数据略低预期，但个人消费支出PCE表现良好支撑美元', '', 'd', '2016-02-01', '2016-02-01', '', '1454294172691.pdf', 62);
INSERT INTO `by_article` (`id`, `cate_id`, `title`, `content`, `intro`, `site_title`, `site_keywords`, `site_description`, `tags`, `flag`, `create_date`, `update_date`, `img`, `attach`, `click`) VALUES
(2939, 1, '财富线A+B教你股票贵金属到底选哪个好', '<p style="text-indent:28px;line-height:150%"><span style="font-size: 16px; font-family: 宋体, SimSun;">2月22日，像是要契合这222的数字一般，投资市场也来犯二了。股市、金市、油市统统不按之前的走，一直在涨的跌一个看看，一直在跌的涨一个试试咯。股市那些在年前‘灾难性’暴跌中被套的股民无奈割肉才出来没多久啊，A股像是迎接新任证监会主席刘先生一般，在慢吞吞急死人的小幅反弹之后，终于来了个大幅反弹，站上2900点大关；黄金春节前后收复的约16%的涨幅，在上周缓缓回吐一部分后，在全球股市的上涨行情中，高台跳水下跌近2%；而一直处在严寒重灾区的油市，却在美国石油钻井数大降以及国际能源署的乐观预期中彪悍拉升了6%。</span></p><p style="text-indent:28px;line-height:150%"><span style="font-family: 宋体, SimSun; font-size: 16px;">看样子好像所有的涨跌都有基础面的支撑，发现应该不难吧？广大投资者只回三个字——“呵呵哒”。说的轻巧是吧？总结的都很到位是吧？新闻写的很详细是吧？但是！这所有的新闻消息都是在行情已经发生过才有的总结啊，也就是在做多亏损、做空被打脸等等结束之后，在分秒必争的投资市场已经过了算是超级长的一天之后，各大新闻板块开始的总结性陈述，对投资还有个鬼用啊！</span></p><p style="text-indent:28px;line-height:150%"><span style="font-family: 宋体, SimSun; font-size: 16px;">在投资市场，尤其是黄金、白银、原油这些以短线交易为主的投资市场，对行情的把握就相当于对盈利的把握，我们需要的是快人一步，在稍早或者行情出现伊始便能迅速发现并且进行交易。针对这些，我们来看一下<a href="http://www.yytf099.com/" style="font-family: &#39;&#39;; font-size: medium; white-space: normal; color: black; text-decoration: none;"><strong>壹银添丰集团</strong></a>推</span><span style="font-family: 宋体, SimSun; font-size: 16px;">出的财富线量化交易系统。</span></p><p style="text-indent:28px;line-height:150%"><span style="font-size: 16px; font-family: 宋体, SimSun;">BS<span style="font-family: 宋体;">信号系统模块方便投资者根据系统出现的买卖信号进行多空操作；多空预警模块方便投资者掌握多空趋势的转换，对仓位实施动态管理，不要贪婪，更不要恐惧；</span>GLQ<span style="font-family: 宋体;">模块是为了实时过滤交易噪音提示市场风险，减少无效操作的次数。</span></span></p><p style="text-indent:28px;line-height:150%"><span style="font-family: 宋体, SimSun; font-size: 16px;">有买卖信号，有风险预警，有噪音过滤，实时行情实时把握，哪里还需要担心市场犯二？市场犯二的时候，恰巧是给冷静机智的投资者盈利的机会呢！</span></p><p style="text-indent:28px;line-height:150%"><span style="font-family: 宋体, SimSun; font-size: 16px;">上一篇文章：<span style="font-family: &#39;&#39;; font-size: medium;">&nbsp;</span><a href="http://www.yytf099.com/industrynews/2909" style="font-family: &#39;&#39;; font-size: medium; white-space: normal; color: black; text-decoration: none;">法兴称2016需警惕商品市场二轮风暴</a></span></p><p><br/></p>', '2月22日，像是要契合这222的数字一般，投资市场也来犯二了', '财富线A+B教你股票贵金属到底选哪个好', '股票,贵金属,财富A+B,壹银添丰集团', '2月22日，像是要契合这222的数字一般，投资市场也来犯二了', '', '', '2016-02-24', '2016-02-25', '', '', 70),
(2940, 1, '壹银添丰有色金属：改革板块强势暴涨', '<p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><br/></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><strong><span style="font-size:14px;font-family:宋体;color:#333333">受利好消息推动，今天大盘放量大涨，延续反弹走势，收盘大涨超2%，站上2900点大关。那么整体来看，由于有场外资金不断进场，因此大盘的反弹行情还没有结束，上方仍有空间。</span></strong><span style="font-size:14px;color:#333333">不过从本轮反弹到现在，许多个股已经有了不小的涨幅，另外大盘指数离3000点也越来越近，再加上创业板的风险已经出现，因此接下来建议大家在操作上要增加风险意识，不宜追高。那么从投资机会上来说，现在最有资金号召力的无疑是供给侧改革概念，今天这个板块再次大涨，那么我们今天就再来给大家梳理一下这个板块的投资机会。</span></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><strong><span style="font-size:14px;font-family:宋体;color:#333333">我们先来看看这个板块今天的表现情况：</span></strong></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><span style="font-size:14px;color:#333333">在市场资金不断的炒作下，今天供给侧改革概念再次迎来暴涨行情，相关板块强势大涨，其中钢铁、煤炭、有色等板块涨幅居前，成为推动大盘上行的主力军，板块内许多个股强势封涨停。</span></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><strong><span style="font-size:14px;font-family:宋体;color:#333333">那么这个题材大不大?到底有没有深入炒作的空间呢?</span></strong></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><span style="font-size: 14px;color:#333333">2015</span><span style="font-size:14px;color:#333333">年年底的中央经济工作会议明确将供给侧改革作为适应和引领经济新常态的突破口，并提出了2016年“去产能、去库存、去杠杆、降成本、补短板”的五大重点任务。供给侧改革是对过去30多年改革注重需求端的重大思路调整，绝非一项短期政策变化，而是一项长周期经济改革。</span></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><span style="font-size:14px;color:#333333">那么从这段话我们可以看出，供给侧改革是中央经济政策的重大调整，因此毫无疑问将会成为今天A股市场最大的主题投资机会，值得我们持续关注。</span></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><span style="font-size:14px;color:#333333">我们老股民都知道啊，炒股要抓主线，要紧跟顶层设计，凡是受到中央高度关注并积极推动的主题投资机会都能催生一波大的行情机会，也能催生一批翻倍的暴涨牛股，比如我们来看几个案例：</span></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><span style="font-size:14px;color:#333333">比如国家提出一带一路战略，引发资金对一带一路相关板块的持续暴炒，大量一带一路概念股上演翻倍的暴涨行情。比如龙头个股600317营口港，受政策利好，从14年4月24号，到去年6月12号，一年时间股价暴涨588%，涨幅惊人。</span></p><p style=";margin-bottom:0;text-align:center;text-indent:32px;line-height:26px"><span style="font-size:12px;color:#333333"><img src="/plugins/ueditor/php/upload1/20160225/1456362810706099.png" title="r.png"/></span></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><span style="font-size:14px;color:#333333">再比如国家大力推动国企改革，引发资金对国企改革板块的持续暴炒，大量国企改革概念股上演持续暴涨的行情。比如龙头个股601766中国中车，受改革利好，从14年10月24日，到去年4月20日，半年时间股价暴涨500%。</span></p><p style=";margin-bottom:15px;text-align:center;text-indent:32px;line-height:24px"><span style="font-size:14px;color:#333333"><img src="/plugins/ueditor/php/upload1/20160225/1456362823430687.png" title="s.png"/></span></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><span style="font-size:14px;color:#333333">从这些实战案例中我们可以发现，只要是中央高度关注的大型主题投资机会，都能给相关个股带来翻倍甚至是翻几倍的暴涨行情，并且行情持续时间长，个股表现机会多。那么这次应该也不会例外，预计这次的供给侧改革又将催生一批翻倍的暴涨牛股。<strong><span style="font-family:宋体">那么我们该怎么去把握这种大行情呢?<a href="http://www.yytf099.com/" style="font-family: &#39;&#39;; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰有色金属</a>通过深入的研究分析，总结出了把握供给侧改革板块暴涨行情的三大主线：</span></strong></span></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><strong><span style="font-size:14px;font-family:宋体;color:#333333">1</span></strong><strong><span style="font-size:14px;font-family:宋体;color:#333333">、强周期性龙头公司。</span></strong><span style="font-size:14px;color:#333333">供给侧改革的核心之一就是淘汰落后产能，相关领域的龙头企业有望享受到产业龙头的品牌溢价效应。比如钢铁、煤炭、有色等。</span></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><strong><span style="font-size:14px;font-family:宋体;color:#333333">2</span></strong><strong><span style="font-size:14px;font-family:宋体;color:#333333">、新兴产业成长主题。</span></strong><span style="font-size:14px;color:#333333">供给侧改革的另一个核心是更新供给结构，智能制造、新能源汽车、虚拟现实、精准医疗等新产业将有大的机会。</span></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><strong><span style="font-size:14px;font-family:宋体;color:#333333">3</span></strong><strong><span style="font-size:14px;font-family:宋体;color:#333333">、新消费概念。</span></strong><span style="font-size:14px;color:#333333">我国消费结构正在发生深刻变化，以消费新热点、消费新模式为主要内容的消费升级，将引领相关行业迅速成长，如医疗器械、文化传媒、体育等。</span></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><span style="font-size:14px;color:#333333">围绕这三大主线，我们就可以很准确的把握住供给侧改革这个大的主题投资机会，只要哪条主线受到资金热炒，我们就买入相应主线的标的个股，就能够精准的把握住相关个股的暴涨行情。</span></p><p style=";margin-bottom:0;text-indent:32px;line-height:26px"><span style="font-size:12px;color:#333333">&nbsp;</span></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px"><strong><span style="font-size:14px;font-family:宋体;color:#333333">注：以上内容为<a href="http://www.yytf099.com/" style="font-family: &#39;&#39;; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰有色金属</a>属分析师个人观点，仅供投资参考。更多详情请登陆壹银添丰有色金属直播室。</span></strong></p><p style=";margin-bottom:15px;margin-left: 0;text-indent:32px;line-height:24px">上一篇文章：<a href="http://www.yytf099.com/industrynews/2939" style="font-family: &#39;&#39;; font-size: medium; white-space: normal; color: black; text-decoration: none;">财富线A+B教你股票贵金属到底选哪个好</a></p><p>&nbsp;</p><p><br/></p>', '受利好消息推动，今天大盘放量大涨，延续反弹走势，收盘大涨超2%，站上2900点大关。那么整体来看，由于有场外资金不断进场，因此大盘的反弹行情还没有结束，上方仍有空间。', '壹银添丰有色金属：改革板块强势暴涨', '壹银添丰有色金属,改革板块,暴涨', '受利好消息推动，今天大盘放量大涨，延续反弹走势，收盘大涨超2%，站上2900点大关。那么整体来看，由于有场外资金不断进场，因此大盘的反弹行情还没有结束，上方仍有空间。', '', '', '2016-02-25', '2016-02-25', '', '', 42),
(2942, 25, '三个大会的召开预示着近期A股无忧', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp;　 &nbsp;2月25日，近期沪指稳中有升，昨天尾盘演出逆袭，人气虽还未彻底康复，但估计跌也跌不到哪里，近期有三个主要会议将连续举办，备受全球注目，别的有音讯称，国企变革十项试点计划将发布，估计A股近期无忧。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　三大会议连续举办</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　一、G20峰会将于2月26日在上海举办</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　金融商场动乱、油价起伏不定、全球增加远景堪忧、人民币何去何从？在这种复杂多变的局势下，引人注目的二十国集团财长和央行行长会议将于本周五(2月26日)在上海拉开帷幕，而其议程自身就变成了商场重视焦点。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　经历年头全球股市大跌后，商场希望各国协调一致来提振全球经济并重塑决心。一些剖析师和出资者呼吁推呈现代版广场协议---1985年首要经济体达到的那项协议旨在让美元价值下降并稳定全球外汇商场。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　现在有很多G20国家呼吁推出影响办法，加强方针协作，但在缺少交集的情况下，要达到相似1985年广场协议那样的协议，看来显得不太可能。当年美元劲升造成商场动乱，而广场协议扭转了美元升势。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　二、全国两会将于3月3日和5日开幕</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　第十二届全国人民代表大会第四次会议和政协第十二届全国委员会第四次会议，将分别于2016年3月5日和3月3日在北京开幕。全国人大常委会办公厅和全国政协办公厅1日宣布，欢迎中外记者到时前来采访。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　十二届全国人大四次会议、全国政协十二届四次会议将在北京市复兴路乙11号梅地亚基地设立新闻基地，担任招待和组织中外记者对两个会议的采访。新闻基地将于2月27日正式开展工作。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　三、国有企业概念十项试点计划或近期发布</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　据证券日报音讯，国资委有关人士证明，2月25日揭露十项变革试点的计划，大力推进国企变革。受此音讯影响，国企变革概念股昨天团体迸发，上海电力(600021,股吧)、中成股份(000151,股吧)、新式铸管(000778,股吧)、华电动力(600726,股吧)、际华集团(601718,股吧)等多只概念股强势涨停，变成商场中的一大亮点。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　对此，剖析人士标明，昨天概念股的团体异动，有望推动央改板块重上A股商场风口，短期出资首要重视两视点：1。板块中领涨龙头股有望继续有所体现，值得活泼跟踪；2。出资者可活泼逢低重视板块内没有呈现显着反弹的标的，这类个股具备较高的安全边沿，一起也具有较大的估值修正空间。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　大盘评述：</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　两会主题成焦点 商场个性大变换</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　据出资快报音讯，两会行将举办，国企变革概念股变成商场追捧的热门；在此带动下，昨天大盘演出V型反转。事实上，从近期盘面看，商场首要环绕两会主线进行炒作。剖析指出，跟着两会的接近，出资者将会把焦点逐步转移到两会主题；两会首要议题将变成有关职业的催化剂，大盘也有望继续震荡走高。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　两会主题成商场焦点</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　2016年全国两会行将举办，两会焦点之一的国企变革概念再度变成商场追捧的热门。事实上，从近期盘面看，商场首要环绕两会主线进行炒作，如近期活泼有加的煤炭、钢铁、有色金属以及国企变革等。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　周三，受外围股市跌落影响，两市股指早盘走弱，盘中一度大跌30点，午后在国企变革等权重的带领下演出V型反转行情。截至收盘，上证指数报2928.9点,涨0.88%；深圳成指报10307.63点,涨0.08%；创业板指数报2203.74点,跌0.65%。对此，剖析人士认为，跟着两会的接近，出资者把焦点逐步转移到两会主题，周三带领大市走出低迷的国企变革概念股即属此主题。估计两会涉及到的“十三五”计划、供应侧变革、国企变革等，而两会首要议题将变成有关职业的催化剂。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　<a href="http://www.yytf099.com/" style="font-family: &#39;&#39;; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰有色金属</a>估计，短期方针面偏暖，供应侧变革、国企变革、十三五计划等可能是方针影响的会集迸发点。近期包含下调首付份额、提高住宅公积金账户存款利率、下降契税营业税等多项办法发力房地产商场去库存，标明稳增加的地位在逐步上升。总结来看，在汇市暂稳、方针托底、情绪修正的布景下，短期商场有望连续反弹走势。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　有商场人士指出，通过年前的大跌，现在商场的估值水平全体较低，对基金和其它组织出资者都具备适当的出资吸引力，近期QFII活泼抄底A股就是最主要的信号之一。商场当时处于估值修正期间，渐进上行的走势应该是各方都等待的。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 以上信息由<a href="http://www.yytf099.com/" style="font-family: &#39;&#39;; font-size: medium; white-space: normal; color: black; text-decoration: none;"><strong>壹银添丰集团</strong></a>编辑整理发布。</span></p><p><br/></p>', ' 2月25日，近期沪指稳中有升，昨天尾盘演出逆袭，人气虽还未彻底康复，但估计跌也跌不到哪里，近期有三个主要会议将连续举办，备受全球注目，别的有音讯称，国企变革十项试点计划将发布，估计A股近期无忧。', '三个大会的召开预示着近期A股无忧', '三个大会,A股,召开', ' 2月25日，近期沪指稳中有升，昨天尾盘演出逆袭，人气虽还未彻底康复，但估计跌也跌不到哪里，近期有三个主要会议将连续举办，备受全球注目，别的有音讯称，国企变革十项试点计划将发布，估计A股近期无忧。', '', '', '2016-02-25', '2016-02-25', '', '', 27),
(2941, 1, '壹银添丰集团：新年新气象，壹银添丰员工户外拓展', '<p style="text-align:center"><br/></p><p><span style="font-family: 宋体, SimSun;">&nbsp;——“<span style="font-family: 宋体, SimSun; font-size: 16px;">熙熙攘攘的人海之中，命运让我们相聚。繁华都市的日升日落，映在我们眼底。”</span></span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;"><span style="font-family: 宋体; font-size: 16px;">中国有多大？好巧，我们聚在了上海；上海有多大？好巧，我们聚在了壹银集团……</span>300<span style="font-family: 宋体; font-size: 16px;">多人的团队，是楼上楼下办公室里一个个忙碌的身影组成，是月会中满厅震天的掌声组成，是今天在这儿的一群朋友组成。</span></span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;"><span style="font-family: 宋体; font-size: 16px;">我们是同事，是搭档，是伙伴，是朋友，是家人。此前各自明细的分工，忙碌的工作，或许我们并不熟悉，甚至有的面孔依然是陌生的。但我们可以默契的喊出整齐的问好口号，可以最快速度找到</span>8<span style="font-family: 宋体; font-size: 16px;">人问好、找到</span>10<span style="font-family: 宋体; font-size: 16px;">人拥抱、找到</span>15<span style="font-family: 宋体; font-size: 16px;">人抱成团……</span></span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">默契是因为我们懂得我们是一个团队，速度是因为我们以高效率为习惯素养。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">今天我们远离办公室，在漂亮的吴淞炮台湾湿地深林公园，蓝天白云，悠悠然然的一缕缕梅花香，打破部门与办公室的界限，和所有虽不常见面却是每天一起奋斗的伙伴们一起，以快乐活泼的游戏开始我们新一年的新征程。</span></p><p style="text-align:center;text-indent:28px"><img src="/plugins/ueditor/php/upload1/20160225/1456363601783211.jpg" title="1.jpg"/></p><p style="text-align:center;text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp;</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;"><span style="font-family: 宋体; font-size: 16px;">——“</span><strong><span style="font-family: 宋体; font-size: 16px; font-weight: normal; background: white;">追求真理的一点一滴，我们不会轻易放弃，相信只要我们在努力，未来将无比绚丽。</span></strong><span style="font-family: 宋体; font-size: 16px;">”</span></span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;"><span style="font-family: 宋体; font-size: 16px;">“一、二、一、二……”大型的两人三足游戏，相互扶持，共同迈步，每一个小队全神集中，全力以赴，初赛时我们以</span>26<span style="font-family: 宋体; font-size: 16px;">秒取得小团第一，决赛时</span>20<span style="font-family: 宋体; font-size: 16px;">秒的成绩是我们对对手的尊敬，和一直以来坚持对自己的超越。</span></span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">以小队为单位，所有人蒙上眼罩，搭着前面搭档的肩膀，只靠站在最后的司令的指挥和站在最前面的蒙眼方向感好一点的队友。在所有人都禁言的时候，信任是支持前进的精神支柱，迅速以动作传达司令的命令唯一是制胜法宝。成功没有捷径，果断的指挥、清晰的传达、干脆的执行，这游戏就是我们日常工作写照。</span></p><p style="text-align:center;text-indent:28px"><img src="/plugins/ueditor/php/upload1/20160225/1456363613658127.jpg" title="2.jpg"/></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp;</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;"><span style="font-family: 宋体; font-size: 16px;">——“</span><strong><span style="font-family: 宋体; font-size: 16px; font-weight: normal; background: white;">也许成长的日子里，一路是坎坷荆棘，也许一路的风风雨雨，会溅上满身污泥。</span></strong><span style="font-family: 宋体; font-size: 16px;">”</span></span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">团队大战撕名牌。迎面而上的是勇士，巧妙周旋的是智者……无论是哪种，最后迎来的只能是正面冲突，就像有的困难必须翻过而不可能绕过一样，即使摔倒，即使团队只剩最后一人，除了坚持奋战到底，我们没有其他选择。这就是我们面对困难样子。</span></p><p style="text-align:center;text-indent:28px"><img src="/plugins/ueditor/php/upload1/20160225/1456363623980547.jpg" title="3.jpg"/></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp;</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;"><strong><span style="font-family: 宋体; font-size: 16px; font-weight: normal; background: white;">——“请别放弃别灰心，还有我们在这里，露出微笑拿出信心，让荆棘风雨全都过去。”</span></strong></span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;"><strong><span style="font-family: 宋体; font-size: 16px; font-weight: normal; background: white;">当300多人拉起绳子围成的圈，或许走上一个人并没有什么难度，那同时走上15个人呢？依然撑得稳稳的，甚至还可以晃起绳子，和走在绳索上的亲爱的同伴开个玩笑~~能走在绳子上靠的是同伴的支撑，能晃起绳子靠的是同伴的齐心协力。</span></strong></span></p><p style="text-align:center;text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;"><strong><span style="font-family: 宋体; font-size: 16px; font-weight: normal; background: white;"><img src="/plugins/ueditor/php/upload1/20160225/1456363634589717.jpg" title="4.jpg"/></span></strong></span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;"><strong><span style="font-family: 宋体; font-size: 16px; font-weight: normal; background: white;">&nbsp;</span></strong></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;"><strong><span style="font-family: 宋体; font-size: 16px; font-weight: normal; background: white;">——“我们一起努力，我们永远珍惜，成长岁月里，我们是团结的集体，相信我们会创造奇迹。”</span></strong></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;"><strong><span style="font-family: 宋体; font-size: 16px; font-weight: normal; background: white;">&nbsp;&nbsp;&nbsp; </span></strong><strong><span style="font-family: 宋体; font-size: 16px; font-weight: normal; background: white;">我们是一个企业，我们是一个团队，我们也是一个家庭。“成长的岁月”是我们每个人在壹银财富不断进步的日子，是进步的我们又促进企业发展的日子。即使有一天我们可能老去，</span></strong><strong><span style="font-family: 宋体; font-size: 16px; font-weight: normal; background: white;"><a href="http://www.yytf099.com/" style="font-family: &#39;&#39;; font-size: medium; white-space: normal; color: black; text-decoration: none;"></a><a href="http://www.yytf099.com/" style="font-family: &#39;&#39;; font-size: medium; white-space: normal; color: black; text-decoration: none;"></a><strong><a href="http://www.yytf099.com/" style="font-family: &#39;&#39;; font-size: medium; white-space: normal; color: black; text-decoration: none;"><strong>壹银添丰集团</strong></a></strong>也会在金融行业的顶端屹立。</span></strong></span></p><p><br/></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">上一篇文章：<span style="font-family: &#39;&#39;; font-size: medium;"></span></span><a href="http://www.yytf099.com/industrynews/2940" style="font-family: &#39;&#39;; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰有色金属：改革板块强势暴涨</a><a href="http://www.yytf099.com/industrynews/2940" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;"></span></a></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;"><strong><span style="font-family: 宋体; font-size: 16px; font-weight: normal; background: white;">&nbsp;</span></strong></span></p><p><br/></p>', '熙熙攘攘的人海之中，命运让我们相聚。繁华都市的日升日落，映在我们眼底。', '壹银添丰集团：新年新气象，壹银添丰员工户外拓展', '壹银添丰集团,新年新气象,户外拓展', '熙熙攘攘的人海之中，命运让我们相聚。繁华都市的日升日落，映在我们眼底。', '', '', '2016-02-25', '2016-02-25', '', '', 33),
(2943, 25, 'A股震动不断，融券政策调整', '<p>&nbsp;<span style="font-family: 宋体, SimSun; font-size: 16px;"> &nbsp;24日，方正证券（601901.SH）布告表明已免除融券约束。当日，壹银添丰集团记者了解到，中信证券（600030.SH）亦于22日康复了融券买卖。<br/></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;“融券约束免除与否不代表什么信号，仅仅券商根据本身的思考。并且融券量本身就很少，对商场不会有大影响。”一家上市券商的两融人士向记者表明。&nbsp;<br/></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;在A股商场并不安稳，以做空为主要功用的融券事务的康复是否会对商场造成冲击？有券商人士以为，短期会对商场造成影响。不过多位券商人士以为，因融券规划有限，券商的铺开不会对商场发生大影响。<br/></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;2月24日，方正证券布告，拟免除公司融券买卖的临时性约束办法，自2月29日起生效。<br/></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;"><strong>壹银添丰集团</strong></span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">记者了解到，2月22日中信证券就已免除融券约束。“公司的融券约束现已铺开，22日（周一）就能够开端操作了。但正式布告还没有具体下来。”<br/></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;上一年A股遭受巨震后，沪深买卖地点8月3日别离下发布告，修正融资融券买卖实施细则，最主要的调整是将融券操作由“T+0”改为“T+1”。随后，中信证券、方正证券、长城证券、华泰证券、国信证券等多家券商表明为合作规矩的紧迫修正，操控事务危险，对融券事务进行了暂停不过，并非所有券商都铺开了融券约束。记者了解到，齐鲁证券、国信证券等仍未免除融券约束。“咱们的融券事务还没有铺开，暂时还没有有关通知。”国信证券人士通知记者。齐鲁证券人士亦表明，现在公司融券事务仍处于暂停状况。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;商场重视的是，在A股体现欠佳之下，具有做空功用的融券事务的康复是否会造成冲击？“铺开融券仅仅让卖正常化，短期对商场有冲击，但早铺开比A股上去再铺开好。”上海一位券商人士以为。<br/></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;事实上，即使券商康复了融券事务，但在券源供应上也非常有限。例如已康复融券事务的银河证券，券源量却非常有限。“咱们已康复融券，但没有券源。”银河证券人士通知记者。而长江证券在康复布告中也表明，敞开ETF券商供应，别的融券券源供应则视情况而定。<br/></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;南方基金首席战略分析师杨德龙表明，A股商场融券数量平日里就很少，所以康复融券事务对商场没有太大冲击。<br/></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;“非常时期约束性办法免除，意味着券商以为商场已从此前的单边跌落康复到了常态。从盘面来看，A股市场也自1月底就展开了反弹，近来新开户数据相同能够看出信心有所康复。”杨德龙表明。<br/></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;Wind数据显现，近期融券余额已有所上升。到2月24日，沪深两融余额8892.92亿元，其间融资余额8870.38亿元，融券余额22.55亿元，较上星期融券余额已有所上升。<br/></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;上一年8月份开端，部分券商约束了融券事务，即使展开融券事务的券商券源也非常有限。Wind数据显现，从上一年7月份开端，融券余额从90亿元规划猛降至30亿元规划徜徉。上一年4月9日，融券余额达到最高点，为103.11亿元。而现在融券余额仅为22.55亿元，较最高点规划已减少了78.33%。<br/></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;以上由</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;"><strong>壹银添丰集团</strong></span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">编辑整理发布<br/></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;上一篇文章：<span style="font-family: &#39;&#39;; font-size: medium;">&nbsp;</span><a href="http://www.yytf099.com/finance/2942" style="font-family: &#39;&#39;; font-size: medium; white-space: normal; color: black; text-decoration: none;">三个大会的召开预示着近期A股无忧</a></span></p><p><br/></p>', '​  24日，方正证券（601901.SH）布告表明已免除融券约束。当日，壹银添丰集团记者了解到，中信证券（600030.SH）亦于22日康复了融券买卖。', 'A股震动不断，融券政策调整', 'A股,融劵,政策调整,壹银添丰集团', '​  24日，方正证券（601901.SH）布告表明已免除融券约束。当日，壹银添丰集团记者了解到，中信证券（600030.SH）亦于22日康复了融券买卖。', '', '', '2016-02-26', '2016-02-26', '', '', 31),
(2944, 1, '两市均高开：沪指高开0.69% 钛金属居前', '<p>&nbsp; &nbsp; &nbsp;<span style="font-family: 宋体, SimSun; font-size: 16px;">周五，两市均高开，沪指高开0.69%，报2760.06点，成交14.25亿元；深成指高开0.78%，报9625.37点，成交25.81亿元。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;板块方面，钛金属、维生素、公共交通等板块涨幅居前；ST、文教休闲等板块跌幅居前。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;音讯面上，证监会弄清三大利空风闻：否定创业板停止审阅；G20财长和央行行长会议举行 汇率疑问或成焦点；108份年报曝光“国家队”三大主力四季度意向；中信方正免除融券卖出约束 业界:商场冲击有限；“南热北冷”:节后港股通净流入规模超沪股通2倍；期指愈发问操作 国泰君安座位砍15%空单“锁利”；央行开释3400亿对冲到期 降准预期犹在；国企十项变革试点发布 点名2公司试点国资运营；QFII接连49个月新开A股账户 三职业成增仓标的；中融人寿被禁添加股票投资 举牌3公司浮亏近两亿。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;昨天，A股俄然大跌，千股跌停重现。沪综指暴降6.41%至2741.25点，深综指跌7.34%至1738.67点。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;多位商场人士以为，当日A股的跌落或与一起发生的资金面趋紧及其引起的套利景象有关；一方面央行对部分银行定向降准优惠的撤销，另一方面又恰逢“月底”这一资金紧张时点。资金面的紧张则对A股的流动性形成了连锁反应。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;“目前商场心态仍较为慎重，不是钱的疑问而是危险偏好的疑问。熔断时的磁吸效应再次演出。”海富通基金则以为，目前商场存在两个忧虑，一是G20财长和央行行长会议以后，人民币汇率走势仍不明朗；二是两会接近，供应侧变革是焦点，但如何做，怎么做，商场还存疑。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;阅历2月25日暴降后，银河证券首席战略剖析师孙建波广为流传的商场观念适当悲观——A股现已进入一个中长期弱势的走势中，跌落还远没有完毕，不要寄希望于小幅的反弹，应当脱离商场。将来两年A股商场都会呈现弱势行情，小范围的反弹会存在，但不宜抓。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;不过，也有剖析人士以为，尽管昨天大跌对技能形状及商场心情形成较大伤口，但商场快速回调也极大地开释了短期调整压力，在全体环境趋暖及方针预期升温布景下，估计商场短期将再度步入震动整固期间。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;广发证券战略剖析师陈杰以为，之前的每一次暴降，都对应着一次夸姣梦想的幻灭，首次是对“杠杆牛”梦想的幻灭；第2次是对“国家队救市”梦想的幻灭；第三次是对“财物荒”梦想的幻灭。这</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">一次反弹的完毕也许会十分安静，即以“涨不动”的方式完毕反弹，然后进入缩量震动期间。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;深圳一私募基金经理则以为，假如A股真有2015年6月以来的第四轮暴降，那么即是对煤炭、钢铁、有色等职业将来成绩好转梦想的幻灭，因为这些都是指数权重股，也许影响比前几次更大。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;他一起表示，2月25日很难说是不是又一波大跌的开端，以后商场很也许呈现“大奇迹日”级别的反弹，打破3000点，招引一部分投资者出场接盘后重新杀跌，终究再创新低。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;以上信息由</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;"><strong>壹银添丰集团</strong></span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">编辑整理发布</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;上一篇文章：</span><a href="http://www.yytf099.com/industrynews/2941" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰集团：新年新气象，壹银添丰员工户外拓展</span></a></p>', '周五，两市均高开，沪指高开0.69%，报2760.06点，成交14.25亿元；深成指高开0.78%，报9625.37点，成交25.81亿元。', '两市均高开：沪指高开0.69% 钛金属居前', '高开,沪指,钛金属', '沪指高开0.69% 钛金属板块涨幅居前\n', '', '', '2016-02-26', '2016-02-26', '', '', 46),
(2945, 1, '壹银添丰： 股市暴降三部曲', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">一、股市暴降曲一：大户套现，散户接盘</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;上一年的5月、6月，股市震动跌落，官媒开端护盘，这是咱们做的一件错事。但是这次护盘后，5月、6月间有很多杠杆资金入市，再加上做空手法完备，所以引发了后来的大规划跌落。大庄家们也张狂套现，从5月1日起到7月8日证监会禁令出台，一共套现3.2万亿元，强逼政府出手救市。而上市公司高管们在5月总计套现366.5亿元，6月336.4亿元，单月套现金额相当于2015年前四个月套现金额的总和。&nbsp;</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 7月24日，第二轮股价暴降。大股东又开端张狂套现，炸弹再次爆破。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 7月27日净卖出1813亿元。当日上证指数暴降8.48%，创八年来最大跌幅。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 7月28日，证监会再次介入，中铁二局、金力泰、南风股份等多家上市公司发布公告称，大股东违规减持被证监会立案查询。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 8月14日，中国证监会发布公告称，仍将持续以多种方式表现维稳效果。证监会这一表态被商场充分化读为，政府救市的阶段性使命现已完结。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">二、股市暴降曲二：高杠杆配资</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 高杠杆配资首要呈现在2015年4月今后。为何呢？因为假如不凭借杠杆，民间没有那么多钱，为了尽快套现，引入杠杆会更方便让散户接盘。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 配资有三种方式，榜首种是官方的融资融券。这是证监会监管下经过券商等正规渠道的融资余额，杠杆是2倍。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 第二种是散户经过HOMS形式进行线上场外配资，均匀3倍的杠杆，还能确保本金安全，配资额也是在4、5、6三个月到达顶峰。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 第三种是民间线下场外配资，其金额更加难以预算。他们不经过HOMS系统，而是直接借钱给股民开户，监控账户确保资金安全。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 到2015年6月，场内场外配资规划到达最顶峰4.8万亿元，股价也被推到最高点。很多杠杆资金入市的成果即是，一旦呈现跌落，就会发作千股齐跌的壮丽局面。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 而紧接着在7月24日的第二轮股价跌落中，配资又一次大规划出逃，拖累股市。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">三、股市暴降曲三：做空准则加重商场惊惧</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 在2015年4月股市泡沫开端构成时，做空工具也横空出世。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 简略解释一下，中证500股指期货是说，这500只股票你每只持有一股，假设在今日的现货商场需求100元，而你判别一个月后它们是跌落的，那你能够以今日的报价100元卖出。假如有人看多后市，情愿接你的单，一个对赌就构成了。一个月后假如跌落到了80元，那么中心20元的差额即是你的赢利。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 但现在的问题是，7月1日因为中小板和创业板的股票无量跌停，现货卖不出去，只要经过股指期货空单去对冲现货头寸，导致以中证500股指期货为首的合约大幅贴水。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 咱们看到，三枚炸弹对股市的三轮跌落起到了推波助澜的效果，而榜首枚炸弹大股东套现是股市下行的元凶巨恶。因为大股东在高位很多减持套现，散户资金不足，商场随之发生很多高杠杆配资。在泡沫越吹越大以后股价一定会暴降，怎么办？做空期货再赚一笔或许对冲跌落。这需求的不仅仅是一两个方针，而是有用的监管系统，而这恰是咱们目前的证券商场最薄弱的当地。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 以上内容由</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰有色金属</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">编辑整理发布。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/industrynews/2944" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">两市均高开：沪指高开0.69% 钛金属居前</span></a></p>', '股市暴降曲一：大户套现，散户接盘', '壹银添丰： 股市暴降三部曲', '壹银添丰,股市暴降,大户套现,高杠杆配资,做空', '股市暴降曲一：大户套现，散户接盘', '', '', '2016-02-29', '2016-02-29', '', '', 31);
INSERT INTO `by_article` (`id`, `cate_id`, `title`, `content`, `intro`, `site_title`, `site_keywords`, `site_description`, `tags`, `flag`, `create_date`, `update_date`, `img`, `attach`, `click`) VALUES
(2946, 25, '沪指大跌3%破2700，壹银添丰教你2016理财方法', '<p>&nbsp; &nbsp; &nbsp;<span style="font-family: 宋体, SimSun; font-size: 16px;">9:48，沪指跌3.01%，报2684,2600股翻绿，跌停及跌超9.9%的股份达119股。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 9:41，沪指跌2.62%，报2694，迪士尼、创投领跌，成长股全线重挫。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 9：25，沪指低开0.45%，报2754.</span></p><p><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;"><strong>壹银添丰集团</strong></span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">预测：A股未来2-3个月见底</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 股票市场现在面临最后一跌，应该会在未来2-3个月见底。而最后一跌将看到A股大底，代表着最后一波调整结束，后面就是小波动，小震荡。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 那么我们应该做什么呢？做高价值硬通货主题投资。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰建议2016年大类资产理财建议</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 不要把钱都放入银行，银行的利率抵不过物价的增长，总的来说放入银行是亏损的。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">今年大类资产理财建议为：</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 首先未来2-3年都要增配黄金，白银，原油。在近几年经济不是很好的情况下一定要配点黄金，白银，原油等高价值硬通货。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 其次，有闲钱的话可以买入一线及核心二线城市的房地产；卖出三四线城市房地产，三四线城市房产已达饱和，没有升值空间。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 第三，如果资金充足的话可以买入一线城市的商铺。为未来经济好转做准备。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/finance/2943" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">A股震动不断，融券政策调整</span></a></p>', '', '沪指大跌3%破2700，壹银添丰教你2016理财方法', '壹银添丰,沪指,大跌,高价值,硬通货,原油,白银', '沪指大跌3%破2700，壹银添丰教你2016理财方法', '', '', '2016-02-29', '2016-02-29', '', '', 33),
(2947, 1, '壹银添丰：2月OPEC原油产量继续下滑 长达20个月的跌势能否曾经触底', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　&nbsp; 周一(2月29日) </span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; text-decoration: underline;"><span style="font-size: 16px; font-family: 宋体, SimSun;"><strong><span style="font-size: 16px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; color: black;">壹银添丰集团</span></strong></span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">发布的一项调查结果显现，石油输出国组织(OPEC)2月原油产量自高位回落，归因于伊拉克北部地域出口停顿，以及其他产油国消费遭到干扰。</span><br/></p><p><span style="font-size:16px;font-family:宋体">　　调查还发现，头号石油出口国沙特阿拉伯产量持稳，初步阐明该国政府正遵照2月16日与委内瑞拉、卡塔尔和非OPEC成员国俄罗斯达成的产量冻结协议。</span></p><p><span style="font-size:16px;font-family:宋体">　　美国原油近月合约收涨0.97美圆，或3%，报33.75美圆/桶，盘中触及33.98美圆/桶高位。</span></p><p><span style="font-size:16px;font-family:宋体">&nbsp;&nbsp;&nbsp; 调查显现，OPEC的2月原油日供给量从1月的3265万桶降至3237万桶。调查是基于船运数据和来自石油公司、OPEC与参谋公司人士的音讯展开的。</span></p><p><span style="font-size:16px;font-family:宋体">　　中国央行周一不测降息，一年来第五次下调了存款准备金率。中国为全球最大石油进口国。</span></p><p><span style="font-size:16px;font-family:宋体">　　美国政府数据显现，美国12月石油产量连续第三个月降落，至2014年 12月以来最低，石油需求自去年8月以来初次上升。</span></p><p><span style="font-size:16px;font-family:宋体">　　壹银添丰调查显现，2月OPEC石油产量从最近的历史最高程度降落，因伊拉克北部出口停滞和其它产油国消费中缀。伊拉克是2015年OPEC供给增长的最大来源。</span></p><p><span style="font-size:16px;font-family:宋体">　　沙特阿拉伯誓词将“继续与其它主要产油国停止接触，以努力限制油价的动摇”。此前该国与OPEC成员国委内瑞拉、卡塔尔及非OPEC成员国俄罗斯达成了将产量限制在1月程度的协议，目前正努力推</span></p><p><span style="font-size:16px;font-family:宋体">进该该方案的落实。沙特阿拉伯将日产量稳定在1月水准1,020万桶，指称2月多数时分出口稳定。沙特的日产量在6月时到达纪录高位1056万桶。</span></p><p><span style="font-size:16px;font-family:宋体">　　“我们不得不承受油价将从如今程度上行的事实，”BRG Brokerage的能源买卖商Jeffrey Grossman称。</span></p><p><span style="font-size:16px;font-family:宋体">　　油价较2014年中触及的100美圆之上高位仍下跌约70%，但过去两周稳步上升，一些买卖员和投资者疑心市场能否曾经触及近期的底部。</span></p><p><span style="font-size:16px;font-family:宋体">　　路透调查显现，剖析师估计今年均匀油价在略高于40美圆/桶。</span></p><p><span style="font-size:16px;font-family:宋体">　　从高盛到摩根士丹利到巴克莱，各大银行以为，如不减产，产量冻结不会大幅提振价钱。</span></p><p><span style="font-size:16px;font-family:宋体">　　伊朗是沙特方案的绊脚石，该国方案将石油产量提升至制裁前的出口程度。伊朗政府周一称，上月出口增加至每日175万桶的峰值。</span></p><p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">北京时间5:59，美油报33.90美圆/桶，布油报36.66美圆/桶。</span></p><p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">上一篇文章：&nbsp;</span><a href="http://www.yytf099.com/industrynews/2945" style="font-size: 16px; text-decoration: underline; color: black; font-family: 宋体, SimSun;"><span style="font-size: 16px; color: black; font-family: 宋体, SimSun;">壹银添丰： 股市暴降三部曲</span></a></p><p style="text-indent:28px"><span style="font-size:16px;font-family:宋体">&nbsp;</span></p><p><br/></p>', '　  周一(2月29日)壹银添丰发布的一项调查结果显现，石油输出国组织(OPEC)2月原油产量自高位回落，归因于伊拉克北部地域出口停顿，以及其他产油国消费遭到干扰', '壹银添丰：2月OPEC原油产量继续下滑 长达20个月的跌势能否曾经触底', '壹银添丰,原油,产量下滑', '', '', '', '2016-03-01', '2016-03-01', '', '', 47),
(2948, 25, '壹银添丰：央行降息，对股市的影响', '<p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">29日晚间，央行决议降息，这是央行2016年来首次降准，也是上一年以来第六次降息，上一次宣告降息是在上一年10月23日。<br/></span></p><p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">商场上一种盛行的观念以为，下降预备金率会开释流动性，对股市构成利好，而进步预备金率的效果正巧相反。</span></p><p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">壹银添丰数据显示，从2010年1月到2011年6月，央行在一年半的时间里接连12次进步预备金率，但上证指数在次日跌落的状况只呈现6次，占比仅为50%。调高预备金率仅在最开端的几回利空效应对比显着。</span></p><p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">与之相对的是，自2011年11月30日央行敞开降准周期以来，已累计施行了8次降准，其中5次都呈如今上一年(不含本次降准，下同)。从降准对股市影响来看，亦是降准周期敞开时利好效果较显着。放到当时降准周期来看，8次降准中有5次在消息发布后的首个交易日沪指都呈现跌落。</span></p><p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">当然，以上都是从调准对A股短期影响的调查，A股长时间走势遭到调准的影响更小。</span></p><p style="text-indent:28px"><a href="http://www.yytf099.com/" style="font-size: 16px; text-decoration: underline; font-family: 宋体, SimSun;"><span style="font-size: 16px; font-family: 宋体, SimSun;"><strong><span style="font-size: 18px; font-family: 宋体; color: black;">壹银添丰集团</span></strong></span></a><span style="font-size: 16px; font-family: 宋体, SimSun;">预测：这些板块或将获益</span></p><p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">1、地产：降准关于地产股来说归于利好。从供应端来讲，降准以后，有利于降低房地产开发商的担负利率；从需求端来讲，降准有利于减轻大家购买房地产的担负，有利于调集大家买房的需求。地产龙头股：招商地产、保利地产、万科A、金地集团等。</span></p><p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">2、银行：关于银行股而言，降准有利有弊，减小银行存贷款利率的差额关于银行的赢利添加了压力；一起添加了银行吸储的难度。可是，添加放贷，以及经济的复苏和开展，又将带动银职业务量的攀升，有利于银行增盈。整体看，关于银行股来说，长线仍有利好效果、短线则看资金是不是追捧。A股市场上市的银行股有工商银行、建设银行、交通银行、农业银行、中国银行、安全银行、中信银行、光大银行、宁波银行、华夏银行、浦发银行、兴业银行、招商银行、北京银行、南京银行、民生银行合计16家。</span></p><p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">3、券商：降准将会加重商场的动摇，一起成交量将会大幅添加，作为依靠生意业务的券商而言归于严重利好，中信证券、海通证券、国信证券等券商股将获益。</span></p><p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">4、有色金属：降准通常意味着以有色金属为代表的大宗商品价格将上涨，因此有色金属股有望获益于央行降准。欧洲央行降准以后，A股有色金属股迎来短暂上涨的状况也印证了这一逻辑。有关个股：云南铜业、江西铜业、厦门钨业等。</span></p><p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">5、筹资性现金流占对比大的职业：降准意味着公司获取资金才能的增强以及获取资金本钱的下降，因此，关于那些资金链紧绷，筹资性现金流较大的职业来讲，降准通常意味着利好。数据显示，本年上半年房地产及产业链上的修建，军工、电子等职业的筹资性现金流最高，现金流压力较大。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;"><span style="font-size: 16px; font-family: 宋体;">上一篇文章：</span><span style="font-size: 14px; font-family: Calibri, sans-serif;"><a href="http://www.yytf099.com/finance/2946"><span style="font-size: 18px; font-family: 宋体; color: black;">沪指大跌</span><span style="font-size: 18px; font-family: Simsun, serif; color: black;">3%</span><span style="font-size: 18px; font-family: 宋体; color: black;">破</span><span style="font-size: 18px; font-family: Simsun, serif; color: black;">2700</span><span style="font-size: 18px; font-family: 宋体; color: black;">，壹银添丰教你</span><span style="font-size: 18px; font-family: Simsun, serif; color: black;">2016</span><span style="font-size: 18px; font-family: 宋体; color: black;">理财方法</span></a></span></span></p><p><br/></p>', '​29日晚间，央行决议降息，这是央行2016年来首次降准，也是上一年以来第六次降息，上一次宣告降息是在上一年10月23日。', '壹银添丰：央行降息，对股市的影响', '壹银添丰,降息,股市', '', '', '', '2016-03-01', '2016-03-01', '', '', 23),
(2949, 25, '壹银添丰：API原油库存增长超预期 油价借势反弹 ', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp;<span style="font-family: 宋体;">&nbsp; &nbsp;昨日(周二，03.01)，美国供应管理协会(ISM)公布数据显示，美国2月ISM制造业指数49.5，高于预期的48.5，亦高于1月的48.2。ISM制造业指数继1月之后再度上涨；欧洲央行行长德拉吉在致一位欧洲议员的信中表示，欧洲央行下周将针对经济风险加大、通胀不及预期的背景重估刺激政策，他还强调如果欧洲央行决定行动，使用各种政策工具达成通胀目标的意愿不受限制；API数据显示上周美国原油库存增长超预期，并创2015年4月以来新高。油价收盘时回吐早先涨幅。WTI 4月原油期货收报33.89美元/桶，日内涨幅收窄至0.41%。布伦特5月原油期货不涨不跌，收报36.62美元/桶。</span></span></p><p><span style="font-family: 宋体; font-size: 16px;">&nbsp;&nbsp; &nbsp;尽管油价动荡前景不明，对于中国经济放缓的担忧亦挥之不去，美国制造业活动的复苏迹象仍然助推美股和欧股走高。周二，标普收涨2.39%，创逾一个月以来最大收盘涨幅。道指收涨2.11%，纳指收涨2.89%。富时泛欧绩优300指数收涨1.46%。美油波动后收涨1.9%，创1月5日以来收盘新高。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　&nbsp; 美国供应管理协会(ISM)公布数据显示，美国2月ISM制造业指数49.5，高于预期的48.5，亦高于1月的48.2。ISM制造业指数继1月之后再度上涨。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　尽管制造业PMI高于预期和1月数值，但仍低于50，表明美国制造业活动仍然继续收缩。分项数据如下，其中，物价支付指数由1月的33.5提高至38.5，新订单指数与1月持平。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　API数据显示2月28日当周美国原油库存增长超预期，油价回吐早先涨幅。WTI 4月原油期货收报33.89美元/桶，日内涨幅收窄至0.41%。布伦特5月原油期货不涨不跌，收报36.62美元/桶。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　美国供应管理协会(ISM)公布数据显示，美国2月ISM制造业指数49.5，高于预期的48.5，亦高于1月的48.2。ISM制造业指数继1月之后再度上涨。数据公布后，两年期美债收益率上升6个基点，至0.85%，触及1月以来新高；10年期美债收益率上升9个基点，至1.83%；美元兑欧元短线升高后回落。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　周二，标普500指数收涨46.10点，涨幅2.39%，创1月29日以来最大收盘涨幅，报1978.33点。道琼斯工业平均指数收涨348.44点，涨幅2.11%，报16864.94点。纳斯达克综合指数收涨131.65点，涨幅2.89%，报4689.60点。纳斯达克100指数收涨3.2%，创2015年8月份以来最大收盘涨幅。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　在3月9日到10日的利率会议上，欧洲央行将重新对2016年至2018年的经济做出预测，并有望对今年的通胀预测做出大幅下修。路透对18名交易员开展的投票显示，欧洲央行3月10日会议宣布降息概率为100%；扩大QE规模的概率为50%。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　最新的通胀数据显示，欧元区2月CPI意外陷入萎缩。这增加了欧洲央行在3月会议上扩大宽松政策的可能性。四大经济体中，德国、法国、西班牙三个国家的CPI全部不及预期。目前，欧元区19国的通胀水平已经接近三年不及欧央行“接近且略低于2%”的通胀目标。</span></p><p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">市场期待关键产油国可能就限制原油产量达成协议，推动油价反弹。此外，周二早公布的美国2月ISM制造业PMI超出预期，并且连续<span style="font-size: 16px; font-family: 宋体, SimSun;">第二个月上涨，推动美股涨至两个月以来新高，同时亦助推油价。</span></span></p><p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">以上文字由<a href="http://www.yytf099.com/"><span style="font-family: 宋体, SimSun; color: black;">壹银添丰有色金属</span></a>编辑整理发布。</span></p><p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">上一篇文章：<a href="http://www.yytf099.com/finance/2948" style="font-size: 16px; font-family: 宋体, SimSun; color: black; text-decoration: underline;"><span style="font-size: 16px; font-family: 宋体, SimSun; color: black;">壹银添丰：央行降息，对股市的影响</span></a></span></p><p><br/></p>', '昨日(周二，03.01)，美国供应管理协会(ISM)公布数据显示，美国2月ISM制造业指数49.5，高于预期的48.5，亦高于1月的48.2。', '壹银添丰：API原油库存增长超预期 油价借势反弹 ', '原油库,油价,壹银添丰', '昨日(周二，03.01)，美国供应管理协会(ISM)公布数据显示，美国2月ISM制造业指数49.5，高于预期的48.5，亦高于1月的48.2。', '', '', '2016-03-02', '2016-03-02', '', '', 30),
(2950, 1, 'A股市场风云突变，壹银添丰给投资者建议', '<p style="text-indent:28px"><span style="font-family: 宋体; font-size: 16px;">壹银添丰讯 两市开盘涨跌不一，沪指开盘报2733.77点，上涨0.02%。深成指开盘报9308.49点，跌落0.14%。创业板开盘报1930.84点，跌落0.21%。<br/></span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">周二，在央行降准利好音讯刺激下，A股商场止跌反弹，沪深两市成交额较前一交易日略有削减。壹银添丰剖析称：现在商场处于两会窗口期，近期商场大幅杀跌，维稳空间相对足够，出资者不用过于惊惧，估计大盘短线将在2650点至2850点区间展开震荡。个股方面，主张出资者调仓换股到获益“两会”方针的有关板块，仓位较重的出资者能够高抛低吸，降低成本。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">两要素叠加助大盘反弹</span></p><p style="text-indent:28px"><span style="font-family: 宋体; font-size: 16px;">1.反弹力气逐步增强，</span></p><p style="text-indent:28px"><span style="font-family: 宋体; font-size: 16px;">2.逢低吸纳优异超跌股</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;"><a href="http://www.yytf099.com/"><span style="font-family: 宋体, SimSun; font-size: 16px; color: black;">壹银添丰有色金属</span></a><span style="font-family: 宋体; font-size: 16px;">专家主张：本次降准旨在稳增加和对冲资本流出。对股市构成正面维稳效果，特别对金融蓝筹及地产股构成直接利好。 在连续急跌以后，指标上现已呈现超卖痕迹，阶段性的反弹有望展开。</span></span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">总体上，近2日外资继续借道抄底，商场决心没有康复，在弱势行情下，利空要素需逐个消化，利多音讯也难以保持商场人气，特别是在现在增量资金不济的前期下，反复已成为必定，出资者需操控好仓位，切勿追涨杀跌，掌握关于商场的主动性。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">首先从商场来看，咱们以为商场本月呈现超预期行情的也许性不大。两会举行尽管对行情有助推效果；但两会后，跟着有关预期的执行，商场有也许再次步入调整。 活跃型出资者，主张保持40%-60%摆布权益类基金装备份额。稳健型出资者，主张保持30%-50%摆布权益类基金装备份额。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">从中长时间来看，移动互联职业的生长空间无穷，代表中国经济结构转型方向，该基金有望取得中长时间稳健增值。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">从出资视点来看，两会时期商场热门主要集中于获益于供应侧变革去产能标的和十三五计划叠加稳增加刺激的职业。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">上一篇文章：<span style="font-family: 宋体; font-size: 16px;"><a href="http://www.yytf099.com/industrynews/2947"><span style="font-family: 宋体, SimSun; font-size: 16px; color: black;">壹银添丰：2月OPEC原油产量继续下滑 长达20个月的跌势能否曾经触底</span></a></span></span></p><p><br/></p>', '壹银添丰讯 两市开盘涨跌不一，沪指开盘报2733.77点，上涨0.02%。深成指开盘报9308.49点，跌落0.14%。创业板开盘报1930.84点，跌落0.21%。', 'A股市场风云突变，壹银添丰给投资者建议', 'A股,壹银添丰,投资者建议', '壹银添丰讯 两市开盘涨跌不一，沪指开盘报2733.77点，上涨0.02%。深成指开盘报9308.49点，跌落0.14%。创业板开盘报1930.84点，跌落0.21%。', '', '', '2016-03-02', '2016-03-02', '', '', 36),
