(2952, 25, '壹银添丰讯：上海期货交易所新增八家铝期货交易中心', '<p><span style="font-size: 18px; font-family: 宋体, SimSun;">&nbsp; &nbsp;&nbsp;<span style="font-size: 16px; font-family: 宋体, SimSun;"><span style="font-family: 宋体, SimSun;">3月1日，上海期货生意业务所（以下简称上期所）宣布对于在河南、山东、重庆和天津四个地域新设八家铝期货交割堆栈的批复。新设堆栈分别为河北国储物流株式会社、中储成长株式会社（郑州物流中间、洛阳分公司、天津南仓分公司）、山东高通物流有限公司、山东恒欣仓储有限公司、重庆中集物流有限公司、重庆国储物流有限公司、国</span>度物质贮备局天津八三三处、天津全程物流配送有限公司，新增铝期货库容合计17.5万吨。新设堆栈将于2017年2月16日起解决入库并制造尺度仓单用于铝期货合约交割。</span></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　据<a href="http://www.yytf099.com/"><strong><span style="font-family: 宋体; font-size: 16px; color: black;">壹银添丰有色金属交易中心</span></strong></a>懂得，跟着近年来的财产结构调剂，我国铝财产的临盆与花费地正由东南部沿海向要地本地和北方地域慢慢迁徙。对此，上期所不停亲密跟踪研讨，屡次构造调研河南、山东、天津、重庆等铝临盆和花费市场疾速成长地域，访问重要电解铝临盆企业、花费企业和天下重要铝贸易商及有色金属仓储物流企业,并屡次构造铝行业相干企业召开座谈会,充足论证在新兴电解铝花费与物流地区设置铝期货交割堆栈的可行性与详细计划。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　上期所的调研报告表现，我国电解铝财产正产生着深入变更：一是电解铝产量急剧增长，2014年产量达到2430多万吨；二是电解铝临盆往西部新疆等地域转移，今朝我国有色金属电解铝临盆重要会合在我国东南（新疆、内蒙、青海、甘肃）地域、东北（四川、广西、云南）地域及华夏（河南、山西）及沿海的山东省；三是我国有色金属电解铝重要花费地区由珠三角（广东南海）、长三角（江苏、浙江）两大地区向我国西部的重庆市、华夏地域的河南省及环渤海地区的山东、京津冀地域转移扩大，这些新兴花费地区铝产物的加工花费已成范围，而且花费量宏大。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　上期所相干负责人表现，生意业务所现有的28个铝期货交割堆栈会合在华东与华南地域，这一结构方法固然在电解铝财产成长后期施展了较好后果，但已不克不及满意现阶段的行业成长必要，难以有用办事铝财产成长，无奈充足施展在新形势下领导电解铝从产地向花费地流转的功效，影响了期货市场办事财产的效力。这次在河南、山东、重庆和天津等新兴花费和物流集散地区设立铝期货交割堆栈，将使上期所交割堆栈结构更顺应今朝的财产实际环境，吸引下流花费企业介入期货市场，从而晋升我国铝期货市场的介入度，更好地施展价钱发明功效，更好地办事海内电解铝财产转型进级。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">同时，上期所本着尊敬市场、办事市场的基本原则，深入调研市场各方看法，充足斟酌铝现货市场生意业务习气，依据运费价差、物流偏向等身分，对新设铝期货交割堆栈地域设置地域升贴水：河南贴水120元、山东临沂贴水50元、山东济南贴水100元、重庆贴水80元、天津贴水150元。往后，壹银添丰有色金属交易中心还将亲密跟踪市场变更环境，迷信、主观、合时地对地域升贴水停止评价和调剂。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">上一篇文章：<a href="http://www.yytf099.com/finance/2949"><span style="font-family: 宋体; font-size: 16px; color: black;">壹银添丰：API原油库存增长超预期 油价借势反弹</span></a></span></p><p><br/></p>', ' 3月1日，上海期货生意业务所（以下简称上期所）宣布对于在河南、山东、重庆和天津四个地域新设八家铝期货交割堆栈的批复', '壹银添丰讯：上海期货交易所新增八家铝期货交易中心', '壹银添丰,上海期货交易所,铝期货', ' 3月1日，上海期货生意业务所（以下简称上期所）宣布对于在河南、山东、重庆和天津四个地域新设八家铝期货交割堆栈的批复', '', '', '2016-03-03', '2016-03-03', '', '', 21),
(2953, 1, '壹银添丰：新疆氧化铝期货交割签约典礼胜利举办', '<p style="text-indent:28px"><span style="font-size: 16px; font-family: 宋体, SimSun;">2016年3月1日，阿拉丁氧化铝生意业务中间新疆交割堆栈的签约典礼胜利举办。阿拉丁氧化铝生意业务中间作为环球第一家氧化铝电子生意业务平台再一次转变氧化铝财产格式。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;"><a href="http://www.yytf099.com/"><strong><span style="font-family: 宋体; font-size: 16px; color: black;">壹银添丰有色金属交易中心</span></strong></a>讯：近几年，在国度“支撑新疆应用动力上风，承接电解铝产能转移”的政策指引下，新疆电解铝财产进入了疾速的成历久。2015年新疆地域的电解铝总产能达到了683.5万吨，位居天下第二位，占天下总产能的17.7%。曾经构成为了准东经济开发区、乌鲁木齐和昌吉一带和石河子三个铝财产凑集区，区内共9家电解铝临盆企业，新疆铝厂的计划产能前期具备很大的扩产后劲。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">单只管新疆原铝的产能已具备相称的范围，但在其成长中存在重要原材料氧化铝必要外购。库存量大等严重弊病。仅库存一项就必要历久占用资金6.7亿元。是以在新疆扶植交割堆栈、有自力的订价系统是本地铝企的激烈诉求，也是新疆地域在铝行业市场话语权回升的必经之路。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">在以后市场的大情况下，阿拉丁氧化铝电子生意业务平台应运而生，我中间的建立将为海内铝行业和新疆地域带来普遍而深远的社会经济意义。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">起首，该生意业务中间的设立和经营，将起到稳固社会的严重意义。阿拉丁氧化铝生意业务中间则能够经由过程其库存前移功效，彻底转变以往新疆铝厂保持较高氧化铝库存的场合排场，大幅度低落资金占用本钱。锁定利润，从而坚持失业岗亭的稳固。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">其次，阿拉丁氧化铝生意业务中间的运转，能够赞助海内铝企赢取更多利润。经由过程中国强大的铝产物临盆与消费量来为中国氧化铝在国内市场争夺订价权。其所构成的氧化铝价格指数，将是具备天下影响力的，这有助于赞助海内铝厂低落质料洽购本钱，赞助氧化铝厂博得更多利润。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">第三、阿拉丁氧化铝生意业务中间的质押融资功效，具备为企业供给存货质押等金融中介服务的自然上风。标准生意业务资金的治理，进步企业资金利的用率，加速资金周转，从而低落企业经营本钱。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">中央政府提出的 “一带一路”计谋和“互联网+”行动计划，无力的推动了互联网与当代制造业的联合，促进了电子商务、产业互联网和互联网金融的康健、有序成长。</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰有色金属交易中心讯：阿拉丁周全相应国度号令，合时推出氧化铝电子生意业务平台，联合中央政府提出的 “一带一路”计谋和“互联网+”行动计划，将第一批交割堆栈选在“丝绸之路”的经济带关键-新疆，并设立新疆氧化铝标准化合约，是对中央政府提出的“一带一路”计谋和“互联网+”行动计划在新疆的详细理论！</span></p><p style="text-indent:28px"><span style="font-family: 宋体, SimSun; font-size: 16px;">上一篇文章：壹银添丰：<a href="http://www.yytf099.com/industrynews/2951"><span style="font-family: 宋体; font-size: 16px; color: black;">2016年3月3日全国有色金属交易中心数据</span></a></span></p><p><br/></p>', '2016年3月1日，阿拉丁氧化铝生意业务中间新疆交割堆栈的签约典礼胜利举办。阿拉丁氧化铝生意业务中间作为环球第一家氧化铝电子生意业务平台再一次转变氧化铝财产格式。', '壹银添丰：新疆氧化铝期货交割签约典礼胜利举办', '氧化铝,壹银添丰有色金属交易中心,签约,举办', '2016年3月1日，阿拉丁氧化铝生意业务中间新疆交割堆栈的签约典礼胜利举办。阿拉丁氧化铝生意业务中间作为环球第一家氧化铝电子生意业务平台再一次转变氧化铝财产格式。', '', '', '2016-03-03', '2016-03-03', '', '', 34),
(2954, 1, '壹银添丰讯：地产的火爆带动了铜价的强势反弹 ', '<p>　<span style="font-family: 宋体, SimSun; font-size: 16px;">　3月3日，有色金属板块领涨市场，铜价强势反弹11%</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　据业内人士引见，近日，国内多家公募机构参与有色金属种类的调研。而由于规则限制，公募资金在投资商品市场中将作为长期投资者存在，铜等强势种类成为公募机构的首选。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　四川川商商品交易中心-壹银添丰铜品类剖析师表示，“目前铜价的反弹主要是对国内政策预期，此外，铜消费也进入了3月需求旺季。假如铜的需求呈现好转，铜价反弹估计可以坚持下去。”</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　阅历了2016年惨淡开局之后，大宗商品市场迎来久违的复苏。多数商品在新兴市场向好的预期下，进入反弹通道。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　其中，有色金属板块表现不俗。Wind数据显现，自1月15日4318美圆的六年低位后，LME铜价钱已反弹超越11%。LME铝价钱从1月12日最低1444美圆反弹至1820美圆，上涨幅度超越25%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　招商期货宏观剖析师李科引见，“此轮大宗商品的上涨主要还是遭到政策预期的影响，市场预期年后将有更多的货币和财政政策推出，此外供应侧的变革也正在逐渐推进，一加一减，对大宗商品构成有效支撑。”</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　去年，由于美圆加息及中国需求下滑的影响，大宗商品市场低迷不振，有色金属种类成为重灾区之一，其中，LME铜价钱累计重挫25%。铜价下跌促使全球最大铜消费商——智利国度铜业公司等矿产公司缩减本钱支出，嘉能可等局部公司则经过关闭铜矿限制产量。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　不过，随着近期铜价的复苏，嘉能可首席执行官3月1日以为，大宗商品价钱正在筑底。而国际投行高盛此前估计今年铜价会呈现更多的损失，且中国对金属的需求增长不会呈现本质性的回复。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　实践上，关于大宗商品何时筑底的讨论不断不曾中止。据业内人士透露，国内一些公募机构也参加有色种类的调研中。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　国度统计局数据显现，2015年我国精铜产量799.64万吨，相比 2014年全年产量777.23万吨增长2.88%；2015年产量增速较之前几年的两位数增幅有所下滑。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　精铜进口量则由于外汇要素影响维持高位。依据海关总署数据， 2016年1月精铜进口量32.39万吨，同比增加7.87%。国内精铜的供应照旧坚持在较高程度。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　而</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">-壹银添丰调研，2016年1月全球精铜产能应用率因减产而同比有所下滑，但思索到产能的增加，铜精矿供给较为富余，估计产量同比不会有太大变化。消费方面，全球多数国度消费相对稳定，同比变化也相对有限。综合来看，全球供给仍表现为过剩状态。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　实践上，固然阅历2015年铜价的大幅下滑，但全球大型铜矿在减产方面依然缺乏动力。此前嘉能可发布2016年的产量目的，仅比2015年下调10万吨左右。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　不过，音讯面上，智利1月份铜产量同比降落13%，而秘鲁1月份铜产量增速也低于预期。华泰期货以为，短期铜价钱的支撑要素来自国际铜供给增长放缓，但一旦伦铜反弹至4800美圆/吨上方以后，料对供给释放有一定的刺激，伦铜的反弹空间并不看好。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　去年12月，包括江西铜业、铜陵有色在内的中国10家铜冶炼企业结合发布削减铜产量的声明，将把2016年产量削减35万吨，占到中国去年铜总产量的8.75%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　而3月消费旺季的到来则为铜价的上涨带来一定的想象。钱鹏引见，“从调研状况来看，今年的需求将会好于去年程度，特别是在铜管、板网、漆包线的消费上，这主要得益于新能源的开展。而目前房地产市场的回暖则为有色金属的需求带来想象。”</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　数据显现，2015年，房地产开发投资同比增长1%，增速回落0.3个百分点。2015年新开工面积同比降落14%，降幅收窄0.7个百分点。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　钱鹏表示，“房屋在建造过程和销售后都会增加有色金属的需求。新开工面积的确在下滑，曾经表现在去年铜价的大跌中。目前，铜价的上涨更多的是对将来需求增长的预期，房地产回暖也是需求增长的一个要素。”</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/industrynews/2953" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰：新疆氧化铝期货交割签约典礼胜利举办</span></a></p>', '3月3日，有色金属板块领涨市场，铜价强势反弹11%', '壹银添丰讯：地产的火爆带动了铜价的强势反弹 ', '地产,壹银添丰,有色金属交易中心', '3月3日，有色金属板块领涨市场，铜价强势反弹11%', '', '', '2016-03-04', '2016-03-04', '', '', 35);
INSERT INTO `by_article` (`id`, `cate_id`, `title`, `content`, `intro`, `site_title`, `site_keywords`, `site_description`, `tags`, `flag`, `create_date`, `update_date`, `img`, `attach`, `click`) VALUES
(2955, 25, '壹银添丰讯：大量资金进入市场 大宗商品市场或迎春天', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 最近一个月以来，此前连续表现不佳的大宗商品逐渐走强。其中纽约油价大幅反弹16%，布伦特油价反弹10%，COMEX黄金期价反弹10.3%，LME铝和铜期价均反弹6%，纷繁创下近期新高。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　市场分析师表示，随着美国等地经济数据好于预期，大宗商品需求有望增加，资金也开端重回大宗商品。其中，特别是本身避险属性明显的黄金等贵金属可能成为领涨者。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　数据显现，最近一个月以来主要大宗商品价钱呈现反弹。期间两地油价表现强劲，纽约原油期货价钱累计上涨16%，布伦特原油期货价钱累计上涨10%。贵金属与基本金属涨幅也较为明显，COMEX黄金期货价钱累计上涨10.3%，白银期货价格累计上涨4.5%，铂金价钱累计上涨10%，钯金价钱累计上涨5%。LME3个月铝期货价钱累计上涨6%，铜期货价钱累计上涨6%，锌期货累计上涨10%，镍期货价钱累计上涨5%，铅期货价钱累计上涨4%，锡期货价钱累计上涨12%。连部分关联度较小的农产品价钱也呈现反弹，例如ICE糖期货价钱累计上涨12%，可可价钱累计上涨6.5%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　多家机构指出，随着资金重新回流，市场心情愈加悲观，大宗商品曾经走入“触底反弹”阶段。彭博监测数据显现，在买卖所上市买卖的ETP产品已成为大宗商品投资最大的单一类别。与大宗商品相关的ETP在今年1月的净流入资金额为50亿美圆，一改此前的净流出趋向，且主要流向为石油和黄金，二者各自净流入的金额约为27亿美圆。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">惠誉评级旗下研讨机构BMI于3日发布最新报告称，相比兴隆国度股市，大宗商品往常看起来更具有吸收力，估量大宗商品价钱接近见底。不过BMI也强调，固然大宗商品价钱曾经接近底部，但估量2016年反弹之后将有一段平稳时期，而不是强劲反弹。该机构以为，阻止大宗商品价钱耐久、连续多个季度反弹的主要要素，或将是部分令人失望的新兴市场经济数据。BMI还表示，一些大宗商品的反弹不会好事多磨，例如铁矿石和液化自然气等。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　巴克莱银行也在最新发布的报告中表示，由黄金石油领衔，2016年投资资金曾经开端重返大宗商品资产。这是2015年大宗商品遭遇持续三年的资金流出后首次呈现持续吸收资金流入现象。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　市场分析师表示，此前跌幅过大的原油和具有避险属性的黄金等贵金属成为大宗商品中的领涨者，由于原油供求关系仍具有一定不肯定性，因此后者可能将更受市场喜欢。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　巴克莱表示，关于原油而言，国际原油价钱低于每桶30美圆对许多投资者而言是低价的，许多分析师也都预测油价将在2016年反弹，因此投资者大肆抄底买入并不奇特，特别是油价目前已触及2009年初金融危机时的底部。关于黄金而言，美国较差的数据已将美联储下次加息的预期推迟，曾经招致美圆一段时期以来走软，再加上对金融市场以及许多行业前景的担忧，凸显了黄金的避险价值。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　荷兰银行集团战略师乔吉特·博埃勒今年年初之前不时看空黄金后市，但目前她改动了观念，并估量今年年底之前金价有望上升至每盎司1300美圆，这大大高于其此前给出的每盎司900美圆的预测值。她强调，市场关于美联储的加息步伐以及节拍呈现质疑，是招致黄金价钱今年以来完成强势反弹主要缘由。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　德意志银行日前也上调了2016年至2019年的金价预估值，分别从每盎司1033美圆、1100美圆、1150美圆和1233美圆，上调至1195美圆、1231美圆、1275美圆和1317美圆，理由是全球金融体系面临的压力上升、美国企业信誉违约周期风险增加以及主要新兴经济体资金外流招致货币贬值等。该行估量金价也可能在今年二季度会呈现时节性走软，届时将显现出入场抄底机遇。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/finance/2952" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰讯：上海期货交易所新增八家铝期货交易中心</span></a></p>', '    最近一个月以来，此前连续表现不佳的大宗商品逐渐走强。其中纽约油价大幅反弹16%，布伦特油价反弹10%，COMEX黄金期价反弹10.3%，LME铝和铜期价均反弹6%，纷繁创下近期新高。', '壹银添丰讯：大量资金进入市场 大宗商品市场或迎春天', '壹银添丰,大量资金,大宗商品', '    最近一个月以来，此前连续表现不佳的大宗商品逐渐走强。其中纽约油价大幅反弹16%，布伦特油价反弹10%，COMEX黄金期价反弹10.3%，LME铝和铜期价均反弹6%，纷繁创下近期新高。', '', '', '2016-03-04', '2016-03-04', '', '', 28),
(2956, 1, '壹银添丰：有色金属反弹的主因关乎货币', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　 &nbsp;今年1月下旬以来，大宗商品价钱呈现了明显的反弹，其中作为强周期的有色金属价钱3月份的反弹有晋级的趋向,而且这种反弹在很大水平上超越业内的预期，从反弹强度的强弱排序来看，锡价、铅价、锌价和铝价明显抢先。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　分离市场反弹的时间、幅度，宏观环境和时节性特性，笔者以为，有三个要素驱动有色金属呈现超预期反弹，即以减产为代表的供给端收缩，以时节性旺季为代表的需求改善预期，以及以央行“放水”为代表的逆周期政策。其中前两者可能扶持金属价钱反弹，但央行超预期“放水”是反弹晋级的关键要素。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　回忆历史状况，此轮“放水”和以往不同，不论是经济增长阶段、人口构造还是杠杆水平都决议了货币政策只能制造短期的价钱泡沫，但是不会驱动新一轮商品牛市的呈现。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　有色金属反弹超预期</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　笔者统计的结果显现，此轮有色金属反弹根本上超乎大多数人的预期。以去年创下的低点到今年反弹的最高点计算，铜、铝、铅、锌、镍和锡六种期货价钱反弹幅度都超越10%，其中，反弹幅度最大的是锡期货合约，国内锡期货活泼合约最高反弹幅度到达42.4%，而锡现货价钱反弹幅度也到达33.1%。仅次于锡反弹强度的是锌，沪锌和伦敦金属买卖所（LME）三个月锌价最高反弹幅度为24.9%和28.1%。相对来讲，镍和铜反弹幅度是最弱的，沪镍活泼合约和沪铜活泼合约最高反弹幅度为13.6%和14.4%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　减产等削减供给使价钱企稳</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">从价钱传导机制来看，在价钱持续不时下跌过程中，局部亏损的企业减产招致供给缩减，从而引发供给曲线向左移，假定在需求不变的状况下，即需求曲线不变动，那么平衡价钱会向上挪动，这是减产和价钱的互相影响关系。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　普通来讲，最先反弹的种类常常是供给最先减少的种类，而供给减产有几种状况：一是消费商减产；二是库存降落；三是商品因融资等要素被锁定无法流通。分离当前的经济形势，招致供给端变化的要素最主要是减产。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　反弹幅度最大的锡，2015年处于下跌的趋向，使得国内锡矿山、冶炼厂普遍减产，特别是2015年11月份国内锡价跌至8万元/吨左右的程度之后，很多锡矿山直接停产，招致了国内锡产量的普遍降落。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　铅方面，随着近几年国内铅锌价钱的不时下跌，2015年，大量范围型再生铅企业堕入亏损被迫停产，再加上环保政策的“加码”，许多中小型铅消费企业生存压力增大，消费受限，使得铅矿产出降落比拟凶猛。国际铅锌研讨组织（ILZSG）发布的数据显现，2015年1~11月，全球铅矿产量为401.5万吨，较2014年同期下滑11%。特别是2015年7月份我国对再生铅行业税收政策停止调整，增值税退税由50%下调至30%，招致再生铅企业的产出积极性降落。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　2016年1月份，锌价加速反弹，主要是世纪锌矿（Century）及Lisheen矿彻底关闭，招致锌精矿加工费明显降落。再加上嘉能可集团2015年年底宣布2016年关停50万吨锌矿产能，进一步加剧了市场关于锌矿供给的担忧。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　铝价反弹的最高阶段始于2015年12月，主要是由于2015年下半年国内铝冶炼厂累计减产效果显现。今年2月份，铝价反弹再度重启，由于我国基于供应侧变革征收专项基金，招致自备电设备的电解铝企业本钱优势削弱。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　由于2015年全球铜矿减产范围不超越70万吨，不及全球产量的4%，所以铜价反弹在六大种类中最弱。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　需求不够成反弹主驱动力</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　四川川商商品交易中心以为，需求端并非此轮反弹的主要驱动力。作为一个反响现货市场的直观指标，目前除了锌价之外，大多数有色金属现货报价处于贴水状态。理论上讲，现货升水意味着供给偏紧，而招致供给偏紧的无非是产出降落和消费好转，但现货贴水和局部种类减产的状况下，现货还是呈现贴水的状况，这意味着现货需求疲软。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　分种类来看，铜消费主要在电力（41%）、电子通讯（15%）、日用消费品（15%）、机械制造（10%）等范畴；铝资源消费主要在建筑业（38%）、交通运输（17%）、耐用消费品（16%）、电力（15%）等范畴；铅主要用于铅酸蓄电池（80%）、化工等范畴；锌主要用于镀锌范畴；镍主要用于不锈钢；锡主要用于焊接资料。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　因而有色金属大多数用于在电力、交通运输和建筑行业。从2016年1~2月份上述行业的数据来看，由于今年1月份冰冷的天气和2月份春节放假要素，电网建立项目喝房地产项目开工率不高。1月份汽车销量相对较好，但是2月份汽车销售遇冷，特别是日系车销量全线下滑。从丰田公司、日产公司、本田公司和马自达公司曾经发布的2月在中国的销售量看，只要丰田高于2015年2月的销量，同比增幅为6.3%，本田同比下跌7.7%，而日产和马自达分别下滑13%和19.3%，跌幅到达两位数。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　四川川商商品交易中心货币超预期放松是有色金属超预期反弹的主因</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　依据曾经发布的经济数据，今年1月，我国信贷和融资的经济数据强劲。数据显现，综合社会融资、中央债、国债，测算余额同比增加15.1%，较2015年12月上升了0.8个百分点，持续了2015年年中以来的上升势头。分项数据看，1月份广义货币（M2）增速高达14%，为2013年12月以来的最高增速。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　此外，1月份,国内商业银行突击放贷，带来的资金活动性高于预期，中国央行可能会继续经过公开市场操作来均衡市场资金面。但是，2月29日中国央行宣布，自2016年3月1日起，普遍下调金融机构钱存款准备金率0.5个百分点，以坚持金融体系活动性合理富余，引导货币信贷平稳适度增长，为“供应侧”变革营造适合的货币金融环境。笔者以为，这是我国为了避免经济“硬着陆”，防备债务违约和导向稳增长，新一轮的经济刺激可能加码。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　目前，察看我国货币政策和楼市政策，我国经过货币宽松和居民“加杠杆”方式，来对冲企业“去杠杆”带来的经济下行压力。但是，这种货币超预期放松有两种假定状况呈现：</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　第一种假定是1月和2月股市暴跌，企业债违约风险呈现，银行间长端利率有拐头向上的趋向。为了防备企业和中央政府借新债换旧债压力增加而呈现违约，我国在今年一季度加大宽松力度来暂时稳定场面，为变革提供时间缓冲。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　假如是这种状况的话，那么二季度货币政策很大可能回归中性，最终资金活动性会回归理性，从而使大宗商品的价钱反弹可能只是暂时的状况，最终大宗商品价钱将会回归供需根本面主导，而非投机需求主导。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　第二种假定是假如我国在“两会”之后继续大范围的放松货币政策，并暂时将变革延后的话，那么相似2008年的经济刺激方案将重现，那么，届时包括大宗商品、股市等风险资产价钱有望在将来会大幅上涨，包括居民消费价钱指数（CPI）等通胀指标也会掉头，加速上冲。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　理论上来看，价钱是一种货币现象，目前国内局部城市楼市火爆，1月CPI上升都离不开M2增速的上升。回忆2005~2007年和2009~2010年这两个时间段，铜等大宗商品价钱的持续上涨，离不开M2增速的攀升。如2005年M2同比增速为14%左右，到了2007年升至17%以上；2008年M2增速为17%左右，而2009年增速攀升至30%左右。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　四川川商商品交易中心假如2016年重现好像2008年大范围刺激方案的话，那么实体经济和资产价钱表现可能另一番状况呈现。首先，当前我国人口红利消逝，中国经济潜在增长率下滑，那么大范围经济刺激带来的可能是资产价钱泡沫，而传统的房地产和制造业出清被中缀，经济可能只是短期的上升；其次，企业局部债务再度收缩，金融部门再度加杠杆，最终价钱泡沫幻灭引发部分的金融危机。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　综合推断，笔者倾向于第一种状况呈现，即经过货币宽松给变革提供时间缓冲，但是由于刚性兑付部门的加杠杆，目前政策效果可能有负面的隐患。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/industrynews/2954" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰讯：地产的火爆带动了铜价的强势反弹</span></a></p><p><br/></p>', '　  今年1月下旬以来，大宗商品价钱呈现了明显的反弹，其中作为强周期的有色金属价钱3月份的反弹有晋级的趋向,而且这种反弹在很大水平上超越业内的预期，从反弹强度的强弱排序来看，锡价、铅价、锌价和铝价明显抢先。', '壹银添丰：有色金属反弹的主因关乎货币', '壹银添丰,有色金属,货币,反弹', '　  今年1月下旬以来，大宗商品价钱呈现了明显的反弹，其中作为强周期的有色金属价钱3月份的反弹有晋级的趋向,而且这种反弹在很大水平上超越业内的预期，从反弹强度的强弱排序来看，锡价、铅价、锌价和铝价明显', '', '', '2016-03-08', '2016-03-08', '', '', 39),
(2957, 25, '壹银添丰：大宗商品阶段性上涨，黄金涨幅最大', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　 &nbsp;假设要说2016年的市场热点，黄金的迸发无疑是出乎市场意料的。进入3月份，黄金的靓丽表现仍在持续，而受益于风险心情的上升，大宗商品也在近期强势上涨。但是，市场人士依然提示，固然近期走势向好，市场关于金价的后续走向仍有分歧，而大宗商品在今年或更多存在阶段性机遇，说其反转向上仍为时兴早。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　金价后市存分歧</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　四川川商商品交易中心黄金市场今年年初以来的表现是出乎市场预料的，而这种不测在近期还在继续。上周，即便遭到美国强劲的非农数据的影响，金价仍未遭到打压，反而一度突破了2月中旬的高点。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　统计显现，上周国际市场上风险偏好意情持续上升，推进风险资产明显反弹。而金价也受益于大宗商品的强势上涨，上周国际金价上涨近35.5美圆，周涨幅达2.9%，报收于每盎司1259美圆；一度突破2月中旬创下的1261美圆/盎司的高点，再创今年反弹收盘新高。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　回想2月份黄金的市场表现，民生银行金融市场部分析师汤湘滨以为，此前美圆与黄金在2月份一度呈现同涨同跌的现象，但并不完好如此。2月上旬美圆下跌，金价快速上涨。随后美圆反弹，金价转向震荡上涨。“国际金价涨势放缓，主要遭到避险心情削弱以及短期涨幅较大的影响。目前美圆和金价回归负相关性。主要是由于市场避险心情向通胀预期转变。”他估量在当前市场风险偏高升温，大宗商品强势反弹推进通胀预期上升的背景下，美圆和金价将维持负相关性，也就是说美圆下跌将对金价上涨构成支撑。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　而从美圆近期的表现看，汤湘滨以为近期美圆指数呈现回落是一个值得关注的信号。上周美国经济数据较好，特别是最新的就业数据表现强劲，但美圆指数却缺乏上涨动力，而是震荡回落。“以致连上周五美国强劲的非农数据也无法抵挡对美圆的抛压，这显现市场对美圆的态度可能正在发作显著变化。”他以为，近期美圆兑澳元、加元以及日元汇率的跌幅曾经较大，最大跌幅分别抵达7.74%、8.43%和6.14%。美圆的阶段性回落正在成为市场风险偏好上升的信号之一。这也将在一定程度上对金价构成支撑，使得金价在短期内仍有上涨动能和空间。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">值得关注的是，近期市场上关于黄金后续的走势也存在分歧。据彭博社最新调查显现，因近期股市的上涨令避险需求遭到抑止，黄金买卖员、分析师对本周金价走势的看跌程度升至7月以来的最高位。统计显现，在接受调查的17位黄金买卖员及分析师中，有2人看涨（占比12%），8人看空（占比47%），7人看平（占比41%）。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　大宗商品或迎来阶段性机遇</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　除了国际金价的持续上涨，上周市场上的贵金属以及大宗商品的表现均较为出色。统计显现，国际银价上周上涨0.81美圆，全周上涨5%，报收于每盎司15.5美圆。其他市场方面，美圆指数小幅回落，全周下跌0.8%，报收于97.34；国际原油期货价钱强势反弹，全周上涨9.6%，报收于每桶36美圆；LME金属指数大幅反弹，全周上涨近5.7%，创近5个月来的新高；彭博国际农产品（12.70 +1.36%，买入）指数全周上涨近4.3%。上周大宗商品CRB现货指数也创下2015年11月上旬以来最高值。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　对此，市场人士分析以为，大宗商品的反弹一方面是由于超跌反弹的技术需求，另一方面，由于3月美联储加息预期较弱，招致美圆走低，也使得大宗商品价钱下行的压力暂缓。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　而在汤湘滨看来，短期大宗商品价钱强势反弹，显现国内外市场对经济前景好转的预期明显加强，因此也对大宗商品的价钱构成了一定的支撑。但是他以为这并不意味着大宗商品的“春天”曾经来临，要说反转更是为时兴早。2016年市场不肯定要素仍不少，大宗商品近期可能迎来阶段性上涨的机遇，但后续走势仍需求观察。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/finance/2955" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰讯：大量资金进入市场 大宗商品市场或迎春天</span></a></p>', '假设要说2016年的市场热点，黄金的迸发无疑是出乎市场意料的。进入3月份，黄金的靓丽表现仍在持续，而受益于风险心情的上升，大宗商品也在近期强势上涨。', '壹银添丰：大宗商品阶段性上涨，黄金涨幅最大', '壹银添丰,大宗商品,上涨,涨幅', '假设要说2016年的市场热点，黄金的迸发无疑是出乎市场意料的。进入3月份，黄金的靓丽表现仍在持续，而受益于风险心情的上升，大宗商品也在近期强势上涨。', '', '', '2016-03-08', '2016-03-08', '', '', 21),
(2958, 1, '壹银添丰：二会政策对有色金属市场的影响', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">一、财政政策：积极的财政政策托底需求<br/></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; </span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">讯：2016年财政赤字目的2.18万亿元，较2015年的1.62万亿大幅添加。赤字率3%，大于2015年2.3%的目的。意味着2016年持续施行积极财政政策并加大。报告指出将过度扩展财政赤字次要用于减税降费，进一步加重企业担负。报告指出，将片面施行营改增、取消违规政府性基金、免征18项行政事业性免费，加重企业和团体担负5000多亿元。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 经济增长：降低增速目的，波动预期2016年GDP增速目的是6.5-7%，较2015年目的降低。习近平在“十三五”规划建议指出2016年至2020年经济年均增长底线是6.5%以上，6.5-7%定调经济增长的合理区间，波动市场预期。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 供应侧变革：持续淘汰落后产能</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 2016年将严控新减产能，坚决淘汰落后产能，积极稳妥处置僵尸企业。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 货币政策：稳健偏宽松</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 2016年将统筹运用地下市场操作、利率、存准率、再存款率等工具，坚持活动性合理富余。M2增速目的13%，较2015年进步，并于2015年实践完成状况根本分歧。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">二、对金属市场的影响</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 供应侧变革意味着持续淘汰落后产能，化解过剩产能，将有助于逐渐无效改善以后的库存高企的场面，我们可以看到从2014年以来就提出了钢铁水泥行业的淘汰落后产能目的，截至目前，黑色金属库存也呈现了明显的下降；而关于有色金属行业而言，去库存才刚刚开端，因而供应侧变革在有色金属行业的施行效果对改善供需根本面将尤为重要。我们或需求看到的是后续详细政策的呈现。&nbsp;</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 积极的财政政策意味着需求层面的托底和提振。我们可以从两方面停止剖析。一是企业降税减负，消费本钱下降。二是企业和团体减负，进步推销与消费积极性，提振市场需求预期。我们以为，企业减负与淘汰落后产能必需偏重而行，这样才干完成在保证优质企业良性安康开展的同时，改善产能过剩的现状。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 货币政策进一步宽松，市场活动性加强，M2增速下行，通胀上升。从货币政策层面我们以为，PPI进一步持续下行趋向将失掉阶段性遏制，通胀是大宗商品价钱的先行目标，估计金属价钱的阶段性反弹行情仍将失掉进一步延续。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 不过，我们对投资这一点并不持过于悲观的态度，我们看到根底设备建立方面并无大增长的意图，水利、公路、铁路建立及投资在投资额的相对量上并无分明增长。但是有色金属层面的处于地产后端的铝、锌、镍则将在一定水平上受害，以及与地产成交亲密相关的家电行业也将受害。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 因而，我们以为2016年政府任务报告关于金属市场的意义，更多的是“去产能、去库存、降本钱、去杠杆、补短板”重在改善供求关系，而非双方面的“安慰”需求。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 去年底以来，四川川商商品交易中心金属价钱走势正沿以下三个途径演化：</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 第一阶段，超跌反弹，金属价钱继续下行，空头回补带来超跌反弹；</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 第二阶段，政策预期反弹，即以后所属阶段。以后，全体经济增速下行，投资放缓意味着拉动经济高速增长的动力目前已不复存在；产能过剩，仍面临坎坷构造性变革路途意味着商品熊市周期尚未完毕。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 第三阶段：趋向重塑。关键点在于政策落实及根本面实践改善状况。若政策落实、通胀程度以及需求安慰超预期，那么价钱无望进一步走高，但若以上预期兑现，根本面未有分明改观，则反弹行情也将面临终止。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/industrynews/2956" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰：有色金属反弹的主因关乎货币</span></a></p>', '四川川商商品交易中心讯：2016年财政赤字目的2.18万亿元，较2015年的1.62万亿大幅添加。', '壹银添丰：二会政策对有色金属市场的影响', '壹银添丰,二会,有色金属', '四川川商商品交易中心讯：2016年财政赤字目的2.18万亿元，较2015年的1.62万亿大幅添加。', '', '', '2016-03-09', '2016-03-09', '', '', 25),
(2959, 1, '高库存推动镍价大跌 翻身希望渺茫', '<p><span style="font-size: 16px; font-family: 宋体, SimSun;">　 &nbsp;四川川商商品交易中心3月7日消息，大宗商品集体笼罩在愁云惨雾之中，但很少有比镍跌得更加惨烈。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　尽管铜、铝等金属都徘徊在历史低点，但仍高于全球金融危机时期所创下的低谷，特别是近几周以来价格出现反弹。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　但镍上个月跌至13年新低，尽管自那以后收复部分失地，但仍远低于2008、2009年的价格。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　本轮下跌令市场参与者困惑不解。2014年，全球最大的镍矿石供应国印度尼西亚颁布了出口禁令，因此市场人士原本预计镍价在一段时间内将保持坚挺。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　伦敦金属交易所(LME) 3个月镍期货目前报每吨9,290美元左右，仅仅是2014年5月价格的近三分之一，并是2007年5月所创峰值的六分之一。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　BMI Research大宗商品研究部主管戴维斯John Davies表示，在印尼颁布镍矿石出口禁令之后，全球镍消费者预计接下来市场会剧烈收紧，因此囤积起了大量的精炼镍和镍矿石。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　“但镍市吃紧成为现实的过程非常、非常缓慢。”</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　镍价低迷背后的原因是中国需求低于预期以及全球产量居高不下。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　中国占全球镍消费量的30%左右，大部分进口的镍用于生产不锈钢。由于汽车生产和建筑业的需求疲软，去年中国的不锈钢产量下滑1%。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　美银美林(Bank of America-Merrill Lynch)的数据显示，镍价的下挫与去年中国国内不锈钢价格下跌30%的走势一致。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　受此影响，2015年中国镍矿石进口减少26.3%，今年到目前为止同比减少9.6%左右。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　投资服务公司Wallachbeth Capital首席执行长Ilya Feygin称，目前镍供应严重过剩，预计中国的不锈钢产量在2020年之前不会增长。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　尽管镍需求低迷，但一些大型镍生产商仍能够实现盈利，其中一个原因是能源成本低。一些国家本币贬值也是一个原因。由于担心失去市场份额，一些最大型的生产商不愿减产，即便减产可能有助于支撑价格。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　目前只有中国含镍生铁制造商削减了产量；含镍生铁是一种低品位镍合金，是纯镍的一种成本较低的替代品。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　美银美林金属市场策略师Michael Widmer称，减少的这些产量甚至也已经基本被中国以外地区“非常强劲”的镍产量所弥补。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-size: 16px; font-family: 宋体, SimSun;">四川川商商品交易中心</span></a><span style="font-size: 16px; font-family: 宋体, SimSun;">表示，很长时间以来镍生产商一直都不愿减少产量。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　目前镍库存正在不断增加。2012年初以来，伦敦金属交易所仓库的镍库存已经增长四倍，至44.5万吨左右，远高于15.8万吨的十年平均水平。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　上海期货交易所的镍库存也在增长，2015年5月至2016年1月期间，镍库存增长超过九倍，至58,778吨。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　中国部分镍库存被用来作为抵押品以获得贷款；近几年以金属为抵押品的融资方式变得非常流行。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　过去铜一直被选作这类交易的抵押品。但交在发生了一些争议性事件后，此类交易转而选择使用镍等不太引人注目的金属，以降低受关注度。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　花旗集团(Citigroup)在一份报告中表示，该行认为，在去年前11个月中国进口的258,125吨精炼镍中，有相当一部分被用作了融资抵押品，而非用于实际需求。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　令镍市场前景雪上加霜的是，全球最大镍开采国印尼目前正考虑取消其镍矿石的出口禁令。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">　　花旗集团在上述报告中称，在该行看来，即使只是针对出口禁令可能取消的讨论，也会进一步打击镍市场人气，进而拖累镍价前景。</span></p><p><span style="font-size: 16px; font-family: 宋体, SimSun;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/industrynews/2958" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-size: 16px; font-family: 宋体, SimSun;">壹银添丰：二会政策对有色金属市场的影响</span></a></p>', '四川川商商品交易中心3月7日消息，大宗商品集体笼罩在愁云惨雾之中，但很少有比镍跌得更加惨烈。', '高库存推动镍价大跌 翻身希望渺茫', '镍价,大跌', '四川川商商品交易中心3月7日消息，大宗商品集体笼罩在愁云惨雾之中，但很少有比镍跌得更加惨烈。', '', '', '2016-03-09', '2016-03-09', '', '', 29),
(2960, 25, '壹银添丰：建行加入国际贵金属市场获得白银定价权', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 四川川商商品交易中心讯：芝加哥商品买卖所及汤森路透宣布，中国建立银即将成为伦敦金银市场协会白银机制（LBMA SilVer Price）的新成员。建行也成为首家参加LBMA白银定价机制的中资银行。市场人士以为，此举进一步强化了中资银行在国际贵金属市场的话语权。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 2015年6月起，中行、建行、工行、交行先后参加LBMA黄金定价机制。同年10月19日芝商所与建行所签署的体谅备忘录显示：“建行有意参与由CME Benchmark Europe Limited 所管理的LBMA白银机制，并推进建行中国客户买卖芝商所的产品。”该协作意向于本月7日宣布成行。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 建行金融市场部总经理谷裕说：“这进一步增强了我们在欧洲推进人民币活动性和人民币产品的综合举措。”</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 芝商所国际业务初级董事总经理William Knottenbelt表示，作为中国四大行之一，建行参加LBMA白银定价机制无疑将受得其他白银市场参与者的欢送。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 汤森路透基准价主管Tobias Sproehnle则表示，建行参加LBMA白银定价机制，成为重要的新成员，有助于加深该机制在国际市场的洞察力。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;“建行的参加将令我们的竞拍更国际化。我们也鼓舞其他市场的参与者参加我们的机制。”LBMA首席执行官Ruth Crowell如是说。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 2014年8月起，CME Benchmark Europe Limited 和汤森路透接替London Silver Market Fixing Limited，并结合运营LBMA白银机制。建行是LBMA白银定价机制的第六名成员，此前成员包括美国汇丰银行、摩根大通银行、加拿大丰业银行、多伦多道明银行和瑞银集团。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 据</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">理解，LBMA白银机制次要由芝商所提供电子拍卖平台，价钱在此平台停止计算，并由汤森路透担任管理基准以及分配。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 广发期货贵金属研讨员尹雨杰在承受期货日报记者采访时表示，就国际白银供需对国际白银定价的影响而言，此举中临时无望降低国际外市场的升水幅度。他引见，除去汇率要素，近两年，上海黄金买卖所白银T+D绝对LBMA现货价钱的升水不断维持在较高程度，去年均匀为8%，往年1月份开端下降，目前在5%左右。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 一位参与LBMA市场买卖的国际投资者以为，LBMA是现货买卖，中资银行参与LBMA定价机制，意图能够在于经过现货做市报价来获取高额的点差收益。“如今国际有不少LBMA市场成员的上级、下上级或N级代理商，可买卖杠杆高达一两百倍，收的手续费也特别高。但为了高额收益，要是看准了行情，也不在乎那些点差了。”他说。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/finance/2957" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰：大宗商品阶段性上涨，黄金涨幅最大</span></a></p><p><br/></p>', '    四川川商商品交易中心讯：芝加哥商品买卖所及汤森路透宣布，中国建立银即将成为伦敦金银市场协会白银机制（LBMA SilVer Price）的新成员。建行也成为首家参加LBMA白银定价机制的中资银行。市场人士以为，此举进一步强化了中资银行在国际贵金属市场的话语权。', '壹银添丰：建行加入国际贵金属市场获得白银定价权', '壹银添丰,建行,国际贵金属市场,白银,定价权', '    四川川商商品交易中心讯：芝加哥商品买卖所及汤森路透宣布，中国建立银即将成为伦敦金银市场协会白银机制（LBMA SilVer Price）的新成员。建行也成为首家参加LBMA白银定价机制的中资银', '', '', '2016-03-09', '2016-03-09', '', '', 26),
(2961, 1, '壹银添丰：供需不平衡，上半年铝价有望上涨', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　产能弹性受抑和较低的库存程度招致供应缺口进一步扩展。国际现有建成产能约3890万吨，其中，运转产能约3020万吨，由于后期国际关停产能较多，招致现有运转产能供应弹性缺乏；加之去年四季度库存去化绝对充沛，现阶段库存总量低于去年同期程度；二季度供求缺口将会进一步扩展。关于关停的产能而言，一方面，其复产需求的铝价的进一步下跌：1）铝价至多高于其现金本钱线，且预期价钱可以维持；2）复产需求的额定本钱1000元/吨，预期在将来的运营中失掉补偿。从往年的需求量来判别，铝价至多要维持在12000元/吨的程度，才有能够呈现规模化复产，而现阶段的价钱显然无法满足这一需求；另一方面，关停产能的复产周期需求2-3个月的工夫；这一意味着即便二季度初开端复产，铝价的反弹也无望延续到二季度末。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 本钱支撑将利于价钱波动，利润弹性将在电解铝和氧化铝环节共同表现。电解铝本钱构造中最重要的电力本钱在煤炭行业膨胀的背景下，下行空间已不大；此外，氧化铝行业在后期增产的背景下，也不能够维持临时盈余，价钱会有所上升。两方面都从本钱端构成对铝价的支撑。从铝产业链来看，现阶段基于产能去化和库存程度的考量，电解铝和氧化铝关于需求的价钱弹性较大，是需求复苏的次要受害环节。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 估计将来国际铝价的价钱中枢无望在维持在12000元以上。在剔除经济尾部风险的思索下，将来行业供需将是一个逐渐再均衡的进程，行业全体维持微利和盈亏均衡的形态会更为合理；而随同国际汽车置办税减免政策和地产政策的抓紧，依据安泰科和2016年国际原铝消费增速无望高于2015年，全年铝消费量估计在3150-3200万吨，思索开工进度的影响，需求维持略高的产能程度，对应的边沿本钱需求维持在12000元吨/以上。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; </span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">投资建议和引荐：基于供求两方面有利要素对铝价中期反弹的支持以及行业临时产能出清的趋向；我们以为国际电解铝上市公司投资价值逐步显现。引荐南山铝业，云铝股份和中国铝业。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/industrynews/2959" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">高库存推动镍价大跌 翻身希望渺茫</span></a></p><p><br/></p>', '产能弹性受抑和较低的库存程度招致供应缺口进一步扩展。国际现有建成产能约3890万吨，其中，运转产能约3020万吨，由于后期国际关停产能较多，招致现有运转产能供应弹性缺乏；', '壹银添丰：供需不平衡，上半年铝价有望上涨', '壹银添丰,供需,铝价,上涨', '', '', '', '2016-03-10', '2016-03-10', '', '', 24),
(2962, 1, '壹银添丰：镍矿生产商削减出口量，镍矿今年或紧缺', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　据</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">3月9日音讯，菲律宾镍矿消费商已就往年产量和出口量最多增添20%达成分歧，以回应镍价受中国需求疲软拖累跌至逾10年低点。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 在印尼2014年制止出口未经加工的矿石后，菲律宾成为中国最大的镍矿石供给国。但价钱下挫意味着，该国无法充沛受害于销量增长。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; Global Ferronickel Holdings Inc担任投资者关系的副总裁Ramon Peter Adviento表示，菲律宾镍矿商协会曾经赞同将往年的矿石产量较2015年的程度增添20%。该协会成员的镍矿石产量占菲律宾总产量的60%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">Adviento并称，包括Global Ferro镍在内的该协会成员镍矿石累计出口量估计也将增加20%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇：</span><a href="http://www.yytf099.com/industrynews/2961" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰：供需不平衡，上半年铝价有望上涨</span></a></p>', '据四川川商商品交易中心​3月9日音讯，菲律宾镍矿消费商已就往年产量和出口量最多增添20%达成分歧，以回应镍价受中国需求疲软拖累跌至逾10年低点。', '壹银添丰：镍矿生产商削减出口量，镍矿今年或紧缺', '壹银添丰,镍矿,出口量', '', '', '', '2016-03-10', '2016-03-10', '', '', 27);
INSERT INTO `by_article` (`id`, `cate_id`, `title`, `content`, `intro`, `site_title`, `site_keywords`, `site_description`, `tags`, `flag`, `create_date`, `update_date`, `img`, `attach`, `click`) VALUES
(2963, 25, '四川川商商品交易中心：有色金属市场调研', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 四川川商商品交易中心关于铜的调研：天量多因跨市场套利，需求未见明显恢复2016年1月以来中国出口了天量的精铜，招致中国的库存疾速上升，目前曾经接近40万吨，但是同时伦敦的库存下降比拟快。总体来说铜贸易商并不以为铜的库存比拟高，和去年同期相比降低5~7%。目前我们察看到有少量铜的需求订单，往年以来铜矿冶炼行业表现不错，预期随着时节性需求的攀升，供应的产能应用率会逐步上升，目前未见铜矿在整个产业内的瓶颈。</span></p><p></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 四川川商商品交易中心关于电解铝的调研：供应端中小铝厂对低价反响2015年第四季度电解铝最低价跌至9500元/吨时，一些高本钱消费商中场离场使得电解铝增产比拟分明；由于电解铝厂的大局部本钱是自备电，所以动力煤价钱的反弹关于电解铝的本钱曲线有一定的提升作用；海内电解铝遭到低价的安慰有能够增产比拟分明。目前贸易商比拟看多电解铝价。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; </span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">关于镍的调研：低价还缺乏以供应反响2015年造船、家电的需求错位招致电解镍的需求大幅度膨胀，但是中国的镍解厂在低价下的反响不够，并没有明显增产，目前贸易商并不看好镍。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 四川川商商品交易中心关于锌的调研：矿端逐间紧缺2015年汽车销售的火爆招致锌的需求添加比拟分明，但是次要矿区锌矿产量却有所下降，估计往年下半年锌的现货市场会有一定的紧张。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 四川川商商品交易中心关于钢铁的调研：低库存和供应瓶颈共同作用招致钢铁反弹，需求端复苏不分明2011年当前我国钢铁产业构造绝对固定，地域需求和产业构造决议了华东的钢材价钱比华北的钢材价钱贵100美元/吨。但是往年以来华北的钢材价钱却比华东的钢材价钱高100美元/吨，而且春节当前华北地域的需求疾速提升，使得唐山地域的钢坯价钱迅速拉涨。我们从钢厂理解到这局部需求次要是来自于一些西部地域的政府工程订单，而这从以前来看是比拟少见的。往年华东地域钢厂的钢铁需求量并没有呈现疾速的恢复，通常钢铁的需求上升呈现在正月十五之后的第一个月，在这一个月间钢厂的库存会渐渐攀升，到三月中旬和三月底库存才会下降。假如需求低于预期会呈现比拟猛烈的自动去库存，招致价钱下跌，但是往年我们察看到两头商却在不时地加库存。由于年前整个钢铁行业的利润比拟差，全国将近95%的钢厂都在盈余，截止2015年12月将近6000万吨左右的钢铁产能加入。开年以来钢铁的高炉开工率目前在70%，比2015年同期下跌10%，环比复苏也比拟慢，这和整个钢铁行业的利润以及资金紧张有一定的关系。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇：</span><a href="http://www.yytf099.com/finance/2960" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰：建行加入国际贵金属市场获得白银定价权</span></a></p><p><br/></p>', '四川川商商品交易中心关于铜的调研：天量多因跨市场套利，需求未见明显恢复2016年1月以来中国出口了天量的精铜，招致中国的库存疾速上升，目前曾经接近40万吨', '四川川商商品交易中心：有色金属市场调研', '有色金属,市场调研', '', '', '', '2016-03-10', '2016-03-10', '', '', 23),
(2964, 25, '贵州企业起草编制铝合金锻件国标', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　从四川川商商品交易中心监局得悉：贵州省一企业起草编制的一项规范近日由国度质检总局公布施行，此规范施行可使相关产品的消费、验收等到达国际程度，降低消费本钱。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 据</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">悉，此规范由贵州航宇科技开展股份无限公司作为第一同草单位编制，规范称号为《铝及铝合金模锻件、自在锻件和轧制环形锻件通用技术条件》，规范编号为GB/T32249-2015。规范的制定进一步标准了铝合金锻件产品的种类、规格和市场，填补了国际无铝合金环形锻件规范的空白，满足了国际各铝合金锻件消费企业的消费及进出口铝合金锻件质量验收的需求。规范普遍使用于航空、航天、兵器、船舶等行业，其施行可以使产品的消费、验收等到达国际程度，降低消费本钱，促进我国铝合金工业从资源耗费向开展高端产品转换，促进经济和贸易的增长。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇：</span><a href="http://www.yytf099.com/finance/2963" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心：有色金属市场调研</span></a></p>', '从四川川商商品交易中心监局得悉：贵州省一企业起草编制的一项规范近日由国度质检总局公布施行，此规范施行可使相关产品的消费、验收等到达国际程度，降低消费本钱。', '贵州企业起草编制铝合金锻件国标', '铝合金,锻件', '从四川川商商品交易中心监局得悉：贵州省一企业起草编制的一项规范近日由国度质检总局公布施行，此规范施行可使相关产品的消费、验收等到达国际程度，降低消费本钱。', '', '', '2016-03-10', '2016-03-10', '', '', 25),
(2965, 1, '壹银添丰：上海期货交易所批准洛阳市首家铝期货交割库', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　 &nbsp;3月1日，据</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">了解，洛阳中储铝期货交割库（以下简称洛阳中储）正式取得上海期货买卖所批准设立，核定库容铝1万吨，地域贴水120元，成为洛阳市第1家、全省第1批获批的铝期货交割库。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　洛阳中储是中储开展股份有限公司在洛阳市设立的分公司，以铝期货交割库为依托，向社会各界提供仓储运输、加工配送、中转发运、现货买卖、质押融资、国际货代、海关监管、物资经销等多功用、一体化的综合物流效劳。洛阳中储位于西工区道南路41号，占地9.8万平方米，被省发改委评定为“河南钢材价钱监控点”、“省特征效劳业园区”，被市政府规划为商贸物流示范园区，是洛阳市乃至豫西地域最大的物流效劳基地。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　洛阳中储铝期货交割库的设立，有利于提升洛阳市传统制造业竞争力，特别是可以完成铝锭在洛阳市境内顺利交割，无需再运往上海、无锡，可以显著降低电解铝企业的运输本钱。同时，地域贴水120元使得洛阳中储铝期货交割库更具价钱优势，降低了铝加工企业每吨120元的采购本钱，可以吸收沿海地域铝加工企业来洛阳市投资建厂，打造完好的铝制品全产业链。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/industrynews/2962" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰：镍矿生产商削减出口量，镍矿今年或紧缺</span></a></p><p><br/></p>', '  3月1日，洛阳中储铝期货交割库（以下简称洛阳中储）正式取得上海期货买卖所批准设立，核定库容铝1万吨，地域贴水120元，成为洛阳市第1家、全省第1批获批的铝期货交割库。', '壹银添丰：上海期货交易所批准洛阳市首家铝期货交割库', '壹银添丰,上海期货交易所,铝期货,交割库', '  3月1日，洛阳中储铝期货交割库（以下简称洛阳中储）正式取得上海期货买卖所批准设立，核定库容铝1万吨，地域贴水120元，成为洛阳市第1家、全省第1批获批的铝期货交割库。', '', '', '2016-03-11', '2016-03-11', '', '', 26),
(2966, 1, '壹银添丰：油价已触底反弹静待价格上涨', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　固然昨日的电子盘买卖中，国际油价有所回落，但在3月9日场内买卖中，纽约4月原油期货合约收涨1.79美圆，涨幅高达4.9%，报每桶38.29美圆，创下2015年12月7日以来最高收盘位；布伦特5月原油期货收涨1.42美圆，涨幅为3.6%，报每桶41.07美圆，也创下2016年迄今收盘新高。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　关于国际油价刷新阶段高点，有剖析人士指出，虽然美国能源信息署（EIA）发布的数据显现，截至3月6日当周，美国EIA原油库存增加388万桶，超出此前市场普遍预期的增加值350万桶，不过市场似乎愈加关注上周汽油库存大幅减少452.6万桶，该数值创2014年4月以来最大单周降幅。剖析师称，美国废品油库存降落，正值尼日利亚及伊拉克原油产量因输油管道被袭而降落，同时伊朗新供给上市也不如预期之多，这些要素均令做多者更有胆量。也有业内人士表示，国际油价强势反弹标明市场风险心情在改善，有利于提升对其他大宗商品的投资热情，大宗商品正在酝酿反弹的春天。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　油市利好音讯频出虽然原油高库存的压力仍在，但随着利好油市的音讯频频发出，市场对原油持悲观态度，3月初开端油价就有显著反弹，接二连三地打破阻力位，翻开新的上升区间。本周三（3月9日）发布的美国EIA原油库存数据环比大幅降落，加之市场传言沙特欲借款60亿至80亿美圆以对付巨额财政赤字，国际原油价钱开启影响强势反弹，纽约原油期货收涨近5%。重山集团全民买卖资深剖析师张强以为，此波大涨修复了原油价钱的反弹趋向，价钱正在远离“W底”形态，后市有望坚持震荡反弹走势。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>也持悲观见地。她以为，从原油的供需端来看，各大原油消费国在讨论协同减产，其中冻产协议的达成初见效果。同时，美国不时减少石油活泼钻井数，而市场预期原油需求也将呈良性增长，这将改善原油供给过剩的场面，为油价提供支撑。各大原油消费国希望经过协同减产来改善油市供给过剩的场面。拉美产油国将举行会议，支持冻产等措施以提振油价。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　据外媒报道，伊拉克官员表示，OPEC和非OPEC产油国将于3月20日在莫斯科会晤。产油国将召开会议讨论原油供给过剩等问题，市场对原油减产的预期再度升温，技术性买盘涌现令油价遭到提振。随着3月份原油价钱一路飙升，打破了每桶30美圆至38美圆之间的数个阻力位，翻开新的上升区间。总体而言，原油终于渡过了低价寒冬，迎来了反弹的春天。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　此外，在沙特、俄罗斯等原油出口国，长期低迷的油价对财政及经济的影响曾经相当严重。这些产油国有提振油价的意愿和动力，只是他们还要在市场份额与油价低迷之间停止权衡。张强表示，将来2-3个月将是产油国“协作减产”会谈的关键期，假如会谈可以获得停顿，那么关于油价将是很大的提振。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　那么，国际油价反弹之路会否好事多磨呢？对此，多位承受采访的市场人士表示，原油仍接受着全球油市供给过剩的压力，同时技术性回调和多头获利回补也将令油价承压。而从宏观角度来看，原油的需求端尚未呈现明显改善，且缺乏好转迹象，特别是中国经济放缓令市场对将来中国原油需求持疑虑态度，在此背景下，只靠供应端的“协作减产”是缺乏以改动原油价钱熊市格局的。所以目前的上涨还只能定位为反弹，而不是趋向性反转，将来油价将还有重复，整体呈现低位宽幅震荡格局。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　大宗商品料受带动在大宗商品中，原油是绝对的领头羊，原油价钱上涨有助于提振投资者对商品市场的悲观心情，并带动其他大宗商品价钱的反弹，特别是对能源及根本金属等周期性比拟强的商品而言，原油的影响力是很大的。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　不过，四川川商商品交易中心剖析，其他大宗商品的价钱走势并不是和原油完整同步的，特别是此波原油反弹，一局部缘由在于产油国冻结产量协议等音讯的影响，而并非宏观经济的复苏。就短期来看，在原油走强的带动下，大宗商品价钱纷繁呈现强势反弹，构筑底部形态的迹象较为明显，这种现象还有望持续一段时间，至少此前的单边快速下跌走势可能曾经完毕，市场上一味看空大宗商品的观念正在逐渐减少。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“原油反弹与其他大宗商品价钱上涨是相辅相成的，所以原油反弹也有助于其他大宗商品上升。”龚文佳说，详细来看，原油从2月12日开端反弹，期间油价上升了31%，贵金属当中的黄金、白银等均呈现出上升趋向，工业金属中铜、铝、镍等种类也是一路飙升，化工、黑色等种类更是遭到明显带动。原油反弹标明市场的风险心情正在逐渐改善，这也影响着其他大宗商品，有利于带动其他大宗商品中的多头气氛，促进其他大宗商品的反弹。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　宏观经济或正在改善从根本面来看，从原油的供给面来看，各大原油国着手协同减产等措施来减轻库存居高不下的压力，同时冻产协议也初见效果，行将到来的OPEC和非OPEC产油国的会晤，使得市场对原油减产的预期再度升温。再从原油的需求端来看，全球经济增速缓和上升，中国原油进口强劲。中国海关总署3月8日发布的数据显现，作为全球第二大石油进口国，中国2016年2月份的原油进口量环比增加19%至3180万吨，相当于每日804万桶左右，创下日均数量的最高纪录。中国不时增加石油战略储藏，有助于局部消弭全球原油供过于求的场面。“总体而言，原油供需端均呈良好态势开展，原油上升就是其表现的结果。”龚文佳表示。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　张强则提示，原油价钱与宏观面的关系并不是简单的因果关系，油价上升不一定就是宏观面改善所致，而宏观面的好转大约率会推进油价上升。所以，不能由于原油价钱上升就断定宏观经济曾经改善，而要从多个角度来对待这一问题。首先，国际原油价钱自低位反弹以来，固然幅度曾经到达了近50%，但是仍处于大周期的低位，因而，油价能否曾经摆脱下跌趋向目前尚难定论，还需求进一步察看。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　其次，此波国际油价反弹的开启，有很大一局部缘由是主要产油国在限制产量及协作减产方面的努力，并非原油需求增长所致，而只要原油需求大幅上升，才干认定为宏观经济在好转。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　第三，近期发布的美国、欧洲及中国等新兴经济体的宏观经济数据并无明显好转，关于宏观面改善的判别需求更多的数据支持。所以，油价上升并不意味着宏观面的改善，但是却是一个正面的信号——普通商品市场的牛市周期要早于宏观经济半年，不扫除今年下半年宏观面全面好转的可能性。</span></p><p>&nbsp; &nbsp; <span style="font-family: 宋体, SimSun;">上一篇文章</span>：<a href="http://www.yytf099.com/industrynews/2965" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：上海期货交易所批准洛阳市首家铝期货交割库</a></p>', '　固然昨日的电子盘买卖中，国际油价有所回落，但在3月9日场内买卖中，纽约4月原油期货合约收涨1.79美圆，涨幅高达4.9%，报每桶38.29美圆，创下2015年12月7日以来最高收盘位；布伦特5月原油期货收涨1.42美圆，涨幅为3.6%，报每桶41.07美圆，也创下2016年迄今收盘新高。', '壹银添丰：油价已触底反弹静待价格上涨', '油价,触底反弹,价格', '　固然昨日的电子盘买卖中，国际油价有所回落，但在3月9日场内买卖中，纽约4月原油期货合约收涨1.79美圆，涨幅高达4.9%，报每桶38.29美圆，创下2015年12月7日以来最高收盘位；布伦特5月原油', '', '', '2016-03-11', '2016-03-11', '', '', 38),
(2967, 25, '壹银添丰：黄金价格不稳或市场需求放缓', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　 &nbsp;周三（3月9日）<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>得知，遭到原油价钱和股市上升的影响，COMEX金价连续第二个买卖日走低。投资者选择逢高获利了却，使得金价快速跌破1250美圆/盎司关口，短时目的或看向20日均线程度。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　自2016年以来，全球经济被拖入危机气氛。从全球央行的政策预期来看，将来全球宽松大潮愈演愈烈的概率较大。在宽松的宏观经济背景下，后市黄金价钱“小牛”行情经过修整，持续上行的概率较大。因而，当前回调行情或为逢低买盘增筹提供时机。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　目前，局部兴旺国度的经济复苏态势并不明朗，而一些新兴市场国度经济正堕入艰难。2月26—27日的G20会议在上海召开，该会议并未推出对各国央行有实践限制的公告，由此增加了将来各国对外汇干预的可能。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　在全球经济疲软之际，为提振通胀和压低汇率，日本央行在1月底开启负利率形式，市场由此预期将来全球央行货币政策将愈加宽松。固然负利率能否真正提振经济还值得商榷，但负利率的背后可能引发全球货币政策竞相宽松。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　本周新西兰联储不测降息25个基点至2.25%，其称因一系列通胀预期指标呈现大幅下滑。该央行还暗示至少还会再降息一次。从最近欧美央行官员讲话来看，本周四欧洲央行将继续加大宽松力度，美联储3月中旬加息概率很低。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　2015年，美圆上涨不断被以为是美国低通胀、油价下跌、出口增长疲弱、海外销售放缓和业绩乏善可陈的关键要素。在全球经济面临转型之际，当前美圆稳定运转对美国本身经济更有利。市场弱化美联储3月和4月加息的预期，更增加了金市多头的“底气”。由宏观环境决议的市场多头气氛短时不会疾速改动，因而黄金作为避险资金“宠儿”的位置估计暂不会动摇。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　随着当前市场对风险的担忧心情降温，黄金需求增速放缓。本周包括欧美股市以及以油价为代表的大宗商品普遍上涨，反映出市场风险心情呈现缓解。黄金市场需求也跟随市场环境变化呈现了增速放缓迹象，促使金价冲高回落。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　世界最大的黄金ETF—SPDR在周二的持仓减少了2.4吨，这是近4周来最大的减持。四川川商商品交易中心（CFTC）上周五发布的数据显现，上周机构也减持了COMEX黄金非商业净多头头寸。这是他们自1月中旬转为净多仓后初次呈现减持状况。反映市场大户持仓构造的非商业净多头寸呈现调整，反映出黄金价钱进入超买调整期。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　技术面上看，隔夜金价日线级别失守1250美圆/盎司的前期支撑。MACD指标绿色动能柱扩张，双线再度死叉，小时指标亦显现下行趋向，估计短时金价可能继续向1230美圆/盎司的趋向线支撑回撤。但是周线和月线指标仍显现多头趋向，只需金价可以守稳1230美圆/盎司左近区域，估计后市仍然可以持续上行。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/finance/2964" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">贵州企业起草编制铝合金锻件国标</a></span></p>', ' 周三（3月9日）四川川商商品交易中心得知，遭到原油价钱和股市上升的影响，COMEX金价连续第二个买卖日走低。投资者选择逢高获利了却，使得金价快速跌破1250美圆/盎司关口，短时目的或看向20日均线程度。', '壹银添丰：黄金价格不稳或市场需求放缓', '壹银添丰,黄金价格,需求', '周三（3月9日）四川川商商品交易中心得知，遭到原油价钱和股市上升的影响，COMEX金价连续第二个买卖日走低。投资者选择逢高获利了却，使得金价快速跌破1250美圆/盎司关口，短时目的或看向20日均线程度', '', '', '2016-03-11', '2016-03-11', '', '', 27),
(2968, 25, '壹银添丰：今年或修改证券法稳定股市', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 据<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>音讯，3月9日下午3时，第十二届全国人民代表大会第四次会议在人民大会堂举行第二次全领会议，听取全国人大常委会委员长张德江关于全国人民代表大会常务委员会工作的报告。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　原拟去年年底出台的新版证券法，列入了今年的立法方案。依据张德江委员长9日作的全国人大常委会工作报告，2016年，全国人大常委会将完善社会主义市场经济等方面法律制度，包括修正证券法。报告显现，今年将继续审议证券法修订草案。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　将汲取股市异动经验</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　十八届五中全会期间，习近平就《中共中央关于制定国民经济和社会开展第十三个五年规划的倡议》起草的有关状况作阐明时指出，近来频繁显露的部分风险特别是近期资本市场的猛烈动摇阐明，现行监管框架存在着不顺应我国金融业开展的体制性矛盾，也再次提示我们必需经过变革保证金融平安，有效防备系统性风险。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　十三五规划倡议也提出：积极培育公开透明、安康开展的资本市场，推进股票和债券发行买卖制度变革，进步直接融资比重，降低杠杆率。推进资本市场双向开放，改良并逐渐取消境内外投资额度限制。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　王超英表示，为落实上述关于资本市场变革的请求，有关方面正在抓紧研讨落实有关资本市场的顶层设计，“将分离中国资本市场的实践状况，关于市场变革采取各种各样的措施”。“变革有胜利也有失败，有的试得好就胜利了，有的试得不好可能就失败了”，以被叫停的熔断机制为例，王超英称，“阐明了资本市场的变革需求十分谨慎、慎重”。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　全国人大常委会委员、全国人大财政经济委员会副主任委员尹中卿说，上级请求证券法修正要汲取股市异动的经历经验，变革不成熟的根本制度。因而，证券法修正将完善根本制度，会触及证券发行对企业的请求、退出制度、监管机构的职责等多个方面。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　违法违规将进步处分力度</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　对违法违规行为的处分力度是本次修订《证券法》中备受市场关注的重要内容。此前，《证券法》因对违法违规行为的处分力渡过小被戏称为“豆腐法”，已成为阻碍中国股市安康开展的严重障碍。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　据四川川商商品交易中心统计，在过去的三年里，共有35家公司触及财务造假而遭到证监会的行政处分，其中32家公司的罚款均不超越60万元(“顶格处分”)。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“新法会不会加大对立功分子的惩罚力度，能否让立功分子牢底坐穿、倾家荡产，还需求在细节上研讨。”董登新说。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇：<a href="http://www.yytf099.com/finance/2967" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：黄金价格不稳或市场需求放缓</a></span></p>', '四川川商商品交易中心音讯，3月9日下午3时，第十二届全国人民代表大会第四次会议在人民大会堂举行第二次全领会议，听取全国人大常委会委员长张德江关于全国人民代表大会常务委员会工作的报告。', '壹银添丰：今年或修改证券法稳定股市', '壹银添丰,证券法,稳定股市', '四川川商商品交易中心音讯，3月9日下午3时，第十二届全国人民代表大会第四次会议在人民大会堂举行第二次全领会议，听取全国人大常委会委员长张德江关于全国人民代表大会常务委员会工作的报告。', '', '', '2016-03-11', '2016-03-11', '', '', 26),
(2969, 1, '壹银添丰：周末股市喜忧参半', '<p>&nbsp; <span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; 周五股指期货收十字星。主力合约IF1603开于2980.2点，收在2986.6点，截止开盘下跌20.4点，跌幅0.68%。上证50股指期货收十字星线。截至开盘，主力合约IH1603收在2052.8点，跌幅0.63%；上证50指数报收在2070.72点，涨幅0.45%。IC 1603合约收在5413.2点，跌幅0.57%。中证500指数收在5508.98点，跌幅0.23%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 周五现货上证指数窄幅震荡。早盘上证综指开在2781.6点，收在2810.31点，开盘下跌5.58点，涨幅0.2%。核心市场方面，道琼斯工业指数报收在17213.31点，涨幅1.28%；纳斯达克指数报收在4748.47点，涨幅1.85%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 核心方面，全球股市大幅反弹，美股个人大涨，标普500指数和道指涨逾1%，均创年内开盘新高；欧股大幅反弹，德股、法股均劲升逾3%；亚太股指少数小幅下跌，日股涨0.51%。当周，全球股市少数下跌，标普500和道指均涨逾1%，连涨周围，韩国、台湾、新西兰股指亦连涨周围。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 国际市场，上周五券商、保险、银行等金融股尾盘发力，沪指开盘翻红，守住2800点，但量能持续萎缩，两市成交仅3041亿元。上日成交金额为3550亿元。当周央行地下市场操作净回笼资金2050亿元。市场人士指出，降准后货币政策悲观心情重新低头，短期内活动性根本无忧。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; <a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰有色金属</a>数据发布，国度统计局3月12日密集发布一批微观经济数据，喜忧参半。工业消费增速创2009年3月以来新低，显示微观经济开年照旧疲软，社会消费品批发增速有所回落，固定资产投资增速稳中有升，房地产开发投资增速时隔两年初次上升。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 证监会主席刘士余12日在十二届全国人大四次会议记者会上说，今后中国资本市场的制度建立要自创国际上的成功做法和经历，但每一项变革必需牢牢立足中国国情。作为资本市场顶层设计，股票发行注册制要搞，但这需求一个较长的工夫，注册制变革不能“单兵突进”。去年股市异动中采取的措施防备了零碎性风险，为修复市场、建立市场、开展市场博得了工夫，目前市场已进入修复形态，一些暂时措施曾经加入，但谈中国证券金融公司的加入为时髦早。熔断机制运转后果与初衷背叛，将来几年我国以中小投资者为主体的市场构造不会发作基本性变化，不具有推出熔断机制的根本条件。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 全体来看受经济疲弱拖累股市弱势不改，反弹空间无限。两会政府任务报告确定多项经济增长目的，数字根本契合预期，估计对市场影响偏中性。本周两会行将落幕。周末统计局发布数据，喜忧参半，除房地产数据外其他均显示微观经济开年照旧疲软。以后现货市场反弹趋弱，股指期货投资者暂时张望，坚持逢高沽空思绪。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/finance/2968" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：今年或修改证券法稳定股市</a></span></p>', '周五股指期货收十字星。主力合约IF1603开于2980.2点，收在2986.6点，截止开盘下跌20.4点，跌幅0.68%。上证50股指期货收十字星线。截至开盘，主力合约IH1603收在2052.8点', '壹银添丰：周末股市喜忧参半', '壹银添丰,喜忧参半,股市', '周五股指期货收十字星。主力合约IF1603开于2980.2点，收在2986.6点，截止开盘下跌20.4点，跌幅0.68%。上证50股指期货收十字星线。截至开盘，主力合约IH1603收在2052.8点', '', '', '2016-03-14', '2016-03-14', '', '', 20),
(2970, 1, '壹银添丰：期指持续疲软，前景并不看好', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　本周市场维持震荡下跌态势，三大期指主力合约成交、持仓总量均有不同水平缩水。受害于蓝筹股屡次护盘，三大期指最终跌幅较校以开盘价来看，IF主力合约全周累计下跌2.16%，IH主力合约全周累计下跌2.29%，IC主力合约全周累计下跌0.71%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 截至周五开盘，沪深300期指主力合约IF1603跌20.4点，跌幅0.68%，开盘价2986.6点。上证50期指IH1603合约最终开盘价为2052.8点，下跌13点，跌幅0.63%。中证500期指IC1603合约最终开盘价为5413.2点，跌31.2点，跌幅0.57%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 期现价差方面，贴水较上周持续修复。截至昨日开盘，IF1603、IH1603、IC1603合约较现货指数间基差辨别31.68、17.92、95.78点。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 音讯面上，本周发布的2月份中国CPI同比增速为2.3%，远超预期的1.8%，而PPI同比仍下滑4.9%。上海中期剖析师王一鸣表示，局部投资者以为通胀程度的上升或将招致央行货币政策改动，因而局部资金持续离场，招致本周市场成交量进一步萎缩。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 本周成交持仓量缩水分明。周五，沪深300期指成交2.51万手，总持仓4.69万手。上证50期指成交8973万手，持仓1.94万手。中证500期指成交1.74万手，持仓2.8万手。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 中金所盘后持仓排名显示，IF1603合约前20名多头席位减持1387手至2.33万手，前20名空头席位减持864手至2.3万手。详细席位上，广发期货减持多单346手，中金期货减持多单252手，华泰期货减持空单484手。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; IH1603合约前20名多头席位减持941手至9659手，前20名空头席位减持734手至9904手，多空单方主力均减仓至1万手以下。IC1603合约前20名多头席位减持253手至1.31万手，前20名空头席位减持298手至1.3万手。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; <a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰有色金属</a>表示，将来或将打破多空僵持的场面。从周线来看，上证指数已延续横盘六周，行将面临方向选择。期指在现货指数上下两难的背景下更显纠结，价差构造重复变化。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 王一鸣进一步指出，本周市场虽然表现疲软，成交量进一步萎缩，但蓝筹股屡次呈现护盘举措，加之三大期指主力合约均存在贴水且临近交割日，招致本周期指市场跌幅较校总体来看，市瞅将维持弱势震荡态势，操作上建议多单慎重持有。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/industrynews/2969" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：周末股市喜忧参半</a></p>', '本周市场维持震荡下跌态势，三大期指主力合约成交、持仓总量均有不同水平缩水。受害于蓝筹股屡次护盘，三大期指最终跌幅较校以开盘价来看，IF主力合约全周累计下跌2.16%，IH主力合约全周累计下跌2.29%，IC主力合约全周累计下跌0.71%。', '壹银添丰：期指持续疲软，前景并不看好', '壹银添丰,期指,疲软,前景', '本周市场维持震荡下跌态势，三大期指主力合约成交、持仓总量均有不同水平缩水。受害于蓝筹股屡次护盘，三大期指最终跌幅较校以开盘价来看，IF主力合约全周累计下跌2.16%，IH主力合约全周累计下跌2.29%', '', '', '2016-03-14', '2016-03-14', '', '', 21),
(2971, 25, '壹银添丰：金价反弹趋势或难逆转', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　 &nbsp;金价涨势迅猛，能否应该持续看多买入？机构对此其实也相当纠结。一边是大行已预测部分见顶，另一方面，却有研讨机构及金矿商以为黄金还将继续下跌。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 海内大型投行在2月初就开端看空黄金，其中就包括了不断看空黄金的高盛。由于看好美国经济复苏，高盛一度预测黄金价钱短期会下行至1100美元/盎司的地位。即便2月中旬黄金大涨后，高盛依然预测金价一旦到达1205美元就可以做空，并在1291美元设立止损仓位。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 但是，全球经济震荡市场动摇难平，黄金一路猛涨。上周，欧洲央行再次开闸放水，随后金价一度打破1280美元关口，创下13个月以来的新高。高盛被不幸“打脸”。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 不过，投行似乎并没有改动观念。目前，另一知名投行瑞银依然以为金价涨势能够接近触顶，如今入场做多黄金曾经太迟，投资者在1310美元/盎司的价位可以思索减仓。大行预测目前金价曾经离开一个潜在的转机点。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 但是，黄金作为往年市场上表现最好的投资品，看多的机构并不逞强，已有研讨机构预测往年还会呈现第二波下跌。Ned Davis 研讨公司发现，遭到黄金ETF的继续资金涌入等要素影响，黄金在往年已下跌20%之后仍能够延续涨势。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 黄金热还在全球继续。2月，全球一切黄金上市产品已取得78亿美元资金流入，并创下单月流入历史新高。最近的资金强势流入能够会吸引更多的黄金临时投资者，并诱发将来数月资金持续流入黄金相关ETF.</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 2011年以来，黄金绝对于其他次要资产表现蹩脚，投资者对持有一种没有利息的产品并没有兴味。显然这一趋向发作了翻转，以后黄金的吸引力超越临时债券、股票甚至地产。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; Ned Davis研讨公司以为，最后金价的涨幅能够来自黄金投机商和买卖员的操作，但随着黄金在一众投资品中“鹤立鸡群”，便开端吸引其他临时的战略投资者的关注。最近曾经看到少量资金涌入实物黄金基金，假如战略投资者开端配置这一产品，将会有更多资金流入相关基金。该公司以为，黄金ETF对金价的抬升被之前的投资者所疏忽。实践上，往年以来已有57亿美元涌入全球最大的黄金ETF——美国上市的SPDR黄金ETF，而其他的包括ETFS实物瑞士黄金基金、iShares黄金信托、Van Eck Merk黄金信托也有资金不时涌入。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; <a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰有色金属</a>表示，短期黄金市场的心情十分纠结，货币政策是影响金价的最大变量。欧洲央行以及日本央行均将利息降至负利率，货币存在银行不如投资黄金，从而给予黄金更多的下跌空间。另一方面，全球货币当局的政策分化也能够会影响金价接上去的表现，美国经济的强势促使美联储提升加息志愿，从而推高美元价钱。由于全球黄金均以美元计价，美元的强势将招致其他地域购置黄金的价钱更贵，从而间接影响黄金走势。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 国信证券的最新研报也以为，投资者持有黄金已并非思索以后的时机本钱，而更多地思索到将来的时机本钱，即实践利率将来的变化。美联储加息预期的强弱无疑是左右将来实践利率变化的关键变量，从而对金价走势发生主导性的影响。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 另一大影响变量则来自通货收缩的预期发作改动。LPL金融剖析公司指出，在油价反弹等要素影响下，往年美国的CPI能够会增长至2%，通胀率若出乎市场预料地下跌将会安慰对黄金的需求。近期金价的下跌能够就包括了通胀的潜在影响，而这一市场环境是上一轮金价下跌所不曾遇到的外界要素。据理解，在2003年到2008年的黄金下跌时期，金价次要由美元走弱以及新兴市场少量消费的要素推进，而并非由通胀要素招致。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 黄金开采公司也显示出对将来金价的悲观。加拿大黄金开采公司New Gold上周就耗资200万美元买入1400美元的黄金看跌期权及1200美元的看多期权，虽然金矿公司首要的做法是对冲金价动摇风险，但也意味着这家金矿公司以为金价在目前的根底上还有下跌10%的空间，而且金价短期难跌破1200美元。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：&nbsp;<span style="font-family: Simsun; font-size: medium;">&nbsp;</span><a href="http://www.yytf099.com/finance/2968" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：今年或修改证券法稳定股市</a></span></p><p><br/></p>', '金价涨势迅猛，能否应该持续看多买入？机构对此其实也相当纠结。一边是大行已预测部分见顶，另一方面，却有研讨机构及金矿商以为黄金还将继续下跌。', '壹银添丰：金价反弹趋势或难逆转', '壹银添丰,金价,趋势', '金价涨势迅猛，能否应该持续看多买入？机构对此其实也相当纠结。一边是大行已预测部分见顶，另一方面，却有研讨机构及金矿商以为黄金还将继续下跌。', '', '', '2016-03-14', '2016-03-14', '', '', 20);
