(2972, 25, '壹银添丰：短期供需不平衡 商品期货过山车波动或常见', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp;　 关于大少数投资者来说，黑色系商品期货好像一阵旋风，忽然刮起又忽而歇息，发作了什么都还没来得及看清。没看清的能够不只是投资者，甚至包括专业的机构。直到周末，都还无机构试图解释清楚这一阵“黑旋风”的逻辑，以及接上去会发作什么。在综合多家机构的说法之后，逻辑渐渐明晰，但机构普遍以慎重为主，将来还需求看根本面的进一步引导。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 对商品期货下跌逻辑研讨最有代表性的，莫过于3月11日莫尼塔的研讨报告，该机构解释称，2016年以来的钢铁市场根本面逐步改善，但在临时产能过剩的暗影下，改善幅度无限。即便这样，中国钢铁市场有能够在短期内呈现市场不均衡的供给缺口。市场在年终活动性注入的支持下，充沛应用了这次短期的供不应求，缩小了价钱信号。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 该机构剖析，在供给端，2015年下半年以来钢铁市场供给逐渐增加。在需求端，2016年以来，钢铁行业下游有渐进式的回暖趋向。据莫尼塔调研，节后钢铁消费需求的回暖次要来自于根底设备投资的需求和局部制造业的回暖，但需求改善仅仅是无限的渐进式向好。下一步房地产市场的热度能否能转换为新开工面积，是决议钢铁市场2016年走势的重要要素。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 去产能方面，莫尼塔针对钢铁行业去产能的案例研讨标明，大中型钢厂去产能化尚未真正开端。典型案例标明，有大中型钢厂在遇到资金链危机时，外地政府积极介入，注入盘活资金，协调外地银行关系，以便救活钢厂。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 莫尼塔的草根调研显示，钢铁贸易商的资金面并没有实践改善。银行照旧对钢贸行业存款采取极端慎重的态度。在钢贸商资金没有充沛改善的前提下，我国钢铁市场缺乏无效的囤货蓄水池功用，限制了钢价将来的下跌空间。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; <a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰有色金属</a>以为，放眼将来，商品市场金消融和商品市场期货、现货市场联动将成为常态。受金融力气影响，产能过剩暗影下的商品市场也会常常由于短期的供需不均衡，而呈现过山车似的价钱动摇。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 在讲清楚了商品期货的下跌逻辑之后，接上去机构对后市如何判别呢？</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 较为慎重的如国信期货，该机构称，由于下游需求并没有明显改善，疾速下跌200~300元的低价钢材现货难以承受，不宜自觉追涨。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 广州期货的态度也比拟明白。该机构称钢材后期价钱暴跌，已透支了将来一段工夫的需求，随着供应端不时释放，现货市场报价呈现松动，大少数地域选择降价出货，全体上进入价钱修复期。前期能否持续下跌，还有待需求证伪，若需求不如预期，钢价恐呈现较大幅度下跌。从资金面看，主力做空志愿较强，目标也收回卖出信号，可尝试性加空单。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 中性偏悲观如中信期货，该券商称上周四现货市场上，钢厂推销心态坚持慎重，贸易商心态分化，局部贸易商开端以较低价出货，另有局部贸易商坚决看好后市，估计现货近期坚持坚硬。逻辑在于钢厂利润大幅恶化，复产预期不减；同时，港口到货量依然偏低，且从发货量和船期推算，3月中旬前，到港压力都不大。期货价钱估计高位偏强震荡。在操作上，中信期货以为，市场反映了在阅历了暴跌暴涨之后，也进入了暂时的迷茫和张望阶段，等候根本面进一步的指引。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 值得一提的是，期货市场的兴隆，也会反映到A股市场上，中国中期就是如此。盘面显示，该股3月8日收盘即发力，用了10分钟左右冲击涨停，并且于第二天盘中再度冲击7%以上的涨幅。至于被市场喜爱的理由，正是由于该公司持有中国国际期货(博客,微博)无限公司19.76%的股权，并且中国中期控股股东中期集团手中也握有中国国际期货无限公司的股权。中国国际期货无限公司次要从事商品期货经纪、金融期货经纪业务，是我国成立最早、规模最大、营运最标准的大型期货公司之一。&nbsp;</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/finance/2971" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：金价反弹趋势或难逆转</a></span></p><p><br/></p>', '关于大少数投资者来说，黑色系商品期货好像一阵旋风，忽然刮起又忽而歇息，发作了什么都还没来得及看清。没看清的能够不只是投资者，甚至包括专业的机构。', '壹银添丰：短期供需不平衡 商品期货过山车波动或常见', '壹银添丰,供需,商品期货', '关于大少数投资者来说，黑色系商品期货好像一阵旋风，忽然刮起又忽而歇息，发作了什么都还没来得及看清。没看清的能够不只是投资者，甚至包括专业的机构。', '', '', '2016-03-14', '2016-03-14', '', '', 24),
(2973, 25, '壹银添丰：全球石油冻产协议或提升油价', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　 &nbsp;俄罗斯动力部长诺瓦克(Alexander NoVak)3月14日完毕在德黑兰的商洽后标明，有关冻住石油产量的全球性协议或许在4月签署，但伊朗应当打扫在外，该国在遭受多年制裁后有权增产。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　3月14日国际油价大跌约3%，因此前伊朗方面标明，在本国石油产量抵达400万桶/日后才会参与冻产商洽，因此很快到达全球规模联手稳产协议的希望幻灭。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　全球四大产油国(俄罗斯、沙特阿拉伯、卡塔尔和委内瑞拉)上月在多哈开会，称准备将产量保持在1月水平，条件是其它产油国也要这么做。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;"><strong>壹银添丰有色金属交易中心</strong></a>称，估量4月可以到达冻产支撑油价的毕竟协议，或许仍是在多哈。一起，该协议或许将伊朗打扫在外，因该国在国际制裁撤销后希望能恢复产量。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　诺瓦克在与伊朗石油部长尚甘尼(Bijan Zanganeh)商洽后标明，“我们也认同这么的观念，伊朗情况格外。以往的制裁严重冲击了伊朗的出产。”</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　外界认为俄罗斯和伊朗的联络和睦。俄罗斯政府曾坚决支撑撤销关于伊朗核计划实施的国际制裁。这些制裁实际上在1月被撤销，从而为伊朗添加原油产量铺平了路程，但也给本已紧张不安的油市添加了不确定性。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　伊朗如今的原油产量约为310万桶/日。受制裁举动影响，近期几年伊朗的原油出口量从2011年前的高位250万桶/日，降至略高于100万桶/日。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　诺瓦克指出，“整体而言，伊朗拥护石油出口国之间有必要进行协作，包含或许的冻住产量。但伊朗的情绪是，他们必须先恢复产量，在此之后他们才会准备参与冻产。”</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　诺瓦克还补偿道，油市如今更加平衡了，但他呼吁到达一项强有力的安稳产量协议，不然商场将面临更多不确定性，这将致使更多的动摇。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　他估量到今年年底，油价料将在每桶40-50美元之间，如今的油价略低于每桶40美元。&nbsp;</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇：<a href="http://www.yytf099.com/industrynews/2970" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：期指持续疲软，前景并不看好</a></span></p>', '俄罗斯动力部长诺瓦克(Alexander NoVak)3月14日完毕在德黑兰的商洽后标明，有关冻住石油产量的全球性协议或许在4月签署，但伊朗应当打扫在外，该国在遭受多年制裁后有权增产。', '壹银添丰：全球石油冻产协议或提升油价', '石油,冻产,油价', '俄罗斯动力部长诺瓦克(Alexander NoVak)3月14日完毕在德黑兰的商洽后标明，有关冻住石油产量的全球性协议或许在4月签署，但伊朗应当打扫在外，该国在遭受多年制裁后有权增产。', '', '', '2016-03-15', '2016-03-15', '', '', 21),
(2974, 25, '壹银添丰：铜价稳中回跌，前景看好', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　 &nbsp;行业新闻：澳新银行研讨表明，大宗产品最坏的时期也许已经曩昔，不过各个种类从低位走出来根据的条件有区别，每个产品供需面收紧的速度都不相同。在一些产品商场，供给添加行将迎来最终一个浪潮，这也许进一步加重供给过剩的现状。现在投资者正亲近重视产品的基本面收紧的转折点。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　行情回忆： LME铜持续收拾，14日一度重回5000美元/吨上方，然后冲高回落，收盘4954.50美元/吨，升0.12%，持仓为34.28万手，持仓量开端削减。沪铜1605合约回落，收盘37410元/吨，持仓27.98万手，国内总持仓72.04万手，主力合约占合约总持仓的38.84%。国内持仓添加，报价振荡收拾。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰有色金属</a>报价：长江现货03月14日涨510元/吨，至37570元/吨；对1605贴水180元/吨。广东现货涨350元/吨，至37450元/吨，对1605贴水300元/吨。上海电解铜现货对当月合约报贴水30元/吨-升水30元/吨，平水铜成交报价37220元/吨-37680元/吨，升水铜成交报价37250元/吨-37720元/吨。显现难得的交投活泼，交割前现铜升水或仍有上涨空间。废铜方面，废铜持货商报价持续举高近400元/吨，商场成交尚可，按需入市接货，全体成交空气稍显改进。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　逻辑主张：对中国经济预期将变成将来一段时间的重视焦点。新年期间，因日本负利率股动日元增值引起的金融商场动荡局势有所缓解，但仍需警觉。铜价维持在一个震动区间，LME在4500-4800美元/吨，沪铜35000-37500元/吨。近期，铜价遭到商场心情推进走高，打破压力后，后市有用收拾后仍有阶段性上扬时机。现在重视铜价回跌整固的状况。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇：<a href="http://www.yytf099.com/finance/2973" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：全球石油冻产协议或提升油价</a></span></p><p><br/></p>', '行业新闻：澳新银行研讨表明，大宗产品最坏的时期也许已经曩昔，不过各个种类从低位走出来根据的条件有区别，每个产品供需面收紧的速度都不相同', '壹银添丰：铜价稳中回跌，前景看好', '铜价,壹银添丰,回跌', '行业新闻：澳新银行研讨表明，大宗产品最坏的时期也许已经曩昔，不过各个种类从低位走出来根据的条件有区别，每个产品供需面收紧的速度都不相同', '', '', '2016-03-15', '2016-03-15', '', '', 19),
(2975, 1, 'WTI油价跌超4% 国内夜盘期货普跌', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　尽管产油量下滑的预期对油价供应了一些支撑，但商场仍对过量供应和疲弱的经济前景持有忧虑。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　伊朗短期没有减产或许，也没有限产或许。该国标明，不会考虑参与冻住产量的国际商洽，除非本国原油产量增加至400万桶/天。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　产油大国沙特2月的原油产量则与1月底子持平。外媒援引知情人士，沙特阿拉伯2月原油产量持稳于1022万桶/日，迫临前史峰值；2月向商场供应1040万桶/日，因有些供应来自库存。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　摩根士丹利在周一发布的研报中标明，“套期保值加上库存空间紧急”限制了美国WTI油价上涨，意味着生意员正兜销原油期货合约，以对冲远期产量和存储空间的疑问。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　摩根士丹利强调，即使美元指数持续回调，原油近月期货合约也将很难突破45美元。高盛上星期称，估量二季度原油生意区间在每桶25-45美元，高于一季度的20-40美元。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　高盛和巴克莱警告称，全球过剩产量约为100万桶，这将令油价重回下跌通道。“若要商场从头回归平衡，则油价低于每桶40美元的时间最少为两个季度。”巴克莱周一如此标明。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　不过，投机者正在增持原油净多仓。美国商品期货生意委员会(CFTC)数据闪现，到3月8日当周，对冲基金与其他大型投机客增持NYMEX WTI原油期货和期权合约净多头头寸39509手，至174949手。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰有色金属</a>持有相对达观的态度。该行上星期标明，原油等大宗商品商场正闪现出一种痕迹，即商场失调形势的最坏形势或许现已过去了，投资者心境现已有所改善，原因是在商场底子面稍微改善的形势下，投资者认为下行危险的或许性有所降低；美元走强和股市不坚定所带来的逆风现已有所削弱，商场正在日益将注重焦点放在大宗商品价格下跌所带来的长时间影响上。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　IEA对于油价是不是触底的区分近期发生了180度大转变。该组织上星期发布月报称，因OPEC以外的高本钱原油供应减少，组织内部的产量降低，全球过剩规划减缩，油价或已触底。这和二月月报的基调显着不一样，IEA当时称因为商场仍严峻过剩，油价或进一步下跌。此外，IEA认为产量冻住协议上半年不太或许持续支撑油价。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　摩根士丹利近期也标明，油价或许现已见底。“就如今来看，油价如同现已触及底部，尽管或许在本年的剩下时间都会坚持疲软。2017年将初步反弹。”</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　但摩根士丹利一同警告称，持续放缓的经济和高产量将阻遏油价大幅上升。该行估量，全球性经济衰退的概率约为30%。&nbsp;</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇：<a href="http://www.yytf099.com/finance/2972" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：短期供需不平衡 商品期货过山车波动或常见</a></span></p><p><br/></p>', '尽管产油量下滑的预期对油价供应了一些支撑，但商场仍对过量供应和疲弱的经济前景持有忧虑。', 'WTI油价跌超4% 国内夜盘期货普跌', '油价下跌,期货普跌,WTI', '尽管产油量下滑的预期对油价供应了一些支撑，但商场仍对过量供应和疲弱的经济前景持有忧虑。', '', '', '2016-03-15', '2016-03-15', '', '', 16),
(2976, 1, '壹银添丰：国外铜供应稳定，铜价变化不大', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰有色金属</a>逻辑：近期嘉能可发布2016年的产值目标，仅比2015年下调10万吨摆布，而且2015年嘉能可实践产值降低非常细小，显示出即使当时市场环境，干流铜矿供货商实在减缩生产志愿不强。而以智利国家铜业公司为代表的矿山尽力在降低成本，加上全体供给的添加，中期铜报价仍然面临压力。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　短期逻辑： 2月份我国精炼铜和铜精矿进口均同比大幅添加。1-2月份我国十种有色金属产值同比降低4.3%，不过，当时短期的逻辑仍然智利和秘鲁铜供给增速不及预期，估量市场在见到供给添加前，短期支持也许持续。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　日内走势：沪期铜主力合约1605日内收盘在37750元/吨，最低报价37500元/吨，最高报价38140元/吨。夜盘收报37410元/吨，较昨天结算价跌落360元/吨。同期，伦铜较上个交易日上涨0.12%，收报4954.5美元/吨。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　14日日内以及夜盘，铜报价全体上冲高回落，不过当时短期逻辑并未发生本质改动，国外铜供给释放速度不及预期的格式没有改动；虽然我国1-2月份铜精矿进口同比大增，但估计也许是锻炼公司为交储所进口，而精炼铜进口的添加归于全球范围内的库存搬运，现在表里比价现已批改，因而进口添加不能作为跌落的动力；但中期来看，铜供给释放是大方向，关于中期铜报价我们仍然不看好。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;"> &nbsp; &nbsp;上一篇：<a href="http://www.yytf099.com/industrynews/2975" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">WTI油价跌超4% 国内夜盘期货普跌</a></span><br/></p>', '中期逻辑：近期嘉能可发布2016年的产值目标，仅比2015年下调10万吨摆布，而且2015年嘉能可实践产值降低非常细小，显示出即使当时市场环境', '壹银添丰：国外铜供应稳定，铜价变化不大', '铜供应,铜价,壹银添丰', '中期逻辑：近期嘉能可发布2016年的产值目标，仅比2015年下调10万吨摆布，而且2015年嘉能可实践产值降低非常细小，显示出即使当时市场环境', '', '', '2016-03-15', '2016-03-15', '', '', 17),
(2977, 1, '壹银添丰：矿企频繁融资 大宗商品回暖', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; <a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>2月16日，中金岭南发布定增预案，称公司拟以不低于9.16元/股非公开发行不超越2.13亿股，募集资金总额不超越19.5亿元，用于尾矿资源综合回收及环境管理开发、高新技术资料及有色金属商品报价及线上买卖平台等项目及补充活动资金。公司称，此次定将增促进公司业务晋级转型，并将有助于公司在传统业务根底上，切入资源综合应用、环境管理、高新技术资料以及产业链综合效劳等范畴，培育新的利润增长点等。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　另外，江西铜业也于2月25日公告称，公司拟以不低于11.37元/股的价钱，向包括公司控股股东江铜集团在内的不超越10名特定对象，非公开发行不超越2.98亿股，募集不超越35亿元。据悉，上述资金将用于城门山铜矿三期扩建工程项目、银山矿业公司深部挖潜扩产技术改造项目、德兴铜矿五号（铁罗山）尾矿库项目建立，剩余金额补充活动资金。公司表示，拟募投的扩建、技改项目将协助公司稳步扩展矿山产能范围，进一步提升原料自给率，降低本钱，并稳固市场位置，为将来开展奠定坚实的根底。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　导报记者留意到，上述公司主业触及铜、铝、锌等有色金属矿产品开采加工，而在今年一季度，上述金属价钱一改去年低迷走势，走出一波上涨行情。如沪锌主力合约从去年的11815元/吨，涨到14220元/吨，涨幅20%；沪铜主力合约同期涨幅也超越10%。固然与铁矿石一度高达50%的涨幅仍有差距，但的确提振了市场。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“局部金属价钱强势反弹，令市场资金面开端倾向大宗商品的底部构成，对上市公司经过定增‘抄底’扩产的态度也有所改观。”中诚参谋首席投资参谋王瑞鑫对导报记者表示，相关矿产公司股价受利好快速走高，也给发行方推进定增发明了较好条件。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　不过，受访业内人士表示，目前大宗商品市场仍处于猛烈动摇中，能否真正回暖仍有待考量。“矿产公司限产去库存及中国经济变革预期，应是此轮大宗商品上涨的主因，但实体经济需求仍未呈现明显好转，市场根本面仍缺乏持续走好的支撑。”王瑞鑫说，倡议投资者对相打开市公司的定增动作慎重看待，防备后期市场回落的风险。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/industrynews/2976" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：国外铜供应稳定，铜价变化不大</a></span></p>', '如2月16日，中金岭南发布定增预案，称公司拟以不低于9.16元/股非公开发行不超越2.13亿股，募集资金总额不超越19.5亿元，用于尾矿资源综合回收及环境管理开发、高新技术资料及有色金属商品报价及线上买卖平台等项目及补充活动资金。', '壹银添丰：矿企频繁融资 大宗商品回暖', '壹银添丰,矿企,融资,回暖,大宗商品', '如2月16日，中金岭南发布定增预案，称公司拟以不低于9.16元/股非公开发行不超越2.13亿股，募集资金总额不超越19.5亿元，用于尾矿资源综合回收及环境管理开发、高新技术资料及有色金属商品报价及线上', '', '', '2016-03-16', '2016-03-16', '', '', 15),
(2978, 1, '壹银添丰：第一季度铁矿石走俏', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　春节后至今，黑色产业链呈现了大幅上涨走势，铁矿石更是其中的领涨种类。一方面是供应端的时节性收缩，到港量持续低位。另一方面是需求端的阶段性复苏，钢厂在阅历了2015年9月以来长时间的减产周期后，春节后在需求复苏、利润好转的状况下，开端了集中复产。但是阅历了上周的猛烈动摇之后，本周铁矿石进入高位整理格局。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　现货市场根本面照旧平稳</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>综合来看，目前现货根本面总体照旧平稳。现货价钱在阅历了暴跌之后开端稳步回落。但钢厂复产的增加保证了刚需的存在，在暴跌时暂停采购的钢厂，周一在价钱回落时，询盘量明显增加。因而，现货价钱近期将坚持平稳态势。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　我们对1605合约单边走势维持高位整理观念。主要逻辑在于，现货价钱估计维持高位整理，大涨和大跌的动力目前都没有看到。而期货价钱在周一创出新高后疾速跳水，上方压力凸显。同时，1605合约期价的贴水幅度曾经明显收窄，截至周一，1605合约期价相比普氏指数贴水28元/吨，相比日照港PB粉现货贴水54元/吨，这个程度曾经是近期较低的贴水幅度，加上目前处于3月中旬，间隔1605合约交割还有两个月的时间，期现价差对行情的支撑依然较弱，供需面依然是行情的主导要素。在现货价钱高位整理的状况下，估计近期1605合约运转区间在406—430元/吨。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　月间价差方面，1605与1609合约价差近期不断在45点以上。我们以为，这个价差程度在距交割月还有两个月的状况下，无论是相比历史区间，还是1605与1609合约之间的理论持仓本钱，都处于偏高程度。同时，5月相对普氏以及现货也处于低贴水区间。能够思索在45点以上停止1605与1609合约价差的反套操作。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　种类间对冲方面，我们以为，买铁矿石抛螺纹钢照旧能够持有，依据目前的钢厂盈利状况，根本面逻辑仍然成立。平仓信号方面，倡议关注以下几点，一是高炉开工率坚持平稳不再增加，二是现货炼钢利润下跌至0到亏损200元/吨区间。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/industrynews/2977" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：矿企频繁融资 大宗商品回暖</a></span></p>', '春节后至今，黑色产业链呈现了大幅上涨走势，铁矿石更是其中的领涨种类。一方面是供应端的时节性收缩，到港量持续低位。', '壹银添丰：第一季度铁矿石走俏', '壹银添丰,铁矿石', '春节后至今，黑色产业链呈现了大幅上涨走势，铁矿石更是其中的领涨种类。一方面是供应端的时节性收缩，到港量持续低位。', '', '', '2016-03-16', '2016-03-16', '', '', 20),
(2979, 25, '壹银添丰：持仓分析', '<p>　<span style="font-family: 宋体, SimSun; font-size: 16px;"> &nbsp;周二，三大股指期货走势悬殊，中证500指数期货最弱，加权指数下跌1.37%，上证50指数期货局部翻红，较为强势。从不同板块涨跌幅上剖析，中小板和创业板或迎来调整，而主板特别是权重股较为强势，护盘迹象明显。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　据<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>统计，沪深300期指主力合约IF1603报3046.6点，高于上一买卖日的收盘价3042点。四份合约持仓量合计为46635手，比前一买卖日减少689手，成交量环比减少1495手。主力合约IF1603持仓量减少4694手至23164手，成交量环比减少2778手。由于本周1603合约面临交割，主力正在移仓换月，且近期并没有太多的利多音讯，这使得股市张望氛围较浓。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　主力持仓方面，前20名席位在IF1603合约上，共持买单17440手、卖单17335手。主力净多持仓量105手，多头力气略强于空方。交割日临近，多空双方均选择继续减仓，空头减持力度略大于多头。详细席位方面，主力合约持买单前20名中，减持多单的公司比例为100%，其中国泰君安期货、中金期货等席位公司减持多单均超越500手，减持超越百手的席位占比为60%。持卖单前20名中，全部减持空单，其中中信期货席位减持数量超越800手，其他公司减持数量都在300手以内。局部期货公司的头寸正在向IF1604合约上转移。前20席位在IF1604合约上，共持买单10097手、卖单10184手，较上一买卖日分别增持3052手、2767手。在持买单排行榜上，一切会员全部选择增持，其中国泰君安期货、中金期货席位增持手数超越500手，超越100手的期货公司占比为50%。持卖单前20名的会员中，有两家选择减持，其他公司都在增持，增持的数量也都在500手之内，这意味着多头力气悄然增长，市场心情正在变暖。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　总体剖析，多头渐渐积存力气，空头前期优势正被一点点蚕食。此外，近期动摇幅度明显降低，有利于市场心情稳定。由于交割日临近，主力战场逐步转移到1604合约上，我们以为，将来股市或将持续小幅振荡上行的格局。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;上一篇文章：<a href="http://www.yytf099.com/finance/2974" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：铜价稳中回跌，前景看好</a></span><br/></p>', '周二，三大股指期货走势悬殊，中证500指数期货最弱，加权指数下跌1.37%，上证50指数期货局部翻红，较为强势。从不同板块涨跌幅上剖析，中小板和创业板或迎来调整，而主板特别是权重股较为强势，护盘迹象明显。', '壹银添丰：持仓分析', '壹银添丰,持仓', '周二，三大股指期货走势悬殊，中证500指数期货最弱，加权指数下跌1.37%，上证50指数期货局部翻红，较为强势。从不同板块涨跌幅上剖析，中小板和创业板或迎来调整，而主板特别是权重股较为强势，护盘迹象明', '', '', '2016-03-16', '2016-03-16', '', '', 13),
(2980, 25, '壹银添丰：负利率时代黄金成2016投资热门', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　进入2016年，国内黄金价钱随国际金价强劲反弹。来自<a href="http://www.yytf099.com/" style="font-size: medium; white-space: normal; font-family: Simsun; color: black; text-decoration: none;">四川川商商品交易中心</a>的最新数据显现，截至3月11日收盘，Au9995和Au9999分别收报264.54元和264.97元，较上年末上涨17.8%和18.9%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　金价走高带动与黄金相关的投资品热销。作为境内市场范围较大的黄金ETF，华安黄金ETF3月1日持仓范围首度打破10吨，截至3月11日已超越13吨，较年初翻了两番，年内日均成交逾5亿元钱。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“基于多方面要素，居民和机构关于黄金的投资需求正在快速升温。”华安基金事业部总经理许之彦剖析以为，一方面，2016年全球经济仍然面临风险，推升了关于黄金的避险需求。另一方面，权益类资产动摇加剧，投资者纷繁配置更多元化的资产，躲避单一种类投资风险。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　虽然受欧洲央行不测降息刺激，近期国际金价一度攀上每盎司1283美圆的一年多新高，但与每盎司1920美圆的历史高点相比，跌幅仍达33%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　近年来，我国民众理财认识不时提升，“不要把鸡蛋放在一个篮子里”的投资金律取得日益普遍的认知。特别是随同“负利率时期”的降临，具备良好抗通胀才能的黄金正被越来越多的普通投资者归入资产配置篮子。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　继实物黄金、纸黄金之后，黄金ETF逐步成为黄金投资的主流渠道。许之彦表示，作为一种具有实物支撑的证券化投资产品，黄金ETF具备T+0日内回转、可作为融资融券标的等买卖性优势，与股票等权益类资产也呈现出显著的负相关性，因而遭到众多投资者喜爱。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　华安基金总经理童威表示，我国早已是全球最大的黄金消费国和消费国，但黄金在居民和机构资产配置中的比例明显偏低。包括中国版黄金ETF在内，黄金资产配置在我国尚有宏大开展空间。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/finance/2979" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：持仓分析</a></span><br/></p>', '进入2016年，国内黄金价钱随国际金价强劲反弹。来自上海黄金买卖所的最新数据显现，截至3月11日收盘，Au9995和Au9999分别收报264.54元和264.97元，较上年末上涨17.8%和18.9%。', '壹银添丰：负利率时代黄金成2016投资热门', '壹银添丰,负利率,投资热门', '进入2016年，国内黄金价钱随国际金价强劲反弹。来自上海黄金买卖所的最新数据显现，截至3月11日收盘，Au9995和Au9999分别收报264.54元和264.97元，较上年末上涨17.8%和18.9', '', '', '2016-03-16', '2016-03-16', '', '', 21),
(2981, 1, '壹银添丰：黄金ETF减仓但白银ETF继续增仓', '<p><span style="font-family: 宋体, SimSun; font-size: 18px;">　<span style="font-family: 宋体, SimSun; font-size: 16px;">　<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>在周二(3月15日)发布的报告中称，全球最大的黄金ETF呈现了自去年以来的初次单日减仓最多的状况，但白银ETF持仓仍持续增加。跟踪商品价钱的贵金属ETF在股市买卖，需贮存金银来支撑其股价。周一黄金ETF录得减仓5.3吨，在时自12月以来单日减仓最多的。总体而言，2016年仍以增仓为主。</span></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　德银称“不知为何市场察看家们没有留意到，白银ETF目前很受欢送，彭博跟踪的白银ETF在连续9日增仓之后昨日继续扩张。”“今年以来已增仓474吨，简直与去年的减仓(524吨)相当。ETF的增仓得益于银价走低。白银今日早间的买卖价位15.30美圆/盎司。”&nbsp;</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/industrynews/2978" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：第一季度铁矿石走俏</a></span></p>', '德国商业银行在周二(3月15日)发布的报告中称，全球最大的黄金ETF呈现了自去年以来的初次单日减仓最多的状况，但白银ETF持仓仍持续增加。', '壹银添丰：黄金ETF减仓但白银ETF继续增仓', '壹银添丰,黄金ETF,白银ETF', '德国商业银行在周二(3月15日)发布的报告中称，全球最大的黄金ETF呈现了自去年以来的初次单日减仓最多的状况，但白银ETF持仓仍持续增加。', '', '', '2016-03-17', '2016-03-17', '', '', 27),
(2982, 1, '壹银添丰：负利率时代 黄金或继续受宠', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 年初以来，国际金价上涨幅度逾18%，黄金的每一次回调都成了多头增筹的良机。在2月中旬金价进入调整节拍后，对冲基金黄金多头曾经连续三周增仓。上周五以来，在美联储会议召开之际的市场慎重心情中，金价连续回落。但剖析人士以为，从宏观角度来看，2016年后，全球主要经济体货币政策宽松大潮愈演愈烈，黄金市场曾经进入气氛，且全球避险需求也不时为金市积累人气，经过下行修整，金价持续上行的概率仍较大，而回调行情或为逢低买盘增筹提供时机。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　为提振通胀和压低汇率，日本央行在1月底试水负利率形式，市场由此预期将来全球央行货币政策将愈加宽松。固然负利率能否真正起到提振经济的作用还值得商榷，但负利率的背后可能引发全球货币竞相贬值趋向却日渐明显。招金期货研讨员李晓杰以为，采取负利率实践上是经过尽可能低地维持实践利率，刺激信贷以及削弱本币，增加出口，刺激本国经济增长，完成充沛就业，从而减缓本国危机，但这同时也转嫁了危机到邻国，很容易引发各国在降低负利率或货币贬值方面展开剧烈竞争，进而使得各国央行彼此削弱处理问题的才能，降低货币政策边沿效应，这会加压当前疲弱的全球经济。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰有色金属</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">说，美圆不断被以为是美国低通胀、油价下跌、出口增长疲弱、海外销售放缓和业绩乏善可陈的关键要素。在全球经济面临转型之际，当前美圆稳定运转对美国本身经济更有利，因而美联储在3月和4月加息的概率较低，这无疑会增加将来金市多头的“底气”。他估计，由宏观环境决议的市场多头气氛短时不会疾速改动，因而黄金作为市场宠儿的位置将暂不会动摇。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/industrynews/2981" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰：黄金ETF减仓但白银ETF继续增仓</span></a></p>', '年初以来，国际金价上涨幅度逾18%，黄金的每一次回调都成了多头增筹的良机。在2月中旬金价进入调整节拍后，对冲基金黄金多头曾经连续三周增仓。', '壹银添丰：负利率时代 黄金或继续受宠', '壹银添丰,负利率,黄金', '年初以来，国际金价上涨幅度逾18%，黄金的每一次回调都成了多头增筹的良机。在2月中旬金价进入调整节拍后，对冲基金黄金多头曾经连续三周增仓。', '', '', '2016-03-17', '2016-03-17', '', '', 26),
(2983, 25, '壹银添丰：原油价格的反弹走势不容乐观', '<p>　<span style="font-family: 宋体, SimSun; font-size: 16px;"> &nbsp;<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;"><strong>壹银添丰有色金属交易中心</strong></a>消息，关于近日的原油出产国的针对暴跌的原油价钱开端才去的一系列的提振措施，伊朗总统鲁哈尼则表示，此前伊朗不减产只是的为了拿回制裁前的市场占有量，制裁解除后伊朗夺回市场份额的计划正在奏效，伊朗方面表示在过去的两个月里伊朗的日出口增加四十万桶，这以数值明显超出此前业内人士的预估值，消息显现固然伊朗反面有了明显的效果但是这比伊朗等候的目的没能达成，伊朗的态度很明白的表示过，减产等我们拿回我们的市场份额再说。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　近期阿联酋石油部长表示，原油输出国组织态度都是与其他非成员产油国协作不时坚持开放，目前的原油价钱使得大部分产油国都愿意支持产量冻结的这一提议，往常的原油价钱使得多数原油出产国没有什么理由在往常的方式下增加本国的产量，产量冻结固然不能挽救往常的原油价钱，但是就长远来看是有辅佐的，在一定程度上缓解的供应过剩的长期格局。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　消息显现各出产国产量冻结也是持有不同意见，但是整体来看原油市场的格局往常处于相对的平稳状态，原油出产国科威特公开表示就产量冻结，只需包括伊朗在内的一切主要产油国都同意冻结，科威特才会同意冻结产量的协议，科威特往常的日产量在三百万桶左右，往常来说原油市场的协商冻结产量来挽救原油价钱伊朗仍是一个不安定的影响要素。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　消息显现分析师预估，就上周美国原油的库存就增加了三百六十万桶左右，这使得总库存连续第四周坚持上升高记载，北海的海原油供预估在下个月会抵达四年来的高产，这曾经是连续第八个月日产量高于两百万桶的持续走势上，美国能源资料协会(EIA)在短期能源展望中称，预估本年美国原油日产量将减少76万桶，并表示激进估量本年美国原油日消耗量将增长八万桶左右。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　业内人士表示，表面上看是由于周度库存数据拉低了原油价钱走走势，但是理论是由于科威特的言招致了市场的不安定心情影响了昨天的原油价钱下滑的主要素，在当前的大环境下，原油价钱继续上涨根本没有有力的支撑点，各原油出产国之间见地很难统一即时全球的出产国都同意将本国的产量冻结就短期而言辅佐也不是很大，由于各国一月的原油产量都曾经基本是各国最大产量，整体来看缓解往常油市的供应过剩问题才是价钱走升的主要支撑，就美国的页岩油来说在市场上也占有很大的份额，但是就往常的原油价钱页岩油依然可以坚持是盈利的，想让美国再度减产基本就没可能，欧佩克以及俄罗斯就算是真正的冻结了本国的产量往常的就是的市场的消耗量来说依然还是严重的过剩，库存依然每天都在增加，近期原油价钱的反弹走势不会持续很久。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/finance/2980" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：负利率时代黄金成2016投资热门</a></span></p><p><br/></p>', '壹银添丰有色金属交易中心消息，关于近日的原油出产国的针对暴跌的原油价钱开端才去的一系列的提振措施，伊朗总统鲁哈尼则表示', '壹银添丰：原油价格的反弹走势不容乐观', '壹银添丰,原油,反弹', '壹银添丰有色金属交易中心消息，关于近日的原油出产国的针对暴跌的原油价钱开端才去的一系列的提振措施，伊朗总统鲁哈尼则表示', '', '', '2016-03-17', '2016-03-17', '', '', 20),
(2984, 25, '壹银添丰：现货市场疲软，钢，铁矿石未来出路在何方', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　 &nbsp;上周五(3月4日)夜盘以来，螺纹钢、铁矿石期货价钱连续上涨。本周前两个买卖日，热轧卷板、螺纹钢、铁矿石主力1605合约连续以涨停板收盘，期货市场“黑色系”涨势凶猛。详细种类而言，昨日除了铁矿石、螺纹钢、热轧卷板期货涨停以外，硅铁期货价钱上涨5.70%，焦炭期货价钱上涨4.10%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>记者咨询业内人士得知，当前螺纹钢和铁矿石期价走强主要受前期去产能和后来的货币政策、节后复产带来的现货端价钱大涨支撑。3月以来的前6个买卖日，铁矿石期货价钱累计上涨超越16%，热轧卷板、螺纹钢、焦炭期价同期分别上涨15.74%、13.15%和6.89%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　周一，国际铁矿石现货价钱涨幅接近20%，至62.6美圆/吨，创2009年有纪录以来最大单日涨幅。截至目前，铁矿石期货较现货价仍有贴水。剖析人士以为，这是铁矿石期价上涨的最主要动力，而支撑铁矿石现货上涨的主要缘由则在于市场对国内经济构造性变革以及全球偏宽松活动性等存在利好预期。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　在3月8日盘中开板期间，大局部抗风险才能较弱的投资者曾经选择离场，成交持仓来看，换手相对充沛，风险曾经得到一定水平释放。其中，铁矿石主力1605合约8日的换手率为1.54倍，螺纹钢主力1605合约8日的换手率为3.89倍，风险接受才能较弱者大多或已换手出局。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　在买卖风险控制方面，市场人士以为，从目前的风险状况来看，国际市场及现货市场均已现疲弱态势，5月合约离目前尚有2个月时间，5月市场状况亦将会呈现较大变化，故铁矿石和钢材期货等行情会趋向缓和或走弱。从昨日市场表现看，接下来即便铁矿石和钢材呈现极端的单边三板行情，市场人士以为也将是强弩之末。而从两买卖所现有风控规则看，如呈现单边无报价三板行情，则也会相应地有或调整保证金、涨跌停板或强减等多种选项，这需求买卖所监测剖析和判别。从市场当前表现看，以温和的市场化手腕化解风险的可能性更高，参与者不用惊惶。&nbsp;</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/finance/2983" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：原油价格的反弹走势不容乐观</a></span></p>', '上周五(3月4日)夜盘以来，螺纹钢、铁矿石期货价钱连续上涨。本周前两个买卖日，热轧卷板、螺纹钢、铁矿石主力1605合约连续以涨停板收盘，期货市场“黑色系”涨势凶猛', '壹银添丰：现货市场疲软，钢，铁矿石未来出路在何方', '壹银添丰,市场疲软,现货市场', '上周五(3月4日)夜盘以来，螺纹钢、铁矿石期货价钱连续上涨。本周前两个买卖日，热轧卷板、螺纹钢、铁矿石主力1605合约连续以涨停板收盘，期货市场“黑色系”涨势凶猛', '', '', '2016-03-17', '2016-03-17', '', '', 20);
