(2985, 1, '壹银添丰：郑州物流中心铝期货交割库揭牌', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>3月17日，中储发展股份有限公司郑州物流中心上期所铝期货指定交割库举行揭牌仪式，中储股份郑州物流中心负责人与上期所相关人士共同为交割仓库揭牌。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　据了解，中储发展股份有限公司郑州物流中心和洛阳分公司仓库今年3月1日获批成为上期所铝期货指定交割库，初始核定库容均为1万吨。河南是铝制品重要的生产基地和消费地，在此设立铝期货交割库有利于吸引铝制品上下游企业参与期货市场，提升现货企业的参与度，可更好地为国内电解铝产业转型升级服务。</span></p><p>&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/industrynews/2982" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：负利率时代 黄金或继续受宠</a></p>', '3月17日，中储发展股份有限公司郑州物流中心上期所铝期货指定交割库举行揭牌仪式，中储股份郑州物流中心负责人与上期所相关人士共同为交割仓库揭牌。', '壹银添丰：郑州物流中心铝期货交割库揭牌', '壹银添丰,铝期货,交割', '3月17日，中储发展股份有限公司郑州物流中心上期所铝期货指定交割库举行揭牌仪式，中储股份郑州物流中心负责人与上期所相关人士共同为交割仓库揭牌。', '', '', '2016-03-18', '2016-03-18', '', '', 25),
(2986, 1, '壹银添丰：大宗商品难现众乐乐', '<p>　<span style="font-family: 宋体, SimSun; font-size: 16px;">　关于近期大宗产品反弹，商场观念不合较大。尽管目前商场普遍看多，但宝城期货金融研究所所长助理程小勇以为，美联储加息推延，美元回落仅仅一个方面的要素。因而产品和美元在必定程度上呈现此消彼长的特征。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　不过，</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">说，外汇商场也存在必定的特殊情况，即欧洲和日本扩大宽松并没有镇压欧元和日元，美元并没有被迫上涨，这说明本年全球钱银政策和汇率变动不同于上一年。依照传统的“宽松-汇率价值降低-刺激出口”的逻辑，这也许意味着欧美发达国家都不太情愿本币价值降低，因而美联储加息脚步慎重。从这个层面来看，各国钱银径向价值降低也许诱发滞胀的危险，产品价格也也许分解，单边大涨大跌都不大也许。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　值得注意的一个现象是，近期大宗产品走势分解，其间黑色和黄金涨幅最大，但铜等有色涨幅稍逊。程小勇剖析以为，主要是和供需基本面以及金融特点有关。黑色金属下流直至房地产，归于前端花费，有色金属归于后端花费，且有色的库存有关于黑色偏高。再加上铁矿石通过上一年大跌后海外铁矿石商场集中度进步后的倒逼机制，因而黑色金属反弹异常微弱。而黄金上涨主要是基于美元实践利率回落下的持有成本降低，以及潜在的对冲滞胀危险的需要上升。最终近期产品上涨，基本面方面有少许改进，如下流补库，上游有限的去产能，但最主要的因素仍是钱银现象，发达国家持续宽松措施到负利率，国内钱银脱实向虚的外溢效应。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　东吴期货研究所所长姜兴春表明，黄金主要仍是避险功用和金融特点起到推进效果，先于大宗产品反弹且愈加微弱；黑色系主要仍是供应侧呈现了供应缩短，修正供需平衡表，加上房地产一线城市量价齐升、新增固定资产出资升温，杰出的商场预期都“助涨”黑色系。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/industrynews/2985" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：郑州物流中心铝期货交割库揭牌</a></p>', '关于近期大宗产品反弹，商场观念不合较大。尽管目前商场普遍看多，但宝城期货金融研究所所长助理程小勇以为，美联储加息推延，美元回落仅仅一个方面的要素。因而产品和美元在必定程度上呈现此消彼长的特征。', '壹银添丰：大宗商品难现众乐乐', '壹银添丰,大宗商品', '关于近期大宗产品反弹，商场观念不合较大。尽管目前商场普遍看多，但宝城期货金融研究所所长助理程小勇以为，美联储加息推延，美元回落仅仅一个方面的要素。因而产品和美元在必定程度上呈现此消彼长的特征。', '', '', '2016-03-18', '2016-03-18', '', '', 27),
(2987, 25, '壹银添丰：原油暴涨的背后是产油国冻产', '<p>　<span style="font-family: 宋体, SimSun; font-size: 16px;">　因为过夜美联储会议开释鸽派信号，世界油价再度大幅上涨。到北京时间3月17日17时，NYMEX原油期价报每桶39.62美元，挨近3个月高点。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　方正中期高级研究员隋晓影表明，预期将本年加息次数从4次缩减至2次，美元指数大幅下挫，原油受到支持，一起产油国定于4月17日召开会议参议约束产值疑问令商场心情再度受到提振；而EIA原油库存显示上周美国原油库存添加132万桶，增幅在不断缩窄。整体来看，近期受一系列利好音讯支持，油价有望延续前期的涨势，但上行压力将越来越大。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“美元指数上涨无疑对大宗产品构成压力，这次美联储暂不加息，美元指数大幅下跌，对大宗产品反弹有利。”东吴期货研究所所长姜兴春对中国证券报记者表明。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　本年以来，世界油价从每桶28美元低点反弹至40美元邻近，出现涨幅大、时间短的特色。因为原油是大宗产品商场的龙头种类，其大幅反弹也带动了铁矿石、螺纹钢、锌等别的大宗产品疾速上涨。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">剖析称，近期内黑色金属和黑色能源以及黄金涨幅较大，前两者与国内去库存和房价上涨有关，后者与原油价格反弹有关。尽管有色金属与房地产也有关系，但有色金属归于房产的后端，反映对比滞后。这是致使近期内黑色金属涨幅较大和有色涨幅较小的重要原因，从往后看，房产上涨仍归于部分和短期景象，不代表房产价格的发展趋势，一起去库存仍需一个较长的进程，现在仍归于概念阶段，因而，大宗产品仍以区间震动为主，走出单边行情的可能性不大。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/finance/2984" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：现货市场疲软，钢，铁矿石未来出路在何方</a></p>', '因为过夜美联储会议开释鸽派信号，世界油价再度大幅上涨。到北京时间3月17日17时，NYMEX原油期价报每桶39.62美元，挨近3个月高点', '壹银添丰：原油暴涨的背后是产油国冻产', '壹银添丰,原油,冻产', '因为过夜美联储会议开释鸽派信号，世界油价再度大幅上涨。到北京时间3月17日17时，NYMEX原油期价报每桶39.62美元，挨近3个月高点', '', '', '2016-03-18', '2016-03-18', '', '', 23),
(2988, 25, '壹银添丰：钢价涨势仍以区间震荡为主', '<p>　<span style="font-family: 宋体, SimSun; font-size: 16px;"> &nbsp;近期<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>螺纹钢期货报价剧烈波动，暴涨暴跌的过山车行情令盘面多空不合加大。短期固定资产出资环比回温暖终端贸易商弥补库存，一起支持钢价维持在2000元/吨摆布邻近胶着震荡。近几个交易日，钢材现货成交价跟着期价大幅回落，但由于回落起伏小于期价，加上唐山区域钢坯报价较为坚硬，期价再次贴水。现货商短期对钢价的观点有所转暖，加上微观环境有利钢价上涨，期价言顶尚早。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　此轮钢价上涨，最首要的要素莫过于市场对钢厂减产的一致性预期和地产职业回暖的一起效果。尽管“供应侧”变革还没有看到实质成效，钢铁职业的产能数据仍然显示出显着的过剩格局，可是近期钢价上涨带来的盈余面上升，并没有让钢厂达产率显着上升。在钢价显着上涨的市场环境下，2月下旬国内粗钢日均产值为205万吨，较去年同期的222万吨降低7万吨，同比降幅较为显着。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　市场回暖令不少钢企有增产或许复产的方案，但国内实践产能利用率环比还在下行，五大钢材种类的日均产值同比降低4.4万吨。在当时钢厂遍及有100-250元/吨盈余的状态下，全国样本钢厂高炉开工率仅较上星期添加2.35个百分点为76.66%，与去年同期85%的高炉开工水平有必定距离。有些东北、西北等内陆区域由于前期亏本太严峻，资金制约复产起伏较小。后期全国高炉开工能否大幅上升是钢价能否持续反弹的一个首要影响要素。从现阶段的复产起伏来看，高炉开工率和钢厂过半的盈余面相比，好像上升力度不行。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　而微观环境，首要是房地产职业敏捷反弹，缓解了市场对钢铁供过于求的悲观观点。现在钢铁整体社会库存水与去年相比，同比减少了178.09万吨，降幅高达22.32%，一起钢厂库存也显着低于去年同期。库存偏低，可是需求复苏微弱，特别是中端贸易商在钢价大涨后呈现集中补库，钢厂也开端频频挺价。1-2月国内房地产开发出资完结额累计同比从1%上升至3%，商品房出售累计同比大幅扩大至28.2%，较去年底添加了21.7%，地产出售火爆，量价齐升，但其延续性，还有待二季度对土地成交额、新开工面积和商品房库存等滞后数据，以及一系列工业基建数据的印证。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章</span>：<a href="http://www.yytf099.com/finance/2987" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：原油暴涨的背后是产油国冻产</a></p>', '近期螺纹钢期货报价剧烈波动，暴涨暴跌的过山车行情令盘面多空不合加大。短期固定资产出资环比回温暖终端贸易商弥补库存，一起支持钢价维持在2000元/吨摆布邻近胶着震荡', '壹银添丰：钢价涨势仍以区间震荡为主', '壹银添丰,钢价,震荡', '近期螺纹钢期货报价剧烈波动，暴涨暴跌的过山车行情令盘面多空不合加大。短期固定资产出资环比回温暖终端贸易商弥补库存，一起支持钢价维持在2000元/吨摆布邻近胶着震荡', '', '', '2016-03-18', '2016-03-18', '', '', 22),
(2989, 1, '壹银添丰：原油行情分析及建议', '<p>&nbsp;<span style="font-family: 宋体, SimSun; font-size: 16px;"> &nbsp; 受上周美元指数持续走弱，冻产协议预期升温和OPEC预期今年需求将上升等利好的推动下，上周油价持续走强。不过数据显示美国石油钻井平台数量自12月来首次上升，令市场重新担忧供应过剩问题，导致美原油收阴。截至收盘，美国NYMEX4月原油期货价格收盘下跌0.76美元，跌幅1.90%，报收39.44美元/桶。布伦特5月原油期货价格收盘下跌0.34美元，跌幅0.80%，报收41.20美元/桶。尽管周五下跌，但原油价格连续数周上涨，布伦特原油连续第四周攀升，美国原油连升第五周。两份合约本周都上涨约2%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　虽然两大原油期货基准价格近一月已飙升50%，但仍难掩盖原油近期的走强缺乏基本面实质改善的支撑，油价高企恐难持久，投资者需警惕短线回调风险。很多分析师表示最近的大多数涨势似乎亦是受本周美联储下调今年升息次数的预期推动，因全球经济增长前景疲软。这可能提振在风险资产上的投资。美联储宽松的货币政策已经令原油的吸引力重燃。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; </span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰有色金属</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">原油技术分析师分析：受EIA数据和美联储会议结果的影响，油价一度飙升到274.6的高度，然后回落在266一线进行高位回调整理。美国页油减产和主要产油国确认冻产协议的召开，都为油价的上涨提供了一定的动力。金盘神手认为，油价的底部基本可以确认，当然，本周行情的反弹力度和月线的突破站稳，还需要进行进一步的确认，至少在冻产协议出炉之前行情还是一个走高的趋势。从四小时图上看，红色能量柱方量减缓，KDJ死叉向下，这在周一开盘时将直接考验259一线的支撑强度，若不跌破中轨支撑，则操作上建议回调做多，若跌破中轨则看下方支撑232一线。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/industrynews/2986" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：大宗商品难现众乐乐</a></p><p><br/></p>', ' 受上周美元指数持续走弱，冻产协议预期升温和OPEC预期今年需求将上升等利好的推动下，上周油价持续走强。不过数据显示美国石油钻井平台数量自12月来首次上升，令市场重新担忧供应过剩问题，导致美原油收阴', '壹银添丰：原油行情分析及建议', '壹银添丰,原油,建议', ' 受上周美元指数持续走弱，冻产协议预期升温和OPEC预期今年需求将上升等利好的推动下，上周油价持续走强。不过数据显示美国石油钻井平台数量自12月来首次上升，令市场重新担忧供应过剩问题，导致美原油收阴', '', '', '2016-03-21', '2016-03-21', '', '', 17),
(2990, 1, '壹银添丰：油，铜3月份还将再次拉落回升', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; <a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰有色金属</a>原油行情分析：原油完美的回踩了支撑位置，比我预期的涨幅还要高，刷新了高点位置，不断持续性的拉升，现在就是一个强势的行情，其实这种行情就好比上台阶一样，只要不破最后一次拉升前的低点，整个上涨就没有结束，什么破位什么时候转变思路，不破就抓一个大的行情，如此简单而已。原油日线图大阳上涨。延续前一交易日的上涨幅度，只要不出现冲高收低的收盘，整体还是看好上涨，还会慢性上升。虽然节奏上可能会放缓，但趋势上走得挺好，主思路还是低位做多。建议尽量少看超短线图，以大周期图为主参考。因为盘中伴随回调，小周期图容易走诱空的形态，所以尽量避免在上涨途中去猜顶做做空单。日图上价格虽远离短线均线，但强势姿态并未改变，尤其是短周期行情指标的配合到位，今天重点留意布林上轨处阻力，日线整体维持看多。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; </span><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰油操作建议：&nbsp;1.建议258-260附近做多，止损3个点，目标看265-267；2.建议274-275附近做空，止损3个点，目标看267；</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 现货铜行情分析：铜从日线图上看，K线录得5连阳，铜价自周二低点31768获得支撑反弹，低点和高点不断抬高，连阳的态势表现了多头的强势，同时均线系统呈多头排列，技术指标MACD有二次增量的迹象，KDJ和RSI表现偏强，铜价还有反弹的需求，铜价整体的上涨格局依然完好，但在上涨过程中的反复或修正是难免的，无需去纠结，更无需去猜顶。市场涨跌我们无法改变，但市场涨跌我们完全可以去跟随。再者结合当下基本面来看，铜价短期内还有继续上涨破高的可能，今天重点要关注32500一带支撑。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 壹银添丰铜操作建议：1.建议32500附近做多，止损300点，目标看33000；2.33200附近做空，止损200点，目标看32500；</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/industrynews/2989" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：原油行情分析及建议</a></span></p>', '壹银添丰原油行情分析：原油完美的回踩了支撑位置，比我预期的涨幅还要高，刷新了高点位置，不断持续性的拉升，现在就是一个强势的行情，其实这种行情就好比上台阶一样', '壹银添丰：油，铜3月份还将再次拉落回升', '壹银添丰,原油,铜,回升', '壹银添丰原油行情分析：原油完美的回踩了支撑位置，比我预期的涨幅还要高，刷新了高点位置，不断持续性的拉升，现在就是一个强势的行情，其实这种行情就好比上台阶一样', '', '', '2016-03-21', '2016-03-21', '', '', 23),
(2991, 25, '壹银添丰：原油市场供应过剩屡战屡败 ，2016年油价行情低迷', '<p>&nbsp; &nbsp; <span style="font-family: 宋体, SimSun; font-size: 16px;">周一(3月21日)国际原油价格震荡下挫，上周美油虽因“三大利好”首度突破40美元大关，但供应过剩再度发力油价随后回落至39美元上方，而机构预计供应过剩恐将持续至2017年底。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 美国WTI原油4月期货周五(3月18日)收跌0.76美元，或1.89%，报39.44美元/桶，本周上涨2.56%。布伦特原油5月期货周五收跌0.34美元，或0.61%，报41.20美元/桶，本周上涨2.36%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">美国WTI原油期货价格盘中最低触及39.89美元/桶，布伦特原油期货价格盘中最低触及41.08美元/桶。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">美国油服公司贝克休斯(Baker Hughes)最新公布的数据显示，截至2016年3月18日当周美国石油活跃钻井数增加1座至387座，为去年12月18日以来首次增加。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 且中国原油制品净进口较上月统计减少148.1万桶至651.8万桶/日，环比下滑19%。中国经济放缓引发市场对其原油消费能力的担忧。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 周五(3月18日)俄罗斯央行(Russia&#39;s central bank)公布的季度货币政策报告显示，由于预计油价将较此前进一步走软，该央行对未来三年俄罗斯的经济前景抱有略更悲观的态度，并下调经济预估。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 并预计，原油市场供应过剩将持续至2017年底，同时预计2016年乌拉尔油均价在每桶30美元，明后年为每桶35和40美元。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 周五(3月18日)美国商品期货交易委员会(CFTC)发布的周度报告称，截至3月15日当周，对冲基金经理增持美国原油期货及期权净多头头寸。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">数据显示，截至3月15日当周，纽约商品交易所(NYMEX)原油及伦敦洲际交易所(ICE)WTI原油期货与期权净多头共增加34051手，至172033手。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp;“油价走势将出现反复，其很难升至45美元以上，”Oil Price Information Service分析师Tom Kloza指出。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 而据</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰有色金属</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">周五(3月18日)公布的最新调查显示，分析师及交易员对本周NYMEX原油价格走势分歧较大。在接受调查的38位分析师中，看涨17人(45%)，看跌16人(42%)，看平5人(13%)。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 原油市场供应过剩再度发力，油价承压受挫反弹空间受限，因此建议投资者应谨慎为主，采取高抛低吸及时止盈的方式来降低市场风险.</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/finance/2988" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：钢价涨势仍以区间震荡为主</a></p><p><br/></p>', '周一(3月21日)国际原油价格震荡下挫，上周美油虽因“三大利好”首度突破40美元大关，但供应过剩再度发力油价随后回落至39美元上方，而机构预计供应过剩恐将持续至2017年底。', '原油市场供应过剩屡战屡败 ，2016年油价行情低迷', '原油,供应过剩,油价低迷', '周一(3月21日)国际原油价格震荡下挫，上周美油虽因“三大利好”首度突破40美元大关，但供应过剩再度发力油价随后回落至39美元上方，而机构预计供应过剩恐将持续至2017年底。', '', '', '2016-03-21', '2016-03-21', '', '', 21),
(2992, 25, '壹银添丰：黑色系期货 经济新常态下显功能', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　由于国外矿山持续增产，国内需求依然低迷，2015年铁矿石供给过剩成为推动期现货市场价格下行的主要动力。受市场格局影响，产业客户积极参与国内期货以规避风险，铁矿石期货成交、持仓规模扩大，客户结构得到改善，市场功能发挥水平进一步提高。同时，2015年黑色系另一品种——焦炭产能延续过剩，期现价格持续下跌，焦炭期货交易规模和客户数量下降，整体运行趋弱，但产业客户参与期货的比重增加。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　铁矿石成交和持仓规模扩大</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">记者从大商所获得的数据显示，2015年，铁矿石成交量为2.60亿手(单边，下同)，同比增长169%。2015年铁矿石成交量占大商所期货总成交量的23.25%，较2014年上升10.73个百分点，占国内商品期货的8.02%，较2014年上升3.81个百分点。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　相对于铁矿石的活跃，焦炭期货成交量及成交额均出现下降，且成交额降幅更明显。2015年，焦炭期货成交量为1566万手，成交额为13162.74亿元，分别较2014年下降75%和80%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　市场分析人士认为，铁矿石和焦炭均为黑色系产业链条品种，但铁矿石市场容量、客户参与量以及品种涵盖范围都超过焦炭，部分市场参与机构优先选择铁矿石期货来规避市场风险，导致焦炭成交和持仓下降。但整体上看，黑色系品种2015年持仓、成交已经实现大幅提升，国内外市场影响力越发明显。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　产业客户积极参与期货交易</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　2015年年末，铁矿石期货持仓量为94万手，同比增长114%。2015年铁矿石期货月末平均持仓量占大商所商品总持仓量的平均比值为15.23%，较2014年上升5.29个百分点，占国内商品期货的7.00%，较2014年上升2.53个百分点。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　随着持仓量的增加，铁矿石客户数量稳步增长，结构趋于多元化。截至2015年年底，月均交易客户为80550户，较2014年增长84.2%。具体看，随着矿山、钢铁企业、铁矿石贸易商等产业客户与基金、私募和期货资管等机构投资者的参与，法人户数量大幅上升，2015年月均交易法人户较2014年增长57%。另外，交投活跃也使得个人投资者踊跃参与，2015年铁矿石期货交易个人户较2014年增长85%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　焦炭市场上，月均交易法人户占3.82%，较2014年增加1.48个百分点；个人户占96.18%，较2014年下降1.48个百分点。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　铁矿石贸易商作为钢铁产业链条上的一环，2014—2015年进口利润被挤压殆尽，贸易商的生存成了头等大事。在操作层面，其采取了多种期现相结合的方法，例如，在基差较小时购买现货，同时在期货上卖出保值，而在基差较大时采取相反方向的操作；新加坡掉期与大连铁矿石套利交易；买卖期货公司设计的铁矿石期货场外期权产品。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　国内“黑色系”彰显影响力</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　随着铁矿石期货成交、持仓的攀升，国内市场的话语权在增强。市场分析人士认为，大商所设立铁矿石期货，上海清算所上线铁矿石掉期，北京国际矿业权交易所引入全球四大矿山力拓、必和必拓、淡水河谷、FMG入股，均为我国争取定价权做出了不懈努力。从实际效果看，国外的铁矿石矿山和贸易商越来越关注大商所铁矿石期货价格。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　据了解，为进一步发展铁矿石期货，增强市场定价能力，今年大商所将继续推进铁矿石期货国际化和保税交割。铁矿石国际化的关键因素是“人、钱、物”，“物”的方面可通过保税交割解决，“人”的方面将参照监管部门对特定品种的规定，让铁矿石成为境外投资者可以参与的境内特定商品，“钱”的方面将按照原油的模式把外汇作为保证金冲抵。另外，交易所还将适时研究开发铁矿石期权、指数等新型衍生工具。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/finance/2991" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：原油市场供应过剩屡战屡败 ，2016年油价行情低迷</a><a href="http://www.yytf099.com/finance/2991" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;"></a></p><p><br/></p>', '由于国外矿山持续增产，国内需求依然低迷，2015年铁矿石供给过剩成为推动期现货市场价格下行的主要动力。受市场格局影响，产业客户积极参与国内期货以规避风险，铁矿石期货成交、持仓规模扩大，客户结构得到改善，市场功能发挥水平进一步提高。', '黑色系期货 经济新常态下显功能', '黑色系期货,新常态', '由于国外矿山持续增产，国内需求依然低迷，2015年铁矿石供给过剩成为推动期现货市场价格下行的主要动力。受市场格局影响，产业客户积极参与国内期货以规避风险，铁矿石期货成交、持仓规模扩大，客户结构得到改善', '', '', '2016-03-21', '2016-03-21', '', '', 24),
(2993, 1, '壹银添丰：原油冻产，原油冬天已过', '<p>&nbsp;<span style="font-family: 宋体, SimSun; font-size: 16px;"> &nbsp; 美国原油产值也降至一年多的低位，商场热议原油的暴降好像也到头了。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　原油价格自上一年以来持续暴降，至本年1月末，最高的时分一度跌去70%。虽然出路依然未卜，但随着几个首要产油过之间达到冻产协议，美国原油产值也降至一年多的低位，商场热议原油的暴降好像也到头了</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　最新的原油看多头寸创出自上一年6月以来的最大涨幅。依据美国纽约商品交易委员会(CFTC)截止3月15日的数据显现，对冲基金和其他一些出资者均增加了对美国WTI原油的看多持仓。一切的期权期货的原油净多头头寸上涨了17%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　一个月之前，原油交易员们还在调查原油是不是会多的没当地放，与此一起，英国石油公司首席执行官Bob Dudley恶作剧成，为了没当地放原油，可能会把原油倒到游水池里。不过近期看来，虽然没有盈余，不少公司还在亏损，但有痕迹显现，曩昔六个月内，原油的过剩疑问现已没有那么严峻。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　IEA之前预言称，最差劲的暴降现已曩昔。<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰有色金属</a>分析师Torbjoern也表明，出人意料的，那些海上漂着的油轮是有人要的，而且岸上的油储也没有耗尽。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　依据2月29日美国动力部的数据，美国原油产值自2015年4月触及巅峰以后，开始进入下滑趋势，截止3月11日当周为2011年12月以来首次出现年度下滑。仅仅在一年之前，原油的每年度增加还处在超越每日需要100万桶的水平。一起依据贝克休斯的数据显现，美国油田的钻井渠道数量总2014年10月起至今现已下降了76%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　虽然短期内仍是有下行风险，不过咱们以为，油价的下行趋势现已要完毕了。随着本年需要改进一起产值下滑，全球原油的库存水平也将逐步下滑，到本年下半年，原油价格将会上升至令生产商们愿意重新开始出资项目的水平。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　战略动力与经济研究中心董事长Michael Lynch也这么以为。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　感受上十分低的钻井数量将给商场带来一些平衡。商场动能看来将会持续股动多头，交易员们好像是信任油价将持续反弹。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　之前看跌原油到20美元/桶的高盛近来也转向了，以为油价最差劲的时分现已曩昔了。在最新的对全球钱银现已大宗商品的预期中，高盛预计原油接下来将渐渐上升至57美元/桶。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/finance/2992" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;"><a href="http://www.yytf099.com/industrynews/2990" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：油，铜3月份还将再次拉落回升</a></a></span></p>', '美国原油产值也降至一年多的低位，商场热议原油的暴降好像也到头了。', '壹银添丰：原油冻产，原油冬天已过', '壹银添丰,原油,冻产', '美国原油产值也降至一年多的低位，商场热议原油的暴降好像也到头了。', '', '', '2016-03-22', '2016-03-22', '', '', 17),
(2994, 1, '壹银添丰：传统旺季，有色金属强势反弹', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　3月份作为传统旺季，下流补库驱动产品季节性反弹能够了解，但从反弹起伏和下流订单来看，二者明显不匹配，供需基本面并不能彻底解说这种超预期强势上涨走势。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　联系商场反弹时间(季节性)、起伏、微观环境等要素分析，笔者以为，供给端减产对有色金属反弹有辅佐作用，而旺季时节下流存在补库，但缺乏以致使供给从过剩转为严重。因而，驱动力很大也许来源于金融特点。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　首要，减产减轻供给压力 但不改变过剩格局。从报价传导机制来看，在报价继续不断跌落过程中，有些亏损公司减产致使供给减缩，然后引发供给曲线向左移，假设在需要不变的情况下，即需要曲线不改变，那么均衡报价会向上移动，这是减产和报价的相互影响关系。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　通常来讲，最早反弹的种类往往是供给最早削减的种类，而供给减产有几种情况：一是生产商减产；二是库存降低；三是产品因融资等要素被确定无法流通。联系当时经济形势看，致使供给改变最大的要素是减产。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　从实践产出来看，包含铜、铝、铅、锌、镍和锡都呈现或多或少的减产，其间锡、铅、锌影响最大，因而反弹起伏最高。铜矿方面，上一年全球铜矿减产规划不会超越70万吨，不到全球产值的4%，因而铜价反弹最弱。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　房地产职业，有色金属在地产中花费首要集中于后端，即竣工期间。1-2月份房子竣工面积同比添加28.9%，也许带来有些铜线、铝合金门窗的需要回暖，但后续继续性缺乏。因素在于，一是楼市加杠杆致使开发商加大推盘，但<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>数据表现为季节性。二是新开工面积继续大于竣工面积，将来库存在2月的7.39亿平方米基础上还将被迫添加，在高库存压力下，房地产出资和房子竣工面积也许转为负添加。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　其次，流动性外溢效应催生强势反弹。 二季度货币政策很大也许回归中性，最终流动性也会回归理性，然后使得包含有色金属在内的大宗产品反弹完毕，商场最终回归供需基本面主导，而非投机需要主导。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　假如货币政策效应递减，财政政策加码，那么包含大宗产品、股市等危险财物报价有望在将来一个季度和半年会大幅上涨，包含CPI等通胀目标也会拐头加快上冲。其间2月份同比涨幅已经升至2.3%，这也许是滞胀到来的先兆。从理论上讲，报价是一种货币景象，现在楼市火爆，1月和2月CPI上升都离不开M2增速的上升。回忆2005年至2007年、2009年-2010年，包含铜等大宗产品报价继续上涨，这其间就离不开M2增速的攀升。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　但是，当时经济结构、公司财物负债表情况和人员结构都不同于2008年。首要，当时人员红利不见，2014年我国流动人员开端负添加，我国经济潜在添加率下滑。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　其次，假如传统的地产和制造业出清被中断，经济也许仅仅短期上升，很大也许仅仅一个季度性回暖，那么原先停产的产能将从头扩张，带来愈加严重的产能过剩问题。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　再次，公司有些债款再度膨胀，金融部门再度加杠杆，最终也许引致报价泡沫幻灭。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/industrynews/2993" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：原油冻产，原油冬天已过</a></span></p>', '3月份作为传统旺季，下流补库驱动产品季节性反弹能够了解，但从反弹起伏和下流订单来看，二者明显不匹配，供需基本面并不能彻底解说这种超预期强势上涨走势。', '壹银添丰：传统旺季，有色金属强势反弹', '壹银添丰,有色金属,强势反弹', '3月份作为传统旺季，下流补库驱动产品季节性反弹能够了解，但从反弹起伏和下流订单来看，二者明显不匹配，供需基本面并不能彻底解说这种超预期强势上涨走势。', '', '', '2016-03-22', '2016-03-22', '', '', 18),
(2995, 25, '壹银添丰：外部溢出效应：铜锌铝多继续持有', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　 &nbsp;上星期铜锌铝呈偏强态势，沪镍保持震动走势，联系盘面和资金面看，铜铝锌于其均线组上方运转，走势偏强，沪镍则暂缺支持。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　美国：</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　1.因考虑负外部溢出效应及薪酬增速不及预期，美联储决议保持利率不变，根本契合预期；2.美联储将2016年GDP增速预期由2.4%下调至2.2%,PCE通胀率中值预期由1.6%下调至1.2%；3.美国3月密歇根大学消费者决心指数初值为90，预期为92.2。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　欧元区：</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　1.</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰有色金属</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">德拉称，估计利率将在较长时期内保持在当时或更低水平。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　全体看，微观面因素对有色金属影响偏多。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　现货方面</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　(1)截止2016-3-18，上海金属网1#铜现货报价为38170元/吨，较上日上涨640元/吨，较沪铜近月合约贴水70元/吨，铜价接连攀升，商场货源充足，持货商兜售志愿激烈，商场供给略显过剩，下流在持续上涨的铜价压力下，畏高心态开端减少，逐渐入市，全体成交通常。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　(2)当日，0#锌现货报价为14310元/吨，较上日上涨315元/吨，较近月合约贴水40元/吨，周内炼厂持续出货，下流逢低活泼收购，受下流企业开工上升带动，全体成交较上星期持续改进。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　(3)当日，1#镍现货报价为69350元/吨，较上日上涨1300元/吨，较沪镍近月合约贴水350元/吨，不锈钢报价企稳，下流逢低收购活泼，大型钢厂收购心情较高，中小型钢厂仍有张望心情，暂未有很多复产，金川公司挺价，周内累计上调镍价至70000元/吨。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　(4)当日，A00#铝现货报价为11430元/吨，较上日上涨130元/吨，较沪铝近月合约升水5元/吨，期铝震动偏强，持货商换现志愿增强，商场货源充足，下流全体消费呈现企稳上升痕迹，全体成交活泼。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 全体看，进口锌精矿加工费下调有望令精锌供给减缩，利多锌价，铜铝下方支持较强，且微观面影响偏多，铜锌铝前多可持续持有；沪镍暂缺利多提振，且其暂缺支持，震动走势或连续，主张暂张望。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/finance/2992" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：黑色系期货 经济新常态下显功能</a></span></p>', '上星期铜锌铝呈偏强态势，沪镍保持震动走势，联系盘面和资金面看，铜铝锌于其均线组上方运转，走势偏强，沪镍则暂缺支持。', '壹银添丰：外部溢出效应：铜锌铝多继续持有', '壹银添丰,外部溢出,持有', '上星期铜锌铝呈偏强态势，沪镍保持震动走势，联系盘面和资金面看，铜铝锌于其均线组上方运转，走势偏强，沪镍则暂缺支持。', '', '', '2016-03-22', '2016-03-22', '', '', 17);
