(2996, 25, '壹银添丰：有色金属并未显著好转', '<p>　<span style="font-family: 宋体, SimSun; font-size: 16px;"> &nbsp;2016年1月，有职业“风向标”之称的中经有色金属工业景气指数(下称“中经有色指数”)为13.0。而此轮指数最高点(超越80)在2010年创下的，至今累计跌幅挨近9成。比较全球1974年、1980年、1988年发明的有色职业大调整，我国有色金属协会部属的安泰科首席专家冯君从估计，这次世界金融危机致使的报价跌落时刻将创历史纪录。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　2016年1月，有职业“风向标”之称的中经有色金属工业景气指数(下称“中经有色指数”)为13.0。而此轮指数最高点(超越80)在2010年创下的，至今累计跌幅挨近9成。比较全球1974年、1980年、1988年发明的有色职业大调整，我国有色金属协会部属的安泰科首席专家冯君从估计，这次世界金融危机致使的报价跌落时刻将创历史纪录。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　2008年世界金融危机迸发，2009年美国施行宽松货币政策，我国施行4万亿影响经济，有色报价敏捷飙涨，短短一年摆布时刻，中经有色指数从挨近15点飙升到超越80点。2010年，需要削弱，中经有色指数快速回落；2013年，经济企稳的美国完毕QE，美元进入增值通道。大宗产品实施美元定价，强势美元按捺了金属报价。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“此外，职业景气量高时飙升的出资带来很多新增产能、需要萎缩致使供过于求也镇压了金属走强。”冯君从剖析说。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　从外部环境看，春季反弹或将连续。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">以为，近来，商场呈现了有利于有色金属的改变。一方面，原先猜测美元2016年将有4次加息，最新调整为估计两次，年内首次加息的时刻也从3月调为6、7月之后，美元短期走弱有助于大宗产品春季行情；别的，2016年前两月，我国房地产出售、出资数据明显好转，新开工增速大幅反弹，后期有色需要有望上升。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　在中金岭南首席剖析师伍锡军看来，近期金属反弹超预期，一方面是2015年金属超跌，另一方面，近来房地产去库存超预期，未来4月份房产开工、基建开工都有望加快，估计跟着美元加息落地，全年金属报价走势将呈现上半年强于下半年。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　但从基本面看，金属行情不乐观。冯君从说，从供给来看，2016年有色供给有所减缓，但产能扩增仍在持续。如铝，2015年我国新增电解铝产能341万吨/年，较上一年下降28.3%，为近十年来最大降幅；2016年和2017年，新建产能都超越300万吨。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“最主要的疑问还是在于需要削弱。”安泰科估计，2016年，铜质料供给富余，持续过剩，报价震动走低；铝供需改进，报价阶段性回暖；铅消费趋弱，产能进程，报价重心下移；锌基本面改进，报价阶段性反弹；镍库存高企，产销萎缩，报价震动寻底。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/finance/2995" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：外部溢出效应：铜锌铝多继续持有</a></p><p><br/></p>', '2016年1月，有职业“风向标”之称的中经有色金属工业景气指数(下称“中经有色指数”)为13.0。而此轮指数最高点(超越80)在2010年创下的，至今累计跌幅挨近9成。', '壹银添丰：有色金属并未显著好转', '壹银添丰,有色金属', '2016年1月，有职业“风向标”之称的中经有色金属工业景气指数(下称“中经有色指数”)为13.0。而此轮指数最高点(超越80)在2010年创下的，至今累计跌幅挨近9成。', '', '', '2016-03-22', '2016-03-22', '', '', 20),
(2997, 1, '壹银添丰：利比亚拒绝出席冻产会议 原油价格恐蒙阴影', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　 &nbsp;一名利比亚驻石油输出国组织(OPEC)代表周二(3月22日)表示，利比亚将配合伊朗抵制冻产协议，计划不出席将于4月17日在多哈召开的产油国会议，该会议将商讨产量冻结协议，从而稳定油价。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　如果利比亚和伊朗双双缺席，OPEC与非OPEC产油国的冻产协议恐将蒙上阴影，即使利比亚原油产量数月来一直起伏不定，同时该国产量迅速增长的可能性也依然较低。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　利比亚代表称：“我们不会出席，很明显，他们必须同意我们在国家安全形势改善之时能够恢复原油产量。”</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　早在2月中旬沙特、卡塔尔、委内瑞拉和俄罗斯达成冻产意向时，利比亚已经表达了想要将原油产量恢复至内战前水平的愿望。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　作为此次会议的主办方，</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">已经邀请了全部13个OPEC成员国以及非OPEC主要产油国。市场预计此次会议上将能够进一步扩大产量冻结协议的影响。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　虽然伊朗目前尚未明确表示是否出席此次会议，但伊朗官方已经重申了不会冻结产量的立场，该国计划将原油产量回复至制裁前水平。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　相关数据显示，利比亚和伊朗的潜在产量增幅对于市场来讲是举足轻重的，但是利比亚内战已经导致该国产量自2014年来跌至每日40万桶，显著低于2011年内战爆发前的每日160万桶水平。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　伊朗1月原油产量为每日290万桶，该国表示将进一步增加每日50万桶的出口量，不过目前对欧洲地区的出口量仅为适度增长。&nbsp;</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/industrynews/2994" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：传统旺季，有色金属强势反弹</a></p>', '一名利比亚驻石油输出国组织(OPEC)代表周二(3月22日)表示，利比亚将配合伊朗抵制冻产协议，计划不出席将于4月17日在多哈召开的产油国会议，该会议将商讨产量冻结协议，从而稳定油价。', '壹银添丰：利比亚拒绝出席冻产会议 原油价格恐蒙阴影', '壹银添丰,原油,冻产会议', '一名利比亚驻石油输出国组织(OPEC)代表周二(3月22日)表示，利比亚将配合伊朗抵制冻产协议，计划不出席将于4月17日在多哈召开的产油国会议，该会议将商讨产量冻结协议，从而稳定油价。', '', '', '2016-03-23', '2016-03-23', '', '', 14),
(2998, 1, '壹银添丰：美国原油库存大幅增加，增幅远超预期', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　 &nbsp;</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">周二(3月22日)最新数据显现，上星期美国原油库存大幅添加，增幅远超预期，而汽油和精炼油库存则双双录得削减。北京时间周三22:30，美国能源信息署(EIA)将发布美国上星期官方原油库存数据。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　API这次发布的详细数据显现，到3月18日当周，美国原油库存添加879.6万桶，库存总量升至5.32亿桶纪录高位，预期为添加300万桶，前值为添加149.7万桶。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　API数据还显现，美国上星期汽油库存锐减430.2.8万桶，预期为削减182.5万桶，前值为削减117.8万桶。精炼油库存削减39.1万桶，预期为削减50万桶，前值为削减83万桶。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　此外，到3月18日当周美国库欣区域原油库存削减137万桶。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　API数据显现原油库存增幅超过预期后，美国原油在盘后买卖中扩展跌幅，下挫1%，至每桶41.12美元。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">API：美国上星期原油库存暴增879.6万桶 汽油库存大降&nbsp;</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　北京时间05:06，美国WTI原油期货价格报41.22美元/桶，布伦特原油期货价格报41.61美元/桶。&nbsp;</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/industrynews/2997" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：利比亚拒绝出席冻产会议 原油价格恐蒙阴影</a></span></p><p><br/></p>', ' 美国石油学会(API)周二(3月22日)最新数据显现，上星期美国原油库存大幅添加，增幅远超预期，而汽油和精炼油库存则双双录得削减。北京时间周三22:30，美国能源信息署(EIA)将发布美国上星期官方原油库存数据。', '壹银添丰：美国原油库存大幅增加，增幅远超预期', '壹银添丰,原油库,增幅', ' 美国石油学会(API)周二(3月22日)最新数据显现，上星期美国原油库存大幅添加，增幅远超预期，而汽油和精炼油库存则双双录得削减。北京时间周三22:30，美国能源信息署(EIA)将发布美国上星期官方', '', '', '2016-03-23', '2016-03-23', '', '', 14),
(2999, 25, '壹银添丰：库存减少助美油上破41关口', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　 &nbsp;美国NYMEX 5月原油期货价格周一(3月21日)收盘上涨0.38美元，涨幅0.9%，报41.52美元/桶，油价收盘突破41美元关口，再度改写上一年12月以来的高位。此前数据显现美国原油期货交割地库欣原油库存自1月来初次削减。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　 &nbsp;与此同时，ICE布伦特5月原油期货价格收盘上涨0.34美元，涨幅0.83%，报41.54美元/桶。近月布伦特原油期货自1月20日触及12年低点27.10美元后现已大涨了53%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　不过尾盘油价升势受限，分析师称，因投资人担忧在油价反弹两个月后，美国动力公司再度添加原油产值。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　交易商征引商场情报公司Genscape的数据称，到3月18日该周库欣库存削减57.0574万桶，至6,905万桶。之前库欣库存迫临7,000万桶，令商场人士担忧也许触及储能。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰有色金属</a>称，虽然降幅怎么说都不算很大，但最新的数据打破了继续的添加。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　路透访查的分析师估计，在到3月18日该周美国原油库存添加300万桶，改写纪录高位。政府数据显现，截至3月11日该周，库欣库存添加至6,750万桶的峰值。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　除了库存担忧外，一些分析师还担忧美国原油产值攀升。周五动力效劳公司贝克休斯发布的数据显现，上星期美国石油钻井渠道数量在连降12周后添加了一座。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　分析师遍及赞同过火解读钻井渠道上涨为时过早，因在曩昔一年，钻井渠道数量现已削减了三分之二至2009年来最低。不过有痕迹显现，自2月油价反弹了50%后，钻井渠道数量下降的趋势正在稳定下来。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　包含Oasis Petroleum和Pioneer Natural Resources Co在内的有些美国页岩油生产商正在激活已钻探但未完成油井，这也许给现已饱和的商场带来更多供应，且伤害油价继续反弹气势。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/finance/2996" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：有色金属并未显著好转</a></span></p><p><br/></p>', '美国NYMEX 5月原油期货价格周一(3月21日)收盘上涨0.38美元，涨幅0.9%，报41.52美元/桶，油价收盘突破41美元关口，再度改写上一年12月以来的高位。此前数据显现美国原油期货交割地库欣原油库存自1月来初次削减。', '壹银添丰：库存减少助美油上破41关口', '壹银添丰,库存减少,上破', '美国NYMEX 5月原油期货价格周一(3月21日)收盘上涨0.38美元，涨幅0.9%，报41.52美元/桶，油价收盘突破41美元关口，再度改写上一年12月以来的高位。此前数据显现美国原油期货交割地库欣', '', '', '2016-03-23', '2016-03-23', '', '', 12),
(3000, 25, '壹银添丰：油价可能重回跌势', '<p><span style="font-family: 宋体, SimSun;">&nbsp;<span style="font-family: 宋体, SimSun; font-size: 16px;">　 原油专家、Again Capital联合创始人John Kilduff周一(3月21日)指出，美国原油不会耐久维持在3月份的40美元/桶水平，油价将再次跌向25美元/桶水平。</span></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　上星期WTI原油涨幅达2.44%，为连续第五周上星期，因OPEC产油国宣告将于多哈举办冻产协议会议。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“我以为，即使他们将于下个月接见会晤，商场上仍将出现‘买谣言、卖现实&quot;这一景象，”Kilduff标明。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">指出，4月会议上不太可能会有效果，因沙特油长欧纳密(Ali Al-Naimi)2月时宣告，沙特不会减产因其不相信其他产油国将遵循这一承诺。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　与此同时，自1月份制裁免除以来，伊朗原油产量继续增加。“在回升至制裁前水平之前，该国不会在冻产协议上予以协作。”</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　Kilduff着重，不管冻住协议能否达到，首要的是欧佩克成员国和其他生产商能够坐下来参议这一事宜。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“8周内，油价自低位反弹上涨近50%…… 首要是是受冻住协议提振，这简直让我觉得可笑，”Kilduff指出，“现实上，仅仅因为他们愿意在某种程度上协作，多头就进场致使油价上涨。”</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　Kilduff指出，周五发布的原油钻井数量增加并不一定与近期价格上涨有任何关系。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“钻井数量坐落2009年以来最低位，这一节点上我不确定他们还能削减多少钻井，”Kilduff指出，并补偿道商场现已消化了欧佩克即将到来的会议及冻产协议。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　此外，Kilduff正在查询中国钱银和商场的表现。新年今后，远期外汇商场现已将人民币价值下降预期计入会议，可是人民币并未价值下降。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“这一要素导致悉数涨势，”他指出，“我以为，这还使得美油价格和生产商幸免于难。”&nbsp;</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章</span>：<a href="http://www.yytf099.com/finance/2999" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：库存减少助美油上破41关口</a></p>', '原油专家、Again Capital联合创始人John Kilduff周一(3月21日)指出，美国原油不会耐久维持在3月份的40美元/桶水平，油价将再次跌向25美元/桶水平。', '壹银添丰：油价可能重回跌势', '壹银添丰,油价,跌势', '原油专家、Again Capital联合创始人John Kilduff周一(3月21日)指出，美国原油不会耐久维持在3月份的40美元/桶水平，油价将再次跌向25美元/桶水平。', '', '', '2016-03-23', '2016-03-23', '', '', 15),
(3001, 1, '壹银添丰：多因素使白银运行在高位区', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　3月初至今，世界现货白银报价自低位反弹至16美元/盎司邻近，现在保持在高位区间运转。在美联储加息预期不断延缓的布景下，低利率环境将继续支持白银高位运转，一起，出资心情回暖也将进一步助涨银价。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　美联储鸽派会议声明助涨银价</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　美联储在本次会议上保持联邦基金利率0.25%—0.5%不变。美联储并未就下次何时加息给出承诺，声明称，加息取决于实践和预期经济状况，并重申加息过程将是缓慢的。美联储在声明中对近期经济形势作出了评价。美联储标明，美国经济活动以温文速度扩大，家庭开销增加，但公司出资和净出口疲软。尽管近几个月通胀有所攀升，但根据商场的通胀目标依然处于低位，值得注意的是，美联储会议基调较商场预期偏鸽派，白银止跌收涨。美联储称，年头以来，全球经济和金融商场出现剧烈动摇，尽管美国经济仍然温文扩大，但美联储供认，商场剧动和全球经济增速下滑对美国的远景构成了要挟。美联储对危险的评价颇为重要，这标明美联储对加息方针倾向于按兵不动。美联储3月会议上的危险评价，标明官员们不急于加息，期望对将来有更断定的知道后，再挑选加息，因而美联储4月加息的可能性并不高。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　美联储对将来经济评价偏慎重</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　美联储3月更新了利率和经济数据猜测，对将来经济评价偏慎重，加息预期进一步延缓将继续支持白银上涨。详细来看，美联储全线下调将来利率猜测。从最新利率猜测散点图来看，美联储官员们估计2016年年末时联邦基金利率中值为0.875%，意味着年内有两次加息，下一次加息可能在6月，这较上一年12月时四次加息的猜测大幅削减。此外，官员们估计2017年年末时联邦基金利率可达1.875%，2018年年末时为3%，长时间联邦基金利率为3.25%，也均低于上一年12月时的猜测。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　因为海外经济疲软和美国出口欠安，美联储下调经济增速。<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>估计2016年GDP增速为2.2%，比上一年12月时猜测低0.2个百分点；估计2017年GDP增速为2.1%，比上一年12月时猜测低0.1个百分点；估计2018年GDP增速为2.0%，与上一年12月时猜测持平。美国劳动力商场依然微弱，失业率猜测下移。美联储在声明中称，近期包含新增就业人数在内的一系列目标显现，将来劳动力商场将进一步走强。美联储官员们估计本年年内失业率可达4.7%，2018年年末时到达4.5%，均低于此前预期。受能源报价疲软和美元强势影响，通胀数据遭到下修。美联储官员们估计本年通胀为1.2%，比此前预期要低。因而，美联储整体调低经济数据猜测，标明对将来经济预期持慎重态度，利好白银报价。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　出资者心情进一步升温</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　归纳思考，在美联储释放鸽派会议声明的布景下，美国加息进程延缓，低利率环境降低了白银的持有成本。一起，SLV白银ETF出现加快流入态势，出资心情升温将进一步支持白银上涨。一般来说，SLV白银ETF持仓与世界银价出现高度正相关，白银持仓较高意味着白银报价体现较好的概率大。年头至今，SLV白银基金持仓自9888吨增加至10218吨，尤其是3月以来净流入增速加大，标明出资者看好将来白银报价走势。短期来看，估计银价短期内将保持高位区间运转。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/industrynews/2998" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：美国原油库存大幅增加，增幅远超预期</a></span></p>', '3月初至今，世界现货白银报价自低位反弹至16美元/盎司邻近，现在保持在高位区间运转。在美联储加息预期不断延缓的布景下，低利率环境将继续支持白银高位运转，一起，出资心情回暖也将进一步助涨银价', '壹银添丰：多因素使白银运行在高位区', '壹银添丰,白银,高位区', '3月初至今，世界现货白银报价自低位反弹至16美元/盎司邻近，现在保持在高位区间运转。在美联储加息预期不断延缓的布景下，低利率环境将继续支持白银高位运转，一起，出资心情回暖也将进一步助涨银价', '', '', '2016-03-24', '2016-03-24', '', '', 12),
(3002, 1, ' 壹银添丰：国际原油价格或以达到顶峰', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　当原油报价升至40美元/桶及以上时，页岩钻井就会“复出”。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　原油报价现已从其2月低点上涨约50%，并超越40美元/桶价位。可是这次反弹也许现已挨近其上限，至少或许暂时是这么，由于继续的供给过剩和新的页岩出产远景或约束原油报价进一步的潜在上涨。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　在曩昔的2个季度里，美国的石油产值稳步减少，且其产值自2015年4月触及近970万桶/日的峰值以来现已下降了50多万桶/日。美国石油公司在2016年现现已过许多切实可行的办法来减少其核算开销以及推延其石油钻探方案。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　这引发了新一轮的原油商场达观心情。此外，像伊拉克和尼日利亚等地石油供给的中止也致使近25万桶/日的石油供给减少，这些意外状况为3月份原油报价的上涨供给了动力。即使国际原油商场“油满为患”，可是地缘政治依然可以影响原油报价。更多的石油多头也是怀揣着4月OPEC石油会议的预期，凭仗“出产冻住协议也许会对全球石油供给过剩疑问发生实质影响”这一毫无根据的信仰勇敢做多。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　虽然</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">现已找到一些可以信任原油报价将上涨的理由，理由好像有许多，可是不会继续添加，数据为悲观心情的倚仗。到3月11日当周，美国的原油库存继续录得前史高位，增至5.23亿桶。直到原油库存开端大幅减少，不然原油报价在40美元/桶的阻力区间将面对重重阻力。伊朗产值也在继续添加，虽然增速低于预期。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　现实上，原油报价可以反弹至40美元/桶的价位很大程度上是由于投机。在曩昔不到2个月的时间里，由于空头头寸见顶后大幅减少，交易员敏捷平仓，然后推进原油报价上涨了12-13美元/桶。上星期的上升趋势得以继续，由于对冲基金以及别的主要资金管理机构添加了近17%的原油净多头头寸，空头头寸持仓如今处于自上一年6月份以来的最低水平。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　可是如今，石油交易商处于几个月来最达观的状态，但是相应的商场基本面依然没有变的明显明亮，因此交易员也许将自个置于油价提早回档的困难地步。一旦“OPEC不会前来解救”这一现实变的更加清晰，且交易员的多头头寸处于史无前例的高位，原油报价也许会在短时间内跌至30美元/桶下方的前史低位。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　但是，这不仅仅是一个投机者的游戏。跟着原油报价的上涨，原油现货商场也会呈现转变，由于当原油报价升至40美元/桶及以上时，页岩钻井就会“复出”。美国北达科他州一些区域的保本报价坐落20-25美元左右。页岩油挖掘活动现已成为一个“短周期”事情，一口页岩油井可以在数周或数月内完结，但是此前的离岸原油挖掘项目却需求数年。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　与此一起，美国页岩油气公司拥有数千座钻探过而又未完结的“半成品钻井”(DUC)。在曩昔一年里，石油公司不愿意钻透其油井，一起也不愿意出售至低迷的原油商场上去，但是为了节约短期流动资金，因此决议推延进一步的钻探活动。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/industrynews/3001" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：多因素使白银运行在高位区</a></span><br/></p>', '原油报价现已从其2月低点上涨约50%，并超越40美元/桶价位。可是这次反弹也许现已挨近其上限，至少或许暂时是这么，由于继续的供给过剩和新的页岩出产远景或约束原油报价进一步的潜在上涨。', ' 壹银添丰：国际原油价格或以达到顶峰', '壹银添丰,原油,价格', '原油报价现已从其2月低点上涨约50%，并超越40美元/桶价位。可是这次反弹也许现已挨近其上限，至少或许暂时是这么，由于继续的供给过剩和新的页岩出产远景或约束原油报价进一步的潜在上涨。', '', '', '2016-03-24', '2016-03-24', '', '', 11),
(3003, 25, '壹银添丰：昨日国内大宗商品全线下跌', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　 &nbsp;</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">23日讯，国内大宗产品以收跌为主，推动跟踪大宗产品综合体现的文华产品指数收跌。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　到收盘，螺纹钢期货领涨，主力合约收于每吨2193元，较前一交易日结算价上涨32元，涨幅1.48％；燃油期货领跌，主力合约收于每吨2059元，较前一交易日结算价跌落156元，跌幅7.04％。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　详细种类方面，有色金属全线收跌：铝期货主力合约收于每吨1.15万元，跌幅0.13％；铜期货主力合约收于每吨3.82万元，跌幅0.24％；铅期货主力合约收于每吨1.36万元，跌幅0.48％；锌期货主力合约收于每吨1.44万元，跌幅0.66％。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　石化类产品亦近全线收跌：ＰＶＣ期货主力合约收于每吨5445元，跌幅0.09％；ＰＴＡ期货主力合约收于每吨4664元，跌幅0.64％；焦煤期货主力合约收于每吨622.5元，跌幅0.88％；ＰＥ期货主力合约收于每吨9235元，跌幅0.91％；沥青期货主力合约收于每吨1848元，跌幅2.63％；橡胶期货主力合约收于每吨1.16万元，跌幅2.65％。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　农产品方面，软产品涨跌互现：白糖期货主力合约收于每吨5588元，跌幅0.34％；棉花期货主力合约收于每吨1.05万元，涨幅0.1％。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　油脂类产品弱势盘整：菜籽粕期货主力合约收于每吨1977元，涨幅0.71％；豆粕期货主力合约收于每吨2357元，涨幅0.34％；油菜籽期货主力合约收于每吨3948元，涨幅0.23％；而棕榈油期货主力合约收于每吨5410元，跌幅0.62％；豆油期货主力合约收于每吨6018元，跌幅0.86％。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/finance/3000" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：油价可能重回跌势</a></span></p><p><br/></p>', '到收盘，螺纹钢期货领涨，主力合约收于每吨2193元，较前一交易日结算价上涨32元，涨幅1.48％；燃油期货领跌，主力合约收于每吨2059元，较前一交易日结算价跌落156元，跌幅7.04％。', '壹银添丰：昨日国内大宗商品全线下跌', '壹银添丰,大宗商品,下跌', '到收盘，螺纹钢期货领涨，主力合约收于每吨2193元，较前一交易日结算价上涨32元，涨幅1.48％；燃油期货领跌，主力合约收于每吨2059元，较前一交易日结算价跌落156元，跌幅7.04％。', '', '', '2016-03-24', '2016-03-24', '', '', 11),
(3004, 25, '壹银添丰：铝金属未来仍有增长空间', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　现在国内电解铝职业可以用“2个添加、3个降低和4个特色”归纳。现货人士宋乃春解说，产值和花费均在添加，出资、效益以及出口大幅降低，而“4个特色”为产能过剩、恶性竞争、融资困难以及退出不畅。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　在传统观念中，电解铝一直被认为是高能耗、高污染职业，跟着技术发展，如今尽管现已脱离了高污染，但照旧是高能耗职业。因而，每一次国家方针调控，电解铝都是要点调控目标。宋乃春介绍，铝职业出资年均额现已从此前的1000亿元以上缩减到上一年的500多亿元。即便如此，近几年铝产值照旧以每年8%~10%的速度在添加，2015年原铝产值现已到达3140万吨。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　与此一起，电解铝作为国家经济建造不可或缺的首要原材料，需要相对旺盛。比方，如今高铁厢体等也采用揉捏铝，而铸造铝首要用于汽车发动机缸体、气缸盖等。此外，铝板、铝箔作为包装材料，花费添加也尤其显着。可以说，中国是当之无愧的铝生产国和花费大国，但现在铝公司和别的首要工业品公司相同，大多在本钱线下运转，铝根本处于全职业亏损状况。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“考虑到公司区别和花费动摇，2016年铝价很也许在11000—13000元/吨。”现货人士宋乃春表明，尽管国内经济增速放缓，需要添加也会相应削减，但跟着城镇化建造加速和“一带一路”的推进，铝需要会遭到必定程度的推进。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　现在<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰有色金属</a>来看，铝价仍对比坚挺。“从报价走势来看，铝价现已从底部走出来了。铝价一有本钱支持，二有刚性需要。”他剖析，本来长期而言，铝花费还有很大的添加空间。从曩昔10年的统计数据来看，国民经济每添加1万亿元，铝花费会添加约64万吨。据此国内有专家猜测铝花费顶峰应该在4500万吨摆布。时刻方面，安泰科猜测这将经历8年时刻，中国有色金属工业协会猜测为10年。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　到达4500万吨峰值意味着铝花费不再添加，进入平衡期。而平衡期以后，铝花费将逐步走上下坡路。宋乃春解说，此刻铝的再生功能现已十分强，铝可以重复利用20次摆布。跟着废铝收回逐步添加，原铝在产值、需要两方面也许一起逐步降低。估计5年以内，铝需要还能保持年均约5%的添加，随后便会依次进入平衡期和降低期。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/finance/3003" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：昨日国内大宗商品全线下跌</a></span></p>', '现在国内电解铝职业可以用“2个添加、3个降低和4个特色”归纳。现货人士宋乃春解说，产值和花费均在添加，出资、效益以及出口大幅降低，而“4个特色”为产能过剩、恶性竞争、融资困难以及退出不畅。', '壹银添丰：铝金属未来仍有增长空间', '壹银添丰,铝金属,增长', '现在国内电解铝职业可以用“2个添加、3个降低和4个特色”归纳。现货人士宋乃春解说，产值和花费均在添加，出资、效益以及出口大幅降低，而“4个特色”为产能过剩、恶性竞争、融资困难以及退出不畅。', '', '', '2016-03-24', '2016-03-24', '', '', 11),
(3005, 1, '壹银添丰：暴涨暴跌的“黑色系”', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　昨天，通过短暂连涨的黑色系期货价格演出惊人一“跳”，并领跌国内产品期市，铁矿石、焦煤、沥青主力合约跌停。此前，在大宗产品价格崎岖趋于平稳之际，许多期货出资者以为大宗产品再也掀不起“大风波”了，但一支“奇兵”却让大宗产品尤其是黑色系期货赚足了眼球：黑色系期货暴涨暴跌，变成大宗产品商场的心情目标。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　过夜外盘大宗产品商场大跌、国内消息称上海或收紧房地产方针，昨天早盘，期货散户于先生灵光一闪，“报仇”的时机也许来了。他预感到黑色系期货多头也许扛不住了，多头撤离很也许导致价格回落，决断增加了空单仓位。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　通过前期的张狂拉涨，近三个交易日铁矿石期货接连收阴线，周四收盘铁矿跌落24.5点，以6%的跌停报收，9月合约成交量再创新高。而螺纹钢在复产不及预期的情况下，走势强于铁矿，但在黑色系全体走弱的布景下，螺纹主力合约也跌落了3.42%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　回忆本轮黑色系暴涨潮，业内人士形容其特色为“突但是密布”。本次黑色系期货暴涨潮共分为两轮，榜首轮发生在3月7日、8日，国内期市螺纹钢及铁矿石期货接连涨停，但随后接连回落；3月17日，第二轮暴涨潮降临，直至3月21日，螺纹期货成交量从缺乏800万手疾速增至2000万手，铁矿石期货在3月9日大幅贴水108元也推动期货疾速拉升，多头一时风头无限。3月22日，铁矿石期货开端跌落。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　关于这轮黑色系暴涨暴跌潮的推手，<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>以为，增量资金入市是行情波幅加大的重要因素。在产品行情汹涌澎湃之际，股票商场公募基金等在行情平淡的情况下现已纷繁介入期市，这波行情的发起者很也许来自“炒股”的资金。仅3月17日一天内，期市净流入资金就达194亿元，为整个商场规模的4%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“春节以来，美联储加息节奏放缓，催生了大宗产品热，来自股市的有些资金进入了期货商场。许多证券公司都在约请期货公司研讨员对客户进行培训和举行出资战略报告会。许多自然人加马上开户脚步。我们近来也接连接到组织包含公募基金的约请来供给大宗产品的战略。”海通证券期货研讨主管高上表明。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/industrynews/3002" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：国际原油价格或以达到顶峰</a></span></p>', '昨天，通过短暂连涨的黑色系期货价格演出惊人一“跳”，并领跌国内产品期市，铁矿石、焦煤、沥青主力合约跌停。此前，在大宗产品价格崎岖趋于平稳之际', '壹银添丰：暴涨暴跌的“黑色系”', '壹银添丰,暴涨,黑色系', '昨天，通过短暂连涨的黑色系期货价格演出惊人一“跳”，并领跌国内产品期市，铁矿石、焦煤、沥青主力合约跌停。此前，在大宗产品价格崎岖趋于平稳之际', '', '', '2016-03-25', '2016-03-25', '', '', 16),
(3006, 1, '壹银添丰：大宗商品二季度预测', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　随着第一季度进入结尾，商场对第二季度的产品商场展开讨论。从大类财物装备视点而言，当时全球各首要种类财物的体现与油价呈现较强的相关性的背面，意味着啥呢？</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　毋庸置疑，原油在大类财物装备中非常重要。自2月初油价反弹以来，油价与全球大类财物呈现出高度的相关性，这意味着私人部分和公司杠杆率仍是较高。只要减缓通缩担忧，花费者才会更多地花费，进而推进公司加速出产。在公司层面，公司债款对现金流比例居高不下，这意味着尽管公司在财务报表层面存在税后利润，可是实践出产却面对现金流紧缺的困境。回到原油商场，远月合约升水未必可以得以继续，除非需要端得到明显改进以及在控制产值方面有实质性发展。原油面对41美元/桶邻近的较强阻力位，若可以有用打破，则下一方针报价将奔向43美元/桶。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　金银比值是近期商场较热的论题之一，笔者以为金银比值自身成为买卖战略，或者说押注比值回归缺少逻辑。由于金银的工业属性存在差异，金银比值发作动摇只是意味着黄金、白银各自动摇起伏不一致，从而致使比值发作违背，这种违背的回归并不具有必定性。笔者不看空黄金，原因有二：一是汇率要素。美元兑日元或连续跌落，这将致使产品空头头寸继续减少，此刻利多黄金。二是商场关于我国主权债款CDS的看法。外资人士将银行业债转股和延期付出评价为负面事件，黄金将仍然遭到喜爱。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　至于铜种类，近期商场构造发作明显改动，最首要的特点是LME和SHFE期铜远期曲线升贴水构造呈现分解，LME铜远期贴水而SHFE铜远期升水，在中期基本面没有呈现较明显改进的大布景下，商场参与者瞄准沪铜远期升贴水构造，将伦敦铜移到国内，吃掉国内远月升水基差。这也就印证上海库存创40万吨天量的景象。展望第二季度，若微观缺少较强预期或商场做多心情缺乏，笔者以为国内沪铜远月升水将逐渐回落，转而进入远月贴水。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　全体来看，尽管当时商场的共识是第一季度财物报价动摇较大，但<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>以为第二季度财物报价动摇起伏也不会小。当时商场承受油价在25—45美元/桶区间动摇的预判，这意味着商场对油价动摇的对冲方向也存在较大变化。如果商场对美国中心通胀预期进一步增强，不扫除美元重拾升势的也许，这将令大宗产品全体承压的概率添加。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/industrynews/3005" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：暴涨暴跌的“黑色系”</a></span></p>', '　　随着第一季度进入结尾，商场对第二季度的产品商场展开讨论。从大类财物装备视点而言，当时全球各首要种类财物的体现与油价呈现较强的相关性的背面，意味着啥呢？', '壹银添丰：大宗商品二季度预测', '壹银添丰,大宗商品,二季度', '　　随着第一季度进入结尾，商场对第二季度的产品商场展开讨论。从大类财物装备视点而言，当时全球各首要种类财物的体现与油价呈现较强的相关性的背面，意味着啥呢？', '', '', '2016-03-25', '2016-03-25', '', '', 10);
INSERT INTO `by_article` (`id`, `cate_id`, `title`, `content`, `intro`, `site_title`, `site_keywords`, `site_description`, `tags`, `flag`, `create_date`, `update_date`, `img`, `attach`, `click`) VALUES
(3007, 25, '壹银添丰：期交所全部挤进国际衍生品交易所前十', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　依据美国期货业协会(FIA)最新发布的对全球78家衍生品买卖所期货期权成交量的统计数据，2015年全球场内期货期权成交量为247.7亿手，同比增加13.5%。以大连产品买卖所为首的国内三家产品买卖所悉数提高前十，其间大商所以期货成交量11.16亿手、由上年的第十位升至第八位而耀人眼目(郑商所、上期所别离第九、第十)。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　从种类成交状况看，国内期交所多个种类在世界商场同类产种类位列前茅。为首的大商所体现更为杰出，其豆粕期货成交量位居全球农产品期货期权首位，棕榈油、豆油、玉米、玉米淀粉、黄大豆1号和鸡蛋期货别离位居全球农产品期货期权成交量排行的第4、第5、第9、第13、第17和第19位，10个农产品中有7个位列前20名；铁矿石期货位列全球金属期货期权成交量排行的第2位；焦炭、焦煤期货在全球动力期货期权成交量排行中位居第16和第17位。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　跟着商场规划增加、构造改进，大连期货商场功用表现更为充沛。从商场报价有用性来看，玉米、玉米淀粉、豆油、棕榈油、焦炭、铁矿石等种类期现报价有关性均在0.9以上，且具有良好的超前预期性，变成有关种类国内商场的权威参考报价。公司参加期货避险职极且取得了极好的效果。如大商所油脂油料、玉米加工、煤焦矿等避险链条招引了大批的工业公司参加，目前国内90%的规划以上油脂油料公司(日压榨才能在1000吨以上)、85%以上的棕榈油进口公司、500多家钢铁工业链公司参加大商所有关种类的期货买卖。豆油、棕榈油、豆粕等期货种类已经变成很多公司现货买卖的计价根底，上一年几大粮商“大商所期货报价+基差”定价方法出售豆粕的数量已占其出售总量的30%；跟着玉米收储方针调整预期及玉米、玉米淀粉期货的成长，上一年以来玉米和玉米淀粉期货商场功用表现得到极大提高，期货商场开端变成国内商场报价的参照基地，一些玉米加工公司开端在玉米淀粉运营中推广运用基差交易形式，以便于两边公正合理地确定报价、经过“预买预卖”提早规划生产运营，并更为有用地经过套期保值买卖躲避报价动摇危险；上一年在煤焦矿报价大幅下行的布景下，有关公司经过期货商场有用对冲了危险，保证了公司的继续运营，期货套保操作已经变成很多公司运营决议计划中不可或缺的组成部分。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>认为，尽管国内期交所悉数提高世界衍生品买卖所前十，但国内期货商场仍是一个单一、关闭的商场，与中国的交易位置、人民币世界化以及更多地参加全球经济治理的需求，与经济新常态下很多实体公司日益增加的危险办理需求很不相适应。为非常好效劳实体经济发展，需求及早上市产品期权、以铁矿石等期货为试点推进商场对外敞开，早日建成多元、敞开的具有相应世界影响力的综合性衍生品商场，以进一步提高国内衍生品商场效劳实体经济的才能和水平。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; &nbsp;上一篇文章：<a href="http://www.yytf099.com/finance/3004" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：铝金属未来仍有增长空间</a></span></p>', '依据美国期货业协会(FIA)最新发布的对全球78家衍生品买卖所期货期权成交量的统计数据，2015年全球场内期货期权成交量为247.7亿手，同比增加13.5%。以大连产品买卖所为首的国内三家产品买卖所悉数提高前十', '壹银添丰：期交所全部挤进国际衍生品交易所前十', '壹银添丰,期交所,国际衍生品', '依据美国期货业协会(FIA)最新发布的对全球78家衍生品买卖所期货期权成交量的统计数据，2015年全球场内期货期权成交量为247.7亿手，同比增加13.5%。以大连产品买卖所为首的国内三家产品买卖所悉', '', '', '2016-03-25', '2016-03-25', '', '', 7),
(3008, 25, '壹银添丰：沪钢多头行情或将结束', '<p>　<span style="font-family: 宋体, SimSun; font-size: 16px;">　近期沪钢遭到基本面和资金面一起推进，成为商品市场最耀眼的“明星”种类，成交量接连数日保持千万手以上，报价也创下此轮反弹以来的新高。不过，咱们以为现在钢厂超高的赢利不可继续。跟着钢厂不断复产，未来供需联系有望再度发作逆转。别的，前期获利盘有出逃痕迹，远月回调压力逐步显现，主张背靠2200元/吨一线尝试抛空。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　再看需要端，统计局最新对基建、制造业和房地产三个最主要用钢行业发布的数据显现，1—2月基建和制造业出资添加分别为15.71%和7.5%，环比降低1.58%和0.6%，均不及预期。1—2月房地产出资和新开工增速分别为3%和13.7%，超过预期。不过咱们发现房地产出资和新开工增速显着上升与上一年同期基数过低有很大联系。别的，房地产待售面积继续大幅提高并创新高，显现去库存压力仍然很大。综合评价，咱们以为需要端可谓中规中矩，并未有超预期的东西，仍略低于上一年同期水平。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">库存方面，五大种类钢材社会库存(包括有些钢厂前移库存)为1182万吨，比较上一年1550万吨大幅削减368万吨。同时，钢厂库存也显着低于上一年同期。库存较低主要是因为上一年工业过度去库存和春节前后钢厂开工削减。春节后通过中间商和下游用户的两轮会集补库，库存降低速度已开端放缓，低库存炒作体裁有所削弱。别的，海关总署数据显现，2月中国出口钢材811万吨，同比添加4.0%。1—2月钢材累计出口1785万吨，同比降低1.3%。近期国内钢价大幅上涨，现已高于出口报价，使得出口订单显着削减，乃至呈现有些悔单状况，出口削减会相应添加国内资本的投进。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　近期铁矿石、焦炭报价也相继上涨，不过肯定报价上涨远小于制品钢材，也使得现在钢厂赢利达到近两年来的最高水平。考虑到质料端也在复产，质料供给并无缺口，钢厂赢利水平较高，质料本钱支持要素并不强。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/finance/3007" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">壹银添丰：期交所全部挤进国际衍生品交易所前十</span></a></p><p><br/></p>', '近期沪钢遭到基本面和资金面一起推进，成为商品市场最耀眼的“明星”种类，成交量接连数日保持千万手以上，报价也创下此轮反弹以来的新高', '壹银添丰：沪钢多头行情或将结束', '壹银添丰,沪钢,行情', '近期沪钢遭到基本面和资金面一起推进，成为商品市场最耀眼的“明星”种类，成交量接连数日保持千万手以上，报价也创下此轮反弹以来的新高', '', '', '2016-03-25', '2016-03-25', '', '', 9),
(3009, 1, '壹银添丰：铜市场投资者谨慎', '<p><span style="text-decoration: none;"></span></p><p>　　<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a><span style="font-family: 宋体, SimSun; font-size: 16px;">数据显现，截止上星期二以对冲基金为主的大型投机者，已接连两周小幅减少铜期货及期权净多头持仓。而就在周三铜价创下一个月来最大单日跌幅，彭博剖析称这主要因前日布鲁塞尔的恐怖袭击冲击了全球添加远景，加之同期美元的走强镇压了产品报价。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　美国期铜报价自1月底来的1.95美元/磅继续上涨至本月18日的2.314美元高点，反弹起伏超越18%，但现已接连三周徜徉在2.2~2.23美元区间，尤其是上星期三受到恐怖袭击事情影响，报价重挫2.3%，创下2月12日以来最大跌幅。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　铜价去年跌落超越20%，因商场忧虑过剩产能和逐步萎缩的全球需要之间存在对立。而到了今年，我国对自然资源的需要远景有所改善，让产品商场出现了一波超跌后的批改走势。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　海关数据显现，今年前两个月精炼铜进口较上年同期激增27.6%至652,474吨。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　不过四川川商商品交易中心剖析以为，这是由于其间很大一部分增幅似乎是我国国内铜价与海外铜价之间的价差形成的套利做法推进的。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“上海期交所的铜价高于LME报价，以致于在LME买入什物铜，进口到我国，然后交割到上海期交所，就能够获利，”巴克莱在本月21日的陈述中称，“什物交易员对这一套利信号做出反应，将铜运往我国。另一个能够表明上海期交所和LME存在套利时机的迹象是，上海期交所可交割库存触及前史高点，而LME库存已降至2014年10月以来最低水准。”</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　巴克莱的观念或许意味着，我国铜进口添加与实际铜需要上升的关系不大，反而是与企图断定套利赢利的交易员相关更大。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　关于那些以为房地产和基础设施建造好转实际上在股动我国需要添加的达观观念而言，这并不是个好征兆。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　铜的商场数据中有一部分的确支持国内商场活动升温的观念，那就是2016年前两个月铜矿砂及其精矿进口量大增57.5%至263万吨。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　这表明我国锻炼活动在升温，这关于需要而言或许是一个活跃信号，但只要在这些铜矿砂和精矿被消耗掉而不是被储入库房的状况下才是如此，不过如今还不能断定状况的确是如此。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　法兴银行本月引荐客户做空铜价，因我国经济下行速度、需要和供应的对立也许超越预期。摩根士丹利在3月15日的陈述中减少2016年铜价预期3个百分点，称全球微观环境的不断定性是金属报价难以继续走强的要害制约要素。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“很难大量的关停供应，特别是那些债款压身的公司，即使生产成本高于价格。”加拿大蒙特利尔银行驻芝加哥首席出资官Jack Ablin表明。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;"><span style="font-family: 宋体, SimSun; font-size: 18px; text-decoration: none;"></span>&nbsp; &nbsp; 上一篇文章：</span><a href="http://www.yytf099.com/industrynews/3006" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：大宗商品二季度预测</a></p>', '美国产品期货交易委员会（CFTC）数据显现，截止上星期二以对冲基金为主的大型投机者，已接连两周小幅减少铜期货及期权净多头持仓。而就在周三铜价创下一个月来最大单日跌幅', '壹银添丰：铜市场投资者谨慎', '壹银添丰,投资者,铜', '美国产品期货交易委员会（CFTC）数据显现，截止上星期二以对冲基金为主的大型投机者，已接连两周小幅减少铜期货及期权净多头持仓。而就在周三铜价创下一个月来最大单日跌幅', '', '', '2016-03-28', '2016-03-28', '', '', 5),
(3010, 1, '壹银添丰：上周股市美元受宠，黄金下跌', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>行情回忆</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　1.周五美黄金04合约报价跌落7.4美元，跌幅0.61%，报收于1209.5美元。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　2.周五美白银05合约报价跌落0.035美元，跌幅0.23%，报收于15.165美元。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　3.周五晚间沪金1606合约跌落0.055元，跌幅0.02%，报收于256.05元。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　4.周五晚间沪银1606合约上涨4元，涨幅0.12%，报收于3414元。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　财经要闻</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　1.统计局：1-2月份全国规划以上工业企业利润总额同比增加4.8%</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　2.财政部：2月中央政府收入环比降逾三成，出入赤字为618亿元</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　3.EPFR最新陈述显现，新式商场股票基金的资金净流入额创下曩昔37周以来的高位</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　4.TIAA全球资产办理：美国股市下半年将会上涨，标普500指数也许打破之前的高点，全年也许上涨5%-10%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　5.巴克莱：今年前两个月大宗产品共取得超越200亿美元资金流入，为2011年以来最强开年体现，但估计这一态势无法持续。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　近期美联储官员对加息进程的估计，致使美元指数走高。黄金报价自1月份以来阅历了三种不一样推进要素：首先是12月份美联储加息预期实现后利空要素削弱，其次是2月份因为全球股票商场跌落致使避险心情升温，以及后期3月份跟从产品报价上涨。近期产品报价回调黄金跟从跌落。在短期没有新的推进要素呈现之前，估计保持弱势。跌落的危险在于，因为股票商场和产品商场齐跌，致使避险心情再度升温。可是此要素现已在此波上涨中呈现过，即便呈现也会削弱。操作上，沪金短线空单背靠258持有，暂不追空，小幅反弹时背靠压力位轻仓试空。</span></p><p>&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/industrynews/3009" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：铜市场投资者谨慎</a></p>', '周五美黄金04合约报价跌落7.4美元，跌幅0.61%，报收于1209.5美元', '壹银添丰：上周股市美元受宠，黄金下跌', '壹银添丰,股市,美元,黄金', '周五美黄金04合约报价跌落7.4美元，跌幅0.61%，报收于1209.5美元', '', '', '2016-03-28', '2016-03-28', '', '', 7),
(3011, 25, '壹银添丰：美国铝业扩大铝轮毂产量,铝价回升', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　公司指出M-Series铝轮毂比一般钢制轮毂降低了近一半的质量，因而不只能够进步燃油功率的一起还能削减二氧化碳的排放。这种轮毂是能够被无限收回使用的，有较强的抗腐蚀性，修理本钱低。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　为有用应对有色金属报价继续跌落，打破越出产越亏本的怪圈，脱节产能过剩窘境，美国铝业车轮及交通商品公司（Alcoa Wheel &amp; Transportation Products）决议扩展使用于中型商用车的铝轮毂产能。当时，公司有必要决断采纳弹性出产办法自救，不只能够减产保价，一起不会显着添加单位本钱。这是引领有色金属报价回归正路，推进职业走上健康、可继续开展之路的必然选择。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　这些年，受出资需要低迷、产能过剩以及世界大宗商品报价走低一级许多要素的影响，有色金属报价不断跌落并屡创前史新低。据2015年四季度中经有色金属工业景气指数陈述闪现，2015年四季度有色金属出厂报价同比跌落13.2%，接连16个季度处于同比降低态势。其间，铝价比20年前（1993年至1998年）的均匀报价1.48万元/吨还低18.2%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　有色金属报价的断崖式跌落，致使国内有色金属锻炼公司的盈余状况显着恶化。自2012年以来，中国铝锻炼职业已接连3年亏本，且亏本面继续扩展，全体亏本程度不断加重。据测算，现在中国电解铝职业均匀含税彻底本钱约1.2万元/吨，均匀含税现金本钱约1.03万元/吨，即在当时铝价下，仍有大多数公司处于亏本状态。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“因为有色金属报价全部下滑并严峻低于本钱线，迫使各大锻炼公司不得不纷繁采纳大幅度减产办法，以应对运营艰难。”中国工商银行出资银行研究中心分析师罗荣晋说，这也致使有色金属锻炼公司化解产能过剩的压力空前加大，其间电解铝职业较为杰出。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　值得注意的是，在多方要素作用下，现在电解铝职业已有回暖痕迹。据2016年1月中色铝锻炼工业月度景气指数陈述闪现，2016年1月，中色铝锻炼工业先行合成指数为65.79，脱节了继续下滑的趋势。虽然LME铝价同比降幅较大，但从环比来看，2016年1月与2015年12月比较报价根本相等，且SHFE铝价在阅历了2015年12月的继续上升后，2016年1月根本在1.06万元/吨至1.08万元/吨的区间动摇。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“铝价上升在必定程度上说明晰公司弹性出产作用现已闪现。”<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;"><strong>壹银添丰有色金属交易中心</strong></a>说，一方面，公司减产作用显着：2015年12月，电解铝日产量降至8.16万吨，较2015年6月最高的9.19万吨削减了1.03万吨；氧化铝减产作用也将在2016年逐步闪现；另一方面，铝花费新增长点不断出现，如汽车铝车身等使用的开展将为推进铝花费增加新动力，为电解铝职业脱节产能过剩窘境供给未来。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; &nbsp;上一篇文章：<a href="http://www.yytf099.com/finance/3008" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：沪钢多头行情或将结束</a></span></p>', '公司指出M-Series铝轮毂比一般钢制轮毂降低了近一半的质量，因而不只能够进步燃油功率的一起还能削减二氧化碳的排放。这种轮毂是能够被无限收回使用的，有较强的抗腐蚀性，修理本钱低', '壹银添丰：美国铝业扩大铝轮毂产量,铝价回升', '壹银添丰,扩大,铝轮毂,铝价', '公司指出M-Series铝轮毂比一般钢制轮毂降低了近一半的质量，因而不只能够进步燃油功率的一起还能削减二氧化碳的排放。这种轮毂是能够被无限收回使用的，有较强的抗腐蚀性，修理本钱低', '', '', '2016-03-28', '2016-03-28', '', '', 5),
(3012, 25, '壹银添丰：美元未来走势分析', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　上星期，美元与大宗产品商场大逆转：美元兴起，变成上星期商场最大赢家，而同期黄金、原油“变脸”，大宗产品价格全体回落。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　截至3月24日，美元指数接连第五个交易日上涨，创下2015年8月初以来最好体现。3月25日，美元指数震动。大宗产品方面，黄金、原油跌势最为严峻，上星期WTI原油期货本周累计跌落约4.1%；布伦特原油期货本周累计跌落近3%，创1月中旬以来最大单周跌幅；现货黄金上星期累计跌幅则创4个月以来最大跌幅。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　有剖析人士以为，美元也许正在酝酿新一轮反击战。当然，这其间也不排除全球疲软的经济基本面不足以支持产品价格继续上涨。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　这与美联储高官们的“鹰”派言辞不无关系。鸽派声明发布刚满一星期，美联储鹰派官员们便现已忐忑不安，公开呼吁4月加息。圣路易斯联储主席布拉德(James Bullard)近来表明，美国离第2次加息“也许不远了。”</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　美元指数大受提振，接连五个交易日上涨。一些剖析人士乃至以为，加息正在重回商场焦点，美元有望敞开中长期涨势。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a>最新数据显示，以对冲基金为首的大型出资组织所持有的美元净多头合约创下9个月来最大降幅。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“这很也许是空头回补造成的。数据现已表明商场投机力气在阅历一轮美元兜售后，手里可供兜售的美元头寸现已不多，美元跌落走势或回转。此刻美联储官员当令宣布加速加息脚步的声响，无形间令对冲基金找到很好的借口，对美元进行空头回补。”他们剖析说。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“大宗产品指数在2011年头的峰值到现在一直都处于下滑走势。当然，美元同期呈现升值也并非偶尔。明显，别的要素也对商场产生了必定影响，可是美元对大宗产品价格的影响是尽人皆知的。”她说，此外，因为许多别的产品种类的交易价格低于其边沿生产成本，相关企业基本无利可图，其间石油工业则体现最为杰出。大宗产品的熊市还未完毕，可是能够断定现已接近底部。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/finance/3011" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：美国铝业扩大铝轮毂产量,铝价回升</a></span></p><p><br/></p>', '上星期，美元与大宗产品商场大逆转：美元兴起，变成上星期商场最大赢家，而同期黄金、原油“变脸”，大宗产品价格全体回落', '壹银添丰：美元未来走势分析', '壹银添丰,美元,走势', '上星期，美元与大宗产品商场大逆转：美元兴起，变成上星期商场最大赢家，而同期黄金、原油“变脸”，大宗产品价格全体回落', '', '', '2016-03-28', '2016-03-28', '', '', 6),
(3013, 1, '壹银添丰：国内成品油调价五次未能突破 “地板价”', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　依据“十个工作日”一调的准则，3月28日24时，新一轮国内成品油调价窗口即将翻开。因为世界油价依然低于40美元/桶，国家发改委决议本次汽、柴油报价暂不作调整。这已经是新定价机制实施后的第五次暂缓调价。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　本轮计价周期内，世界原油期货报价持续在36美元/桶-41美元/桶之间徘徊，而现货报价在近一个月的时间内，多数时间围绕在36美元/桶-39美元/桶区间动摇，成品油调价因未能打破“地板价”约束而再次搁浅。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　中宇资讯分析师高承莎在承受《证券日报》记者采访时表明，短期内世界原油期货报价在40美元/桶邻近震动的也许性较大。因此，现货均价打破40美元/桶的也许性相对来讲较小，预计下一轮成品油调价仍有也许受制于“地板价”约束而最终不做调整。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　但是，</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">却以为下轮成品油零售价上调的也许性较大。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　刘霞向《证券日报》记者解说称，尽管各个产油国关于4月17日举行的原油冻产会议情绪各不相同，但大多数产油国表现出的活跃配合情绪，将会对市场心态构成支持效果。此外，就美国本周的原油库存数据来看，一方面商业库存持续改写前史新高，另一方面库存呈现回头痕迹，因此，这两项数据关于油价的效果彼此抵消。所以，归纳来看，后期世界油价将会有一个阶段性的触底进程，此后将会从头反弹至40美元/桶以上，并有望触及42美元/桶。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　受世界油价低迷影响，“三桶油”也毫无意外被拖累。3月23日，中石油发表的年报显现，2015年该公司完成净利润355.17亿元，同比降低66.9%；24日，中海油发布的年报显现，该公司上一年完成净利202.5亿元，同比降低66.4%；尽管中石化还未发表全年成绩，但据该公司此前发布的上一年前三季度陈述以及第四季度世界原油报价的趋势能够猜测，该公司在2015年的净利润很有也许与其他两家公司相同大幅跌落。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/industrynews/3010" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：上周股市美元受宠，黄金下跌</a></span></p>', '依据“十个工作日”一调的准则，3月28日24时，新一轮国内成品油调价窗口即将翻开。因为世界油价依然低于40美元/桶，国家发改委决议本次汽、柴油报价暂不作调整', '壹银添丰：国内成品油调价五次未能突破 “地板价”', '壹银添丰,成品油,地板价', '依据“十个工作日”一调的准则，3月28日24时，新一轮国内成品油调价窗口即将翻开。因为世界油价依然低于40美元/桶，国家发改委决议本次汽、柴油报价暂不作调整', '', '', '2016-03-29', '2016-03-29', '', '', 6),
(3015, 25, '壹银添丰：大宗商品下行概率大', '<p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　前期以原油为代表的大宗商品商场迎来了一轮较大的反弹行情，尤其是3月美联储不加息的消息进一步带动商品商场反弹，这也给商场带来了较大的豁达心境。但是接受采访的多位分析人士认为，这并不代表大宗商品现已形成了反转。<br/></span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“随着原油突破40美元，大宗商品在悉数3月均有不错表现，从商场心境和资金流向看，上涨行情并不会在短期结束，更有或许是上涨后的回调。如今从各品种的持仓和资金分析，行情都有继续之势，后续应更多注重需求是不是的确增加，是不是有新抢手出现。”屈晓宁说，在美元近三个月的轰动期，大宗商品均出现不一样程度的上涨，特别是黑色品种和有色金属，上涨幅度都很大，这表明相对比价联络下，美元和大宗商品首要呈负相关联络。长期来看，以美元计价的商品会在自身供需和美元增值双重压力下轰动，而以黑色为主的商品则会更多注重国内商场底子面的改动。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　对于原油商场，</span><a href="http://www.yytf099.com/" style="font-family: 宋体, SimSun; font-size: 16px; white-space: normal; color: black; text-decoration: underline;"><span style="font-family: 宋体, SimSun; font-size: 16px;">四川川商商品交易中心</span></a><span style="font-family: 宋体, SimSun; font-size: 16px;">认为，如今的要害点在于OPEC和非OPEC国家能否达到减产的协议，如今包括伊朗等国家就连冻产协议都不情愿签定，这意味着全球产油国为了争夺商场比例，确保本国石油出口收益，并不容易发动减产。从近来的数据来看，有些国家石油产值还在创新高，冻产协议对于供应过剩几乎作用全无，此前反弹首要是根据产出下滑的预期，而预期没有完成，那么原油价格必然会从头回归底子面驱动的跌势。而大宗商品反弹或许告一段落，但短期商品大幅跌落的或许性也很小，因而新一轮轰动行情或许会翻开。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　“尽管本年开端以原油为首的大宗商品走出了一波不小的反弹，但是从更大周期看，大宗商品仍处于大周期的熊市。”王守凯分析，大宗商品指数在2011年头的峰值到如今一直都处于下滑走势。当然，美元出现增值也并非偶尔。明显，其他要素也对商场产生了一定影响，但是美元对大宗商品价格的影响是尽人皆知的。许多商品的交易价格低于其边缘生产成本，相关企业底子无利可图，其间石油工业表现最为出色。大宗商品的熊市还未结束，但是可以断定现已靠近底部，此轮反弹或将结束，但是在底部企稳后大周期的反弹不会悠远。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/finance/3012" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：美元未来走势分析</a></span></p><p><br/></p>', '前期以原油为代表的大宗商品商场迎来了一轮较大的反弹行情，尤其是3月美联储不加息的消息进一步带动商品商场反弹，这也给商场带来了较大的豁达心境。', '壹银添丰：大宗商品下行概率大', '壹银添丰,大宗商品,下行', '前期以原油为代表的大宗商品商场迎来了一轮较大的反弹行情，尤其是3月美联储不加息的消息进一步带动商品商场反弹，这也给商场带来了较大的豁达心境。', '', '', '2016-03-29', '2016-03-29', '', '', 9),
(3016, 25, '壹银添丰：美国原油库存料将增加', '<p>　　<a href="http://www.yytf099.com/" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">四川川商商品交易中心</a><span style="font-family: 宋体, SimSun; font-size: 16px;">周一(3月28日)发布的调查结果显现，美国上星期原油库存料将接连第七周上升，一起汽油和精粹油库存料将双双削减。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　依据受访的8名分析师均匀预期，到3月25日当周美国原油库存料将添加320万桶，而汽油库存将削减240万桶，精粹油库存则将削减10万桶。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　此外，3月25日当周精粹厂利用率估计降低0.1%，至88.3%。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　美国能源信息署(EIA)发布最新的库存数据显现，到3月18日当周美国原油库存添加935.7万桶，再创前史新高，是分析师估计添加309万桶的三倍多，前值为添加131.7万桶，现在库存量到达5.325亿桶，增幅1.8%。美国原油日均进口添加69.1万桶，为2013年来最高。当周美国汽油库存削减464.2万桶，为2014年4月5日以来的最大当周降幅，首要原油交割地，俄克拉何马州库欣区域库存削减125.8万桶，为七周来初次降低且创2015年9月11日来的最大单周降幅。一起美国上星期原油日均产值环比削减3万桶至903.8万桶/日。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">　　美国石油学会(API)将于北京时间本周三(3月30日)04:30发布美国上星期原油库存数据，而美国能源信息署(EIA)将于当天22:30发布官方库存陈述。</span></p><p><span style="font-family: 宋体, SimSun; font-size: 16px;">&nbsp; &nbsp; 上一篇文章：<a href="http://www.yytf099.com/finance/3015" style="font-family: Simsun; font-size: medium; white-space: normal; color: black; text-decoration: none;">壹银添丰：大宗商品下行概率大</a></span><br/></p>', 'FX168讯据外媒周一(3月28日)发布的调查结果显现，美国上星期原油库存料将接连第七周上升，一起汽油和精粹油库存料将双双削减。', '壹银添丰：美国原油库存料将增加', '壹银添丰,原油,库存', 'FX168讯据外媒周一(3月28日)发布的调查结果显现，美国上星期原油库存料将接连第七周上升，一起汽油和精粹油库存料将双双削减。', '', '', '2016-03-29', '2016-03-29', '', '', 5),
