(2, '联系我们', '<p class="MsoNormal" style="text-indent:24.0pt;mso-char-indent-count:2.0;line-height:24.0pt;mso-line-height-rule:exactly"><br/></p><p class="MsoNormal" style="text-indent:24.0pt;mso-char-indent-count:2.0;line-height:24.0pt;mso-line-height-rule:exactly"><span lang="EN-US" style="font-size:12.0pt">&nbsp;&nbsp;&nbsp;&nbsp;<o:p></o:p></span><span style="font-size: 14pt;">&nbsp;&nbsp;&nbsp;&nbsp;公司名称：&nbsp;陕西壹银添丰有色金属经营公司</span></p><p class="MsoNormal" style="text-indent:24.0pt;mso-char-indent-count:2.0;line-height:24.0pt;mso-line-height-rule:exactly"><span lang="EN-US" style="font-size:12.0pt">&nbsp;&nbsp;&nbsp;&nbsp;<o:p></o:p></span><span style="font-size: 14pt;">&nbsp;&nbsp;&nbsp;&nbsp;办公地址：<span style="font-size: 19px; line-height: 32px; text-indent: 32px;">上海市宝山区共和新路5000弄绿地大厦6号楼1110</span></span></p><p class="MsoNormal" style="text-indent: 24pt; line-height: 24pt;"><span lang="EN-US" style="font-size:12.0pt">&nbsp;&nbsp;&nbsp;&nbsp;<o:p></o:p></span> <span style="font-size: 14pt;">&nbsp; &nbsp;公司总机： 021-62509730</span></p><p class="MsoNormal" style="text-indent: 24pt; line-height: 24pt; text-align: center;"><span style="font-size: 14pt;"><br/></span></p><p class="MsoNormal" style="text-indent: 24pt; line-height: 24pt; text-align: center;"><span style="font-size: 14pt;"><img width="530" height="340" src="http://api.map.baidu.com/staticimage?center=121.451534,31.328088&zoom=18&width=530&height=340&markers=121.451534,31.328088"/></span></p><p class="MsoNormal" style="text-indent: 24pt; line-height: 24pt;"><span style="font-size: 14pt;"><br/></span></p><p class="MsoNormal" style="text-indent: 24pt; line-height: 24pt;"><span style="font-size: 14pt;"><br/></span></p><p class="MsoNormal" style="text-indent: 24pt; line-height: 24pt;"><span style="font-size: 14pt;"><br/></span></p>', '联系我们,壹银添丰集团地址,交易地址,有色金属交易地址', '壹银添丰集团是四川川商商品交易中心,壹银添丰集团地址：上海市宝山区共和新路5000号绿地集团6栋801-816', '联系我们,壹银添丰集团地址,交易地址,有色金属交易地址', 'contact', 'about_page', 'contact us'),
(3, '公司简介', '<p><span style="font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;">壹银添丰财富集团是四川川商商品交易中心，是一家专业从事有色金属经营和投资咨询的大型集团公司。秉承以客户为中心，为客户创造价值，互利互赢的发展战略，迎合全球化的趋势，为广大投资者及时传全球金融资讯、贵金属行情分析。</span></p><p><br/></p><p><span style="font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;">包容：聚集贤能</span></p><p><br/></p><p><span style="font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;">主动：迎接变化</span></p><p><br/></p><p><span style="font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;">责任：实现价值</span></p><p><br/></p><p><span style="font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;">共赢：创造辉煌</span></p><p><span style="font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;"><br/></span></p><p><span style="font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;"><br/></span></p><p><span style="font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;"><br/></span></p><p><span style="font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;"><br/></span></p><p><span style="font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;"><br/></span></p><p><span style="font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;"></span></p><p><span style="font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;">贵金属交易有风险，入市需谨慎</span></p><p><span style="font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;">本公司受广东省贵金属交易中心监管<br/></span></p><p><span style="font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;">监督电话：020-3892&nbsp;8999<br/></span></p><p><br/></p><p><span style="font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;"></span><br/></p>', '公司简介,壹银添丰集团简介,壹银添丰集团信息介绍', '壹银添丰财富集团是经陕西省地方政府同意，以金融服务、有色金属经营和投资咨询的大型集团制的交易场所', '壹银添丰财富集团是四川川商商品交易中心第09号会员单位，立志打造国内较有影响力的有色金属投资服务平台。针对不同投资人群，公司推出各类理财计划，在股市、有色金属等众多领域均取得骄人战绩，公司吸纳海内外近百名行业精英，设立专业分析师团队，铸造行业', 'profile', 'about_page', 'Company Profile'),
(4, '开户指南', '<p>现已开通网上开户服务，只需轻松5步就可以开通实盘账号，方便快捷。如果您还有疑问，请拨打全国免费客服热线：400-619-0099</p>', '开户指南,开户前提,开户须知,两张照片,绑定账号,激活账号,陕西有色金属', '壹银添丰集团开户指南，网上自助开户、免费预约开户（打全国免费客服电话：4006190099）', '开户指南，只需轻松5步就可以开通实盘账号，方便快捷', 'guide', 'guide_page', 'Account Guide'),
(5, '产品合约', '<p>交收仓库，交易中心或会员单位指定仓库。交收费用，根据市场行情具体制定</p>', '产品合约,聚丙烯合约,银精矿合约,手续费,交收费用,壹银添丰集团', '壹银添丰集团关于聚丙烯,银精矿2个交易品种的详细合约。包括了报价单位，手续费等', '产品合约具体信息，包括交易品种，代码，报价单位，交易单位，。。。。。', 'rule', 'product_page', 'Products Contract'),
(6, '软件下载', '<p>川商所行情系统集实时行情、财经资讯、专家看盘为一体，提供国内贵金属市场、外汇、期货市场行情及世界各大交易所实时行情指数，信息丰富全面、交易下单方便快捷</p>', '行情软件,实时行情,财经资讯,专家看盘,实时行情指数', '壹银添丰集团软件下载，提供最新的电脑端行情软件下载，方便快捷', '川商所行情系统集实时行情、财经资讯、专家看盘为一体，提供国内贵金属市场、外汇、期货市场行情及世界各大交易所实时行情指数，信息丰富全面、交易下单方便快捷', 'soft', 'download_page', 'software download'),
(8, '产品介绍', '<p>&nbsp;聚丙烯，一般采用电子盘交易。目前上市的品种以吨计价。银精矿作为国内全新的投资品种，已经被越来越多的人接受、认可。客户通过电子盘下单交易。</p>', '聚丙烯,银精矿,有色金属交易,聚丙烯代码,聚丙烯仓单价格,银精矿代码,银精矿仓单价格', '壹银添丰集团提供聚丙烯，银精矿，等有色金属交易。提供代码，仓单价格供用户参考，完全同步国际有色金属市场的价格', '聚丙烯，一般采用电子盘交易。目前上市的品种以吨计价。银精矿作为国内全新的投资品种，已经被越来越多的人接受、认可。客户通过电子盘下单交易。', 'product', 'product_page', 'product description'),
(9, '川商所介绍', '<p><br/></p><p><img src="/plugins/ueditor/php/upload1/20151221/1450666734709077.jpg" title="about_company.jpg" style="float: left;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;">&nbsp; 四川川商商品交易中心，简称“川商所”，经陕西省人民政府批准，陕西省金融办批复成立的中国唯 &nbsp;一省级金融控股集团旗下的有色金属交易平台。</p><p><br style="font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;"/></p><p class="text_index24" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 24px; font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;">陕西金控集团主要开展银行、证券、保险、信托、基金、担保、产权交易、股权交易、有色交易等业 &nbsp;务。川商所将充分利用陕西金控集团的金融集团性优势和陕西得天独厚的有色资源优势，在西部大开发 &nbsp;政策鼓舞和陕西省省委、省政府的大力支持下，在交易所市场监督管理委员会的指导监督下：把控市场 &nbsp;风险、秉承创新服务宗旨，以促进传统产业整合升级、金融并轨为引导，发展为现代化金融产业创新平 &nbsp;台。</p><p><br style="font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;"/></p><p class="text_index24" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 24px; font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;">川商所作为陕西有色行业的重点创新项目，推出以实物线上贸易、交收、物流配套等综合一体化电子 &nbsp;交易结算系统。交易中心的推出，将推动中国有色产业的规模化经营及提升自主定价权。川商所背靠陕 &nbsp;西省政府的强大公信力，将高速发展的有色行业衍生品规范化，未来努力成为全球最具影响力的有色金 &nbsp;属交易中心。</p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p>', '四川川商商品交易中心,省级金融控股集团,有色金属交易平台,壹银添丰集团', '四川川商商品交易中心，简称“川商所”，经陕西省人民政府批准，陕西省金融办批复成立的中国唯一省级金融控股集团旗下的有色金属交易平台。', '四川川商商品交易中心，简称“川商所”，经陕西省人民政府批准，陕西省金融办批复成立的中国唯一省级金融控股集团旗下的有色金属交易平台', 'shanjin_product', 'shanjin_page', 'Introduction'),
(10, '办公环境', '<p>陕西金控集团主要开展银行、证券、保险、信托、基金、担保、产权交易、股权交易、有色交易等业务。</p>', '办公环境,壹银添丰集团,陕西有色金属交易', '四川川商商品交易中心，简称“川商所”，经陕西省人民政府批准，陕西省金融办批复成立的中国唯一省级金融控股集团旗下的有色金属交易平台', '陕西金控集团主要开展银行、证券、保险、信托、基金、担保、产权交易、股权交易、有色交易等业务。', 'office_env', 'about_page', 'Office environment'),
(11, '品牌标识', '<p>壹银添丰LOGO是由铜钱与梧桐树抽象性结合。含义也是象征着我们的智慧与财富，智慧是我们对行业的精准性与专注性，我们代表着财富，选择我们则选择财富。</p>', '品牌标识,壹银添丰LOGO,陕西有色金属交易,壹银添丰品牌形象', '壹银添丰LOGO是由铜钱与梧桐树抽象性结合，寓意选择我们就是选择财富', '壹银添丰LOGO是由铜钱与梧桐树抽象性结合。含义也是象征着我们的智慧与财富，智慧是我们对行业的精准性与专注性，我们代表着财富，选择我们则选择财富。', 'brand', 'about_page', 'Brand identity'),
(12, '战略合作', '<p>壹银添丰战略合作伙伴包含了财富天下，金融投资报，股市早8点在内的5家新闻媒体。和工商，北商所等大型国家单位。实力雄厚</p>', '壹银添丰合作伙伴,壹银添丰战略合作,壹银添丰背景', '壹银添丰战略合作伙伴包含了财富天下，金融投资报，股市早8点在内的5家新闻媒体。和工商，北商所等大型国家单位。实力雄厚', '壹银添丰战略合作伙伴包含了财富天下，金融投资报，股市早8点在内的5家新闻媒体。和工商，北商所等大型国家单位。实力雄厚', 'cooperation', 'about_page', 'Strategic Cooperation'),
(13, '人工开户', '<p>四川川商商品交易中心提供预约开户服务，填写以下表单，即可获得专业客服经理全程指导服务</p>', '人工开户,壹银添丰人工开户,金牌客服人工开户,四川川商商品交易中心', '四川川商商品交易中心提供预约开户服务，填写以下表单，即可获得专业客服经理全程指导服务', '四川川商商品交易中心提供预约开户服务，填写以下表单，即可获得专业客服经理全程指导服务', 'open_account', 'guide_page', 'Artificial Account'),
(14, '企业文化', '<p>经营使命：为投资者提供最完善的交易平台，助力中国成为世界金融中心。经营战略：先做强，再做大，在做强中做大。</p><p><br/></p>', '壹银添丰企业文化,包容,主动,责任,共赢', '壹银添丰企业文化包括以下4点：包容，聚集贤能、主动，迎接变化、责任，实现价值、共赢，创造辉煌。', '经营理念：以人为本，创新经营，多样并存，追求卓越。经营宗旨：给客户提供更优质的服务并最终回馈员工奉献社会。', 'culture', 'about_page', 'company culture'),
(15, '董事长致辞', '<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;">建设要素交易市场，完善交易市场体系，是全面深化改革的重要任务，是市场发挥资源配置决定性作用的重要途径。陕西有色交易市场的成立是省委、省政府深化经济体制改革的重大举措，将对陕西有色金属产业蓬勃发展产生深远的历史意义。</p><p><br style="font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;">四川川商商品交易中心是陕西金融控股集团交易板块的重要组成部分，其意义在于支持有色金属产业发展、优化金融资源配置、完善金融体系、提升金融服务水平。四川川商商品交易中心的成立是打造西部金融中心的需要；是经济结构转型，推动经济又好又快发展的需要；是提升稀有金属行业竞争力，获取市场定价权的需要。</p><p><br style="font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;">四川川商商品交易中心将在传统交易模式基础上通过产业链交易进行B2B、O2O模式改造，在产、供、销各个环节引入金融介入，致力于打造互联网金融模式下的产融结合及金属商品交易的行业标准，形成金属商品行业规范化、产业链条化、信誉担保化、质量认证化、买卖公平化、监管安全化的完善体系，促进金属商品的平台交易和流通。</p><p><br style="font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;">优秀的管理团队、雄厚的资本实力、成功的实战经验以及诚信务实、追求卓越的风格是四川川商商品交易中心具备国际核心竞争力的重要基石。四川川商商品交易中心将专注于专业化、规模化的拓展和耕耘，拓宽金融服务领域，促进国内贵金属交易市场与国际市场的接轨，并将始终秉承服务客户的宗旨，以“创新、交易、增值、融资”为理念，为有色金属行业发展做出积极贡献</p><p><br/></p>', '壹银添丰董事长致辞', '壹银添丰董事长致辞大致内容：陕西有色交易市场的成立是省委、省政府深化经济体制改革的重大举措', '建设要素交易市场，完善交易市场体系，是全面深化改革的重要任务。陕西有色交易市场的成立是省委、省政府深化经济体制改革的重大举措，将对陕西有色金属产业蓬勃发展产生深远的历史意义。', 'speech', 'shanjin_page', 'Speech'),
(16, '招贤纳士', '<p>壹银添丰招贤纳士准则：人才是企业的资本，人才是最宝贵的财富，壹银添丰的大门对所有有志于金属行情的人敞开着。</p>', '招贤纳士,招聘准则,人才理念,晋升机制,人才战略,用人标准', '壹银添丰招贤纳士详细信息：人才招聘,应聘流程,人才理念,薪酬福利,培训发展', '壹银添丰招贤纳士准则：人才是企业的资本，人才是最宝贵的财富，壹银添丰的大门对所有有志于金属行情的人敞开着。', 'recruitment', 'about_page', 'Talents Wanted'),
(18, '网银签约', '<p>壹银添丰网银签约详细流程</p>', '农行,工商,建行,签约,详细流程,演示,壹银添丰集团', '壹银添丰网银签约详细流程', '壹银添丰网银签约详细流程', 'netsign', 'guide_page', 'Net silver to sign'),
(20, '产品优势', '<p>22小时连续分散式柜台T+0双向杠杆式交易， 操作简单，无涨跌停板限制，交易数据第三方监管</p>', '22小时连续交易,杠杆式交易,T+0双向交易,第三方监管,壹银添丰集团产品', '22小时连续分散式柜台T+0双向杠杆式交易， 操作简单，无涨跌停板限制，交易数据第三方监管', '22小时连续分散式柜台T+0双向杠杆式交易， 操作简单，无涨跌停板限制，交易数据第三方监管', 'advantage', 'product_page', 'Product advantage'),
(24, '资金安全', '<p>四川川商商品交易中心由陕西省政府发牌监管，国务院联席会议备案批准的创新型金融交易中心。是目前最具价值的有色金属现货交易及有色金属现货电子交易投资平台<span style="border: 1px solid rgb(0, 0, 0);"></span></p>', '资金安全,数据透明,交易公正,正规平台,壹银添丰集团正规平台', '​四川川商商品交易中心是正规投资平台，交易资金透明，公正，安全', '四川川商商品交易中心由陕西省政府发牌监管，国务院联席会议备案批准的创新型金融交易中心。是目前最具价值的有色金属现货交易及有色金属现货电子交易投资平台', 'save', 'product_page', 'Money safe'),
(25, '风险提示', '<p>四川川商商品交易中心有色金属延期交收交易具有高投机性和高风险性，不适合于利用养老基金、 举借债务、银行贷款等方式取得的资金进行投资的投资者</p>', '壹银添丰集团风险提示,价格波动的风险,交易风险,不可抗力风险', '壹银添丰集团风险提示：此交易为高投机性的高风险投资，入行需谨慎', '四川川商商品交易中心有色金属延期交收交易具有高投机性和高风险性，不适合于利用养老基金、 举借债务、银行贷款等方式取得的资金进行投资的投资者', 'warning', 'product_page', 'Risk warning'),
(27, '股东背景', '<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;">陕西金融控股集团有限公司是经陕西省人民政府批准设立的国有大型骨干企业，注册资本33亿元，主要从事资本运作及资产管理，股权投资及管理，受托管理专项资金，信用担保和再担保，实业经营，投融资及金融研究，企业重组、并购咨询等经营业务。</p><p><br style="font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;"/></p><p class="text_index24" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 24px; font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;">金控集团自2011年11月成立以来，坚持立足陕西、服务大局的宗旨，积极实施加快发展、创新发展、多元化经营三大战略，开展投资、金融、交易、资产管理四大业务，形成产业投资、创投基金、金融业务、金融服务、要素交易、资产管理、实业发展、发展研究八大组团发展格局。截至2013年底，集团公司总资产88亿元，净资产45亿元，在职职工799人，全资及控股企业14家。</p><p><br style="font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;"/></p><p class="text_index24" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 24px; font-family: SimSun; font-size: 12px; line-height: 22px; white-space: normal; widows: auto;">“十二五”末，金控集团力争总资产达到200亿元，净资产100亿元，努力构建区域性金融资产管理、资本运营平台。</p><p><br/></p>', '壹银添丰集团股东背景,政府批准,国有大型骨干企业,资本运作,资产管理', '陕西金融控股集团有限公司是经陕西省人民政府批准设立的国有大型骨干企业，主要从事资本运作及资产管理。', '陕西金融控股集团有限公司是经陕西省人民政府批准设立的国有大型骨干企业，注册资本33亿元，主要从事资本运作及资产管理，股权投资及管理，受托管理专项资金，信用担保和再担保，实业经营，投融资及金融研究，企业重组、并购咨询等经营业务。', 'background', 'shanjin_page', 'Shareholders Background');
