(3, '壹银贵金属交易客户端', 'yiyinjiaoyi.rar', '    功能强大、操作简单的网上交易系统，能够提供实时行情、网上交易及查询、报表功能，同时有与银行接口的实时转账功能，方便客户出入金，让您的投资交易得到可靠保障，充分把握市场投资机会。', '1397035057856.png', ''),
