(6, '壹银交易软件补丁net4.0', 'jiaoyiruanjianbuding net4.0.rar', '由于某些电脑缺少Farmwork4.0插件可能导致安装新版本交易软件过程中提示缺少farmwork4.0插件。\n请广大用户在安装该软件时若遇到提示缺少插件的情况下，点击下载安装该插件。', '1397182666232.png', ''),
(7, '壹银财富行情交易软件打包下载', 'yiyin_all_in_one.rar', '本压缩包涵盖安卓手机软件，电脑端行情软件和交易软件，以及交易软件补丁。', '1402554964947.jpg', ''),
